a:1:{s:0:\"\";a:1:{s:3:\"rss\";a:1:{i:0;a:6:{s:4:\"data\";s:3:\"\n\n\n\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:7:\"version\";s:3:\"2.0\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:1:{s:0:\"\";a:1:{s:7:\"channel\";a:1:{i:0;a:6:{s:4:\"data\";s:61:\"\n	\n	\n	\n	\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:1:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:16:\"WordPress Planet\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://planet.wordpress.org/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"language\";a:1:{i:0;a:5:{s:4:\"data\";s:2:\"en\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:47:\"WordPress Planet - http://planet.wordpress.org/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"item\";a:50:{i:0;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:99:\"WPTavern: Matt Mullenweg Addresses Controversies Surrounding Gutenberg at WordCamp Portland Q&amp;A\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=85433\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:105:\"https://wptavern.com/matt-mullenweg-addresses-controversies-surrounding-gutenberg-at-wordcamp-portland-qa\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:8531:\"<p>Matt Mullenweg joined attendees at WordCamp Portland, OR, for a Q&amp;A session last weekend and the recording is now <a href=\"https://wordpress.tv/2018/11/08/matt-mullenweg-qa-at-wordcamp-portland-2018/\" rel=\"noopener noreferrer\" target=\"_blank\">available on WordPress.tv</a>.</p>\n<p>The first question came from a user who tried Gutenberg and turned it off because of a plugin conflict. She asked if users will have to use Gutenberg when 5.0 is released. Mullenweg said one of the reasons Gutenberg has been tested so early is to give plugin developers time to get their products compatible. He also said that it has been the fastest growing plugin in WordPress&#8217; history, with more than 600,000 installations since it was first made available.</p>\n<p>In response to her question he said users will have the option to use the Classic Editor and that the team is considering updating it to include per-user controls and the possibility to turn it on/off for different post types.</p>\n<p>Subsequent questions went deeper into recent controversies surrounding Gutenberg, which Mullenweg addressed more in depth.</p>\n<p>&#8220;The tough part of any open source project &#8211; there&#8217;s kind of a crucible of open source development which can sometimes be more adversarial and sometimes even acrimonious,&#8221; he said. &#8220;Working within the same company, you can kind of assume everyone is rowing in the same direction. In a wide open source ecosystem, some people might actually want the opposite of what you&#8217;re doing, because it might be in their own economic self-interest, or for any number of reasons.</p>\n<p>&#8220;I liken it much more to being a mayor of a city than being a CEO of a company. I&#8217;ve done WordPress now for 15 years so I&#8217;m pretty used to it. It might seem kind of controversial if you&#8217;re just coming in, but this is not the most controversial thing we have ever brought into WordPress. The last time we had a big fork of WordPress was actually when we brought in WYSIWYG the first time. Maybe there&#8217;s something about messing with the editor that sets people off.&#8221;</p>\n<p>Mullenweg commented on how polarizing Twitter can be as a medium and how that can impact conversations in negatives ways. He said people tend to read the worst into things that have been said and that has been a new challenge during this particular time in WordPress&#8217; history. WordPress tweets are sprinkled into timelines along with politics and current events in a way that can cause people to react differently than if the discussion was held in a trac ticket, for example.</p>\n<p>One attendee asked, &#8220;With Gutenberg there&#8217;s a lot of uncertainty. Where do you see the tipping point where you see people become more favorable to Gutenberg than the Classic Editor?&#8221;</p>\n<p>&#8220;Part of getting these two plugins, Gutenberg and Classic Editor, out early, was that it could remove uncertainty for people,&#8221; Mullenweg said. &#8220;Months before they were released you could kind of choose your path. The hope is that the 5.0 release day is the most anti-climactic thing ever. Because we have over a million sites that have either chosen to not use Gutenberg, which is totally ok, or have already opted in and have been getting these sometimes weekly updates. We have hosts that have been actually been pre-installing, pre-activating Gutenberg with all of their sites.&#8221;</p>\n<p>Mullenweg said hosts that have pre-installed Gutenberg have not reported a higher than normal support load and that it has basically been &#8220;a non-event.&#8221; It&#8217;s the users who are updating to 5.0 after many years of using WordPress who will have the most to learn.</p>\n<p>&#8220;Gutenberg does by some measures five or ten measures more than what you could really accomplish in the classic editor,&#8221; Mullenweg said. &#8220;That also means there&#8217;s more buttons, there&#8217;s more blocks. That is part of the idea &#8211; to open up people&#8217;s flexibility and creativity to do things they would either need code or a crazy theme to do in the past. And now we&#8217;re going to open that up to do WordPress&#8217; mission, which is to democratize publishing and make it accessible to everyone.&#8221;</p>\n<p>Gutenberg&#8217;s current state of accessibility has been a hot topic lately and one attendee asked for his thoughts about the recent discussions. Mullenweg said there is room for improvement in how this aspect of the project was handled and that WordPress can work better across teams in the future:</p>\n<blockquote><p>Accessibility has been core to WordPress from the very beginning. It&#8217;s part of why we started &#8211; adoption of web standards and accessibility things. We&#8217;ve been a member of the web standards project for many many years. We did kind of have some project management fails in this process where we had a team of volunteers that felt like they were disconnected from the rapid development that was happening with Gutenberg. Definitely there were some things we could do better there. In the future I think that we need &#8211; I don&#8217;t know if it makes sense to have separate accessibility as a separate kind of process from the core development. It really needs to be integrated at every single stage. We did do a lot, as Matias did a big long post on it. We&#8217;ve done a ton of keyboard accessibility stuff, there&#8217;s ARIA elements on everything. One of their feedbacks was that we did it wrong, but we did it the best that we knew how to and it&#8217;s been in there for awhile. There&#8217;s been over 200 closed issues from really the very beginning. We also took the opportunity to fix some things that had been poorly accessible in WordPress from the beginning. It&#8217;s not that WordPress is perfectly accessible and all WCAG AA and it&#8217;s reverting. It&#8217;s actually that huge swaths of WP are inaccessible &#8211; they just might not be considered core paths from the current accessibility team but I consider them core.</p></blockquote>\n<p>In response to a question about the future of React in WordPress, Mullenweg went more in depth on the vision he had when he urged the WordPress community to <a href=\"https://wptavern.com/state-of-the-word-2015-javascript-and-api-driven-interfaces-are-the-future-of-wordpress\">learn JavaScript deeply in 2015</a>. At that time he said &#8220;it is the future of the web.&#8221; He described how each block can be a launching point for something else &#8211; via a modal, such as updating settings, doing advanced things with an e-commerce store, zooming in and out of those screens from the editor. This was perhaps the most inspirational part of the Q&amp;A where the potential of Gutenberg shines as bright as it did in the early demos.</p>\n<p>&#8220;The other beautiful thing is that because Gutenberg essentially allows for translation into many different formats,&#8221; Mullenweg said. &#8220;It can publish to your web page, your RSS feed, AMP, blocks can be translated into email for newsletters, there&#8217;s so much that the structured nature of Gutenberg and the semantic HTML it creates and the grammar that&#8217;s used to parse it, can enable for other applications. It becomes a little bit like a lingua franca that perhaps even crosses CMS&#8217;s. There&#8217;s now these new cross-CMS Gutenberg blocks will be possible. It&#8217;s not just WordPress anymore. It may be a JavaScript block that was written for Drupal that you install on your WordPress site. I mean, hot diggity! How would that have ever happened before? That&#8217;s why we took two years off; it&#8217;s why we&#8217;ve had everyone in the world working on this thing.&#8221;</p>\n<p>JavaScript is what makes this cross-platform collaboration possible and it&#8217;s already evident in the work the Drupal Gutenberg contributors are doing, as well as the platform-agnostic Gutenberg Cloud project. When Gutenberg is released in 5.0, it will enable more for WordPress and the web than we can predict right now.</p>\n<p>&#8220;This is not the finish line,&#8221; Mullenweg said. &#8220;5.0 is almost like the starting point. Expect just as much time invested into Gutenberg after the 5.0 release as before &#8211; to get it to that place where we don&#8217;t think it&#8217;s just better than what we have today but it&#8217;s actually like a world-class web-defining experience, which is what we want to create and what you all deserve.&#8221;</p>\n<p></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sat, 10 Nov 2018 15:30:46 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"WPTavern: WordPress 5.0 Release Date Update to November 27\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=85475\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:69:\"https://wptavern.com/wordpress-5-0-release-date-update-to-november-27\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2548:\"<p>The WordPress 5.0 release date has been pushed back to November 27. The <a href=\"https://make.wordpress.org/core/2018/10/03/proposed-wordpress-5-0-scope-and-schedule/\" rel=\"noopener noreferrer\" target=\"_blank\">previous schedule</a> outlined the possibility of a slip date where the first target date could slip by up to eight days if necessary.</p>\n<p>&#8220;As discussed during the Core devchat this week, the initial November 19th target date is looking a bit too soon for a release date,&#8221; Gutenberg technical lead Matias Ventura said in today&#8217;s announcement on the <a href=\"https://make.wordpress.org/core/2018/11/09/update-on-5-0-release-schedule/\" rel=\"noopener noreferrer\" target=\"_blank\">make.wordpress.org/core</a> blog. &#8220;After listening to a lot of feedback — as well as looking at current issues, ongoing pull requests, and general progress — we’re going to take an extra week to make sure everything is fully dialed in and the release date is now targeted for November 27th.&#8221;</p>\n<p>Ventura outlined a new plan where beta 4 and beta 5 releases will coincide with Gutenberg 4.3 and 4.4 releases. RC1 is expected to be released November 19. He said contributors will be posting daily high level updates on the current status of the release, including things like open pull requests to be reviewed and outstanding bugs, to the #core-editor channel.</p>\n<p>The announcement also includes a short video demonstration of Gutenberg fully integrated with the new default Twenty Nineteen theme.</p>\n<p></p>\n<p>Given the recent <a href=\"https://wptavern.com/calls-to-delay-wordpress-5-0-increase-developers-cite-usability-concerns-and-numerous-bugs-in-gutenberg\" rel=\"noopener noreferrer\" target=\"_blank\">pushback on the timeline</a> from prominent WordPress developers and business owners, the updated November 27 timeline may still not offer enough time to resolve the issues remaining and allow the ecosystem to prepare training materials that accurately reflect late stage UI changes.</p>\n<p>At a spontaneous Q&amp;A session at WordCamp Portland this weekend, Matt Mullenweg said WordPress 5.0 was branched from 4.9.8 so this release has been tightly wound to the previous one to allow for a more seamless transition.</p>\n<p>The next targeted release day falls on the Tuesday after Cyber Monday, which should be a relief to anyone running a WordPress-powered e-commerce site. If WordPress misses the updated November 27 release date, it will be pushed back to the secondary target date of January 22, 2019.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 09 Nov 2018 20:06:54 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:2;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:104:\"WPTavern: WPWeekly Episode 337 – Gutenberg User Experiences, Release Timelines, and the Classic Editor\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"https://wptavern.com?p=85470&preview=true&preview_id=85470\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:109:\"https://wptavern.com/wpweekly-episode-337-gutenberg-user-experiences-release-timelines-and-the-classic-editor\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2142:\"<p>In this episode, <a href=\"http://jjj.me\">John James Jacoby</a> and I break down what&#8217;s happening with Gutenberg. We discuss our trials and tribulations with the editor, the release timeline, and calls from members of the community to delay WordPress 5.0 until January. We also share details on how long the Classic Editor plugin will be supported. Last but not least, we talk about the possible release strategy of shipping point releases every two weeks after WordPress 5.0 is released.</p>\n<h2>Stories Discussed:</h2>\n<p><a href=\"https://wptavern.com/how-to-add-an-image-to-a-paragraph-block-in-gutenberg\">How to Add an Image to A Paragraph Block in Gutenberg</a></p>\n<p><a href=\"https://wptavern.com/adding-aligned-images-to-paragraphs-in-gutenberg-is-not-as-tough-as-i-thought\">Adding Aligned Images to Paragraphs in Gutenberg Is Not as Tough as I Thought</a></p>\n<p><a href=\"https://wptavern.com/wordpress-5-0-beta-3-released-rc-1-expected-november-12\">WordPress 5.0 Beta 3 Released, RC 1 Expected November 12</a></p>\n<p><a href=\"https://joost.blog/wordpress-5-0-needs-a-different-timeline/\">WordPress 5.0 needs a different timeline    </a></p>\n<p><a href=\"https://mrwweb.com/wordpress-5-0-is-not-ready/\">WordPress 5.0 is Not Ready</a></p>\n<p><a href=\"https://wptavern.com/classic-editor-plugin-may-be-included-with-5-0-updates-support-window-set-to-end-in-2021\">Classic Editor Plugin May Be Included with 5.0 Updates, Support Window Set to End in 2021</a></p>\n<h2>WPWeekly Meta:</h2>\n<p><strong>Next Episode:</strong> Wednesday, November 14th 3:00 P.M. Eastern</p>\n<p>Subscribe to <a href=\"https://itunes.apple.com/us/podcast/wordpress-weekly/id694849738\">WordPress Weekly via Itunes</a></p>\n<p>Subscribe to <a href=\"https://www.wptavern.com/feed/podcast\">WordPress Weekly via RSS</a></p>\n<p>Subscribe to <a href=\"http://www.stitcher.com/podcast/wordpress-weekly-podcast?refid=stpr\">WordPress Weekly via Stitcher Radio</a></p>\n<p>Subscribe to <a href=\"https://play.google.com/music/listen?u=0#/ps/Ir3keivkvwwh24xy7qiymurwpbe\">WordPress Weekly via Google Play</a></p>\n<p><strong>Listen To Episode #337:</strong><br />\n</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 09 Nov 2018 17:21:30 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:3;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:47:\"Matt: Gutenberg in Portland Oregon and Podcasts\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"https://ma.tt/?p=48589\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:64:\"https://ma.tt/2018/11/gutenberg-in-portland-oregon-and-podcasts/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1192:\"<p>I&#8217;ve had the opportunity to talk about Gutenberg at two great venues recently. The first was at WordCamp Portland which graciously allowed me to join for a Q&amp;A at the end of the event. The questions were great and covered a lot of the latest and greatest about Gutenberg and WordPress 5.0:</p>\n\n\n\n<div class=\"wp-block-embed__wrapper\">\n\n</div>\n\n\n\n<p>Last week I also joined <a href=\"https://wpbuilds.com/2018/11/08/episode-101-matt-mullenweg-why-gutenberg-and-why-now/\">Episode 101 of the WP Builds podcast</a>, where as Nathan put it: &#8220;We talk about Gutenberg, why Matt thinks that we need it, and why we need it now. We go on to chat about how it’s divided the WordPress community, especially from the perspective of users with accessibility needs.&#8221;</p>\n\n\n\n<p>They may be out of seats already, but <a href=\"https://www.meetup.com/Southern-Maine-WordPress-Meetup/events/256212528/\">I&#8217;ll be on the other coast to do a small meetup in Portland, Maine</a> this week. As we lead up to release and <a href=\"https://2018.us.wordcamp.org/\">WordCamp US</a> I&#8217;m really enjoying the opportunity to hear from WordPress users of all levels all over the country.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 09 Nov 2018 04:45:33 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:4;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:114:\"WPTavern: Calls to Delay WordPress 5.0 Increase, Developers Cite Usability Concerns and Numerous Bugs in Gutenberg\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=85371\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:124:\"https://wptavern.com/calls-to-delay-wordpress-5-0-increase-developers-cite-usability-concerns-and-numerous-bugs-in-gutenberg\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:9585:\"<p>Developers and business owners are waiting anxiously in the wings, as Gutenberg is 11 days away from its debut in WordPress 5.0. There is still a chance that the release could be delayed to the secondary date (January 22, 2019), but the decision has not yet been announced.</p>\n<p>&#8220;I am lukewarm on the 19th, but not because of the number of open issues (which isn&#8217;t a good measure or target) — more that we&#8217;ve been a day or two behind a few times now,&#8221; 5.0 release lead Matt Mullenweg said during yesterday&#8217;s dev chat. He said that reports &#8220;from the field&#8221; continue to be good and companies that have already installed and activated the plugin haven&#8217;t reported a higher than normal support burden.</p>\n<p>&#8220;My concern can be summed up as this,&#8221; Aaron Jorbin said. &#8220;There are approximately 400 issues that need either code or a decision to punt. Assuming five minutes per issue, that means there are about 33 hours worth of bug scrubs that need to take place between now and RC.&#8221;</p>\n<p>&#8220;I don’t think we can make a decision on moving the date in the next 45 minutes,&#8221; Gary Pendergast said in response to concerns raised at the meeting. &#8220;I do think it’s fair to say that the Gutenberg and 5.0 leadership teams are hearing all the feedback, and are actively looking whether the timeline is still correct.&#8221;</p>\n<p>Mullenweg said open issues are not a good measure of whether the release is on target but the numerous bugs the community is encountering has precipitated a flurry of posts advocating for the release to be delayed.</p>\n<p>In a post titled &#8220;<a href=\"https://joost.blog/wordpress-5-0-needs-a-different-timeline/\" rel=\"noopener noreferrer\" target=\"_blank\">WordPress 5.0 needs a different timeline</a>,&#8221; Joost de Valk, author of <a href=\"https://wordpress.org/plugins/wordpress-seo/\" rel=\"noopener noreferrer\" target=\"_blank\">Yoast SEO</a>, cites accessibility concerns and the stability of the project as reasons for a delay. de Valk identifies himself a strong supporter of Gutenberg and his team has already built compatibility and <a href=\"https://wptavern.com/yoast-seo-8-2-adds-how-to-and-faq-gutenberg-blocks-with-structured-data\" rel=\"noopener noreferrer\" target=\"_blank\">Gutenberg-first features</a> into their plugin, which has more than 5 million active installs.</p>\n<p>&#8220;It’s arguably one of the biggest leaps forward in WordPress’ editing experience and its developer experience in this decade,&#8221; de Valk said. &#8220;It’s also not done yet, and if we keep striving for its planned November 19th release date, we are setting ourselves up for failure.&#8221;</p>\n<p>de Valk gave two reasons for why he believes the November 19th timeline to be untenable:</p>\n<blockquote><p>There are some <a href=\"https://make.wordpress.org/accessibility/2018/10/29/report-on-the-accessibility-status-of-gutenberg/\" rel=\"noopener noreferrer\" target=\"_blank\">severe accessibility concerns</a>. While these aren’t new and a few people are working hard on them, I actually think we can get a better handle on fixing them if we push the release back. Right now it looks to me as though keyboard accessibility has regressed in the last few releases of Gutenberg.</p>\n<p>The most important reason: the overall stability of the project isn’t where it needs to be yet. There are so many open issues for the 5.0 milestone that even fixing all the blockers before we’d get to Release Candidate stage next week is going to prove impossible. We have, at time of writing <a href=\"https://github.com/wordpress/gutenberg/issues?utf8=%E2%9C%93&q=is%3Aissue+is%3Aopen+no%3Amilestone+label%3A%22%5BType%5D+Bug%22+-label%3A%22future%22+\" rel=\"noopener noreferrer\" target=\"_blank\">212 untriaged bugs</a> and <a href=\"https://github.com/wordpress/gutenberg/issues?q=is%3Aopen+is%3Aissue+milestone%3A%22WordPress+5.0%22\" rel=\"noopener noreferrer\" target=\"_blank\">165 issues on the WordPress 5.0 milestone</a>.</p></blockquote>\n<p>WordPress developer Mark Root-Wiley published a post the same day titled &#8220;<a href=\"https://mrwweb.com/wordpress-5-0-is-not-ready/\" rel=\"noopener noreferrer\" target=\"_blank\">WordPress 5.0 is Not Ready</a>.&#8221; He outlined why he believes the release needs to be delayed and suggested the project pursue more auditing and quality assurance testing before shipping it out.</p>\n<p>&#8220;WordPress 5.0 can and should be a positive change to WordPress, but if it is released in late November as planned, it won’t be,&#8221; Root-Wiley said. &#8220;There are simply too many bugs in the editor, and the experience is not polished enough. This is because the rate of development has prevented systematic quality assurance (QA) and user testing. Both types of testing are required to ensure the editor is ready and to increase the community’s confidence in the update.&#8221;</p>\n<p>Root-Wiley describes a buggy experience when attempting to write blog posts with the new editor, which echoes many others&#8217; <a href=\"https://jjj.blog/2018/10/wordpress-5-0-beta-1/\" rel=\"noopener noreferrer\" target=\"_blank\">recent</a> <a href=\"https://twitter.com/mor10/status/1060255182552854528\" rel=\"noopener noreferrer\" target=\"_blank\">experiences</a>.</p>\n<p>&#8220;I’m doing my best to give feedback, but it’s exhausting and there are so many little bugs that I struggle to isolate and replicate the one I’m reporting without running into another,&#8221; Root-Wiley said. &#8220;How is it possible for me to find so many bugs without trying from just writing 1.5 blog posts?&#8221;</p>\n<p>Root-Wiley also suggested removing what he deemed to be unnecessary features in order to streamline the editing experience and focus on the fundamentals. These features include the tables block, paragraph background colors, spotlight and fullscreen mode, dropcaps, verse block, among others.</p>\n<p>&#8220;The pace of development has been blistering,&#8221; Root-Wiley said. &#8220;That speed has been great for developing a lot of features and iterating on those features quickly, but it hasn’t allowed for sufficient testing. What’s needed now is more time for people to find and report bugs with the editor features in their proposed final state.&#8221;</p>\n<p>Gutenberg criticism is often characterized as coming from people who are resistant to change, but these strong messages about delaying the release come from developers who believe the new editor is the future and have heavily invested in contributing to its success.</p>\n<p>Both de Valk and Root-Wiley&#8217;s posts seem to have resonated with many who have had similar experiences with the editor. Other core developers and committers have also publicly lent their voices to the call to delay the release.</p>\n<blockquote class=\"twitter-tweet\">\n<p lang=\"en\" dir=\"ltr\">My thoughts are very much aligned here. I\'m super excited for the release &#8212; I think it\'s crucial for WordPress\' success. But I don\'t think it, nor the ecosystem, are quite ready following the shortened release cycle. <a href=\"https://t.co/R0nZt0mk41\">https://t.co/R0nZt0mk41</a></p>\n<p>&mdash; Mike Schroder (@GetSource) <a href=\"https://twitter.com/GetSource/status/1060238359660912640?ref_src=twsrc%5Etfw\">November 7, 2018</a></p></blockquote>\n<p></p>\n<blockquote class=\"twitter-tweet\">\n<p lang=\"en\" dir=\"ltr\">This: <a href=\"https://t.co/wpcQ02qcTw\">https://t.co/wpcQ02qcTw</a>  They are missing almost every milestone on their release schedule, leaving me 1 week to test with RC before Thanksgiving, and plugin/theme authors no time to develop/test with stabler code. It should just come out with their backup January date.</p>\n<p>&mdash; Lisa Woodruff (@lisa_m_woodruff) <a href=\"https://twitter.com/lisa_m_woodruff/status/1060533833899171841?ref_src=twsrc%5Etfw\">November 8, 2018</a></p></blockquote>\n<p></p>\n<p>Opinions on Gutenberg&#8217;s readiness vary wildly depending on the person&#8217;s perspective and involvement in the project. Those who are working on it full-time have not publicly offered opinions indicating that it might not be ready for the November 19 timeline.</p>\n<p>&#8220;The 5.0 milestone is in a very manageable place, but if the volume becomes more worrying in the next couple days or it becomes clear milestones won’t be made, we’ll revise as needed,&#8221; Gutenberg technical lead Matias Ventura Ventura said during yesterday&#8217;s dev chat. He confirmed that the fast pace of development will continue.</p>\n<p>Regardless of when 5.0 is released, users can count on getting minor releases every two weeks to address bugs and issues that pop up after Gutenberg is in the hands of millions more users.</p>\n<p>&#8220;Hopefully as people get used to the more regular cadence they can plan around it, much like they used to complain a ton about, but then got used to, 3 major releases a year,&#8221; Mullenweg said during the dev chat.</p>\n<p>In 2016, Mullenweg began describing how WordPress could become &#8220;the operating system of the web,&#8221; with open APIs that others can build on. While that idea encompasses a lot more than just release schedules, WordPress seems to be moving in the direction of shipping updates that come more frequently and eventually more invisibly in the background, similar to how users update their browsers. Releasing Gutenberg in its current state, with frequent updates following, could prove to be a major testing ground to see if greater world of WordPress users are ready to embrace this new era of rapid iteration.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 09 Nov 2018 00:03:55 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:5;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:87:\"WPTavern: Adding Aligned Images to Paragraphs in Gutenberg Is Not as Tough as I Thought\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=85417\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:98:\"https://wptavern.com/adding-aligned-images-to-paragraphs-in-gutenberg-is-not-as-tough-as-i-thought\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4126:\"Last week, I published <a href=\"https://wptavern.com/how-to-add-an-image-to-a-paragraph-block-in-gutenberg\">an article</a> that describes the process I went through in Gutenberg to try to add an aligned image to a paragraph block. I concluded that performing the task in the Classic Editor was easier than in Gutenberg.\n\n\n\nIn response to the article, William Earnhardt <a href=\"https://wearnhardt.com/2018/11/the-gutenberg-complexity-fallacy/\">compared the process</a> and showed how it can be accomplished in two steps in Gutenberg.\n\n\n\n\n<ol><li>Drag an image into editor where you want it to go. </li><li>Click align right. </li></ol>\n\n\n\n\nDragging and dropping images into WordPress is not something I do. It&#8217;s not how I write. His method is simpler but I prefer to work within the interface. His second suggestion of accomplishing the task is the method I&#8217;ll use from now on.\n\n\n\n\n<ol><li>Click the block inserter above the paragraph you want to insert the image before.</li><li>Select the image block.</li><li>Drag the image onto the block.</li><li>Click align right.</li></ol>\n\n\n\n\nIn the last few months of using Gutenberg, I&#8217;ve become accustomed to adding new blocks by pressing enter at the end of a paragraph block or by clicking the plus sign to the left of a block. I haven&#8217;t used the plus sign between blocks but it makes sense and indeed, it&#8217;s quicker to accomplish the task.\n\n\n\nAccording to Earnhardt, there are even more ways to complete the task in Gutenberg. This brings up an important question, how many different ways and user interfaces should there be to accomplish a task? If you don&#8217;t do it a certain way, are you <a href=\"https://developer.wordpress.org/reference/functions/_doing_it_wrong/\">doing_it_wrong</a>?\n\n\n\n\n<div class=\"wp-block-image\"><img /></div>\n\n\n\n\nTake for example, adding captions to images. In Gutenberg, there are at least two opportunities to add a caption. The first is the attachment details screen after uploading or selecting an image from the media library.\n\n\n\nThe second is the Image block user interface. When using the Image block interface, my cursor gets stuck in the caption area and I need to click outside of the block in order to continue. If I use the attachment details screen, it automatically puts the caption text into the image block, bypassing the hurdle. Which interface am I supposed to use and which method is considered doing_it_wrong?<br />\n\n\n\n\n<div class=\"wp-block-image\"><a href=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2018/11/2018-11-08_00-56-29-1.gif?ssl=1\"><img /></a>Adding a Caption via the Image Block Interface</div>\n\n\n\n\n\n<h2>I&#8217;m Willing to Learn</h2>\n\n\n\n\nI understand the long vision of Gutenberg and what it means for the future of WordPress. For the past several months, I&#8217;ve used the plugin and interface exclusively to craft content.\n\n\n\nI&#8217;ve been learning things along the way and trying to readjust my workflows but the question I keep coming back to when doing things in Gutenberg is why?\n\n\n\nWhy is this button hidden? Why are there three differently located buttons to add blocks when it would be nice to memorize one? Why does this do that and vice versa? Where is all of the research and usability testing that explains the why behind so many of the interactions and flows? Am I just a moron or is it the interface that guides me in the wrong direction?\n\n\n\nMany of my experiences in using Gutenberg this past year have been <a href=\"https://mrwweb.com/wordpress-5-0-is-not-ready/\">echoed by Mark Root-Wiley</a>. He does a great job of saying what I&#8217;ve been feeling and thinking for a long time.\n\n\n\nWhen I and thousands of others watched Matías Ventura‏ perform a <a href=\"https://www.youtube.com/watch?v=XOY3ZUO6P0k&feature=youtu.be\">live demo</a> of Gutenberg at the 2017 State of Word, people were blown away. But this is someone who has been creating Gutenberg from the core and is proficient in all that it offers. Is this the level of Gutenberg proficiency I and others need in order to get things done? Probably not, but at times, it sure feels that way. <br />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 08 Nov 2018 07:37:40 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:6;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:99:\"WPTavern: Classic Editor Plugin May Be Included with 5.0 Updates, Support Window Set to End in 2021\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=85387\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:109:\"https://wptavern.com/classic-editor-plugin-may-be-included-with-5-0-updates-support-window-set-to-end-in-2021\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:6806:\"<p>Gary Pendergast <a href=\"https://make.wordpress.org/core/2018/11/07/classic-editor-plugin-support-window/\" rel=\"noopener noreferrer\" target=\"_blank\">announced</a> this morning that the <a href=\"https://wordpress.org/plugins/classic-editor/\" rel=\"noopener noreferrer\" target=\"_blank\">Classic Editor</a> plugin will be officially supported until December 31, 2021. The plugin eases the transition for sites where plugins or themes are not yet compatible with Gutenberg and gives users the opportunity to preserve their existing workflows.</p>\n<p>&#8220;Since the Classic Editor plugin is central in this transition, we are considering including it with upgrades to WordPress 5.0,&#8221; Pendergast said. &#8220;New WordPress installs would still add it manually, and we’ve included it in the Featured Plugins list to increase visibility. If you have thoughts on this idea, please leave a comment.&#8221;</p>\n<p>Pendergast clarified that &#8220;officially supported&#8221; means that the plugin &#8220;will be guaranteed to work as expected in the most recent major release of WordPress, and the major release before it.&#8221; He also said the project will evaluate the continuing maintenance of the plugin in 2021 and may possibly extend the date.</p>\n<p>The post has already received quite a bit of feedback and generally positive reactions to the prospect of including the Classic Editor along with 5.0 updates for existing sites.</p>\n<p>WordPress Core Committer Pascal Birchler asked for a clarification on what &#8220;we&#8221; referred to in Pendergast&#8217;s post, and Pendergast clarified that he is speaking on behalf of the WordPress project. Other commenters pressed for more information, as the announcement was delivered as something that had already been decided and the conversation surrounding the decision was not public.</p>\n<p>&#8220;I’m grateful for the communication on a hard date for support of the classic editor,&#8221; Darren Ethier commented on the post. &#8220;It helps many people depending on WordPress for their livelihood to make plans surrounding things depending on it. But for volunteers who &#8216;show up&#8217; at meetings and in contributing, the process for arriving at these kinds of decisions in an open source project is very opaque and seems to be increasingly so.&#8221;</p>\n<p>This announcement highlights a trend in recent decision making for the project where decisions on important items appear to have been made behind closed doors without community input. Matthew MacPherson&#8217;s <a href=\"https://wptavern.com/gutenberg-accessibility-audit-postponed-indefinitely\" rel=\"noopener noreferrer\" target=\"_blank\">proposal for an independent accessibility audit</a>, which had broad support from the community, was shut down in a similar way. MacPherson was named WordPress 5.0&#8217;s accessibility lead but didn&#8217;t seem to be fully vested with the power to lead that aspect of the release in the community&#8217;s best interests. I asked MacPherson if he could further clarify how the decision to forego the audit was reached, as it seemed even a surprise to him in the GitHub issue thread. He said he had &#8220;no comment&#8221; on how the decision came about.</p>\n<p>WPCampus is now <a href=\"https://wptavern.com/wpcampus-is-pursuing-an-independent-accessibility-audit-of-gutenberg\" rel=\"noopener noreferrer\" target=\"_blank\">pursuing an accessibility audit</a> in order to better serve its community of more than 800 web professionals, educators, and others who work with WordPress in higher education.</p>\n<p>&#8220;We&#8217;re receiving a lot of interest and I&#8217;m holding meetings with potential vendors to answer their questions,&#8221; WPCampus director Rachel Cherry said. &#8220;We&#8217;ve received a lot of messages from individuals and organizations wanting to contribute financially.&#8221;</p>\n<p>The <a href=\"https://wptavern.com/wordpress-accessibility-team-delivers-sobering-assessment-of-gutenberg-we-have-to-draw-a-line\" rel=\"noopener noreferrer\" target=\"_blank\">recent report from the accessibility team</a> demonstrates critical issues that prevent the team from recommending Gutenberg to users of assistive technology. These issues also have a major impact on those using WordPress for higher education, as the law requires them to meet certain standards. Several in this particular industry commented on Pendergast&#8217;s post to advocate for shipping the Classic Editor plugin with new installs as well.</p>\n<p>&#8220;Many organizations who use WordPress are required by law to provide accessible software under Section 508,&#8221; Rachel Cherry said. &#8220;Until such a time when the accessibility of Gutenberg has been improved, and Section 508 compliance is clear, these organizations will require use of the Classic Editor.</p>\n<p>&#8220;Not to mention the users who will be dependent upon the Classic Editor to have an accessible publishing experience.</p>\n<p>&#8220;Please consider bundling Classic Editor with all versions of core, new and updated, going forward so that every end user has the easy and inclusive option of using it from day one.&#8221;</p>\n<p>Elaine Shannon, another WordPress user who works in academia, also commented on the Pendergast&#8217;s post to recommend having the Classic Editor bundled with new versions of WordPress, due to many education sites running on multisite installations.</p>\n<p>&#8220;Some institutions are on managed hosts, where they’ll receive 5.0 without initiating the update themselves,&#8221; Shannon said. &#8220;Others are managed by on-campus IT services, where one campus admin will push the update and affect thousands of users. In many cases, these are MultiSites where end users – the ones who need the choice of whether to use Gutenberg or Classic Editor – do not have the ability to add a plugin. So regardless of whether these users are in a brand-new shiny install or just an updated existing one, many users are going to need to fall back to the Classic Editor, and if it’s not bundled with Core there will be some folks left having to contact their administrator.&#8221;</p>\n<p>Pendergast&#8217;s post said the WordPress project is considering including the plugin with upgrades to 5.0 but did not identify where or when that decision will be made. However, users who depend on the plugin now have a clear idea of how long it will be supported.</p>\n<p>&#8220;As for the EOL on Classic Editor support, that’s probably more clarity than [the core team] has ever really given on a feature-to-plugin transition and I’m in favor of having that hard date,&#8221; WordPress core developer Drew Jaynes said. &#8220;It sets the right tone that the plugin is not intended as a long-term solution, rather a stopgap with a definitive EOL.&#8221;</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 07 Nov 2018 20:13:35 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:7;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:66:\"WPTavern: Nidhi Jain Is Awarded the Kim Parsell Travel Scholarship\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=85390\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:77:\"https://wptavern.com/nidhi-jain-is-awarded-the-kim-parsell-travel-scholarship\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1553:\"In 2015, the WordPress Foundation <a href=\"https://wptavern.com/the-wordpress-foundation-creates-a-traveling-scholarship-in-memory-of-kim-parsell\">created a travel scholarship</a> in memory of <a href=\"https://wptavern.com/kim-parsell-affectionately-known-as-wpmom-passes-away\">Kim Parsell</a>. The <a href=\"https://2018.us.wordcamp.org/kim-parsell-memorial-scholarship-2018/\">scholarship</a> covers travel expenses, lodging, and a ticket to the event. This year&#8217;s recipient is <a href=\"https://twitter.com/jainnidhi03\">Nidhi Jain</a> from Udaipur, Rajasthan, India. \n\n\n\nJain is a volunteer organizer for WordCamp Udaipur, a WordPress developer, contributor, and a seasoned traveler. <br />\n\n\n\n&#8220;Being selected for the Kim Parsell Memorial Scholarship is an honor, achievement and a proud moment for me,&#8221; Jain told the WordCamp US organizing team when asked what it means to be selected.  \n\n\n\n&#8220;I will try my best to make the most out of it and give back to the community in all possible ways. Since I have been a WordCamp volunteer and organizer in the last few years, I am excited to see and learn from WordCamp US. I am sure, I will have a lot of sweet memories and wonderful learnings to take back home.&#8221;\n\n\n\nPrevious winners include Elizabeth Shilling in 2016 and Bianca Welds in 2017. If you&#8217;re not familiar with who Kim Parsell is, I recommend reading <a href=\"https://heropress.com/essays/family-well-loved/\">this essay</a> which provides some context as to why the scholarship was created in her memory. <br />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 07 Nov 2018 13:59:48 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:8;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"HeroPress: Accidental Activist\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"https://heropress.com/?post_type=heropress-essays&p=2648\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:112:\"https://heropress.com/essays/accidental-activist/#utm_source=rss&utm_medium=rss&utm_campaign=accidental-activist\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:12230:\"<img width=\"960\" height=\"480\" src=\"https://s20094.pcdn.co/wp-content/uploads/2019/11/110618-1024x512.jpg\" class=\"attachment-large size-large wp-post-image\" alt=\"Pull Quote: Imagine a world where more kinds of people are speaking up. That\'s a world I\'m excited to see.\" /><p>I never meant to become an activist. I swear. It was an accident.</p>\n<p>And yet here I am, celebrating my one year anniversary of leading the Diversity Outreach Speaker Training working group in the WordPress Community team. We are causing waves in the number of women and other underrepresented groups who are stepping up to become speakers at WordPress Meetups, WordCamps, and events. Pretty cool, right?</p>\n<p>How did this happen?</p>\n<p>Let’s start this story with how I got into WordPress. Back in 2011, I was looking for a practicum placement for the New Media Design and Web Development college program I was in in Vancouver, BC. We had touched on WordPress only briefly in class. I was curious about it, so I got a Practicum placement working on a higher education website that was built in WordPress. (It was in BuddyPress, even! Ooh. Aah.) As a thank you, my practicum advisor bought me a ticket to WordCamp Vancouver 2011: Developer’s Edition. That event was the start of my love affair with WordPress and I began taking on freelancing gigs. I’ve been a WordPress solopreneur for most of the time since.</p>\n<p>The following year my practicum advisor, who had become a client, was creating the first ever BuddyCamp for BuddyPress. He asked me to be on his organizing team. (Side note: I was especially excited to moderate a panel with Matt Mullenweg and other big names on it!) I was noticed and I was invited to be on the core organizing team for the next year’s WordCamp Vancouver by the lead organizer. I was thrilled. It was quite an honour!</p>\n<p>This is where the real story begins… after an important disclaimer.</p>\n<blockquote><p>Disclaimer: For simplicity in this story, I’ll be using the terms women and men, though in reality gender is not a simple binary and is actually a wide spectrum of different identities.</p></blockquote>\n<h3>The Real Beginning</h3>\n<p>There were three of us—myself and two men—and it was our first time any of us were organizing a WordCamp. We were having dinner in one of our apartments and we had 40 speaker applications spread out before us. The plan was to pick 14 to speak. It was hard. They were all really good.</p>\n<p>The lead organizer grabbed 6 out of the 7 that came from the women and said, &#8220;Well, we are accepting all of these.&#8221;</p>\n<p>At this point I didn’t know that not many women were applying to speak at tech conferences at the time.</p>\n<blockquote><p>So I was the one saying, &#8220;Wait, wait. Who cares what gender they are? Let’s go through them and pick based on the topics that would fit the conference’s flow.&#8221;</p></blockquote>\n<p>They both said that the 6 of the women’s pitches were really good, fit with the flow, and frankly, we needed to accept as many as we could or we’d get called out. (This is embarrassing to say now, but that was the conversation back in 2013.)</p>\n<p>Here’s how it went down:</p>\n<p>After we accepted the six, two of the women dropped out for family emergencies. (Guess how many men dropped out for family emergencies?) Also we had added a third speakers’ track. Now there were only 4 women out of 28 speakers. Only 1 in 7. That is 14%, my friends. That is not great.</p>\n<p>So not great, in fact, that we did get called out. People did talk about it, question us about it, and even wrote blog posts about it.</p>\n<h3>More Experience</h3>\n<p>So when later that year I went to WordCamp San Francisco—the biggest WordCamp at the time (before there was a WordCamp US)—I took the opportunity to chat with other organizers at a WordCamp organizer brunch.</p>\n<blockquote><p>I found out that many of the organizers had trouble getting enough women presenters.</p></blockquote>\n<p>I was surprised to find that we actually had a high number of women applicants in comparison to others, as many of them had zero! They were asking me how we got such a high number. They all said they would happily accept more if only more would apply.</p>\n<p>So then I needed to know, why was this happening? Why weren’t we getting more women applicants? I started researching, reading, and talking to people.</p>\n<p>Though this issue is complex, one thing that came up over and over was that when we would ask the question, &#8220;Hey, will you speak at my conference?&#8221; we would get two answers:</p>\n<ul>\n<li>&#8220;What would I talk about?&#8221;</li>\n<li>&#8220;I’m not an expert on anything. I don’t know enough about anything to give a talk on it.&#8221;</li>\n</ul>\n<p>That’s when the idea happened.</p>\n<h3>The Idea</h3>\n<p>As it goes, the idea happened while I was at a feminist blanket-fort slumber party. Yes, you heard right. And as one does at all feminist blanket-fort slumber parties, we talked about feminist issues.</p>\n<p>When I brought up my issue about the responses we were getting, one of the ladies said, &#8220;Why don’t you get them in a room and have them brainstorm topics?&#8221;</p>\n<blockquote><p>And that was it. That set me on the path.</p></blockquote>\n<p>I became the lead of a small group creating a workshop in Vancouver. In one of the exercises, we invited the participants to brainstorm ideas and show them that they have literally a hundred ideas. (Then the biggest problem becomes picking one. <img src=\"https://s.w.org/images/core/emoji/11/72x72/1f642.png\" alt=\"?\" class=\"wp-smiley\" /> )</p>\n<p>In our first iteration, we covered:</p>\n<ul>\n<li>Why it matters that women (<em>added later: diverse groups</em>) are in the front of the room</li>\n<li>The myths of what it takes to be the speaker at the front of the room (aka beating impostor syndrome)</li>\n<li>Different speaking formats, especially story-telling</li>\n<li>Finding and refining a topic</li>\n<li>Tips to becoming a better speaker</li>\n<li>Practising leveling up speaking in front of the group throughout the afternoon</li>\n</ul>\n<p>Other cities across North America got wind of our workshop and started running it as well, and they added their own material.</p>\n<p>Our own participants wanted more support, so the next year we added material created from the other cities as well as generated more of our own:</p>\n<ul>\n<li>Coming up with a great title</li>\n<li>Writing a pitch that is more likely to get accepted</li>\n<li>Writing a bio</li>\n<li>Creating an outline</li>\n<li>Creating better slides</li>\n</ul>\n<p>We did it! In 2014—in only one year since we started—we had 50% women speakers and 3 times the number of women applicants! Not only that, but it was a Developer’s Edition. It&#8217;s more challenging it is to find women developers in general, let alone those who will step up to speak.</p>\n<h3>Building On</h3>\n<p>Impressive as that is, the reason I am truly passionate about this work is because of what happened next:</p>\n<ul>\n<li>Some of the women who did our workshop and started publicly speaking stepped up to be leaders in our community and created new things for us. For example, a couple of them created a new Meetup track with a User focus.</li>\n<li>A handful of others became WordCamp organizers. One year Vancouver had an almost all-female organizing team – 5 out of 6!</li>\n<li>It also influenced local businesses. One local business owner loved what one of the women speakers said so much that he hired her immediately. She was the first woman developer on the team, and soon after she became the Senior Developer.</li>\n</ul>\n<p>It is results like these that ignited my passion. I’ve now seen time and again what happens when different kinds of folks speak in the front of the room. More kinds of people feel welcome in the community. The speakers and the new community members bring new ideas and new passions that help to make the technology we are creating more inclusive as well as generate new ideas that benefit everyone.</p>\n<p>This workshop has been so successful, with typical results of 40-60% women speakers at WordCamps, that the WordPress Community Team asked me to promote it and train it for women and all diverse groups around the world. We created the Diversity Outreach Speaker Training working group. I started creating and leading it in late 2017.</p>\n<blockquote><p>Thanks to our group, our workshop has been run in 17 cities so far this year, 32 have been trained to run it, and 53 have expressed interest in 24 countries. Incredible!</p></blockquote>\n<p>I love this work so much that I’m now looking at how to do this for a living. I’m proud of how the human diversity represented on the stage adds value not only to the brand but also in the long-term will lead to the creation of a better product. I’m inspired by seeing the communities change as a result of the new voices and new ideas at the WordPress events.</p>\n<p><strong>&#8220;Jill’s leadership in the development and growth of the Diversity Outreach Speaker Training initiative has had a positive, measurable impact on WordPress community events worldwide. When WordPress events are more diverse, the WordPress project gets more diverse — which makes WordPress better for more people.&#8221;</strong></p>\n<p><em>&#8211; Andrea Middleton, Community organizer on the WordPress open source project</em></p>\n<p>I’m exploring sponsorships, giving conference and corporate trainings, and looking at other options so that I can be an Accidental Activist full-time and make a bigger impact. Imagine a world where more kinds of people are speaking up. That’s a world I’m excited to see.</p>\n<h3>Resources:</h3>\n<p>Workshop: <a href=\"http://diversespeakers.info/\">http://diversespeakers.info/</a></p>\n<p>More info and please let us know if you use it or would like help using it: <a href=\"https://tiny.cc/wpwomenspeak\">https://tiny.cc/wpwomenspeak</a></p>\n<p>Diversity Outreach Speaker Training Team—Join us! <a href=\"https://make.wordpress.org/community/2017/11/13/call-for-volunteers-diversity-outreach-speaker-training/\">https://make.wordpress.org/community/2017/11/13/call-for-volunteers-diversity-outreach-speaker-training/</a></p>\n<p>How to build a diverse speaker roster: Coming soon. Contact Jill for it.</p>\n<div class=\"rtsocial-container rtsocial-container-align-right rtsocial-horizontal\"><div class=\"rtsocial-twitter-horizontal\"><div class=\"rtsocial-twitter-horizontal-button\"><a title=\"Tweet: Accidental Activist\" class=\"rtsocial-twitter-button\" href=\"https://twitter.com/share?text=Accidental%20Activist&via=heropress&url=https%3A%2F%2Fheropress.com%2Fessays%2Faccidental-activist%2F\" rel=\"nofollow\" target=\"_blank\"></a></div></div><div class=\"rtsocial-fb-horizontal fb-light\"><div class=\"rtsocial-fb-horizontal-button\"><a title=\"Like: Accidental Activist\" class=\"rtsocial-fb-button rtsocial-fb-like-light\" href=\"https://www.facebook.com/sharer.php?u=https%3A%2F%2Fheropress.com%2Fessays%2Faccidental-activist%2F\" rel=\"nofollow\" target=\"_blank\"></a></div></div><div class=\"rtsocial-linkedin-horizontal\"><div class=\"rtsocial-linkedin-horizontal-button\"><a class=\"rtsocial-linkedin-button\" href=\"https://www.linkedin.com/shareArticle?mini=true&url=https%3A%2F%2Fheropress.com%2Fessays%2Faccidental-activist%2F&title=Accidental+Activist\" rel=\"nofollow\" target=\"_blank\" title=\"Share: Accidental Activist\"></a></div></div><div class=\"rtsocial-pinterest-horizontal\"><div class=\"rtsocial-pinterest-horizontal-button\"><a class=\"rtsocial-pinterest-button\" href=\"https://pinterest.com/pin/create/button/?url=https://heropress.com/essays/accidental-activist/&media=https://heropress.com/wp-content/uploads/2019/11/110618-150x150.jpg&description=Accidental Activist\" rel=\"nofollow\" target=\"_blank\" title=\"Pin: Accidental Activist\"></a></div></div><a rel=\"nofollow\" class=\"perma-link\" href=\"https://heropress.com/essays/accidental-activist/\" title=\"Accidental Activist\"></a></div><p>The post <a rel=\"nofollow\" href=\"https://heropress.com/essays/accidental-activist/\">Accidental Activist</a> appeared first on <a rel=\"nofollow\" href=\"https://heropress.com\">HeroPress</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 07 Nov 2018 12:00:14 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:11:\"Jill Binder\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:9;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:114:\"WPTavern: Authors of Popular WordPress.org Themes Rolling Out Gutenberg Compatibility Updates Ahead of 5.0 Release\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=85247\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:125:\"https://wptavern.com/authors-of-popular-wordpress-org-themes-rolling-out-gutenberg-compatibility-updates-ahead-of-5-0-release\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5506:\"<p><a href=\"https://wordpress.org/themes/astra/\" rel=\"noopener noreferrer\" target=\"_blank\">Astra</a>, a free theme that has steadily been growing in popularity, is now <a href=\"https://wpastra.com/gutenberg-compatible/\" rel=\"noopener noreferrer\" target=\"_blank\">fully compatible with Gutenberg</a>. The theme was first released in May 2017 and has more than 100,000 active installations. It was downloaded approximately 2,000 &#8211; 4,500 times per day over the past month and currently maintains a 5-star average rating on WordPress.org after 844 reviews.</p>\n<p>Astra&#8217;s creators advertise the theme as fast, lightweight (less than 50KB on frontend), and compatible with many page builders. These features have been key to its rapid growth. Last week they announced full Gutenberg compatibility, which means sites built with Astra will be able to take advantage of all the new features in the editor when 5.0 is released.  </p>\n<p>Astra&#8217;s Gutenberg compatibility update includes front-end styles displayed in the editor and support for the full-width alignment option. The width of the content in the editor matches that of the frontend, and the same is true for the typography, colors, and background.</p>\n<p><a href=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2018/11/gutenberg-full-width.gif?ssl=1\"><img /></a></p>\n<p>The theme also ensures that the default Gutenberg blocks, i.e. quotes and galleries, will inherit Astra customizer styles to match the rest of the site. </p>\n<p>Astra&#8217;s creators support the theme by offering commercial <a href=\"https://wpastra.com/pricing/\" rel=\"noopener noreferrer\" target=\"_blank\">packages</a> that include additional features and plugins, <a href=\"https://wpastra.com/ready-websites/\" rel=\"noopener noreferrer\" target=\"_blank\">starter sites</a>, add-ons for page builders, and support. They plan to offer additional Gutenberg features in commercial add-ons. Astra&#8217;s Ultimate Addons product will introduce custom blocks, such as Section, Heading, Info Box, Post Grid, Google Map, Table, Social Share, Menu, Buttons, along with pre-made starter templates.</p>\n<p>After two months of weekend work, Anders Norén reported that <a href=\"https://wordpress.org/themes/author/anlino/\" rel=\"noopener noreferrer\" target=\"_blank\">all 18 of his free themes on WordPress.org</a> have been <a href=\"http://www.andersnoren.se/the-gutenberg-update/\" rel=\"noopener noreferrer\" target=\"_blank\">updated to be compatible with Gutenberg</a>. Norén&#8217;s popular minimalist style themes have a cumulative rating of 4.97 out of 5 stars and have been downloaded more than <a href=\"http://wptally.com/?wpusername=anlino\" rel=\"noopener noreferrer\" target=\"_blank\">2.2 million times</a>. They are active on an estimated 100,000 WordPress installations.</p>\n<p>&#8220;There are no custom blocks or other fancy stuff to be found in the updates, but if you’re running one of my themes, you should be able to update to WordPress 5.0 and start using Gutenberg without any hitches, in the editor or on the front-end,&#8221; Norén said. &#8220;If you plan to keep using the classic editor, things should look mostly the same after you install the update.&#8221;</p>\n<p>The Gutenberg compatibility update for Norén&#8217;s themes includes editor styles, with layout, typography and colors matching the theme, styles for core blocks and new alignment options, and custom font sizes and color palette in the editor. Norén also took the opportunity to do an overall code cleanup and add improvements for older versions of PHP, accessibility and localization improvements, and bug fixes, amounting to 17,525 lines of code added or modified.</p>\n<p>&#8220;The past couple of weekends have been grueling, but knowing that my themes will be ready for WordPress 5.0 – whether it hits the November 20th release date or not – was worth it,&#8221; Norén said.</p>\n<p>Themeisle has updated <a href=\"https://wordpress.org/themes/hestia/\" rel=\"noopener noreferrer\" target=\"_blank\">Hestia</a> with Gutenberg compatibility in the theme&#8217;s <a href=\"https://themeisle.com/blog/hestia-2-0/\" rel=\"noopener noreferrer\" target=\"_blank\">2.0 release</a>. The popular Material Design WordPress theme is the company&#8217;s flagship product and is installed on more than 100,000 WordPress sites. The company is planning to release a brand new theme that will be fully Gutenberg compatible. They have not yet announced if <a href=\"https://wordpress.org/themes/zerif-lite/\" rel=\"noopener noreferrer\" target=\"_blank\">Zerif Lite</a> (100,000+ installs) will be updated for the new editor.</p>\n<p>Six weeks ago, <a href=\"https://wordpress.org/themes/search/Gutenberg/\" rel=\"noopener noreferrer\" target=\"_blank\">searching the WordPress.org Theme Directory for “Gutenberg”</a> produced 26 results where compatibility is mentioned in the theme descriptions. That number has jumped to 53. Support for the new editor seems to have happened much faster in the commercial theme space where <a href=\"https://themeforest.net/category/wordpress?term=Gutenberg\" rel=\"noopener noreferrer\" target=\"_blank\">searching for Gutenberg on Envato</a> already turns up hundreds of results before the editor has even landed in core. Authors of free themes on WordPress.org don&#8217;t always have the same motivation. Those who support popular themes are more likely to have their themes compatible by the time WordPress 5.0 arrives, especially if the free theme is connected to a paid product.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 06 Nov 2018 04:34:25 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:10;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:66:\"WPTavern: WordPress 5.0 Beta 3 Released, RC 1 Expected November 12\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=85224\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:76:\"https://wptavern.com/wordpress-5-0-beta-3-released-rc-1-expected-november-12\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:6909:\"<p><a href=\"https://wordpress.org/news/2018/11/wordpress-5-0-beta-3/\" rel=\"noopener noreferrer\" target=\"_blank\">WordPress 5.0 Beta 3</a> was released this morning. This beta incorporates all the changes from <a href=\"https://make.wordpress.org/core/2018/10/31/whats-new-in-gutenberg-31st-october-2/\" rel=\"noopener noreferrer\" target=\"_blank\">Gutenberg 4.2 RC1</a>, which was released last week. It fixes a bug with the display of the custom fields meta box and also improves REST API requests.</p>\n<p>Gutenberg has undergone a few UI tweaks and introduces a <a href=\"https://github.com/WordPress/gutenberg/pull/10209\" rel=\"noopener noreferrer\" target=\"_blank\">Formatting API</a> for adding new RichText components. The inserter between blocks was updated to provide a more consistent experience that matches the other “add block” buttons. Version 4.2 also adds support for displaying icons in new block categories to better organize groups of blocks. The example pictured in the release post shows the Jetpack icon. The Jetpack team has been <a href=\"https://wptavern.com/jetpack-6-6-improves-site-verification-tools-asset-cdn-module-now-in-beta-gutenberg-blocks-coming-soon\" rel=\"noopener noreferrer\" target=\"_blank\">working on a number of blocks for existing features</a> and is expected to release those soon.</p>\n<p><a href=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2018/11/block-categories.png?ssl=1\"><img /></a></p>\n<p>WordPress 5.0 Beta 3 brings in updates from Twenty Nineteen&#8217;s GitHub repository, including support for selective refresh widgets in the customizer, support for responsive embeds, and tweaks to improve the experience on mobile devices.</p>\n<h3>Updates to WordPress 5.0 Schedule: More Beta Releases and a Shortened RC Period</h3>\n<p>WordPress 5.0 is now two weeks away from its <a href=\"https://make.wordpress.org/core/5-0/\" rel=\"noopener noreferrer\" target=\"_blank\">projected release date</a> of November 19. Last week Gary Pendergast announced some <a href=\"https://make.wordpress.org/core/2018/10/31/wordpress-5-0-schedule-updates/\" rel=\"noopener noreferrer\" target=\"_blank\">updates to the 5.0 release schedule</a> that build in extra time for betas. After pushing out Beta 3 Pendergast said he expects to release Beta 4 later this week. He also offered an explanation for why RC1 is scheduled for release on November 12, allowing for just one week of last-minute testing following RC.</p>\n<p>&#8220;The block editor has been available for over a year,&#8221; Pendergast said. &#8220;It’s already had a longer testing period, with 30 times the number of sites using it, than any previous WordPress release. The primary purpose of the beta and release candidate periods is to ensure that it’s been correctly merged into Core.&#8221;</p>\n<p>Initial feedback on the schedule changes indicate that some user would appreciate a longer RC period, since the code being tested has changed so often. </p>\n<p>&#8220;The API freeze just happened in version 4.2, so saying the editor has been available for over a year in anywhere near its current state doesn’t make sense for a 7-day RC period on such a major change,&#8221; WordPress trainer and developer Brian Hogg <a href=\"https://make.wordpress.org/core/2018/10/31/wordpress-5-0-schedule-updates/#comment-34292\" rel=\"noopener noreferrer\" target=\"_blank\">said</a>.</p>\n<p>&#8220;As an example, just in the last version or two the hover-over menu to remove a block has been taken out and tucked away at the top menu (which was available as shown in <a href=\"https://youtu.be/yjqW_IS6Q7w?t=80\" rel=\"noopener noreferrer\" target=\"_blank\">https://youtu.be/yjqW_IS6Q7w?t=80</a>), with little time for anyone to provide usability feedback on changes like this.&#8221;</p>\n<p>Those who are creating training materials and videos have been waiting for a bit of a reprieve in Gutenberg development to make sure their materials are accurate and ready for 5.0.</p>\n<p>&#8220;Knowing it’s an RC means we can assume a level of &#8216;this is how it will be&#8217; that just isn’t necessarily with pre-RC versions,&#8221; Modern Tribe developer George Gecewicz <a href=\"https://make.wordpress.org/core/2018/10/31/wordpress-5-0-schedule-updates/#comment-34278\" rel=\"noopener noreferrer\" target=\"_blank\">commented</a> on the post. &#8220;That relative certainty is useful for testing aggressively, finalizing design/UI stuff, and revealing post-merge bugs.&#8221;</p>\n<p>Gutenberg 4.1 was supposed to be the &#8220;<a href=\"https://github.com/WordPress/gutenberg/milestone/66\" rel=\"noopener noreferrer\" target=\"_blank\">UI freeze</a>&#8221; milestone, but that hasn&#8217;t happened yet with several changes introduced in 4.2. </p>\n<blockquote class=\"twitter-tweet\">\n<p lang=\"en\" dir=\"ltr\">The \"freeze\" in \"UI freeze\" doesn\'t mean you can thaw it and change it willy nilly. Some of us rely on such landmarks to do our work.</p>\n<p>&mdash; Morten Rand-Hendriksen (@mor10) <a href=\"https://twitter.com/mor10/status/1059269623944642560?ref_src=twsrc%5Etfw\">November 5, 2018</a></p></blockquote>\n<p></p>\n<p>There should be short window of time before 5.0 is released where training materials can be finalized. However, the Gutenberg team plans to continue on from there with its same pace of development.</p>\n<p>&#8220;Over the past six months, there has been a release every two weeks,&#8221; Pendergast said. &#8220;We’ll plan to continue that over the first few WordPress 5.0.x releases, to ensure that bug fixes are available as quickly as possible. How soon should we expect WordPress 5.0.1? Approximately two weeks after WordPress 5.0, unless we see bug reports that indicate a need for a faster release.&#8221;</p>\n<p>WordPress 5.0 is on schedule for its original release date, but there is still a possibility for the the release to be delayed. Matt Mullenweg, <a href=\"https://wptavern.com/wordpress-accessibility-team-delivers-sobering-assessment-of-gutenberg-we-have-to-draw-a-line#comment-266997\" rel=\"noopener noreferrer\" target=\"_blank\">commenting</a> on responses to the accessibility team&#8217;s assessment of Gutenberg, said that delaying the release has &#8220;definitely been considered&#8221; and that it may still happen. His response also indicates that WordPress users can expect the pace of core development to continue along the path Gutenberg has carved. </p>\n<p>&#8220;Despite some differences that still need be resolved, there’s general consensus that the long-term way to create the best WP experience for all types of users is not something you can tack on with 5-6 weeks at the end, but will be the result of continuing the continuous iteration we’ve had with the 42 public releases of Gutenberg so far,&#8221; Mullenweg said. &#8220;It means we can get improvements into the hands of users within weeks following a release, not months (or years) as was the old model with WordPress.&#8221;</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 05 Nov 2018 18:39:49 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:11;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"Dev Blog: WordPress 5.0 Beta 3\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"https://wordpress.org/news/?p=6236\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"https://wordpress.org/news/2018/11/wordpress-5-0-beta-3/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3134:\"<p>WordPress 5.0 Beta 3 is now available!</p>\n\n<p><strong>This software is still in development,</strong>&nbsp;so we don’t recommend you run it on a production site. Consider setting up a test site to play with the new version.</p>\n\n<p>There are two ways to test the WordPress 5.0 Beta: try the&nbsp;<a href=\"https://wordpress.org/plugins/wordpress-beta-tester/\">WordPress Beta Tester</a>&nbsp;plugin (you’ll want “bleeding edge nightlies”), or you can&nbsp;<a href=\"https://wordpress.org/wordpress-5.0-beta3.zip\">download the beta here</a>&nbsp;(zip).</p>\n\n<p>WordPress 5.0 is slated for release on&nbsp;<a href=\"https://make.wordpress.org/core/5-0/\">November 19</a>, and we need your help to get there. Here are some of the big issues that we&#8217;ve fixed since Beta 2:</p>\n\n<h2>Block Editor</h2>\n\n<p>The block editor has been updated to include all of the features and bug fixes from the upcoming <a href=\"https://make.wordpress.org/core/2018/10/31/whats-new-in-gutenberg-31st-october-2/\">Gutenberg 4.2 release</a>. Additionally, there are some newer bug fixes and features, such as:</p>\n\n<ul><li>Adding support for the &#8220;Custom Fields&#8221; meta box.</li><li>Improving the reliability of REST API requests.</li><li>A myriad of minor tweaks and improvements.</li></ul>\n\n<h2>Twenty Nineteen</h2>\n\n<p>Twenty Nineteen has been updated from its <a href=\"https://github.com/WordPress/twentynineteen\">GitHub repository</a>, this version is full of new goodies to check out:</p>\n\n<ul><li>Adds support for Selective Refresh Widgets in the Customiser.</li><li>Adds support for Responsive Embeds.</li><li>Tweaks to improve readability and functionality on mobile devices.</li><li>Fixes nested blocks appearing wider than they should be.</li><li>Fixes some errors in older PHP versions, and in IE11.</li></ul>\n\n<h2>How to Help</h2>\n\n<p>Do you speak a language other than English? <a href=\"https://translate.wordpress.org/projects/wp/dev\">Help us translate WordPress into more than 100 languages!</a> </p>\n\n<p>If you&#8217;re able to contribute with coding or testing changes, we have <a href=\"https://make.wordpress.org/core/2018/11/02/upcoming-5-0-bug-scrubs/\">a multitude of bug scrubs</a> scheduled this week, we&#8217;d love to have as many people as we can ensuring all bugs reported get the attention they deserve.</p>\n\n<p><strong><em>If you think you’ve found a bug</em></strong><em>, you can post to the&nbsp;</em><a href=\"https://wordpress.org/support/forum/alphabeta\"><em>Alpha/Beta area</em></a><em>&nbsp;in the support forums. We’d love to hear from you! If you’re comfortable writing a reproducible bug report,&nbsp;</em><a href=\"https://make.wordpress.org/core/reports/\"><em>file one on WordPress Trac</em></a><em>, where you can also find&nbsp;</em><a href=\"https://core.trac.wordpress.org/tickets/major\"><em>a list of known bugs</em></a><em>.</em></p>\n\n<hr class=\"wp-block-separator\" />\n\n<p><em>WordPress Five Point Oh<br />is just two short weeks away.<br />Thank you for helping!</em> <img src=\"https://s.w.org/images/core/emoji/11/72x72/1f496.png\" alt=\"?\" class=\"wp-smiley\" /><em><br /></em></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 05 Nov 2018 00:20:08 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Gary Pendergast\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:12;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:80:\"WPTavern: GitHub Rolls Out More Small Improvements as Part of Project Paper Cuts\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=85245\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:91:\"https://wptavern.com/github-rolls-out-more-small-improvements-as-part-of-project-paper-cuts\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4625:\"<p>In August, GitHub <a href=\"https://blog.github.com/2018-08-28-announcing-paper-cuts/\" rel=\"noopener noreferrer\" target=\"_blank\">announced</a> Project Paper Cuts, an effort aimed at bringing small improvements to the developer and project maintainer experiences. These are fixes for issues that don&#8217;t generally fall within larger initiatives. Some of the first improvements that have already been implemented include the following:</p>\n<ul>\n<li>Unselect markers when copying and pasting the contents of a diff</li>\n<li>Edit a repository’s README from the repository root</li>\n<li>Access your repositories straight from the profile dropdown</li>\n<li>Highlight permalinked comments</li>\n<li>Remove files from a pull request with a button</li>\n<li>Branch names in merge notification emails</li>\n<li>Create new pull requests from your repository’s Pull Requests Page</li>\n<li>Add a teammate from the team discussions page</li>\n<li>Collapse all diffs in a pull request at once</li>\n<li>Copy the URL of a comment</li>\n</ul>\n<p>One of the latest improvements allows repository admins to transfer an issue that has been misfiled to another repository where it belongs. At the moment it only works within the same GitHub organization account. Initial <a href=\"https://twitter.com/asmeurer/status/1057741387108560897\" rel=\"noopener noreferrer\" target=\"_blank\">feedback</a> from users indicates many would appreciate this feature require push permissions, instead of admin permissions, as there are likely more users who can help in the bug tracker with moving issues, setting labels, and closing bugs.</p>\n<blockquote class=\"twitter-tweet\">\n<p lang=\"en\" dir=\"ltr\">Issue filed in the wrong repo? </p>\n<p>We know your pain! And now we\'ve got a fix. </p>\n<p>Repo admins can transfer issues to wherever they belong. <img src=\"https://s.w.org/images/core/emoji/11/72x72/1f3d8.png\" alt=\"?\" class=\"wp-smiley\" /> <a href=\"https://t.co/rPwNng7ZOl\">pic.twitter.com/rPwNng7ZOl</a></p>\n<p>&mdash; GitHub (@github) <a href=\"https://twitter.com/github/status/1057678791764467712?ref_src=twsrc%5Etfw\">October 31, 2018</a></p></blockquote>\n<p></p>\n<p>The &#8220;<a href=\"https://blog.github.com/2018-11-01-suggested-changes-update/\" rel=\"noopener noreferrer\" target=\"_blank\">suggested changes</a>&#8221; feature GitHub introduced in beta two weeks ago seems to have been adopted fairly quickly by users. Suggested Changes lets users suggest a change to code in a pull request. These changes can be accepted by the author or assignees with one click and then committed.</p>\n<p><a href=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2018/11/suggested-changes.png?ssl=1\"><img /></a></p>\n<p>GitHub reports more than 10 percent of all reviewers suggested at least one change. They have received 100,000 suggestions and estimate that 4% of all review commits created have included a suggestion. Based on feedback so far, GitHub put the following improvements on the roadmap for the Suggested Changes feature: </p>\n<ul>\n<li>The ability to suggest changes to multiple lines at once</li>\n<li>The ability to accept multiple changes in a single commit</li>\n</ul>\n<p>Project Paper Cuts is borrowing heavily from <a href=\"https://github.com/sindresorhus/refined-github/\" rel=\"noopener noreferrer\" target=\"_blank\">Refined GitHub</a>, a browser extension that simplifies the GitHub interface and adds useful features. </p>\n<p>&#8220;Full-time open source developer <a href=\"https://github.com/sindresorhus/\" rel=\"noopener noreferrer\" target=\"_blank\">Sindre Sorhus</a> has built a great browser extension that builds on and improves the GitHub experience, along with a fantastic community that has come together to discuss workflows and build their favorite features,&#8221; GitHub product manager Luke Hefson said. &#8220;Project Paper Cuts has taken inspiration from a lot of Refined GitHub’s additions, and we’re building some of the most-loved features right into GitHub itself.&#8221;</p>\n<p>GitHub is aiming to be more open and transparent with user feedback after the <a href=\"https://wptavern.com/open-source-project-maintainers-confront-github-with-open-letter-on-issue-management\" rel=\"noopener noreferrer\" target=\"_blank\">2016 fiasco with disgruntled open source project maintainers</a>. These fixes for small annoyances add up in the grand scheme of things to improve project workflow for millions of developers and project maintainers. The improvements are shipping out regularly and are all outlined in <a href=\"https://blog.github.com/changelog/\" rel=\"noopener noreferrer\" target=\"_blank\">GitHub&#8217;s public changelog</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 02 Nov 2018 18:58:42 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:13;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:92:\"WPTavern: WPWeekly Episode 336 – Interview With Andrew Roberts, CEO and Co-founder of Tiny\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"https://wptavern.com?p=85267&preview=true&preview_id=85267\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:98:\"https://wptavern.com/wpweekly-episode-336-interview-with-andrew-roberts-ceo-and-co-founder-of-tiny\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2772:\"<p>In this episode, <a href=\"http://jjj.me\">John James Jacoby</a> and I are joined by <a href=\"https://twitter.com/andrew_roberts?lang=en\">Andrew Roberts</a>, CEO and Co-founder of <a href=\"https://www.tiny.cloud/\">Tiny</a>. Tiny is the company behind the popular open source library <a href=\"https://www.tiny.cloud/features/\">TinyMCE</a>. Roberts shares his entrepreneurial journey, what the company plans on doing with its recent <a href=\"https://wptavern.com/tiny-raises-4m-in-series-a-funding-publishes-gutenberg-faq\">round of funding</a>, and the relationship between TinyMCE and Gutenberg.</p>\n<p>Here is an excerpt from the show on what Roberts thinks about Gutenberg.</p>\n<blockquote><p>I think that ultimately Gutenberg will be more innovative than just incrementally changing from the old editor experience toward block-based editing.</p>\n<p>I think you know Matt&#8217;s probably had a tough year with some of the criticisms around Gutenberg but I admire his courage and leadership because if he hadn&#8217;t put his brand equity on the line, if he hadn&#8217;t invested his goodwill in doing this, this would never be launching in a month from now.</p>\n<p>There may be a painful year or two but in the grand scheme of things this will turn out for the better. It&#8217;s taken a lot of courage and bravery for him to do that. He&#8217;s taken a lot of shots in the back, but you know that&#8217;s why he gets paid the big bucks as they say.</p></blockquote>\n<h2>Stories Discussed:</h2>\n<p><a href=\"https://jjj.blog/2018/10/wordpress-5-0-beta-1/\">WordPress 5.0 Beta 1</a><br />\n<a href=\"https://wptavern.com/wordpress-accessibility-team-delivers-sobering-assessment-of-gutenberg-we-have-to-draw-a-line\">WordPress Accessibility Team Delivers Sobering Assessment of Gutenberg: “We have to draw a line.”</a><br />\n<a href=\"https://wptavern.com/woocommerce-3-5-introduces-rest-api-v3-improves-transactional-emails\">WooCommerce 3.5 Introduces REST API v3, Improves Transactional Emails</a><br />\n<a href=\"https://wptavern.com/wp-engine-acquires-array-themes\">WP Engine Acquires Array Themes</a></p>\n<h2>WPWeekly Meta:</h2>\n<p><strong>Next Episode:</strong> Wednesday, November 7th 3:00 P.M. Eastern</p>\n<p>Subscribe to <a href=\"https://itunes.apple.com/us/podcast/wordpress-weekly/id694849738\">WordPress Weekly via Itunes</a></p>\n<p>Subscribe to <a href=\"https://www.wptavern.com/feed/podcast\">WordPress Weekly via RSS</a></p>\n<p>Subscribe to <a href=\"http://www.stitcher.com/podcast/wordpress-weekly-podcast?refid=stpr\">WordPress Weekly via Stitcher Radio</a></p>\n<p>Subscribe to <a href=\"https://play.google.com/music/listen?u=0#/ps/Ir3keivkvwwh24xy7qiymurwpbe\">WordPress Weekly via Google Play</a></p>\n<p><strong>Listen To Episode #336:</strong><br />\n</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 02 Nov 2018 13:25:36 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:14;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:63:\"WPTavern: How to Add an Image to A Paragraph Block in Gutenberg\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=85201\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:74:\"https://wptavern.com/how-to-add-an-image-to-a-paragraph-block-in-gutenberg\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2393:\"<p>WordPress 5.0 is on the horizon and with it comes a number of opportunities to explain how to get things done in the new editor. <br /></p>\n\n\n\n<h2>Testing Scenario<br /></h2>\n\n\n\n<p>A user has written three paragraphs and decides to add an image to the second paragraph. This user wants the image to be aligned to the right. </p>\n\n\n\n<h2>Accomplishing the Task in the Classic Editor</h2>\n\n\n\n<p>The classic editor is essentially one big block. Adding media to a paragraph is as quick as placing the mouse cursor at the beginning of a paragraph, clicking the add new media button, selecting or uploading an image, and choosing its alignment. </p>\n\n\n\n<h2 id=\"mce_6\">Accomplishing the Task in Gutenberg</h2>\n\n\n\n<p>In Gutenberg, each paragraph is a block and each block has its own toolbar. This is important because after writing three paragraphs, you can&#8217;t click on an add media button. Instead, you need to create an image block. </p>\n\n\n\n<p>Once you&#8217;ve selected an image, you need to move the image block above the paragraph block where you want to insert it. At first, you might try to drag and drop the image into the paragraph but that doesn&#8217;t work. You need to use the up and down arrows or drag the block into position. </p>\n\n\n\n<p>Once the image block is in the correct location, click the align right icon. The image will be inserted into the right side of the paragraph block. </p>\n\n\n\n<img />A Right Aligned Image Inside of A Paragraph Block\n\n\n\n<p>If you want to move the image to a different paragraph block, you&#8217;ll need to click the Align center button which turns the image back into its own block and repeat the process described above. </p>\n\n\n\n<h2>Adding Images to Paragraphs in the Classic Editor Is Easier<br /></h2>\n\n\n\n<p>The task I described above is one I think millions of users will have trouble completing when WordPress 5.0 is released. In the Classic editor, the writing flow doesn&#8217;t feel disjointed when you want to add images or embed content into posts. </p>\n\n\n\n<p>In Gutenberg, everything is a block which in many cases, causes the flow to be disrupted as you need to figure out what block you need, how to manipulate it, where to move it, find where the options are, etc. </p>\n\n\n\n<p>The process of adding images to paragraphs will likely improve after WordPress 5.0 is released but until then, the Classic editor wins this use case. </p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 02 Nov 2018 11:35:29 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:15;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:79:\"WPTavern: Google’s reCAPTCHA v3 Promises a “Frictionless User Experience”\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=85145\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:81:\"https://wptavern.com/googles-recaptcha-v3-promises-a-frictionless-user-experience\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3218:\"<p>Google <a href=\"https://webmasters.googleblog.com/2018/10/introducing-recaptcha-v3-new-way-to.html\" rel=\"noopener noreferrer\" target=\"_blank\">introduced reCAPTCHA v3</a> this week, which promises a new &#8220;frictionless user experience.&#8221; Earlier versions of the API stopped bots but also drew the ire of internet users across the globe. Users were regularly inconvenienced with distorted text challenges, street sign puzzles, click requirements, and other actions to prove their humanity. </p>\n<p>v3 offers a marked improvement by detecting bots in the background and returning a score that tells the admin if the interaction is suspicious. It scores traffic with its <a href=\"https://patents.google.com/patent/US20110054961A1/en\">Adaptive Risk Analysis Engine</a> instead of forcing human users to perform interactive challenges. The score can be used three different ways:</p>\n<ul>\n<li>Set a threshold that determines when a user is let through or when further verification needs to be done, i.e. two-factor authentication or phone verification.</li>\n<li>Combine the score with your own signals that reCAPTCHA can’t access, such as user profiles or transaction histories.</li>\n<li>Use the reCAPTCHA score as one of the signals to train your machine learning model to fight abuse.</li>\n</ul>\n<p>v3 give site owners more options to customize the thresholds and actions for different types of traffic. The video below explains how it works and the <a href=\"https://developers.google.com/recaptcha/docs/v3\" rel=\"noopener noreferrer\" target=\"_blank\">developer docs</a> have more information on frontend integration and score interpretation.</p>\n<p></p>\n<p>Site owners can view their traffic in the <a href=\"https://www.google.com/recaptcha/admin\" rel=\"noopener noreferrer\" target=\"_blank\">reCAPTCHA admin console</a>. It also displays a list of all of your sites and what version of the API they are using.</p>\n<p><a href=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2018/10/Screen-Shot-2018-11-01-at-5.08.11-PM.png?ssl=1\"><img /></a></p>\n<p>The admin console also has a form for registering new sites:</p>\n<p><a href=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2018/10/Screen-Shot-2018-11-01-at-5.09.18-PM.png?ssl=1\"><img /></a></p>\n<p>The WordPress Plugin Directory has <a href=\"https://wordpress.org/plugins/search/reCAPTCHA/\" rel=\"noopener noreferrer\" target=\"_blank\">dozens of standalone plugins and contact forms</a> that make use of reCAPTCHA in some way. Sites that are already set up to use v2 or the Invisible CAPTCHA, will not automatically update to use v3. There&#8217;s a different signup and implementation process that the site owner has to perform before having it integrated on the site.</p>\n<p>WordPress plugin developers who offer reCAPTCHA will have to decide if they want to update existing plugins to use v3 or package a v3 offering in a new plugin. The reCAPTCHA v1 API was shut down earlier this year in March. Google&#8217;s <a href=\"https://github.com/google/recaptcha/\" rel=\"noopener noreferrer\" target=\"_blank\">reCAPTCHA PHP client library on GitHub</a> is still actively encouraging use of both v2 and v3. A date has not been announced for v2 to be deprecated. </p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 02 Nov 2018 00:09:59 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:16;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:37:\"Dev Blog: Quarterly Updates | Q3 2018\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"https://wordpress.org/news/?p=6206\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:61:\"https://wordpress.org/news/2018/11/quarterly-updates-q3-2018/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:13505:\"<p><em>To keep everyone aware of big projects and efforts across WordPress contributor teams, I&#8217;ve reached out to each team&#8217;s <a href=\"https://make.wordpress.org/updates/team-reps/\">listed representatives</a>. I asked each of them to share their Top Priority (and when they hope for it to be completed), as well as their biggest Wins and Worries. Have questions? I&#8217;ve included a link to each team&#8217;s site in the headings.</em></p>\n\n<h2><a href=\"https://make.wordpress.org/accessibility/\">Accessibility</a></h2>\n<p></p>\n<ul>\n<li><strong>Contacted</strong>: <a href=\"https://profiles.wordpress.org/joedolson/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>joedolson</a>, <a href=\"https://profiles.wordpress.org/audrasjb/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>audrasjb</a>, <a href=\"https://profiles.wordpress.org/arush/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>arush</a></li>\n<li><strong>Priority</strong>: Work on authoring a manual for assistive technology users on Gutenberg, led by Claire Brotherton (<a href=\"https://profiles.wordpress.org/abrightclearweb/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>abrightclearweb</a>). Continue to work on improving the overall user experience in Gutenberg. Update and organize the WP A11y handbook.</li>\n<li><strong>Struggle</strong>: Lack of developers and accessibility experts to help test and code the milestone issues. Still over 100 outstanding issues, and developing the Gutenberg AT manual helps expose additional issues. The announcement of an accessibility focus on 4.9.9 derailed our planning for Gutenberg in September with minimal productivity, as that goal was quickly withdrawn from the schedule.</li>\n<li><strong>Big Win</strong>: Getting focus constraint implemented in popovers and similar components in Gutenberg.</li>\n</ul>\n<p></p>\n<h2><a href=\"https://make.wordpress.org/cli/\">CLI</a></h2>\n<p></p>\n<ul>\n<li><strong>Contacted</strong>: @danielbachhuber, <a href=\"https://profiles.wordpress.org/schlessera/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>schlessera</a></li>\n<li><strong>Priority</strong>: Current priority is v2.1.0 of WP-CLI, to polish the major refactoring v2.0.0 introduced. You can <a href=\"https://make.wordpress.org/cli/good-first-issues/\">join in or follow progress</a> on their site.</li>\n<li><strong>Struggle</strong>: Getting enough contributors to make peer-review possible/manageable.</li>\n<li><strong>Big Win</strong>: The major refactoring of v2 was mostly without any negative impacts on existing installs. It provided substantial improvements to maintainability including: faster and more reliable testing, more straight-forward changes to individual packages, and simpler contributor on-boarding.</li>\n</ul>\n<p></p>\n<h2><a href=\"https://make.wordpress.org/community/\">Community</a></h2>\n<p></p>\n<ul>\n<li><strong>Contacted</strong>: <a href=\"https://profiles.wordpress.org/francina/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>francina</a>, <a href=\"https://profiles.wordpress.org/hlashbrooke/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>hlashbrooke</a></li>\n<li><strong>Priority</strong>: Supporting contributors of all levels via: monthly <a href=\"https://make.wordpress.org/community/2018/10/08/announcement-monthly-chat-for-wordcamp-organisers/\">WordCamp Organizers chat</a>, better onboarding with a translated <a href=\"https://make.wordpress.org/community/2017/08/11/global-community-team-welcome-pack/\">welcome pack</a>, and Contribution Drive documentation.</li>\n<li><strong>Struggle</strong>: Fewer contributors than usual.</li>\n<li><strong>Big Win</strong>: <a href=\"https://make.wordpress.org/community/2018/09/21/meetup-application-vetting-sprint-26-27-september/\">Meetup Vetting Sprint</a>! </li>\n</ul>\n<p></p>\n<h2><a href=\"https://make.wordpress.org/core/\">Core</a></h2>\n<p></p>\n<ul>\n<li><strong>Contacted</strong>: <a href=\"https://profiles.wordpress.org/jeffpaul/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>jeffpaul</a></li>\n<li><strong>Priority</strong>: Continued preparation for the 5.0 release cycle and Gutenberg.</li>\n<li><strong>Struggle</strong>: Identifying tasks for first time contributors, as well as for new-to-JS contributors.</li>\n</ul>\n<p></p>\n<h2><a href=\"https://make.wordpress.org/design/\">Design</a></h2>\n<p></p>\n<ul>\n<li><strong>Contacted</strong>: <a href=\"https://profiles.wordpress.org/melchoyce/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>melchoyce</a>, <a href=\"https://profiles.wordpress.org/karmatosed/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>karmatosed</a>, <a href=\"https://profiles.wordpress.org/boemedia/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>boemedia</a>, <a href=\"https://profiles.wordpress.org/joshuawold/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>joshuawold</a>, <a href=\"https://profiles.wordpress.org/mizejewski/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>mizejewski</a></li>\n<li><strong>Priority</strong>: Preparing for WordPress 5.0 and continuing to work on better onboarding practices.</li>\n<li><strong>Struggle</strong>: Identifying tasks for contributor days, especially for small- to medium-sized tasks that can be fit into a single day.</li>\n<li><strong>Big Win</strong>: Regular contributions are starting to build up.</li>\n</ul>\n<p></p>\n<h2><a href=\"https://make.wordpress.org/docs/\">Documentation</a></h2>\n<p></p>\n<ul>\n<li><strong>Contacted</strong>: <a href=\"https://profiles.wordpress.org/kenshino/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>kenshino</a></li>\n<li><strong>Priority</strong>: Getting HelpHub out before WordPress 5.0&#8217;s launch to make sure Gutenberg User Docs have a permanent position to reside</li>\n<li><strong>Struggle</strong>: Getting the documentation from HelpHub into WordPress.org/support is more manual than initially anticipated.</li>\n<li><strong>Big Win</strong>: Had a good discussion with the Gutenberg team about their docs and how WordPress.org expects documentation to be distributed (via DevHub, Make and HelpHub). Getting past the code blocks to release HelpHub (soon)</li>\n</ul>\n<p></p>\n<h2><a href=\"https://make.wordpress.org/hosting/\">Hosting</a></h2>\n<p></p>\n<ul>\n<li><strong>Contacted</strong>: <a href=\"https://profiles.wordpress.org/mikeschroder/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>mikeschroder</a>, <a href=\"https://profiles.wordpress.org/jadonn/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>jadonn</a></li>\n<li><strong>Priority</strong>: Helping Gutenberg land well at hosts for users in 5.0.</li>\n<li><strong>Struggle</strong>: Short time frame with few resources to accomplish priority items.</li>\n<li><strong>Big Win</strong>: Preparing Try Gutenberg support guide for hosts during the rollout and good reception from users following it.</li>\n</ul>\n<p></p>\n<h2><a href=\"https://make.wordpress.org/marketing/\">Marketing</a></h2>\n<p></p>\n<ul>\n<li><strong>Contacted</strong>: <a href=\"https://profiles.wordpress.org/bridgetwillard/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>bridgetwillard</a></li>\n<li><strong>Priority</strong>: Continuing to write and publish case studies from the community.</li>\n<li><strong>Big Win</strong>: Onboarding guide is going well and is currently being <a href=\"https://translate.wordpress.org/projects/meta/get-involved\">translated</a>.</li>\n</ul>\n<p></p>\n<h2><a href=\"https://make.wordpress.org/meta/\">Meta</a> (WordPress.org Site)</h2>\n<p></p>\n<ul>\n<li><strong>Contacted</strong>: <a href=\"https://profiles.wordpress.org/tellyworth/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>tellyworth</a>, <a href=\"https://profiles.wordpress.org/coffee2code/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>coffee2code</a></li>\n<li><strong>Priority</strong>: Support for other teams in the lead up to, and the follow-up of, the release of WP 5.0. ETA is the WP 5.0 release date (Nov 19) and thereafter, unless it gets bumped to next quarter.</li>\n<li><strong>Struggle</strong>: Maintaining momentum on tickets (still).</li>\n<li><strong>Big Win</strong>: Launch of front-end demo of Gutenberg on https://wordpress.org/gutenberg/</li>\n</ul>\n<p></p>\n<h2><a href=\"https://make.wordpress.org/mobile/\">Mobile</a></h2>\n<p></p>\n<ul>\n<li><strong>Contacted</strong>: <a href=\"https://profiles.wordpress.org/elibud/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>elibud</a></li>\n<li><strong>Priority</strong>: Have an alpha version of Gutenberg in the WordPress apps, ETA end of year 2018.</li>\n<li><strong>Struggle</strong>: Unfamiliar tech stack and the goal of reusing as much of Gutenberg-web&#8217;s code as possible.</li>\n<li><strong>Big Win</strong>: Running mobile tests on web&#8217;s PRs.</li>\n</ul>\n<p></p>\n<h2><a href=\"https://make.wordpress.org/plugins/\">Plugins</a></h2>\n<p></p>\n<ul>\n<li><strong>Contacted</strong>: <a href=\"https://profiles.wordpress.org/ipstenu/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>ipstenu</a></li>\n<li><strong>Priority</strong>: Cleaning up &#8216;inactive&#8217; users, which was supposed to be complete but some work preparing for 5.0 was necessary.</li>\n<li><strong>Struggles</strong>: Devnotes are lacking for the upcoming release which slows progress.</li>\n<li><strong>Big Win</strong>: No backlog even though a lot were out!</li>\n</ul>\n<p></p>\n<h2><a href=\"https://make.wordpress.org/polyglots/\">Polyglots</a></h2>\n<p></p>\n<ul>\n<li><strong>Contacted</strong>: <a href=\"https://profiles.wordpress.org/petya/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>petya</a>, <a href=\"https://profiles.wordpress.org/ocean90/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>ocean90</a>, <a href=\"https://profiles.wordpress.org/nao/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>nao</a>, <a href=\"https://profiles.wordpress.org/chantalc/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>chantalc</a>, <a href=\"https://profiles.wordpress.org/deconf/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>deconf</a>, <a href=\"https://profiles.wordpress.org/casiepa/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>casiepa</a></li>\n<li><strong>Priority</strong>: Help re-activating inactive locale teams.</li>\n<li><strong>Struggle</strong>: Many GTEs are having a hard time keeping up with incoming translation <a href=\"https://make.wordpress.org/polyglots/?resolved=unresolved&tags=editor-requests\">validation and PTE requests</a>.</li>\n<li><strong>Big Win</strong>: Made some progress in locale research and reassigning new GTEs.</li>\n</ul>\n<p></p>\n<h2><a href=\"https://make.wordpress.org/support/\">Support</a></h2>\n<p></p>\n<ul>\n<li><strong>Contacted</strong>: <a href=\"https://profiles.wordpress.org/clorith/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>clorith</a></li>\n<li><strong>Priority:</strong> Preparing for the upcoming 5.0 release</li>\n<li><strong>Struggle</strong>: Finding a good balance between how much we want to help people and how much we are able to help people. Also, contributor recruitment (always a crowd favorite!)</li>\n<li><strong>Big Win</strong>: How well the team, on a global level, has managed to maintain a good flow of user engagement through support.</li>\n</ul>\n<p></p>\n<h2><a href=\"https://make.wordpress.org/themes/\">Theme Review</a></h2>\n<p></p>\n<ul>\n<li><strong>Contacted</strong>: <a href=\"https://profiles.wordpress.org/acosmin/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>acosmin</a>, <a href=\"https://profiles.wordpress.org/rabmalin/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>rabmalin</a>, <a href=\"https://profiles.wordpress.org/thinkupthemes/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>thinkupthemes</a>, <a href=\"https://profiles.wordpress.org/williampatton/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>williampatton</a></li>\n<li><strong>Priority</strong>: Implementing the Theme Sniffer plugin on WordPress.org which is one step forward towards automation. ETA early 2019</li>\n<li><strong>Struggle</strong>: Not having so many contributors/reviewers.</li>\n<li><strong>Big Win</strong>: Implementing <a href=\"https://make.wordpress.org/themes/2018/10/25/new-requirements/\">multiple requirements</a> into our review flow, like screenshots and readme.txt requirements.</li>\n</ul>\n<p></p>\n<p></p>\n<h2><a href=\"https://make.wordpress.org/training/\">Training</a></h2>\n<p></p>\n<ul>\n<li><strong>Contacted</strong>: <a href=\"https://profiles.wordpress.org/bethsoderberg/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>bethsoderberg</a>, <a href=\"https://profiles.wordpress.org/juliek/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>juliek</a></li>\n<li><strong>Priority:</strong> Getting the learn.wordpress.org site designed, developed, and being able to publish lesson plans to it.</li>\n<li><strong>Struggle:</strong> Getting contributors onboard and continually contributing. Part of that is related to the learn.wordpress.org site. People like to see their contributions.</li>\n<li><strong>Big Win</strong>: We have our new workflow and tools in place. We are also streamlining that process to help things go from idea to publication more quickly.</li>\n</ul>\n<p></p>\n<p><em>Interested in updates from the last quarter? You can find those here: <a href=\"https://wordpress.org/news/2018/07/quarterly-updates-q2-2018/\">https://wordpress.org/news/2018/07/quarterly-updates-q2-2018/</a></em></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 01 Nov 2018 16:46:16 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:7:\"Josepha\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:17;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:46:\"Dev Blog: The Month in WordPress: October 2018\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"https://wordpress.org/news/?p=6230\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:71:\"https://wordpress.org/news/2018/11/the-month-in-wordpress-october-2018/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:8092:\"<p>Teams across the WordPress project are working hard to make sure everything is ready for the upcoming release of WordPress 5.0. Find out what’s going on and how you can get involved.</p>\n\n<hr class=\"wp-block-separator\" />\n\n<h2>The Plan for WordPress 5.0</h2>\n\n<p>Early this month, <a href=\"https://make.wordpress.org/core/2018/10/03/proposed-wordpress-5-0-scope-and-schedule/\">the planned release schedule was announced</a> for WordPress 5.0, which was <a href=\"https://make.wordpress.org/core/2018/10/31/wordpress-5-0-schedule-updates/\">updated</a> a few weeks later. WordPress 5.0 is a highly anticipated release, as it’s the official &nbsp;launch of Gutenberg &#8212; the new block editor for WordPress Core. For more detail, check out this <a href=\"https://make.wordpress.org/core/2018/10/12/granular-timeline/\">&nbsp;granular timeline</a>.<br /></p>\n\n<p>Along with the planned release schedule, <a href=\"https://profiles.wordpress.org/matt/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>matt</a>, who is heading up this release, <a href=\"https://make.wordpress.org/core/2018/10/03/a-plan-for-5-0/\">announced leads for critical focuses on the project</a>, including <a href=\"https://profiles.wordpress.org/matveb/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>matveb</a>, <a href=\"https://profiles.wordpress.org/karmatosed/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>karmatosed</a>, <a href=\"https://profiles.wordpress.org/laurelfulford/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>laurelfulford</a>, <a href=\"https://profiles.wordpress.org/allancole/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>allancole</a>, <a href=\"https://profiles.wordpress.org/lonelyvegan/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>lonelyvegan</a>, <a href=\"https://profiles.wordpress.org/omarreiss/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>omarreiss</a>, <a href=\"https://profiles.wordpress.org/antpb/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>antpb</a>, <a href=\"https://profiles.wordpress.org/pento/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>pento</a>, <a href=\"https://profiles.wordpress.org/chanthaboune/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>chanthaboune</a>, <a href=\"https://profiles.wordpress.org/danielbachhuber/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>danielbachhuber</a>, and <a href=\"https://profiles.wordpress.org/mcsf/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>mcsf</a>.<br /></p>\n\n<p><a href=\"https://wordpress.org/news/2018/10/wordpress-5-0-beta-2/\">WordPress 5.0 is currently in its second beta phase</a> and will soon move to the release candidate status. Help test this release right now by installing the <a href=\"https://wordpress.org/plugins/wordpress-beta-tester/\">WordPress Beta Tester plugin</a> on your site.<br /></p>\n\n<p>Want to get involved in building WordPress Core? Follow <a href=\"https://make.wordpress.org/core/\">the Core team blog</a> and join the #core channel in <a href=\"https://make.wordpress.org/chat/\">the Making WordPress Slack group</a>. You can also help out by <a href=\"https://make.wordpress.org/test/\">testing</a> or <a href=\"https://make.wordpress.org/polyglots/2018/10/24/wordpress-5-0-gutenberg-and-twenty-nineteen/\">translating</a> the release into a local language.</p>\n\n<h2>New Editor for WordPress Core</h2>\n\n<p>Active development continues on <a href=\"https://wordpress.org/gutenberg\">Gutenberg</a>, the new editing experience for WordPress Core. <a href=\"https://make.wordpress.org/core/2018/10/31/whats-new-in-gutenberg-31st-october-2/\">The latest release</a> is feature complete, meaning that all further development on it will be to improve existing features and fix outstanding bugs.<br /></p>\n\n<p>Some have raised concerns about Gutenberg’s accessibility, prompting the development team <a href=\"https://make.wordpress.org/core/2018/10/18/regarding-accessibility-in-gutenberg/\">to detail some areas</a> in which the new editor is accessible. To help improve things further, the team has made <a href=\"https://make.wordpress.org/core/2018/10/19/call-for-testers-community-gutenberg-accessibility-tests/\">a public call for accessibility testers</a> to assist.<br /></p>\n\n<p>Want to get involved in building Gutenberg? Follow <a href=\"https://make.wordpress.org/core/tag/gutenberg\">the Gutenberg tag</a> on the Core team blog and join the #core-editor channel in <a href=\"https://make.wordpress.org/chat/\">the Making WordPress Slack group</a>. Read <a href=\"https://make.wordpress.org/test/2018/10/19/gutenberg-needs-testing-areas/\">this guide</a> to find areas where you can have the most impact.</p>\n\n<h2>Migrating HelpHub to WordPress.org</h2>\n\n<p>HelpHub is an ongoing project to move all of WordPress’ user documentation from the <a href=\"https://codex.wordpress.org/\">Codex</a> to the <a href=\"https://wordpress.org/support/\">WordPress Support portal</a>.<br /></p>\n\n<p>HelpHub has been developed on <a href=\"https://wp-helphub.com/\">a separate staging server</a> and it’s now time to migrate the new documentation to its home on WordPress.org. The plan is to have everything moved over &nbsp;before WordPress 5.0 is released, so that all the new documentation will be available on the new platform from the start.<br /></p>\n\n<p>The HelpHub team has published <a href=\"https://make.wordpress.org/docs/2018/11/01/call-for-volunteers-helphub-migration/\">a call for volunteers</a> to help with the migration. If you would like to get involved, join the #docs channel in <a href=\"https://make.wordpress.org/chat/\">the Making WordPress Slack group</a>, and contact <a href=\"https://profiles.wordpress.org/atachibana/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>atachibana</a> to get started.</p>\n\n<h2>A New Default Theme for WordPress</h2>\n\n<p><a href=\"https://make.wordpress.org/core/2018/10/16/introducing-twenty-nineteen/\">A brand new default theme &#8212; Twenty Nineteen &#8212; has been announced</a>&nbsp;with development being led by <a href=\"https://profiles.wordpress.org/allancole/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>allancole</a>. The theme is packaged with WordPress 5.0, so it will be following the same release schedule as Core.<br /></p>\n\n<p>The new theme is designed to integrate seamlessly with Gutenberg and showcase how you can build a theme alongside the new block editor and take advantage of the creative freedom that it offers.<br /></p>\n\n<p>Want to help build Twenty Nineteen? Join in on <a href=\"https://github.com/WordPress/twentynineteen\">the theme’s GitHub repo</a> and join the #core-themes channel in <a href=\"https://make.wordpress.org/chat/\">the Making WordPress Slack group</a>.<br /></p>\n\n<hr class=\"wp-block-separator\" />\n\n<h2>Further Reading:</h2>\n\n<ul><li>The Support team are putting together more formal <a href=\"https://github.com/Clorith/wporg-support-guidelines\">Support Guidelines</a> for the WordPress Support Forums.</li><li>The group focused on privacy tools in Core <a href=\"https://make.wordpress.org/core/2018/10/11/whats-new-in-core-privacy/\">has released some details</a> on the work they have been doing recently, with a roadmap for their plans over the next few months.</li><li>The Core team <a href=\"https://make.wordpress.org/core/2018/10/15/wordpress-and-php-7-3/\">released an update</a> about how WordPress will be compatible with PHP 7.3.</li><li>The Theme Review Team have published <a href=\"https://make.wordpress.org/themes/2018/10/25/new-requirements/\">some new requirements</a> regarding child themes, readme files and trusted authors in the Theme Directory.</li><li>The WordCamp Europe team <a href=\"https://make.wordpress.org/community/2018/10/23/progressive-web-app-for-wordcamps/\">are working on a PWA service</a> for all WordCamp websites.</li></ul>\n\n<p><em>If you have a story we should consider including in the next “Month in WordPress” post, please </em><a href=\"https://make.wordpress.org/community/month-in-wordpress-submissions/\"><em>submit it here</em></a><em>.</em><br /></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 01 Nov 2018 08:40:03 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Hugh Lashbrooke\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:18;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:61:\"WPTavern: Gutenberg Cloud Plugin for WordPress is Now in Beta\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=85115\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:72:\"https://wptavern.com/gutenberg-cloud-plugin-for-wordpress-is-now-in-beta\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5938:\"<p><a href=\"https://www.frontkom.no/\" rel=\"noopener noreferrer\" target=\"_blank\">Frontkom</a>, the team behind the <a href=\"https://gutenbergcloud.org/\" rel=\"noopener noreferrer\" target=\"_blank\">Gutenberg Cloud</a> project, has published the beta version of its WordPress plugin to the official repository. <a href=\"https://wordpress.org/plugins/cloud-blocks/\" rel=\"noopener noreferrer\" target=\"_blank\">Cloud Blocks</a> serves as a connector, allowing WordPress users to browse and install open source blocks from Gutenberg Cloud. The blocks are hosted on NPM and their assets are served from CloudFlare using <a href=\"https://unpkg.com\" rel=\"noopener noreferrer\" target=\"_blank\">unpkg.com</a>.</p>\n<p><a href=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2018/10/gutenberg-cloud-wp-plugin.gif?ssl=1\"><img /></a></p>\n<p>Gutenberg Cloud&#8217;s online library of blocks is CMS agnostic, offering blocks for both Drupal and WordPress sites, and more CMSs in the future. The service advertises three key benefits for developers who host blocks on Gutenberg Cloud:</p>\n<ul>\n<li>Wider adoption: Your blocks can be used outside of WP</li>\n<li>Discoverability: Your blocks will pop up in the Cloud Blocks UI</li>\n<li>Faster development: No plugin/SVN needed, just publish to NPM</li>\n</ul>\n<p>Frontkom is actively recruiting WordPress developers to add blocks to the cloud to test the process. Documentation for <a href=\"https://github.com/front/cloud-blocks/blob/master/docs/migrate-block.md\" rel=\"noopener noreferrer\" target=\"_blank\">migrating blocks from a plugin</a> is available on GitHub. Frontkom has also produced a new <a href=\"https://github.com/front/create-cloud-block\" rel=\"noopener noreferrer\" target=\"_blank\">boilerplate generator for building Gutenberg Cloud blocks</a>.</p>\n<p>Users should note that the team is still ironing out the experience for developers adding blocks to the cloud, so the plugin isn&#8217;t yet ready for general use. It&#8217;s currently under active development. </p>\n<h3>WordPress Developers Say Gutenberg Cloud May Not be the Best Way to Release Blocks but Platform has Potential</h3>\n<p>I contacted some WordPress developers who have tested sending their blocks to Gutenberg Cloud to get their initial reactions to the platform. </p>\n<p>&#8220;The idea that folks will be able to install blocks a la carte is interesting,&#8221; <a href=\"https://coblocks.com/\" rel=\"noopener noreferrer\" target=\"_blank\">CoBlocks</a> author and ThemeBeans founder Rich Tabor said. &#8220;It’s pretty much as easy as installing plugins.&#8221;</p>\n<p>Tabor experimented with migrating his Block Gallery blocks and said the process was not difficult but he foresees difficulties in maintaining blocks across parent plugins and Gutenberg Cloud.</p>\n<p>&#8220;As a developer, I’m still not entirely convinced Gutenberg Cloud is the best way to release blocks, aside from relatively simple blocks,&#8221; Tabor said. &#8220;I personally lean towards building suites of blocks that share a relative purpose, instead of one plugin (or one Cloud Block instance) per block. For one, it cuts down on maintenance quite a bit, as custom components can be shared between blocks. And there’s much better discoverability on getting relative blocks in the hands of users — if they’re grouped together.&#8221;</p>\n<p>Block collections have been criticized for making it difficult to search for and discover individual blocks, but Tabor makes some good arguments for improving block discoverability by grouping together features users often need. That is the whole point of successful plugins like Jetpack, but this type of packaging also lends itself to criticism about bloat.</p>\n<p>&#8220;It’s a similar conundrum when we look at grouped/not grouped shortcode plugins,&#8221; Tabor said. &#8220;I suppose the main difference is that the nature of blocks is much more complicated than that of shortcodes. History seems to repeat itself.&#8221;</p>\n<p>Tabor said he is considering distributing a few of his free blocks through Gutenberg Cloud but he hasn&#8217;t fully decided yet.</p>\n<p>WordPress core contributor, <a href=\"https://joshpress.net/\" rel=\"noopener noreferrer\" target=\"_blank\">Josh Pollock</a>, who has worked extensively with React and Gutenberg, also tested the Gutenberg Cloud platform. He said he thinks it has a lot of potential for developers who write blocks that are mainly JavaScript already.</p>\n<p>&#8220;I could see how an agency that builds WordPress sites could save a lot of time and hassle building out a block library,&#8221; Pollock said. &#8220;As a plugin developer with a lot of little ideas, the pain and time of setting up a block and block environment, which no one has gotten right yet, makes me very excited about this.&#8221;</p>\n<p>Pollock also reported a positive experience with the <a href=\"https://github.com/front/create-cloud-block\" rel=\"noopener noreferrer\" target=\"_blank\">create-cloud-block</a> generator.</p>\n<p>&#8220;The code that create-cloud-block generates is well-written, but not too opinionated,&#8221; Pollock said. &#8220;The developer experience is both really cool &#8212; you preview your block in a functional Gutenberg-powered editor with no WordPress site attached &#8212; and a little frustrating as there is no live reload yet. I know they are just getting started and the tool doesn&#8217;t lock you into any structure, which is great. I&#8217;ll be keeping my eye on this project.&#8221;</p>\n<p>Frontkom CTO Per André Rønsen said his team will continue testing the cloud internally until they get more developer feedback on the corresponding WordPress plugin. For Drupal users, Gutenberg Cloud will be shipped as a submodule of Gutenberg, which means all sites that install Gutenberg will also get the Cloud module. It can, however, be disabled. Rønsen said his team plans to showcase Gutenberg Cloud for D8 at DrupalCamp Oslo in November.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 31 Oct 2018 23:12:09 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:19;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:38:\"Matt: What’s in My Bag, 2018 Edition\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"https://ma.tt/?p=48557\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"https://ma.tt/2018/10/whats-in-my-bag-2018-edition/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:12451:\"<a href=\"https://i2.wp.com/ma.tt/files/2018/10/bag-v4.jpg?ssl=1\" target=\"_blank\" rel=\"noreferrer noopener\"><img /></a>\n\n\n\n<ol><li><a href=\"https://sdrtraveller.com/collections/accessories/products/travel-folio\">SDR Kashmir Travel Folio</a>, made with this super-cool material called Dyneema, which is twice as strong as Kevlar and 15 times as strong as steel, but virtually weightless.</li><li><a href=\"https://www.amazon.com/dp/B06XGD6CS4/?tag=photomatt08-20\">Garmin Forerunner 935</a> which is a triathlon watch, so it can tell me how much I don’t run, how much I don’t bike, and how much I don’t swim. Crazy sensors on it, and it’s lighter than an Apple Watch, which I tried again to use this year but wasn’t able to handle another device in my life that I had to charge daily. It has a weird charger, pictured next to it, but only needs charging once every few weeks so I don’t mind at all.</li><li>This is the latest 15” grey touchbar MacBook Pro, customized by <a href=\"https://www.uncovermac.com/\">Uncover</a> to have the <a href=\"https://jetpack.com/\">Jetpack</a> logo on it. I like the keyboard quietness and performance improvements of latest generation.</li><li><a href=\"https://www.aersf.com/fit-pack-2-black\">Fit Pack 2 from Aer</a> is the same I wrote a whole blog post about last year, and I still love and adore it every day. They have a few bigger and smaller packs, but the quality is just fantastic and I love all the pockets. Mine is starting to tear a little bit by one of the shoulder straps, but I do keep ~18lbs in it regularly.</li><li>This is a <a href=\"https://www.amazon.com/dp/B0035N09CS/?tag=photomatt08-20\">grey wool buff</a>, which works as a scarf, a hat, or an eye cover if I’m trying to sleep. I tried this out because of one of <a href=\"http://tynan.com/gear2017\">Tynan’s also-great gear posts</a>.</li><li>Passport, because you never know when you’ll need to leave the country.</li><li><a href=\"https://www.amazon.com/gp/product/B06VTJWRJW/?tag=photomatt08-20\">Kindle Oasis</a> with this <a href=\"https://www.amazon.com/gp/product/B07B7H4L8F/?tag=photomatt08-20\">random case on it</a>. I dig that this one is apparently waterproof — which I’ve never tested — but doesn’t feel like we’ve found the perfect size and weight balance yet. Reading is my favorite activity right now so this is my most-loved item.</li><li><a href=\"https://www.amazon.com/gp/product/B01EN9QK6G/?tag=photomatt08-20\">Imazing 10k charger</a>. Great capacity, charges via USB-C. (2nd year)</li><li>I’ve started carrying around some stationery so I can write notes to people when I’m on the road. Now I just need better handwriting&#8230;</li><li><a href=\"http://www.delfonics.com\">Delfonics</a> is a funky-cool Japanese stationery, and <a href=\"https://www.amazon.com/dp/B003N1XRYY/?tag=photomatt08-20\">this 3”x4” Rollbahn notebook is tops</a>, and actually fits in my pocket. The Amazon one linked might be larger, I found it at <a href=\"http://paper-ya.com/\">Paper-Ya on Granville Island</a>.</li><li>A small leather bracelet I got in Seoul, Korea.</li><li>Two things here: a <a href=\"https://www.amazon.com/gp/product/B00CM589B8/?tag=photomatt08-20\">rolled-up chamois cloth</a> for cleaning glasses, inspired by <a href=\"https://ma.tt/2018/01/r-i-p-dean/\">my late friend Dean</a>, and <a href=\"https://twitter.com/helenhousandi/status/746057671531429889\">a WordPress ring I wear sometimes</a>.</li><li>Three pens here: A <a href=\"https://matt.blog/2018/09/30/new-automattic-pen/\">cool customized one we did for Automatticians</a>; a <a href=\"https://www.amazon.com/dp/B00J2S5JNY/?tag=photomatt08-20\">Lamy Accent 4pen</a> which has red, blue, black, and a mechanical pencil built in; a Sharpie for signing stuff.</li><li>Have gone away from the carbon fiber clip and now using this <a href=\"https://www.paulsmith.com/us/mens/accessories/wallets?style=205\">small Paul Smith card wallet</a>.</li><li><a href=\"https://www.amazon.com/dp/B016QO5YNG/?tag=photomatt08-20\">Apple Magic Mouse 2</a>. When this one breaks I’ll switch it out for a black one.</li><li>Charger for the MacBook Pro.</li><li>A super small international adapter, which is also nice for converting the 3-prong in the next item into a 2-prong. It’s Lenmar but I’m not going to link Amazon because they’re charging too much, just picked up in an airport store.</li><li><strong>Probably my favorite new item of the year:</strong> I have given Native Union a hard time in the past but super love <a href=\"https://www.amazon.com/gp/product/B075LPVWBS/?tag=photomatt08-20\">this combo extension cord and USB charger</a>. It is an 8-foot extension cord, which is remarkably handy, has two AC outlets, 3 USB ports, and one USB-C. Total life-saver.</li><li>A <a href=\"https://sdrtraveller.com/collections/accessories/products/accessory-pouch\">dyneema accessory pouch</a>, <a href=\"https://retaw.tokyo/en/\">retaW aoyama / tokyo fragrance lipcream</a>, <a href=\"https://www.amazon.com/gp/product/B005LVYSKQ/?tag=photomatt08-20\">Aveda Peppymint breath refresher</a>, <a href=\"https://www.amazon.com/dp/B000IB0H8G/?tag=photomatt08-20\">Aesop Ginger Flight Therapy</a> roller, a spray hand cleanser, and <a href=\"https://www.amazon.com/dp/B003J35X9I/?tag=photomatt08-20\">Mintia COLDSMASH</a>.</li><li><a href=\"https://www.districtvision.com/about\">District Vision</a> makes these <a href=\"https://www.sportique.com/products/district-vision-nagata-gray-sunglasses-district-black-rose\">these running sunglasses</a> in Japan, which I found at the <a href=\"https://snowpeak.com/\">Snow Peak</a> store in NYC.</li><li>These sunglasses are a collaboration between <a href=\"https://saltoptics.com/\">Salt</a> and <a href=\"https://www.aetherapparel.com/\">Aether</a>.</li><li>A single-use packet of Sriracha. Hot sauce in your bag? Swag.</li><li>A <a href=\"https://www.amazon.com/dp/B00JDUCSD0/?tag=photomatt08-20\">palo santo smudge stick</a>, smells great when you burn it. I’m turning into a hippie.</li><li>Hermes business card holder.</li><li>iPhone XS with a Jetpack <a href=\"https://www.popsockets.com/\">Popsocket</a>.</li><li>Pixel 2, now replaced by a Pixel 3 XL.</li><li>This is a bag with some small opals I gave as a Burning Man gift.</li><li>iPad Pro 10.5 and <a href=\"https://www.amazon.com/dp/B071WLK8GY/?tag=photomatt08-20\">Apple sleeve with Pencil holder</a>, which is still one of my favorite gadgets of the year. Everything about this device just works and is a pleasure to use, and I&#8217;ve already ordered the new 11&#8243; Pro and related accessories.</li><li><a href=\"https://www.amazon.com/gp/product/B013VL4W58/?tag=photomatt08-20\">Half meter (the perfect size) lightning cable</a>.</li><li>Apple USB-C dongle.</li><li><a href=\"https://www.amazon.com/gp/product/B01M8PYE5X/?tag=photomatt08-20\">Cool multi-function USB cable with lightning, two micro-USBs, and USB-C</a>. I give these away all the time now and it’s nice to pair with the battery in #8 because I know I can charge anybody with this thing.</li><li>Short USB-C.</li><li>Combo micro-USB and Lightning.</li><li>Short lightning cable, just like 29.</li><li><a href=\"https://www.amazon.com/gp/product/B001E1Y5O6/?tag=photomatt08-20\">Velcro cable ties</a>, great for tidying pretty much anything. I just take a few out of the big pack and roll them up to travel with.</li><li><a href=\"https://www.amazon.com/gp/product/B06XTXLNCW/?tag=photomatt08-20\">Retractable USB-C</a>, don’t love these as they break but it’s the best of what’s out there.</li><li>USB-C to Lightning, great for super-fast charging.</li><li>My favorite USB-C hub so far, the <a href=\"https://www.amazon.com/gp/product/B07B87BN1M/?tag=photomatt08-20\">Satechi Aluminum Type-C Multimedia Adapter with 4K HDMI, Mini DP, USB-C PD, Gigabit Ethernet, USB 3.0, Micro/SD Card Slots</a>. Pretty much everything you could possibly need.</li><li>A pretty handy <a href=\"https://www.amazon.com/dp/B00OWBHE9I/?tag=photomatt08-20\">Ventev dashport car port charger that’s small and light</a>. (2nd year)</li><li>A few spare SIM cards, some SD cards, thingy to poke SIM card holder, and <a href=\"https://www.amazon.com/gp/product/B010HWCFDA/?tag=photomatt08-20\">combo USB-C / USB-A 64gb stick</a>.</li><li>Lockpick set. (4th year)</li><li><a href=\"https://www.bragi.com/thedashpro/customize/\">Bragi Pro custom earphones</a>. For many years I had custom in-ear monitors, but the convenience of wireless overcame that, even before they started taking headphone jacks out of phones. Bragi now allows you to send in ear molds from an audiologist and they’ll make these custom true wireless headphones that fit and sound great, but I have trouble recommending because the case is so heavy and once got so jammed I almost thought I’d have to throw the whole thing away, and the app has never been able to “connect” for me because it gets stuck on turning on some fitness sensors. If it could connect I think I could turn off the other feature that is annoying, which is the touch controls that I find get triggered by my hat or when my head is against a chair. So, a qualified “maybe try this.”</li><li><a href=\"http://www.amazon.com/gp/product/B00D4LBOV6/?tag=photomatt08-20\">Sennheiser Culture Series Wideband Headset</a>, which I use for podcasts, Skype, Facetime, Zoom, and Google Hangout calls with external folks and teams inside of Automattic. Light, comfortable, great sound quality, and great at blocking out background noise so you don’t annoy other people on the call. I’d love to replace this with something wireless but haven’t found one with as high fidelity audio.</li><li><a href=\"https://www.amazon.com/gp/product/B07712LKJM/?tag=photomatt08-20\">GL.iNet GL-AR750 Travel AC Router</a> which I use to create wifi networks different places I go, which is often faster than hotel/etc wifi, and I can also VPN encrypt all my traffic through it. Pretty handy! But not user-friendly. Often keep it in my suitcase and not my backpack. I have a retractable Ethernet and micro-USB attached to it.</li><li>Matte black Airpods. I love Airpods and these look super cool, I think these were from BlackPods which looks shut down now but <a href=\"https://www.colorware.com/p-743-apple-airpods.aspx\">Colorware has some alternatives</a>. (2nd year)</li><li><a href=\"http://www.westoneaudio.com/index.php/products/hearing-protection/es49-custom-hearing-protection.html\">Westone ES49 custom earplugs</a>, for if I go to concerts or anyplace overly loud. (4th year)</li><li>An ultralight running jacket I think I got at Lululemon Lab in Vancouver. They don’t have anything like it available online right now but it folds up ultra-tiny, weighs nothing, and is a nice layer for on an airplane. My only complaint (as with all Lululemon products) is the low quality of the zipper. (2nd year)<br /></li></ol>\n\n\n\n<p>That’s it for this year. As a bonus I’ll link some of my favorite other-bag items including toiletries: <a href=\"http://www.muji.us/store/4549738743743.html\">Muji dopp kit bag</a>, <a href=\"https://www.amazon.com/gp/product/B00JRK8VAU/?tag=photomatt08-20\">these amazing travel bottles for creams</a>, <a href=\"https://www.amazon.com/gp/product/B0091JL3IO/?tag=photomatt08-20\">travel atomizer</a>, <a href=\"http://www.elysiumhealth.com/\">Elysium Basis</a>, <a href=\"http://www.amazon.com/dp/B00GHDK32Y/?tag=photomatt08-20\">Muji q-tips</a>, <a href=\"https://www.aesop.com/us/p/skin/hydrate/in-two-minds-facial-hydrator/\">Aesop Two Minds Facial Hydrator</a>, <a href=\"https://www.amazon.com/gp/product/B00375P3IE/?tag=photomatt08-20\">Sunleya Sun Care SPF 15</a>, <a href=\"https://www.amazon.com/dp/B00G63D2XC/?tag=photomatt08-20\">folding brush / comb</a>, <a href=\"http://www.amazon.com/gp/product/B00CUG273A/?tag=photomatt08-20\">Philips Sonicare Brush</a>, <a href=\"https://www.aesop.com/us/p/body/personal-care/toothpaste/\">Aesop toothpaste</a>, <a href=\"https://www.amazon.com/dp/B008QMWKES/?tag=photomatt08-20\">Tom&#8217;s SLS-free toothpaste</a>, <a href=\"https://www.amazon.com/dp/B019J13OCQ/?tag=photomatt08-20\">Orabrush cleaner</a>.</p>\n\n\n\n<p>If you&#8217;re curious, here are the previous years: <a href=\"https://ma.tt/2015/01/whats-in-my-bag-2014/\">2014</a>, <a href=\"https://ma.tt/2016/03/whats-in-my-bag-2016-edition/\">2016</a>, <a href=\"https://ma.tt/2017/05/whats-in-my-bag-2017/\">2017</a>.</p>\n\n\n\n<p>If you have any questions please leave them in the comments!<br /></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 31 Oct 2018 03:44:13 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:20;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:94:\"WPTavern: WordPress.com and Jetpack Launch New Activity Feature for Monitoring Website Changes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=85171\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:105:\"https://wptavern.com/wordpress-com-and-jetpack-launch-new-activity-feature-for-monitoring-website-changes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3652:\"<p><a href=\"https://en.blog.wordpress.com/2018/10/30/introducing-activity/\" rel=\"noopener noreferrer\" target=\"_blank\">WordPress.com launched a new Activity feature</a> today, a tool for monitoring changes that occur on the site and actions initiated through the admin. It&#8217;s also available for Jetpack-enabled sites and the activity log can be viewed on WordPress.com or on the WordPress mobile apps. </p>\n<p><a href=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2018/10/activity-feature.png?ssl=1\"><img /></a></p>\n<p>Activity logs the following actions and presents them in an easy-to-read timeline on WordPress.com:</p>\n<ul>\n<li>Published or updated posts and pages</li>\n<li>Comment submission and management activity</li>\n<li>Settings and options modifications</li>\n<li>Login attempts by registered site users</li>\n<li>Plugin installations, updates, and removals</li>\n<li>Theme switches, installations, updates, and deletions</li>\n</ul>\n<p>The Activity log can be useful for debugging client sites where the client cannot remember the actions they performed that changed their website. Users can also update plugins and themes directly from the activity log. </p>\n<p><a href=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2018/10/Screen-Shot-2018-10-30-at-8.02.41-PM.png?ssl=1\"><img /></a></p>\n<p>WordPress.com&#8217;s new Activity feature is reminiscent of XWP&#8217;s <a href=\"https://wordpress.org/plugins/stream/\" rel=\"noopener noreferrer\" target=\"_blank\">Stream</a> plugin, which launched in 2013 with similar admin logging features stored locally. It offers support for multisite as well as several popular plugins, such as ACF, bbPress, BuddyPress, EDD, Gravity Forms, WooCommerce, Yoast SEO, and Jetpack. Stream hasn&#8217;t gained much traction in recent years with just 30,000 active installations. </p>\n<p>In 2014, Stream&#8217;s creators explored offering <a href=\"https://wptavern.com/stream-morphs-from-a-plugin-into-a-service\" rel=\"noopener noreferrer\" target=\"_blank\">Stream as a service</a> where the logs were stored in AWS and included configurable SMS notifications. The service was <a href=\"https://wptavern.com/stream-is-shutting-down-its-cloud-data-storage-october-1st\" rel=\"noopener noreferrer\" target=\"_blank\">shut down in 2015</a> in favor of storing the activity logs locally due to the expense of cloud storage. Shortly after that it was acquired by XWP.</p>\n<p>Automattic is also exploring offering its new Activity feature as a paid service. Currently sites on the Free plan only have access to the last 20 most recent events. Access is tiered based on the plan. Personal and Premium users have access to activities from the last 30 days and Professional users can see all activities for the past year. The ability to filter activities by type is also restricted to paid users only.</p>\n<p>Jetpack site owners should note that Activity is activated by default &#8211; it&#8217;s not a module that can be turned on or off. The feature doesn&#8217;t send any new data to WordPress.com but rather offers a new interface for data that is already synced.</p>\n<p>The full list of activities the feature collects, as well as privacy information related to data retention, is available for <a href=\"https://en.support.wordpress.com/activity/\" rel=\"noopener noreferrer\" target=\"_blank\">WordPress.com</a> and <a href=\"https://jetpack.com/support/activity-log/\" rel=\"noopener noreferrer\" target=\"_blank\">Jetpack sites</a> in the documentation for the feature. Users can report bugs to the <a href=\"https://github.com/Automattic/wp-calypso\" rel=\"noopener noreferrer\" target=\"_blank\">Calypso GitHub repository</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 31 Oct 2018 03:04:32 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:21;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:111:\"WPTavern: WordPress Accessibility Team Delivers Sobering Assessment of Gutenberg: “We have to draw a line.”\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=85082\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:114:\"https://wptavern.com/wordpress-accessibility-team-delivers-sobering-assessment-of-gutenberg-we-have-to-draw-a-line\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:9807:\"<a href=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2018/10/accessibility-team-assessment-gutenberg.jpg?ssl=1\"><img /></a>photo credit: classroomcamera <a href=\"http://www.flickr.com/photos/155535822@N07/27792517478\">DSC03657</a> &#8211; <a href=\"https://creativecommons.org/licenses/by/2.0/\">(license)</a>\n<p>WordPress&#8217; accessibility team has published a <a href=\"https://make.wordpress.org/accessibility/2018/10/29/report-on-the-accessibility-status-of-gutenberg/\" rel=\"noopener noreferrer\" target=\"_blank\">statement on the level of overall accessibility of Gutenberg</a>. The team, largely a group of unpaid volunteers, collaborated on a detailed assessment that publicly challenges Gutenberg&#8217;s readiness for core in a way that no other WordPress team has done through official channels to date. After a week of testing the most recent version of the plugin, the team concluded that they cannot recommend Gutenberg to be used by anyone who relies on assistive technology.</p>\n<blockquote><p>The Accessibility team – like any team in WordPress – has no specific authority over the project. Because we’re a small team of volunteers, we’ve been pragmatic in how we apply the guidelines. We have made tradeoffs in prioritization. Gutenberg is a place where we feel it is necessary to draw a line. The ability to author, edit, and publish posts is the primary purpose of WordPress.</p></blockquote>\n<p>Accessibility team rep Joe Dolson, speaking on behalf of the team, cited cognitive load and complexity, inconsistent user interface behavior, heavy reliance on keyboard shortcuts, and difficulties with keyboard navigation through blocks, among other concerns about Gutenberg. He outlined an example of the keyboard sequence required to do something as simple as change the font size in a paragraph block. It currently requires 34 separate keyboard stops, and even more if the tester doesn&#8217;t have prior knowledge of how to navigate Gutenberg.</p>\n<p>&#8220;Because the complexity of interaction with Gutenberg is an order of magnitude greater than in the classic editor, we believe that Gutenberg is less accessible than the existing classic editor, though it offers many great features that are not available in the current editor,&#8221; Dolson said. </p>\n<p>This assessment echoes many of the common themes found in <a href=\"https://wordpress.org/support/plugin/gutenberg/reviews/\" rel=\"noopener noreferrer\" target=\"_blank\">Gutenberg&#8217;s reviews on WordPress.org</a>, even among the most recent reviews of the latest version. Ratings are currently hovering at 2.3 out of 5 stars. Users have repeatedly said the interface is &#8220;<a href=\"https://wordpress.org/support/topic/gutenberg-is-a-clear-winner/\" rel=\"noopener noreferrer\" target=\"_blank\">far too heavily reliant on hover based functionality</a>.&#8221; Even those without accessibility needs find it <a href=\"https://wordpress.org/support/topic/blocks-concept-seems-great-but-still-so-confusing/\" rel=\"noopener noreferrer\" target=\"_blank\">confusing</a>, <a href=\"https://wordpress.org/support/topic/rage-inducing/\" rel=\"noopener noreferrer\" target=\"_blank\">unintuitive</a>, and <a href=\"https://wordpress.org/support/topic/an-unusable-codewreck/\" rel=\"noopener noreferrer\" target=\"_blank\">difficult to navigate content</a>. Some testers find it <a href=\"https://wordpress.org/support/topic/fixing-what-isnt-broken-w-broken-tools/\" rel=\"noopener noreferrer\" target=\"_blank\">nearly impossible to do what they want to do with it</a>.</p>\n<p>The positive reviews recognize the software as <a href=\"https://wordpress.org/support/topic/much-needed-update-2/\" rel=\"noopener noreferrer\" target=\"_blank\">a work in progress</a> and testers seem more aware of the overall vision for the plugin. They are excited about some of the <a href=\"https://wordpress.org/support/topic/my-experience-with-gutenberg-the-good-and-not-so-good/\" rel=\"noopener noreferrer\" target=\"_blank\">more advanced features that blocks offer</a>, but many positive reviewers urge WordPress to give it more time before making it the default editor.</p>\n<p>The accessibility team is convinced that the main accessibility issues in Gutenberg stem from design issues. </p>\n<p>&#8220;Gutenberg is the way of the future in WordPress, but the direction it has taken so far has been worrying,&#8221; Dolson said. &#8220;We do not want to miss the opportunity to build a modern and inclusive application for WordPress, but in order to achieve that goal, accessibility needs to incorporated in all design processes in the project.</p>\n<p>&#8220;These problems are solvable. Retrofitting accessibility is not an effective process. It is costly in terms of time and resources.&#8221;</p>\n<p>In a recent post titled <a href=\"https://pento.net/2018/10/26/iterating-on-merge-proposals/\" rel=\"noopener noreferrer\" target=\"_blank\">Iterating on Merge Proposals</a>, Gary Pendergast, who is leading the merge of Gutenberg into core, acknowledged that they could have asked for the accessibility team&#8217;s help much earlier in the process. </p>\n<p>&#8220;The Accessibility team should’ve been consulted more closely, much earlier in the process, and that’s a mistake I expect to see rectified as the Gutenberg project moves into its next phase after WordPress 5.0,&#8221; Pendergast said. &#8220;While Gutenberg has always aimed to prioritize accessibility, both providing tools to make the block editor more accessible, as well as encouraging authors to publish accessible content, there are still areas where we can improve.&#8221;</p>\n<p>At this time there has been no official response to the accessibility team&#8217;s assessment. It does not look like it will meaningfully impact the release date, as <a href=\"https://wordpress.org/news/2018/10/wordpress-5-0-beta-2/\" rel=\"noopener noreferrer\" target=\"_blank\">Beta 2</a> went out last night and RC 1 is planned for release today. If the core dev chats are any indication, contributors involved in 5.0 seem to be on board with the ambitious timeline for its release. </p>\n<p>In a post titled &#8220;<a href=\"https://werdswords.com/accessibility-in-gutenberg-is-not-a-one-more-feature/\" rel=\"noopener noreferrer\" target=\"_blank\">Accessibility in Gutenberg is not a one-more feature</a>,&#8221; core developer Drew Jaynes urges the project&#8217;s leadership and contributors not to compromise core accessibility standards for the sake of an expedited timeline.</p>\n<p>&#8220;Please let&#8217;s not make the &#8216;new standard&#8217; be that we&#8217;re willing to ship technically accessible but perhaps not entirely usable-for-all features; let&#8217;s not define it as one that sacrifices standards core to the WordPress experience in the name of perceived expediency; let&#8217;s not define it as the new default authoring experience for all users when not all users can use it well,&#8221; Jaynes said.</p>\n<p>WordPress 5.0 release lead Matt Mullenweg has frequently said the release will ship when it&#8217;s ready. He contends that the interface has been continually modified for accessibility needs throughout the process of developing Gutenberg. </p>\n<blockquote class=\"twitter-tweet\">\n<p lang=\"en\" dir=\"ltr\">Modifying the interface to accomodate a11y is the compromise, it has been continuous throughout the process. I don\'t know how to achieve the imaginary bar you\'re setting up.</p>\n<p>&mdash; Matt Mullenweg (@photomatt) <a href=\"https://twitter.com/photomatt/status/1055889800119508992?ref_src=twsrc%5Etfw\">October 26, 2018</a></p></blockquote>\n<p></p>\n<p>Matthew MacPherson, Gutenberg&#8217;s accessibility lead, was not immediately available for comment on the team&#8217;s assessment. Ultimately, the decision to delay the release will fall to Mullenweg and his leadership team. The accessibility team, however, will not lend its endorsement of Gutenberg at this time:</p>\n<blockquote><p>The accessibility team will continue to work to support Gutenberg to the best of our ability. However, based on its current status, we cannot recommend that anybody who has a need for assistive technology allow it to be in use on any sites they need to use at this time.</p></blockquote>\n<p>Gutenberg is now 20 days away from landing in WordPress 5.0, but this does not leave enough time to solve the design and architectural issues the accessibility team has identified. They have <a href=\"https://core.trac.wordpress.org/ticket/44671\" rel=\"noopener noreferrer\" target=\"_blank\">proposed a notice</a> on the 5.0 release to inform administrators of Gutenberg&#8217;s inadequacy for users of assistive technology, with a prompt to install the Classic Editor plugin. Many people with accessibility needs depend on the WordPress editor in order to do their work and will need to stick with the old interface. The proposal has been closed with a note indicating that 5.0 will point users to the Classic Editor plugin if they need it.</p>\n<p>The mistake of not having consulted accessibility experts in the design phase cannot be easily rectified at this point, but the Classic Editor is still available for those who need to preserve their same workflow. The conflict lies in whether WordPress should ship a new editor that those with accessibility needs cannot immediately use. It is a somewhat painful and frustrating outcome for those users when the entire ecosystem is rapidly moving towards Gutenberg as the standard. </p>\n<p>Either the accessibility and usability issues the team identified are not as bad as they purport or this document is a last-minute clarion call that could prevent WordPress from shipping an editor that excludes users who rely on assistive technology. Due to the gravity of their claims, the accessibility team&#8217;s statement on Gutenberg demands an official response.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 30 Oct 2018 19:16:07 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:22;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"Dev Blog: WordPress 5.0 Beta 2\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"https://wordpress.org/news/?p=6222\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"https://wordpress.org/news/2018/10/wordpress-5-0-beta-2/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2200:\"<p>WordPress 5.0 Beta 2 is now available!</p>\n\n<p><strong>This software is still in development,</strong>&nbsp;so we don’t recommend you run it on a production site. Consider setting up a test site to play with the new version.</p>\n\n<p>There are two ways to test the WordPress 5.0 Beta: try the&nbsp;<a href=\"https://wordpress.org/plugins/wordpress-beta-tester/\">WordPress Beta Tester</a>&nbsp;plugin (you’ll want “bleeding edge nightlies”), or you can&nbsp;<a href=\"https://wordpress.org/wordpress-5.0-beta2.zip\">download the beta here</a>&nbsp;(zip).</p>\n\n<p>WordPress 5.0 is slated for release on&nbsp;<a href=\"https://make.wordpress.org/core/5-0/\">November 19</a>, and we need your help to get there. Here are some of the big issues that we fixed since Beta 1:</p>\n\n<h2>Block Editor</h2>\n\n<p>We&#8217;ve updated to the latest version of the block editor from the Gutenberg plugin, which includes the new <a href=\"https://github.com/WordPress/gutenberg/pull/10209\">Format API</a>, embedding improvements, and <a href=\"https://github.com/WordPress/gutenberg/milestone/71\">a variety of bug fixes</a>.</p>\n\n<p>Meta boxes had a few bugs, and they weren&#8217;t showing at all in the block editor, so we&#8217;ve fixed and polished there.</p>\n\n<h2>Internationalisation</h2>\n\n<p>We&#8217;ve added support for <a href=\"https://core.trac.wordpress.org/ticket/45103\">registering and loading JavaScript translation files</a>.</p>\n\n<h2>Twenty Nineteen</h2>\n\n<p>The <a href=\"https://github.com/WordPress/twentynineteen\">Twenty Nineteen repository</a> is a hive of activity, there have been a stack of minor bugs clean up, and some notable additions:</p>\n\n<ul><li>There&#8217;s now a widget area in the page footer.</li><li>Navigation submenus have been implemented for mobile devices.</li><li>Customiser options have been added for changing the theme colours and feature image filters.</li></ul>\n\n<h2>Everything Else</h2>\n\n<p>The REST API has a couple of bug fixes and performance improvements. PHP 7.3 compatibility has been improved.</p>\n\n<hr class=\"wp-block-separator\" />\n\n<p><em>We&#8217;re fixing the bugs:<br />All the ones you&#8217;ve reported.<br />Some that we&#8217;ve found, too.</em></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 30 Oct 2018 05:04:12 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Gary Pendergast\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:23;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:76:\"WPTavern: php[world] 2018 to Feature Full-Day Gutenberg Development Workshop\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=85120\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:85:\"https://wptavern.com/phpworld-2018-to-feature-full-day-gutenberg-development-workshop\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4715:\"<p>The fourth annual <a href=\"https://world.phparch.com/\" rel=\"noopener noreferrer\" target=\"_blank\">php[world]</a> conference is just two weeks away. The event is dedicated to uniting the PHP community and will be held November 14-15, 2018, in Washington, D.C. </p>\n<p>This year the organizing team created a &#8220;Content Advisory Board&#8221; to ensure the event included sessions that will appeal to everyone. The board includes two WordPress Developers, two Drupal developers, and two more more general PHP developers. They reviewed all incoming talk submissions and gave organizers ideas on what they thought would be of greatest interest to each community.</p>\n<p>php[world] has traditionally included several topics and speakers from the WordPress world. This year the program features a full-day training workshop on Gutenberg development led by Josh Pollock and Zac Gordon. The workshop is called <a href=\"https://world.phparch.com/sessions/modern-wordpress/\" rel=\"noopener noreferrer\" target=\"_blank\">The Future of WordPress Development</a> and is available through a <a href=\"https://world.phparch.com/register/\" rel=\"noopener noreferrer\" target=\"_blank\">separate day ticket</a>. </p>\n<p>&#8220;We&#8217;ve always tried to focus php[world] on being the PHP conference that appeals to WordPress and Drupal developers as well,&#8221; conference co-chair Eli White said.  &#8220;We all write PHP (and JavaScript) code, and the DC area is full of WordPress and Drupal development shops. In fact, the majority of people in the local PHP user groups are doing WordPress development anyway. So we should all just be learning from each other. </p>\n<p>&#8220;For WordPress, that was obviously Gutenberg. Currently the release date for WordPress 5.0 and Gutenberg is November 19th, just a few days after php[world], and so it&#8217;s a really important topic for any developer who works with WordPress to be familiar with.&#8221;</p>\n<p>Workshop attendees can expect to become better acquainted with extending Gutenberg. The instructors plan to cover the basics of block creation as well as more advanced topics like making blocks dynamic and creating advanced blocks with the WordPress REST API and Redux.</p>\n<p>&#8220;For the workshop, our goal is to get folks comfortable with what they could do with Gutenberg,&#8221; Josh Pollock said. &#8220;We&#8217;ll cover the anatomy of a block, and different patterns for creating simple and complex blocks. We&#8217;ll go over each of the types of block types you can create and have hands-on time to play with these new skills and ask real time questions.</p>\n<p>&#8220;Developers should leave with an understanding of the different types of blocks they can build and why. They&#8217;ll also get plenty of example code, links, and advice they can use when it&#8217;s time to build blocks for their own WordPress projects.&#8221;</p>\n<p>The event includes a few other sessions geared towards WordPress developers: David Wolfpaw is giving a workshop called &#8220;<a href=\"https://world.phparch.com/sessions/building-wordpress-themes-a-primer/\" rel=\"noopener noreferrer\" target=\"_blank\">Building WordPress Themes: A Primer</a>&#8221; and Mo Jangda from Automattic is giving a talk on &#8220;<a href=\"https://world.phparch.com/sessions/handle-an-outage/\" rel=\"noopener noreferrer\" target=\"_blank\">How to Handle a Site Outage</a>.&#8221; There is another full-day training on modern PHP security that happens the day before the Gutenberg workshop that White said the WordPress Developers on the content board urged them to include.</p>\n<p>The main conference is also hosting many sessions that would benefit WordPress developers who want to sharpen their PHP skills. A few highlights include:</p>\n<ul>\n<li>Steve Grunwell is giving a &#8220;<a href=\"https://world.phparch.com/sessions/a-crash-course-in-php-namespaces-for-wordpress-developers/\" rel=\"noopener noreferrer\" target=\"_blank\">Crash-Course in PHP Namespaces</a>.&#8221;</li>\n<li>Sara Goleman, a core PHP contributor, will be talking about &#8220;<a href=\"https://world.phparch.com/sessions/php-now-and-tomorrow/\" rel=\"noopener noreferrer\" target=\"_blank\">PHP: Now and Tomorrow</a>,&#8221; discussing the PHP roadmap for 7.4 and 8.0.</li>\n<li>Brandon Savage is giving a two-hour workshop on &#8220;<a href=\"https://world.phparch.com/sessions/practical-object-oriented-design-principles/\" rel=\"noopener noreferrer\" target=\"_blank\">Object-Oriented Design Principles</a>,&#8221; designed to be a an introduction or refresher on OOP best practices.</li>\n</ul>\n<p>Check out the <a href=\"https://world.phparch.com/schedule/\" rel=\"noopener noreferrer\" target=\"_blank\">full schedule</a> on the php[world] website.  </p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 29 Oct 2018 22:36:35 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:24;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:79:\"WPTavern: WooCommerce 3.5 Introduces REST API v3, Improves Transactional Emails\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=84995\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:89:\"https://wptavern.com/woocommerce-3-5-introduces-rest-api-v3-improves-transactional-emails\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3596:\"<p><a href=\"https://woocommerce.wordpress.com/2018/10/23/woocommerce-3-5-is-here/\" rel=\"noopener noreferrer\" target=\"_blank\">WooCommerce 3.5</a> was released this week. It&#8217;s a minor update that has been in development since May and began testing in September. The release should be backwards compatible to version 3.0 of the plugin but users are always advised to test all of their themes and extensions before updating.</p>\n<p>Store owners can expect to see a change in the copy of the default transactional emails. They have been <a href=\"https://github.com/woocommerce/woocommerce/pull/21288\" rel=\"noopener noreferrer\" target=\"_blank\">updated to be friendlier and more human</a>. This is particularly important for the customer-facing emails. All of the following have been updated: on-hold, processing, completed, refunded both full and partially, invoice both with a pending and non-pending status, customer notes, password reset, new account. The default content in the store admin emails has also been improved.</p>\n<p><a href=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2018/10/payment-received.png?ssl=1\"><img /></a></p>\n<p>The WooCommerce team anticipates that the updates to the transactional emails will reduce the need for store owners to customize their email templates. It also gives customers a better, friendlier connection to the store. More updates to the email content editing experience are planned for 2019. </p>\n<p>Store owners may also benefit from the new option to set a low stock threshold in the inventory tab for individual products, export products by category to the CSV exporter, and define custom product placeholder images that will resize to correct store aspect ratio. </p>\n<p>The WooCommerce REST API continues to evolve with v3 introduced in this release. It adds new endpoints required for the <a href=\"https://github.com/woocommerce/wc-admin\" rel=\"noopener noreferrer\" target=\"_blank\">wc-admin feature plugin</a>, the React-powered WooCommerce admin interface that was <a href=\"https://wptavern.com/the-new-woo-adopts-gutenberg-components-user-interface-driven-by-react\" rel=\"noopener noreferrer\" target=\"_blank\">featured at last week&#8217;s WooSesh</a>. REST API v3 also adds new features to existing endpoints while maintaining backwards compatibility with legacy API versions.</p>\n<p>WooCommerce 3.5 introduces support for the <a href=\"https://wptavern.com/woocommerce-custom-product-tables-plugin-now-in-beta-boasts-30-faster-page-loads\" rel=\"noopener noreferrer\" target=\"_blank\">Custom Product Tables feature plugin</a>, which is being developed to improve store performance and scalability. In some cases storing product data in custom tables has brought <a href=\"https://woocommerce.wordpress.com/2018/07/17/woocommerce-custom-product-tables-beta/\" rel=\"noopener noreferrer\" target=\"_blank\">30% faster page loads</a>. </p>\n<p>In version 3.5 the &#8220;Preview Changes&#8221; button was <a href=\"https://github.com/woocommerce/woocommerce/pull/20650\" rel=\"noopener noreferrer\" target=\"_blank\">removed from the publish meta box when editing products</a>. If you&#8217;re missing it, <a href=\"https://www.remicorson.com/woocommerce-3-5-bring-me-that-preview-button-back/\" rel=\"noopener noreferrer\" target=\"_blank\">Rémi Corson published a quick CSS snippet</a> to bring it back.</p>\n<p>Check out the <a href=\"https://woocommerce.wordpress.com/2018/10/23/woocommerce-3-5-is-here/\" rel=\"noopener noreferrer\" target=\"_blank\">release post</a> for a full rundown of all the updates, deprecations, and template file changes in version 3.5. </p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sat, 27 Oct 2018 02:15:47 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:25;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"WPTavern: WP Engine Acquires Array Themes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=85078\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:52:\"https://wptavern.com/wp-engine-acquires-array-themes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5848:\"<p>WP Engine <a href=\"https://wpengine.com/blog/bringing-array-themes-into-the-wp-engine-family/\">has acquired</a> <a href=\"https://arraythemes.com/\">Array Themes</a> and <a href=\"https://atomicblocks.com/\">Atomic Blocks</a> from Mike McAlister for an undisclosed amount. McAlister has been developing WordPress themes since 2009. He initially sold his themes on ThemeForest. In 2011, he founded Array Themes.</p>\n<p>I reached out to McAlister to learn why he chose to be acquired, what excites him most about Gutenberg, and what the plans are going forward.</p>\n<h2>Interview with Mike McAlister</h2>\n<h4><strong>What ultimately made you decide to move on from managing your own theme and products company to a larger, more established company?</strong></h4>\n<p>The catalyst was when Brian Gardner reached out this summer and started a conversation about joining his team at <a href=\"https://wpengine.com\">WP Engine</a>. As I told him at the time, he certainly wasn&#8217;t the first to make that offer, but he was definitely the most interesting. I had always respected Brian&#8217;s ethos on quality and design and really enjoyed our chats over the years.</p>\n<p>Once I started meeting folks at WP Engine like Jason Cohen and David Vogelpohl, it became obvious that we were all striving for the same future and outcome for customers. It just made sense to join forces to make it happen together.</p>\n<p>This was also a unique opportunity for me to start fresh and focus on crafting products with a stellar team. Although I was able to create an industry-respected theme collection and recently the <a href=\"https://wordpress.org/plugins/atomic-blocks/\">Atomic Blocks</a> plugin for Gutenberg, I wanted a new challenge. </p>\n<h4><strong>Couldn&#8217;t Array Themes have been built to directly support the Genesis framework without being acquired by WP Engine?</strong></h4>\n<p>It would be a lot of work to infuse the Array Themes collection and Genesis. The idea wasn&#8217;t exactly to bring Genesis to Array, rather to bring the expertise and craft of Array and Atomic Blocks to WP Engine, StudioPress and Gutenberg. </p>\n<p>StudioPress already has one of the biggest and best theme collections out there and is doubling down on Gutenberg support. I&#8217;m going to contribute what I&#8217;ve learned building Array Themes and Atomic Blocks to make the StudioPress offering even better.</p>\n<h4><strong>Will future themes require the Genesis framework?</strong></h4>\n<p>Although there will not be any new themes released under the Array Themes brand, some of the designs will live on as <a href=\"https://my.studiopress.com/themes/\">StudioPress themes</a> in the future and those will be powered by the Genesis framework. </p>\n<p>We&#8217;re working on some really exciting new themes and features for Genesis that are going to continue making it the go-to solution for creating beautiful websites on WordPress, especially in the Gutenberg era.</p>\n<h4><strong>What do you think of the consolidation of brands in the WordPress space?</strong></h4>\n<p>We&#8217;re seeing a very unique and transitional time in the WordPress industry. The old way of doing things is going out the window as WordPress and its community changes before our eyes. </p>\n<p>Now, more than ever, WordPress needs companies with stellar talent to help usher it through to the next era and contribute to its long term success. I&#8217;m excited to be part of a team that is willing to take on that challenge!</p>\n<p>I can&#8217;t speak to the motivations of other businesses in the WordPress space, but the WP Engine acquisition of the Array product suite makes a lot of sense. </p>\n<p>With their recent acquisition of StudioPress, Array Themes, and Atomic Blocks, WP Engine is showing its customers and the WordPress community that they are doubling down on quality, design, Gutenberg, and an unmatched customer experience. These are all shared qualities between these individual entities and part of the long term strategy at WP Engine.</p>\n<h4><strong>What excites you most about Gutenberg?</strong></h4>\n<p>I&#8217;ve been excited about Gutenberg for over a year now. I was one of the first WordPress product developers to release a <a href=\"https://wordpress.org/plugins/atomic-blocks/\">blocks plugin</a>, a <a href=\"https://wordpress.org/themes/atomic-blocks/\">Gutenberg-friendly theme</a>, <a href=\"https://atomicblocks.com/blog/\">a blog with tutorials</a>, and the <a href=\"http://gutenberg.news/\">Gutenberg News</a> site. </p>\n<p>I created all of these resources as a way of learning Gutenberg as well as contributing back to the community, and I will continue to do that with WP Engine and StudioPress!</p>\n<p>Gutenberg unlocks the WordPress editor and the endless opportunities that follow for content creators, developers, and everyone in between. Gutenberg is already responsible for a flood of new products and new solutions to problems the classic editor couldn&#8217;t solve and it hasn&#8217;t even been merged into core yet! </p>\n<p>The reality here is that Gutenberg isn&#8217;t just the future of WordPress, it&#8217;s the future of the Internet.</p>\n<h2>Discounts Available for Array Themes Customers<br /></h2>\n<p>McAlister is joining WP Engine as a full-time employee. In addition, <a href=\"https://arraythemes.com/about/\">John Parris</a>, a code wrangler for Array Themes has also joined WP Engine. </p>\n<p>StudioPress and WP Engine are offering discounts to single theme and theme club members. Those who purchased a lifetime membership will receive free access to the StudioPress Pro Plus All-Theme package with support and updates.</p>\n<p>To learn more about these discounts and how the acquisition came about, check out <a href=\"https://arraythemes.com/onward/\">McAlister&#8217;s post</a> where he says thanks and farewell to his customers. </p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 26 Oct 2018 23:08:14 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:26;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"Gary: Iterating on Merge Proposals\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:25:\"https://pento.net/?p=2535\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"https://pento.net/2018/10/26/iterating-on-merge-proposals/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5731:\"<p>Developing new WordPress features as plugins has been a wonderfully valuable process for all sorts of features to come into being, from the MP6 Dashboard Redesign, to oEmbed endpoints, and including multiple Customiser enhancements over the years. Thanks to the flexibility that this model offers, folks have been able to iterate rapidly on a wide range of features, touching just about every part of WordPress.</p>\n\n<p>The &#8220;Features as Plugins&#8221; idea was first introduced during the WordPress 3.7 development cycle, during which the features were merged after a short discussion during a core chat: it was only in the WordPress 3.8 cycle that the idea of a merge proposal post (called &#8220;Present Your Feature&#8221; back then) came into being. It was envisioned as a way to consult with WordPress leaders, key contributors, and the wider WordPress community on the readiness of this feature to be released. Ultimately, WordPress leaders would make a decision on whether the feature was right for WordPress, and the release lead would decide if it was ready for that release.</p>\n\n<p>Since then, most feature plugins have published some form of merge proposal post before they were ultimately merged into WordPress, and they&#8217;ve nearly all benefited to some degree from this process.</p>\n\n<p class=\"has-large-font-size\">The merge proposal process has worked well for smaller features, but it struggled with larger changes.</p>\n\n<p>The REST API is a great example of where the merge proposal process didn&#8217;t work. The REST API was a significant change, and trying to communicate the scope of that change within the bounds of a single merge proposal post didn&#8217;t really do it justice. It was impossible to convey everything that was changing, how it all worked together, and what it meant for WordPress.</p>\n\n<p>I&#8217;d go so far as to say that the shortcomings of the merge proposal process are at least partially responsible for why the REST API hasn&#8217;t seen the level of adoption we&#8217;d hoped for. It&#8217;s managed to gain a moderate amount of popularity with WordPress development agencies, and a handful of plugins use it in some ways, but it never really entered into mainstream usage in the ways it could&#8217;ve.</p>\n\n<p class=\"has-large-font-size\">In a project that prides itself on being willing to try new ideas, the merge proposal process has remained largely static for many years.</p>\n\n<p>Gutenberg is the first opportunity since the REST API was merged where we can examine the shortcomings of the merge proposal process, and see how we can apply the original intent of it to the Gutenberg project&#8217;s scope and long term vision.</p>\n\n<h2>Merge Consultation</h2>\n\n<p>Over the last six months, Gutenberg project leads have been consulting with teams across the WordPress project. Helping them get involved when they didn&#8217;t have any Gutenberg experience, explaining how their focus fit into the vision for Gutenberg, and listening to feedback on where things needed to be improved. In many circumstances, this consultation process has been quite successful: the WordPress Media and REST API teams are great examples of that. Both teams have got up to speed on the Gutenberg project, and have provided their valuable experience to make it even better.</p>\n\n<p>That&#8217;s not to say it&#8217;s been entirely successful. There&#8217;s been a lot of discussion about Gutenberg and Accessibility recently, much of it boils down to what <a href=\"https://www.joedolson.com/2018/10/some-gutenberg-accessibility-clarifications/\">Joe Dolson summarised</a> as being &#8220;too little, too late&#8221;. He&#8217;s correct, the Accessibility team should&#8217;ve been consulted more closely, much earlier in the process, and that&#8217;s a mistake I expect to see rectified as the Gutenberg project moves into its next phase after WordPress 5.0. While Gutenberg has always aimed to prioritise accessibility, both <a href=\"https://make.wordpress.org/core/2018/10/18/regarding-accessibility-in-gutenberg/\">providing tools to make the block editor more accessible, as well as encouraging authors to publish accessible content</a>, there are still areas where we can improve.</p>\n\n<p>While there&#8217;s much to be discussed following WordPress 5.0, we can already see now that different teams needed to be consulted at different points during the project. Where Gutenberg has aimed to consult with teams earlier than a previous feature plugin would&#8217;ve, we need to push that further, ensuring that teams are empowered to get involved earlier still in the process.</p>\n\n<p class=\"has-large-font-size\">All feature plugins in the future, great and small, will benefit from this iteration.</p>\n\n<p>Creating a framework for more fluid feedback over the entire lifecycle of a feature project is beneficial for everyone. WordPress teams can ensure that their feedback is taken on board at the right time, project leads gain experience across the broad range of teams that work on WordPress, and projects themselves are able to produce a better resulting feature.</p>\n\n<p>They important thing to remember throughout all of this is that everything is an experiment. We can try an approach, discover the weaknesses, and iterate. We&#8217;re all only human, we all make mistakes, but every mistake is an opportunity to ensure the same mistake can&#8217;t happen again. Sometimes that means changing the software, and sometimes that means changing the processes that help build the software. Either way, we&#8217;re always able to iterate further, and make WordPress fun for everyone. <img src=\"https://s.w.org/images/core/emoji/11/72x72/1f642.png\" alt=\"?\" class=\"wp-smiley\" /></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 26 Oct 2018 03:30:06 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Gary\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:27;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:82:\"WPTavern: WPWeekly Episode 335 – Introduction to BigCommerce with Topher DeRosia\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"https://wptavern.com?p=85070&preview=true&preview_id=85070\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:89:\"https://wptavern.com/wpweekly-episode-335-introduction-to-bigcommerce-with-topher-derosia\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1798:\"<p>In this episode, <a href=\"http://jjj.me\">John James Jacoby</a> and I are joined by <a href=\"https://topher1kenobe.com/\">Topher DeRosia</a>, a developer evangelist for <a href=\"https://www.bigcommerce.com/\">BigCommerce</a>. DeRosia introduces what BigCommerce is, why users and developers should take a look at it, and why they&#8217;re making a big push into the WordPress space. He also provides an update on HeroPress and why next year, you&#8217;ll be seeing him at a lot more WordPress events.</p>\n<h2>Stories Discussed:</h2>\n<p><a href=\"https://wptavern.com/polldaddy-rebrands-to-crowdsignal\" rel=\"bookmark\">Polldaddy Rebrands to Crowdsignal</a><br />\n<a href=\"https://wptavern.com/the-new-woo-adopts-gutenberg-components-user-interface-driven-by-react\" rel=\"bookmark\">The New Woo Adopts Gutenberg Components, User Interface Driven by React</a><br />\n<a href=\"https://wptavern.com/gutenberg-team-addresses-accessibility-concerns-highlights-tools-and-features-that-surpass-the-classic-editor\" rel=\"bookmark\">Gutenberg Team Addresses Accessibility Concerns, Highlights Tools and Features that Surpass the Classic Editor</a></p>\n<h2>WPWeekly Meta:</h2>\n<p><strong>Next Episode:</strong> Wednesday, October 31st 3:00 P.M. Eastern</p>\n<p>Subscribe to <a href=\"https://itunes.apple.com/us/podcast/wordpress-weekly/id694849738\">WordPress Weekly via Itunes</a></p>\n<p>Subscribe to <a href=\"https://www.wptavern.com/feed/podcast\">WordPress Weekly via RSS</a></p>\n<p>Subscribe to <a href=\"http://www.stitcher.com/podcast/wordpress-weekly-podcast?refid=stpr\">WordPress Weekly via Stitcher Radio</a></p>\n<p>Subscribe to <a href=\"https://play.google.com/music/listen?u=0#/ps/Ir3keivkvwwh24xy7qiymurwpbe\">WordPress Weekly via Google Play</a></p>\n<p><strong>Listen To Episode #335:</strong><br />\n</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 25 Oct 2018 20:06:35 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:28;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:78:\"WPTavern: WPCampus is Pursuing an Independent Accessibility Audit of Gutenberg\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=85035\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:89:\"https://wptavern.com/wpcampus-is-pursuing-an-independent-accessibility-audit-of-gutenberg\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:11736:\"<p>WPCampus is looking to hire a company to perform an accessibility audit of the Gutenberg editor. The organization is a community of more than 800 web professionals, educators, and others who work with WordPress in higher education. WPCampus director Rachel Cherry <a href=\"https://wpcampus.org/2018/10/gutenberg-a11y-audit-rfp/\" rel=\"noopener noreferrer\" target=\"_blank\">published a request for proposals</a> detailing the organization&#8217;s specific concerns:</p>\n<blockquote><p>Our organization is sensitive to the legal requirements set by <a href=\"https://section508.gov/\" rel=\"noopener noreferrer\" target=\"_blank\">Section 508 of the Rehabilitation Act</a>. The recent 508 refresh brought these requirements in line with <a href=\"https://www.w3.org/WAI/standards-guidelines/wcag/\" rel=\"noopener noreferrer\" target=\"_blank\">WCAG 2.0 level AA</a>, an industry standard that helps ensure accessibility. WCAG 2.0 is also <a href=\"https://www.w3.org/WAI/policies/\" rel=\"noopener noreferrer\" target=\"_blank\">commonly used as a baseline for policies</a> governing many WPCampus participants outside the United States, with the <a href=\"https://www.w3.org/blog/2018/09/wcag-2-1-adoption-in-europe/\" rel=\"noopener noreferrer\" target=\"_blank\">European Union already moving to WCAG 2.1</a>.</p></blockquote>\n<p>The audit is aimed at determining potential legal risk for institutions upgrading to WordPress 5.0 and will also identify specific challenges that Gutenberg introduces for assistive technology users and others with accessibility needs.</p>\n<p>WPCampus is funding the audit and is not soliciting contributions from the community at this time. However, Pagely has <a href=\"https://twitter.com/Pagely/status/1055289065883365377\" rel=\"noopener noreferrer\" target=\"_blank\">offered to donate $1,000 to the organization</a> in order to offset the costs of the audit.</p>\n<p>&#8220;Contributions wise, at this point, we’d love for folks to share to help ensure we receive a wide variety of proposals,&#8221; Cherry said. WPCampus will publish the results of the audit to share with the greater WordPress community. </p>\n<p>&#8220;Beyond our institutions’ legal obligations, colleges and universities worldwide have committed to providing an accessible digital experience to their diverse communities,&#8221; Cherry said. &#8220;This is consistent with the broader culture of higher education, which values inclusivity and an exchange of ideas free from artificial barriers.</p>\n<p>&#8220;While the WordPress accessibility coding standards require new code to meet WCAG 2.0 AA, the new editor has not received a full accessibility audit. Lacking such an audit, the overall accessibility of Gutenberg is unclear. This makes it difficult for colleges and universities to determine the best course of action once WordPress 5.0 is released with Gutenberg as the default editor.&#8221;</p>\n<h3>The Accessibility Team is Preparing a Statement on Gutenberg&#8217;s Current Level of Accessibility</h3>\n<p>Accessibility has been one of the most pressing concerns regarding Gutenberg&#8217;s readiness for the world. The accessibility team met Monday and established a new weekly meeting time:&nbsp;15:00 UTC on Fridays. They discussed a communication plan for&nbsp;Gutenberg accessibility feedback, particularly in regards to&nbsp;Matthew<a href=\"https://make.wordpress.org/core/2018/10/19/call-for-testers-community-gutenberg-accessibility-tests/\"> MacPherson&#8217;s call for accessibility testing</a> on the plugin. User testing was conducted in March but a lot has changed since then. MacPherson has called for another round of tests from the community after <a href=\"https://wptavern.com/gutenberg-accessibility-audit-postponed-indefinitely\" rel=\"noopener noreferrer\" target=\"_blank\">Automattic decided to forego his proposed independent audit</a> on Gutenberg.</p>\n<p>The discussion became somewhat contentious after Gutenberg phase 2 lead Riad Benguella urged the accessibility team not to make its assessment in comparison to the classic editor but instead look at the larger picture.</p>\n<p>&#8220;Gutenberg is meant for the whole site editing (even if it’s not at the moment) which means it’s the customizer + editor + menus + widgets at the same time,&#8221; Benguella said. &#8220;Just compare apples to apples, please, and if you see Gutenberg as an editor, you missed it. For the sake of iteration, it’s being shipped as an editor for now.&#8221;</p>\n<p>Several members of the accessibility team took issue with statement because Gutenberg will replace the classic editor in WordPress 5.0 (even if users can bring it back with a plugin).</p>\n<p>&#8220;It is <em>crucial</em> we compare these two experiences, because the one completely replaces the other,&#8221; Joe Dolson said. &#8220;It doesn’t matter that the new editor aims to do a lot more, it still must accomplish the same tasks effectively.&#8221;</p>\n<p>Amanda Rush, a blind WordPress user and accessibility specialist, concurred with Dolson&#8217;s assessment.</p>\n<p>&#8220;As someone trying to use Gutenberg as it currently stands with a screen reader, I promise you that future goals for the project are the absolute furthest thing away from my brain at the time,&#8221; Rush said.</p>\n<p>&#8220;Let’s put it this way. Imagine that you are someone who must use assistive technology, or is otherwise reliant on something to do with Accessibility, and you have Gutenberg in front of you and you are trying to accomplish a task. Right now, the only task you can accomplish is writing or editing a post. So, as you are becoming more and more frustrated with the state of things, and trying to get your work done at the same time, imagine what it would be like if someone walked up to you in the middle of this frustrating experience and said well, if you’re calling as an editor you’ve missed it. Because this is going to be so much more than that. That is completely useless, doesn’t have any bearing on what you were trying to accomplish at the time, and promises, whether fairly or not, just more frustration down the road.&#8221;</p>\n<p><a href=\"https://wptavern.com/wordpress-5-0-beta-1-now-available-for-testing\" rel=\"noopener noreferrer\" target=\"_blank\">Beta 1</a> has arrived before the next round of accessibility testing has been completed, and Gutenberg has only recently arrived at UI freeze within the last week. The accessibility team is collaborating on a detailed article with a general and professional statement on the level of overall accessibility in Gutenberg. They plan to publish the statement on Friday.</p>\n<p>In the meantime, WPCampus has taken it upon themselves to spearhead an independent audit to determine if Gutenberg is in compliance with the industry standard WCAG 2.0 level AA, a standard which the accessibility team <a href=\"https://wptavern.com/wordpress-adopts-accessibility-coding-standards-for-all-new-and-updated-code\" rel=\"noopener noreferrer\" target=\"_blank\">adopted as a requirement for all new or updated code released in WordPress</a>. WPCampus&#8217; submission deadline for proposals is November 7, and the organization will select a vendor by November 30. The goal is to release the audit no later than January 17, 2019. </p>\n<p>The timeline WPCampus has identified would not deliver results in time to meaningfully impact WordPress 5.0&#8217;s release date. As Gutenberg has already been merged into core, it seems neither the accessibility team&#8217;s assessment nor an independent third-party audit would be considered a factor in delaying the release. </p>\n<p>&#8220;The goal with the timeline is to allow adequate time to do it right,&#8221; Cherry said. </p>\n<p>The WordPress community has responded positively to this independent effort to get more information on Gutenberg&#8217;s accessibility issues. </p>\n<p>&#8220;I&#8217;m excited for this process as an example of how the community can tackle large tasks like this in creative ways,&#8221; Jeremy Felt <a href=\"https://twitter.com/jeremyfelt/status/1055176432861634560\" rel=\"noopener noreferrer\" target=\"_blank\">said</a> in response to WPCampus&#8217; taking the initiative to get an audit. &#8220;It also has an opportunity to provide great insight and instruction on the accessibility of a complex React application with many interacting pieces.&#8221;</p>\n<blockquote class=\"twitter-tweet\">\n<p lang=\"en\" dir=\"ltr\">This <a href=\"https://twitter.com/hashtag/Gutenberg?src=hash&ref_src=twsrc%5Etfw\">#Gutenberg</a> / <a href=\"https://twitter.com/hashtag/WordPress?src=hash&ref_src=twsrc%5Etfw\">#WordPress</a> <a href=\"https://twitter.com/hashtag/accessibility?src=hash&ref_src=twsrc%5Etfw\">#accessibility</a> audit, spearheaded by <a href=\"https://twitter.com/wpcampusorg?ref_src=twsrc%5Etfw\">@wpcampusorg</a>, is exciting. Now that we power 32% of the web, we need independent verification that we\'re doing it right, building a better web. <a href=\"https://t.co/cXRwcXWQlN\">https://t.co/cXRwcXWQlN</a></p>\n<p>&mdash; Morten Rand-Hendriksen (@mor10) <a href=\"https://twitter.com/mor10/status/1055506088567627776?ref_src=twsrc%5Etfw\">October 25, 2018</a></p></blockquote>\n<p></p>\n<p>Accessibility is part of <a href=\"https://wordpress.org/about/\" rel=\"noopener noreferrer\" target=\"_blank\">WordPress&#8217; stated mission</a>: &#8220;WordPress is software designed for everyone, emphasizing accessibility, performance, security, and ease of use.&#8221; The <a href=\"https://wordpress.org/about/accessibility/\" rel=\"noopener noreferrer\" target=\"_blank\">accessibility pages</a> on the project&#8217;s website advertise WordPress as committed to ensuring all new and updated code conforms with WordPress Accessibility Coding Standards. Many in the community have expressed concern that if WordPress 5.0 ships a critically inaccessible new editor, it will be violating both its stated mission and its standards.</p>\n<p>A great deal of friction has surrounded Gutenberg&#8217;s journey towards becoming an accessible tool for millions of users. The struggle has highlighted areas where the WordPress project can improve its collaboration across teams. It has inspired many to <a href=\"https://twitter.com/mor10/status/1054962217022640128\" rel=\"noopener noreferrer\" target=\"_blank\">share</a> their personal stories and some have even <a href=\"https://twitter.com/ryanwelcher/status/1055158337057239040\" rel=\"noopener noreferrer\" target=\"_blank\">pledged</a> to <a href=\"https://jonathandesrosiers.com/2018/10/accessibility-a-developers-pledge/\" rel=\"noopener noreferrer\" target=\"_blank\">ramp up their accessibility contributions</a>.</p>\n<p>Many contributors were disappointed after Automattic decided to forego the independent accessibility audit on Gutenberg, given the company&#8217;s strong messaging about their passion for inclusive design. However, one positive outcome is that the company is now looking to <a href=\"https://automattic.com/work-with-us/product-designer-accessibility/\" rel=\"noopener noreferrer\" target=\"_blank\">hire a product designer who specializes in accessibility</a>. </p>\n<p>Rian Rietveld&#8217;s <a href=\"https://wptavern.com/wordpress-accessibility-team-lead-resigns-cites-political-complications-related-to-gutenberg\" rel=\"noopener noreferrer\" target=\"_blank\">resignation from the accessibility team</a> was a great loss for the project but it served as a catalyst to bring more visibility to the efforts of WordPress&#8217; accessibility contributors. WPCampus&#8217; initiative to get an accessibility audit for Gutenberg is one example of how the community is rallying around the accessibility team and working to help make the new editor a success for all users, including those with accessibility needs.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 25 Oct 2018 19:53:31 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:29;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"WPTavern: WordPress 5.0 Beta 1 Now Available for Testing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=84914\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:67:\"https://wptavern.com/wordpress-5-0-beta-1-now-available-for-testing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2404:\"<p>WordPress 5.0 is marching forward with <a href=\"https://wordpress.org/news/2018/10/wordpress-5-0-beta-1/\">beta 1 released</a> this evening. Major items that need testing include the Gutenberg editor, the new Twenty Nineteen default theme, and all previous default themes, which have been updated to be compatible with the new editor.</p>\n<p>You&#8217;ll want to make sure you are using Gutenberg version 4.1 before updating your site to WordPress 5.0 beta 1. Gutenberg is now considered feature complete as of the <a href=\"https://make.wordpress.org/core/2018/10/19/whats-new-in-gutenberg-19th-october/\">4.1 release</a>. It is active on more than 580,000 installations.</p>\n<p>WordPress 5.0 beta 1 has arrived five days after its expected release on October 19. Contributors expressed concern in today&#8217;s dev chat over the large number of issues on GitHub in milestones related to 5.0.</p>\n<p>Gary Pendergast, who is responsible for leading the merge, said the dates for RC can be changed if necessary.</p>\n<p>&#8220;We can shift RC if we need to, which won’t necessarily affect the final release date,&#8221; Pendergast said. &#8220;If we have to shift RC a long way, that would be a good time to have another look at the release date.&#8221;</p>\n<p>The Gutenberg team has not published a merge proposal to date. In September, Pendergast <a href=\"https://wordpress.slack.com/archives/C02RQBWTW/p1537994851000100\">said</a> &#8220;the Gutenberg leads are ultimately responsible for the merge proposal&#8221; but the timeline was still to be determined. Unless a proposal is forthcoming, the project seems to have bypassed this stage, which has frequently been a requirement for new themes, APIs, and feature plugins in the past.</p>\n<p>Volunteers contributing to the Gutenberg handbook met for the first time today in the #core-docs channel. Chris Van Patten is coordinating the documentation effort to clean up and prepare Gutenberg-related docs for 5.0 over the next  five weeks.</p>\n<p>Testers are advised to <a href=\"https://core.trac.wordpress.org/tickets/major\">consult the list of known bugs</a> before reporting to the <a href=\"https://wordpress.org/support/forum/alphabeta\">Alpha/Beta forum</a> or <a href=\"https://make.wordpress.org/core/reports/\">filing a bug on trac</a>.</p>\n<p>If this release stays on schedule, Gutenberg is now 26 days away from shipping in WordPress 5.0.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 25 Oct 2018 00:35:57 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:30;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"Dev Blog: WordPress 5.0 Beta 1\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"https://wordpress.org/news/?p=6209\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"https://wordpress.org/news/2018/10/wordpress-5-0-beta-1/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3662:\"<p>WordPress 5.0 Beta 1 is now available!</p>\n\n<p><strong>This software is still in development,</strong>&nbsp;so we don’t recommend you run it on a production site. Consider setting up a test site to play with the new version, and if you are using an existing test site be sure to update the Gutenberg plugin to v4.1. </p>\n\n<p>There are two ways to test the WordPress 5.0 beta: try the&nbsp;<a href=\"https://wordpress.org/plugins/wordpress-beta-tester/\">WordPress Beta Tester</a>&nbsp;plugin (you’ll want “bleeding edge nightlies”), or you can&nbsp;<a href=\"https://wordpress.org/wordpress-5.0-beta1.zip\">download the beta here</a>&nbsp;(zip).</p>\n\n<p>WordPress 5.0 is slated for release on&nbsp;<a href=\"https://make.wordpress.org/core/5-0/\">November 19</a>, and we need your help to get there. Here are some of the big items to test so we can find as many bugs as possible in the coming weeks.</p>\n\n<h2>The Block Editor</h2>\n\n<p>The new Gutenberg block editor is now the default post editor!</p>\n\n<p>The block editor provides a modern, media-rich editing experience. You can create flexible, beautiful content without writing a single line of code, or you can dive into the <a href=\"https://wordpress.org/gutenberg/handbook/\">modern programming APIs</a> that the block editor provides.</p>\n\n<p>Even before you install WordPress 5.0, you can <a href=\"https://wordpress.org/gutenberg/\">try the block editor here</a>.</p>\n\n<p>Of course, we recognise you might not be ready for this change quite yet. If that&#8217;s the case, you can install the <a href=\"https://wordpress.org/plugins/classic-editor/\">Classic Editor plugin</a> now, which will keep the editor you&#8217;re familiar with as the default, even after you upgrade to WordPress 5.0.</p>\n\n<h2>Twenty Nineteen</h2>\n\n<p>Along with the new block editor, we have a new default theme, called Twenty Nineteen, which takes advantage of the new features the block editor provides.</p>\n\n<p>You can read more about Twenty Nineteen in its <a href=\"https://make.wordpress.org/core/2018/10/16/introducing-twenty-nineteen/\">introduction post</a>, and follow along with development over on the <a href=\"https://github.com/WordPress/twentynineteen\">GitHub repository</a>.</p>\n\n<h2>Default Themes</h2>\n\n<p>Of course, we couldn&#8217;t release a beautiful new default theme, and leave all of our old ones behind. All the way back to Twenty Ten, we&#8217;ve updated every default them to look good in the new block editor.</p>\n\n<h2>How to Help</h2>\n\n<p>Do you speak a language other than English? <a href=\"https://translate.wordpress.org/projects/wp/dev\">Help us translate WordPress into more than 100 languages!</a> <strong>A known issue</strong>: the block autocompleter fails for blocks whose names contain  characters in non-Latin scripts. Adding blocks via the plus sign works, and this bug is fixed in the Gutenberg 4.1 plugin. <img src=\"https://s.w.org/images/core/emoji/11/72x72/1f642.png\" alt=\"?\" class=\"wp-smiley\" /></p>\n\n<p><strong><em>If you think you’ve found a bug</em></strong><em>, you can post to the&nbsp;</em><a href=\"https://wordpress.org/support/forum/alphabeta\"><em>Alpha/Beta area</em></a><em>&nbsp;in the support forums. We’d love to hear from you! If you’re comfortable writing a reproducible bug report,&nbsp;</em><a href=\"https://make.wordpress.org/core/reports/\"><em>file one on WordPress Trac</em></a><em>, where you can also find&nbsp;</em><a href=\"https://core.trac.wordpress.org/tickets/major\"><em>a list of known bugs</em></a><em>.</em></p>\n\n<hr class=\"wp-block-separator\" />\n\n<p><em>Minor bug fixes<br />Add up one by one by one<br />Then you change the world</em></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 24 Oct 2018 21:59:04 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Gary Pendergast\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:31;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:71:\"WPTavern: WCEU Team is Working on PWA Support for All WordCamp Websites\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=84992\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:82:\"https://wptavern.com/wceu-team-is-working-on-pwa-support-for-all-wordcamp-websites\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3605:\"<p><a href=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2018/06/venue-map.png?ssl=1\"><img /></a>WordCamp Europe&#8217;s new PWA (Progressive Web App) was one of the highlights of the 2018 event in Belgrade. It allowed attendees to view the schedule, venue map, create bookmarks for sessions, and provided offline access in case of network failure. Attendees could add the app to their home screens and opt to receive push notifications for important updates about the event.</p>\n<p>The first iteration of the PWA was not ready to be scaled for use at other WordCamps across the community, but <a href=\"https://make.wordpress.org/community/2018/10/23/progressive-web-app-for-wordcamps/\">volunteers from the WCEU organizing team are working towards that goal</a>.&nbsp; The app was originally built using React on the frontend and was hosted on a node server. It used WordPress for content management on the backend, along with the&nbsp;<a href=\"https://wordpress.org/plugins/wp-pwa/\">WordPress PWA</a>&nbsp;plugin and&nbsp;<a href=\"https://wordpress.org/plugins/onesignal-free-web-push-notifications/\">OneSignal Push Notifications</a>. The team working on scaling the app for use at other WordCamps is still debating the technologies they will use moving forward.</p>\n<p>Hugh Lashbrooke <a href=\"https://make.wordpress.org/community/2018/10/23/progressive-web-app-for-wordcamps/\">posted</a> about the app&#8217;s progress and invited the community to contribute to <a href=\"https://github.com/wceu/pwa\">WCEU&#8217;s PWA repository</a> on GitHub.&nbsp;</p>\n<p>&#8220;The next stage in the process is for the WCEU Design team to create some designs and wireframes for what the app could look like, posting them for feedback,&#8221; Lashbrooke said. &#8220;We will keep posting updates here as things progress; for now it would be helpful to gather some input from other WordCamp organizers.&#8221;</p>\n<p>Lashbrooke said the goal is that each WordCamp site will have its own PWA so the app is unique for each camp. Since it loads in a mobile browser, it doesn&#8217;t require additional app installations.</p>\n<p>Weston Ruter, one of the collaborators on the <a href=\"https://github.com/xwp/pwa-wp/\">PWA for WordPress</a> feature plugin, emphasized in the comments that the PWA should not be separate from the main site and that users need not even know about the app.</p>\n<p>&#8220;After all, a PWA is just a website,&#8221; Ruter said.&nbsp;&nbsp;&#8220;A PWA does not have to be installed to their homescreen to take advantage of PWA capabilities. They just continue go to their WordCamp website as they do normally, except that it also works when they are offline. The interactive schedule is important, but it’s not really PWA territory: rather it’s just a JavaScript component used on a page.&#8221;</p>\n<p>Ruter encouraged those working on the app to view it as a progressive enhancement on top of the existing WordCamp sites, not an entirely separate application. Ideally it will use the same style and theme used on the main website.</p>\n<p>Lashbrooke asked for developers and WordCamp organizers to leave feedback and feature requests in the comments of his <a href=\"https://make.wordpress.org/community/2018/10/23/progressive-web-app-for-wordcamps/\">post</a>. Requests submitted so far include a &#8220;you are here&#8221; feature and the capability for users to log in with their WordPress.org account to sync schedule favorites across devices. Not every feature request will make it into the first version, but the team will consult the list for future versions of the project.</p></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 24 Oct 2018 15:08:26 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:32;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:65:\"WPTavern: New Plugin Adds Elementor Templates as Gutenberg Blocks\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=84998\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:76:\"https://wptavern.com/new-plugin-adds-elementor-templates-as-gutenberg-blocks\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5217:\"<p>One of the most pressing concerns for users in the Gutenberg era is how page builder plugins will respond. Speculation about the new editor &#8220;killing off page builders&#8221; has run rampant, but these plugins are slowly evolving ahead of Gutenberg&#8217;s imminent inclusion in WordPress 5.0.</p>\n<p>In February, <a href=\"https://wordpress.org/plugins/elementor/\" rel=\"noopener noreferrer\" target=\"_blank\">Elementor</a>, one of WordPress&#8217; most popular page builders, <a href=\"https://elementor.com/blog/upcoming-elementor-v2/\" rel=\"noopener noreferrer\" target=\"_blank\">announced</a> the plugin would be completely compatible with Gutenberg beginning with its 2.0 version that was released a few months later. Like many other plugins, that meant a nominal compatibility without any custom blocks built specifically for the new editor.</p>\n<p>This week marks a major milestone for the page builder, as Elementor <a href=\"https://elementor.com/blog/blocks-for-gutenberg/\" rel=\"noopener noreferrer\" target=\"_blank\">introduced</a> its new <a href=\"https://wordpress.org/plugins/block-builder/\" rel=\"noopener noreferrer\" target=\"_blank\">Elementor Blocks for Gutenberg</a> plugin. The plugin goes beyond basic compatibility, allowing users to insert any Elementor template into Gutenberg with one click. Its custom block functions as a pipeline to the Elementor library, pulling in content and designs the user has already created in the Elementor interface.</p>\n<p><a href=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2018/10/Screen-Shot-2018-10-23-at-9.29.14-PM.png?ssl=1\"><img /></a></p>\n<p>Elementor Blocks for Gutenberg lets users compose with the new editor while maintaining convenient access to items designed in the page builder. It makes it possible to bring more advanced layouts into Gutenberg and preview them inside the editor. Users can select from more than 300+ pre-designed blocks and 100+ pre-designed pages. The plugin will eventually be incorporated into Elementor&#8217;s core plugin.</p>\n<p>The availability of this new plugin demonstrates Elementor&#8217;s commitment to evolving with WordPress as it adopts the editor and tackles customization in Phase 2. The page builder has more than a million active installations and a 4.8-star average on WordPress.org. Achieving this level of success in the page builder market has required a certain level of tenacity and perseverance. Elementor CMO Ben Pines made it clear their product is not going to be sidelined by Gutenberg.</p>\n<p>&#8220;Elementor was launched in a saturated market, with many page builder and website builder alternatives,&#8221; Pines said. &#8220;We managed to become the leaders of our market by offering the best solution, and we plan to continue to lead the way. We will continue in our mission in full collaboration with WordPress.&#8221;</p>\n<p>Elementor and Gutenberg share similar goals in helping WordPress users design their websites without having to touch the code. Pines also emphasized the benefits for developers.</p>\n<p>&#8220;Elementor, Gutenberg, and the veer towards code-free website customization, presents a huge improvement for developers,&#8221; he said.</p>\n<p>&#8220;Instead of being tied up in endless menial tasks like button or headline customization, and having to hand-hold the designer every step of the process – developers can now focus on greater challenges.</p>\n<p>&#8220;This improvement creates a positive loop. Developers have time to build more tools, which in turn help the designers workflow.&#8221;</p>\n<p>Other popular page builder plugins, like <a href=\"https://www.elegantthemes.com/blog/theme-releases/divi-feature-update-introducing-initial-gutenberg-support\" rel=\"noopener noreferrer\" target=\"_blank\">Divi Builder</a> (500k+ installs) and <a href=\"https://kb.wpbeaverbuilder.com/article/588-how-beaver-builder-works-with-gutenberg\" rel=\"noopener noreferrer\" target=\"_blank\">Beaver Builder</a> (500k+ installs), have announced initial support for Gutenberg but in both instances this constitutes a button that lets users toggle between the builder and the new editor.</p>\n<p>Elementor is leading the way among page builders by making its content available inside Gutenberg. It essentially builds in an extra step so users can continue with their existing workflow in the page builder and insert those designs into the new editor.</p>\n<p>Gutenberg&#8217;s current customization capabilities pale in comparison to what popular page builders offer, but phase 2 of the project may precipitate another avalanche of blocks pouring into the WordPress ecosystem &#8211; the same way it did after Gutenberg&#8217;s roadmap was unveiled in June at WordCamp Europe.</p>\n<p>Page builders may not reproduce all of their exiting features in custom blocks until WordPress core is more advanced on its road to Gutenberg-powered customization. This would split the creation interface across two admin screens. At some point users may want to see a deeper integration between the editor and page building capabilities. The exciting thing about Elementor&#8217;s new blocks plugin is that its users don&#8217;t have to choose between Gutenberg and their favorite page builder.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 24 Oct 2018 03:58:53 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:33;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"WPTavern: Upcase Developer Learning Platform is Now Free\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=84859\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:67:\"https://wptavern.com/upcase-developer-learning-platform-is-now-free\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1943:\"<p><a href=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2018/10/upcase-thoughtbot.png?ssl=1\"><img /></a></p>\n<p><a href=\"https://thoughtbot.com/upcase\" rel=\"noopener noreferrer\" target=\"_blank\">Upcase</a>, a subscription learning platform for developers, is now free and open to the public. The content, which includes workshops, videos, flash cards, and coding exercises, was built by <a href=\"https://thoughtbot.com/\" rel=\"noopener noreferrer\" target=\"_blank\">thoughtbot</a>, a design and development consultancy.</p>\n<p>&#8220;We’ve loved building Upcase, both as a business and as a way to share what we’ve learned with the community,&#8221; thoughtbot development director Chris Toomey said. &#8220;But while we’d love to keep investing in Upcase and producing tons of new content, we’ve been moving in a different direction—back to our roots, in fact, as we focus on our core consulting business.&#8221;</p>\n<p>Thoughtbot employees work four days a week and Friday is devoted to learning new skills, working on open source, blogging, and other projects. The company found there was a lack of quality learning resources for intermediate and advanced topics, so they built Upcase with the content they wished had existed. Topics and courses include Git, intro to React, React Native, Unit Testing JavaScript, Ruby on Rails, Haskell, workflow and developer tooling, and techniques and patterns for building maintainable large scale applications.</p>\n<p>Upcase creators said they have seen thousands of customers improve their skills and gain new levels in their careers since launching the site in 2012. The consultancy has created hundreds of hours of videos and screencasts based on their collective expertise. To start on any of the <a href=\"https://thoughtbot.com/upcase\" rel=\"noopener noreferrer\" target=\"_blank\">Upcase</a> learning &#8220;trails&#8221; you can sign in with your GitHub credentials for free access.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 23 Oct 2018 15:10:21 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:34;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:43:\"WPTavern: Polldaddy Rebrands to Crowdsignal\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=84964\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:54:\"https://wptavern.com/polldaddy-rebrands-to-crowdsignal\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2040:\"<p>Polldaddy&nbsp;was founded in 2006 by David Lenehan in Sligo, Ireland and was <a href=\"http://blog.polldaddy.com/2008/10/15/automattic-acquires-polldaddy/\">acquired by Automattic</a> in 2008. Polldaddy is a platform agnostic service providing users with the ability to create polls and surveys.</p>\n<div class=\"wp-block-image\">\n<img />Crowdsignal Logo\n</div>\n<p>Today, 12 years later, Automattic is <a href=\"https://blog.polldaddy.com/2018/10/18/introducing-crowdsignal/\">retiring the Polldaddy</a> name and replacing it with Crowdsignal. Outside of some minor color changes, and updated graphics, the service will largely remain the same. </p>\n<p>Redirects are in place so that bookmarked links to edit surveys, polls, and quizzes will continue to work. Beginning October 24th, visitors to Polldaddy.com will be redirected to Crowdsignal.com.</p>\n<p>There are a few notable changes to keep in mind regarding the transition. The Polldaddy dashboard will automatically redirect to the Crowdsignal version. Polldaddy&#8217;s API will live on <a href=\"https://api.crowdsignal.com/v1/\">https://api.crowdsignal.com/v1/</a> instead of <a href=\"https://api.polldaddy.com/\">https://api.polldaddy.com/</a>. Surveys and quizzes will be served from survey.fm and polls will be served from poll.fm.&nbsp; </p>\n<p>According to Donncha Ó Caoimh, some networks and hosts may need to whitelist the following domains to prevent interruptions in service. The domains are:</p>\n<ul>\n<li>api.crowdsignal.com</li>\n<li>app.crowdsignal.com</li>\n<li>crowdsignal.com</li>\n<li>survey.fm</li>\n<li>poll.fm</li>\n</ul>\n<p>Surveys, quizzes, and polls that are embedded will continue to function normally. </p>\n<p>It&#8217;s the end of an era for the Polldaddy name but what the announcement doesn&#8217;t include is <a href=\"https://twitter.com/jeffr0/status/1053013327834681344\">why the rebranding was necessary</a>. Whatever the reasons are for rebranding, Crowdsignal is a more accurate way to describe what the service provides without being tied to a gender. </p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 23 Oct 2018 02:48:36 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:35;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:115:\"WPTavern: Genesis Framework and StudioPress Themes Add Gutenberg Compatibility, More Gutenberg Features Coming Soon\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=84464\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:125:\"https://wptavern.com/genesis-framework-and-studiopress-themes-add-gutenberg-compatibility-more-gutenberg-features-coming-soon\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2380:\"<p>After <a href=\"https://wptavern.com/wp-engine-acquires-studiopress\" rel=\"noopener noreferrer\" target=\"_blank\">WP Engine acquired StudioPress</a> in June, the company began investing in expanding the Genesis team. WP Engine is hiring new people to work on the <a href=\"https://wpengine.com/themes/genesis-framework/\" rel=\"noopener noreferrer\" target=\"_blank\">framework</a> and expand support and community activities.</p>\n<p>On the latest episode of the newly revived <a href=\"https://studiopress.blog/studiopressfm-season2/\" rel=\"noopener noreferrer\" target=\"_blank\">StudioPress.fm</a> podcast, StudioPress founder Brian Gardner said one of the reasons he sold the company was because he needed outside help to take it where it needed to go in the Gutenberg era. The Genesis community has nothing to worry about when the new editor launches in WordPress 5.0, because <a href=\"https://wpengine.com/blog/gutenberg-believe-in-beauty-of-dreams/\" rel=\"noopener noreferrer\" target=\"_blank\">StudioPress has already made its framework and themes Gutenberg-ready</a>.</p>\n<p>&#8220;With regards to Genesis, the good news is that it has no substantial backwards-compatibility issues with Gutenberg,&#8221; WP Engine CTO Jason Cohen said. &#8220;The main focus of updates to the StudioPress themes are focused on adding styles for the new Gutenberg blocks. However, what we’re most excited about are the brand new features we will be adding to Genesis and the StudioPress themes, that Gutenberg helps enable.&#8221;</p>\n<p>Cohen said the Genesis community can expect their entire product line to become Gutenberg-first themes that add new features to enhance users&#8217; experience in the editor.</p>\n<p>&#8220;Beyond just being &#8216;compatible,&#8217; Genesis will play a big role in being Gutenberg-First,&#8221; Cohen said. &#8220;That means not only supporting the software and ideals of Gutenberg, but using them for new features. In doing so, it’s our intention to light the way for the countless agencies and developers who use WordPress to fuel incredible digital experiences that are made even easier with Gutenberg.&#8221;</p>\n<p>Cohen said WP Engine will update all StudioPress themes to include additional features for Gutenberg once the new editor launches in WordPress 5.0. If the release stays on its current schedule, users can expect to see 5.0 on November 19.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 19 Oct 2018 22:41:21 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:36;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:120:\"WPTavern: Gutenberg Team Addresses Accessibility Concerns, Highlights Tools and Features that Surpass the Classic Editor\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=84857\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:130:\"https://wptavern.com/gutenberg-team-addresses-accessibility-concerns-highlights-tools-and-features-that-surpass-the-classic-editor\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:8021:\"<p>The Gutenberg team has officially <a href=\"https://make.wordpress.org/core/2018/10/18/regarding-accessibility-in-gutenberg/\" rel=\"noopener noreferrer\" target=\"_blank\">responded to recent concerns about the new editor&#8217;s accessibility</a>. Matias Ventura, the project&#8217;s technical lead, published a post with examples of the accessibility efforts the team has made, many which may not be easy to discover. These include features such as keyboard shortcuts, slash command and insertion, high-contrast mode, and mechanisms for navigating regions and blocks with the keyboard.</p>\n<p><a href=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2018/10/keyboard-shortcuts.png?ssl=1\"><img /></a></p>\n<p>Ventura highlighted the audible messages feature that works with screen readers and posted a demo of the fully automated end-to-end testing. It allows contributors to test a sequence of operations with the keyboard (without mouse controls). He also identified several fixes landing in the next releases, including accessibility improvements to the date and color picker features, block navigation, and better focus management.</p>\n<p>&#8220;A large amount of work and effort has gone in building mechanisms necessary to make the editor accessible for a wide user base,&#8221; Ventura said. &#8220;For example, it is entirely possible right now to recreate the &#8216;demo post&#8217; that comes with the Gutenberg plugin using the keyboard. In many ways, these tools are better and more sophisticated than what we offer in the current editor.&#8221;</p>\n<p>Although 270 accessibility-specific tickets have been closed to date, Ventura acknowledged there are still more than 90 remaining. &#8220;The goal is to make this experience as seamless as possible for all users,&#8221; he said.</p>\n<p>Early reactions to the post do not dispute that accessibility work has been done but concerns about Gutenberg&#8217;s overall complexity remain. Fixing this may not be as simple as targeting isolated interactions in the editor.</p>\n<p>&#8220;We need to continue to develop close feedback loops with different users interacting through their preferred tools to make sure what we build is relevant to their experiences,&#8221; Ventura said. Throughout the process of building and testing Gutenberg, contributors have referenced &#8220;short feedback loops,&#8221; an agile process term that seems to make its way into these conversations.</p>\n<p>However, the frequent built-in checkpoints don&#8217;t seem to have served accessibility needs well, as the accessibility team in convinced that having their input much earlier in the design process would have made a bigger difference further downstream.</p>\n<p>&#8220;We’ve been begging for React development assistance focused on accessibility since the beginning,&#8221; Accessibility specialist Joe Dolson said in a post addressing what he perceives to be <a href=\"https://www.joedolson.com/2018/10/some-gutenberg-accessibility-clarifications/\" rel=\"noopener noreferrer\" target=\"_blank\">common myths about Gutenberg&#8217;s accessibility</a>. &#8220;None of us were already primarily JavaScript-focused, let alone React-focused, and with limited time (spread across Gutenberg, the rest of WordPress, all of the WordPress sites themselves, and theme concerns), managing to keep up with the breakneck pace of development was never feasible.&#8221;</p>\n<p>WordPress core contributor John James Jacoby commented on Ventura&#8217;s post, calling attention to the complexity of the interface for all users, including those with and without accessibility needs.</p>\n<p>&#8220;My concern is that many of the above things do not really improve accessibility in the broader sense,&#8221; Jacoby said. &#8220;Instead, they make a complex user interface more complicated by littering the landscape with hidden keyboard shortcuts that are likely to be undiscoverable by regular-bodied folks, let alone folks who lack dexterity in their hands or fingers or eyes to find/understand/navigate/enjoy them.</p>\n<p>&#8220;These are users who demand a semantically simpler application to get their jobs done. Though they’re used to quickly navigating the useless mixed-up garbage-markup soup that comes from web development as a whole, it doesn’t help to add extra &#8216;accessibility-centric&#8217; approaches – we should be making the existing approaches accessible first, and adding new approaches after.&#8221;</p>\n<p>Dolson echoes that sentiment in his recent post. &#8220;Where Gutenberg falls down is on the overall use of the system,&#8221; he said. &#8220;Even though most individual interactions are handled effectively, the overall complexity of the system creates an enormous barrier to users if they are keyboard dependent or using a screen reader.&#8221;</p>\n<p>The community has advocated for a myriad of different needs and wishes during the course of Gutenberg&#8217;s development, but any interface created for the millions of people that WordPress aims to serve will inevitably have to deliver some compromises. Matt Mullenweg answered the feedback regarding complexity from his perspective as the project lead:</p>\n<p>&#8220;We think that the current interface could be a ton more streamlined, but we’ve compromised a lot of the alternative approaches we’ve wanted to take based on accessibility feedback and trying to have a single interface that serves all types of users,&#8221; Mullenweg said. &#8220;If we branched, it would be a different discussion and possibly serve multiple audiences better. There’s a lot of FUD though, ie, that’s going to be illegal in EU.&#8221;</p>\n<p>Ventura&#8217;s post is tightly focused on Gutenberg&#8217;s existing accessibility features and makes no mention of the audit that would have measured if it meets <a href=\"https://wptavern.com/wordpress-adopts-accessibility-coding-standards-for-all-new-and-updated-code\" rel=\"noopener noreferrer\" target=\"_blank\">WordPress&#8217; own stated accessibility standards</a>. These standards require that all new or updated code released in WordPress must conform with the WCAG 2.0 guidelines at level AA. Without an examination of how the product meets these standards, much of the the discussion revolves around subjective opinions about complexity. It&#8217;s difficult to quantify issues like cognitive overload.</p>\n<p>&#8220;It is entirely possible that Gutenberg will come within a hair of passing WCAG (Web Content Accessibility Guidelines) 2.0 at level AA at release, but still be inaccessible,&#8221; Dolson said. &#8220;This is because the micro-interactions are being managed well but the macro-interactions are not. This is a flaw with using WCAG 2.0 as a standard; it does not handle address large scale issues effectively. The cognitive load inherent in the current navigation requirements for assistive technology is overwhelming, and that is an accessibility issue – just not one effectively reflected in our current standards requirements.&#8221;</p>\n<p>One of the myths Dolson&#8217;s post dispelled is that the Gutenberg team doesn’t care about accessibility. Ventura&#8217;s post calls attention what he believes to be &#8220;a significant volume of accessibility-specific tools and functionalities&#8221; in Gutenberg that surpass those of the Classic Editor. The team has worked hard to address accessibility concerns but needs better communication across teams in order to continue serving the wider community of WordPress users with accessibility needs.</p>\n<p>&#8220;There have been a lot of issues on the way that could have been avoided if a React developer had been available to assist with significant dedicated time earlier than 6 weeks before the proposed release; but those were issues coming from ignorance, not a lack of compassion,&#8221; Dolson said.</p>\n<p>&#8220;I don’t know what Gutenberg will be at release. But the accessibility team and the Gutenberg team are working hard to try and reach the best solutions we can.&#8221;</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 19 Oct 2018 18:00:07 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:37;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:81:\"WPTavern: The New Woo Adopts Gutenberg Components, User Interface Driven by React\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=84854\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:91:\"https://wptavern.com/the-new-woo-adopts-gutenberg-components-user-interface-driven-by-react\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2865:\"<p><a href=\"https://woosesh.com/\">WooSesh</a>, the free virtual conference devoted to WooCommerce kicked off earlier today. Todd Wilkins, Head of eCommerce at Automattic, Kelly Hoffman, Head of Design for eCommerce at Automattic, and Aviva Pinchas, Product Lead of the WooCommerce Marketplace at Automattic got things started with the keynote presentation.</p>\n<p>Wilkins highlighted what the team has accomplished since last year and outlined what users can expect in 2019. Pinchas shared a wealth of data from a survey that was sent to WooCommerce users and to end the presentation, Hoffman described how the team designed the new interfaces.</p>\n<p>One of the major changes <a href=\"https://woocommerce.wordpress.com/2018/10/18/wc-admin/\">coming to WooCommerce</a> is a redesigned backend. The project is being developed on GitHub as a feature plugin called <a href=\"https://github.com/woocommerce/wc-admin\">WC-Admin</a>.</p>\n<img />New WooCommerce Dashboard\n<p>The dashboard is a landing page where store owners will be able to see at a glance how their store is doing. The new interface is powered by the React JavaScript framework, specifically the React components that are part of the Gutenberg project. It&#8217;s modular, allowing users to add, move, and remove blocks. Developers will be able to extend the dashboard and provide custom blocks.</p>\n<p>In addition to the new interface, reports are being overhauled. Store owners will be able to filter data, compare date records, have easy access to important data points, and download reports in CSV format. The Activity Panel has been completely redesigned and will be accessible from any page in the WooCommerce backend.</p>\n<img />WooCommerce Activity Panel\n<p>The activity panel will also house a Notifications area that acts as an email Inbox. Developers will be able to add notifications from their extensions using the WooCommerce REST API endpoints.</p>\n<img />WooCommerce Notifications Panel\n<p>To see WC-Admin in action, you&#8217;ll need to download the <a href=\"https://github.com/woocommerce/wc-admin\">feature plugin</a> and run it in a test environment. The WooCommerce team does not recommend using it in a production environment.</p>\n<p>Once it reaches beta, the plugin will be made available on WordPress.org to allow a larger audience to test it before being merged into WooCommerce core. The plugin is scheduled to hit beta in early 2019 with new features being merged in the first quarter of 2019.</p>\n<p>Similar to Gutenberg development where progress updates were published to the Make Core Developer blog every week or every other week, the WooCommerce team plans to publish progress updates every two weeks on its <a href=\"https://woocommerce.wordpress.com/\">developer blog</a>. With these improvements, WooCommerce is another reason for developers to learn JavaScript deeply.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 19 Oct 2018 02:49:41 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:38;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:111:\"WPTavern: Learn How to Build an Interactive Prototype with Dave Martin’s Free JavaScript for Designers Course\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=84685\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:119:\"https://wptavern.com/learn-how-to-build-an-interactive-prototype-with-dave-martins-free-javascript-for-designers-course\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2439:\"<p><a href=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2018/10/Screen-Shot-2018-10-18-at-1.23.18-PM.png?ssl=1\"><img /></a></p>\n<p>Product designer <a href=\"http://davemart.in/\" rel=\"noopener noreferrer\" target=\"_blank\">Dave Martin</a> has published a free video course called <a href=\"http://jsfordesigners.davemart.in/\" rel=\"noopener noreferrer\" target=\"_blank\">JavaScript for Designers</a>. The course is made up of 46 bite-sized videos that walk students through the basics via a hands-on tutorial for building an interactive HTML prototype.</p>\n<p>Martin said he created the course specifically for designers who have been putting off learning how to code with JavaScript. He focused on concepts that are applicable to designers in their jobs, teaching skills that help them communicate to developers exactly how they want an app to behave.</p>\n<p>Coming from a designer&#8217;s perspective, Martin said most JavaScript tutorials are &#8220;dry and boring,&#8221; because they are written by developers. Ordinarily, these types of courses begin with JavaScript&#8217;s historical roots and progress from variables to arrays to objects, losing many learners along the way. Martin&#8217;s course is built more like a tutorial. Students will replicate some of the functionality found in a site like Dribbble. At the end, students should have a sufficient foundation of JavaScript that enables them to build an interactive HTML prototype.</p>\n<p>One of the other important ways this course is different is that the giant &#8220;Get Started&#8221; button on the page doesn&#8217;t take you to a registration form or make you sign up for dripped emails. It simply scrolls down the page so you can dive into the videos. Participants can download the code and follow along with the tutorial.</p>\n<p>Today&#8217;s announcement from WooSesh that WooCommerce is testing its new Javascript-driven interface is just another reminder that JavaScript is overtaking modern UI design and architecture. JavaScript knowledge is going to become increasingly in demand, and designers who have a decent grasp of it will land themselves higher paying positions. Even if you&#8217;re not a designer, Martin&#8217;s course may hold your interest better than traditional JavaScript beginners&#8217; courses. Check out the videos at <a href=\"http://jsfordesigners.davemart.in/\" rel=\"noopener noreferrer\" target=\"_blank\">jsfordesigners.davemart.in</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 18 Oct 2018 19:13:34 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:39;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:80:\"WPTavern: WPWeekly Episode 334 – Accessibility, Gutenberg, and Twenty Nineteen\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"https://wptavern.com?p=84845&preview=true&preview_id=84845\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:85:\"https://wptavern.com/wpweekly-episode-334-accessibility-gutenberg-and-twenty-nineteen\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1849:\"<p>In this episode, <a href=\"http://jjj.me\">John James Jacoby</a> and I have a lengthy discussion about the numerous Accessibility concerns being raised by members of the community. We also talk about the WordPress 5.0 release date, tempers flaring in the WordPress core Slack channel, dealing with political situations within the WordPress project, and more. We share our thoughts on the Twenty Nineteen default theme and provide a quick update on the status of WooCommerce 3.5.</p>\n<h2>Stories Discussed:</h2>\n<p><a href=\"https://wptavern.com/wordpress-accessibility-team-lead-resigns-cites-political-complications-related-to-gutenberg\">WordPress Accessibility Team Lead Resigns, Cites Political Complications Related to Gutenberg</a><br />\n<a href=\"https://wptavern.com/first-look-at-the-twenty-nineteen-default-theme\">First Look at The Twenty Nineteen Default Theme</a><br />\n<a href=\"https://woocommerce.wordpress.com/2018/10/16/important-update-woocommerce-3-5-will-now-be-released-october-23rd/\">Important update: WooCommerce 3.5 will now be released October 23rd.</a><br />\n<a href=\"https://w3techs.com/technologies/overview/content_management/all\">WordPress Now at 32%</a></p>\n<h2>WPWeekly Meta:</h2>\n<p><strong>Next Episode:</strong> Wednesday, October 24th 3:00 P.M. Eastern</p>\n<p>Subscribe to <a href=\"https://itunes.apple.com/us/podcast/wordpress-weekly/id694849738\">WordPress Weekly via Itunes</a></p>\n<p>Subscribe to <a href=\"https://www.wptavern.com/feed/podcast\">WordPress Weekly via RSS</a></p>\n<p>Subscribe to <a href=\"http://www.stitcher.com/podcast/wordpress-weekly-podcast?refid=stpr\">WordPress Weekly via Stitcher Radio</a></p>\n<p>Subscribe to <a href=\"https://play.google.com/music/listen?u=0#/ps/Ir3keivkvwwh24xy7qiymurwpbe\">WordPress Weekly via Google Play</a></p>\n<p><strong>Listen To Episode #334:</strong><br />\n</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 18 Oct 2018 14:40:00 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:40;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:62:\"WPTavern: Gutenberg Accessibility Audit Postponed Indefinitely\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=84781\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"https://wptavern.com/gutenberg-accessibility-audit-postponed-indefinitely\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:10590:\"<a href=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2015/01/red-pen.jpg?ssl=1\"><img /></a>photo credit: <a href=\"https://www.flickr.com/photos/pollas/526544001/\">pollas</a> &#8211; <a href=\"http://creativecommons.org/licenses/by-nc-sa/2.0/\">cc</a>\n<p>Discussion surrounding Gutenberg&#8217;s independent accessibility audit is heating up. Two weeks ago, Matthew MacPherson, who was named WordPress 5.0&#8217;s new accessibility lead, <a href=\"https://github.com/WordPress/gutenberg/issues/10318\" rel=\"noopener noreferrer\" target=\"_blank\">proposed the audit</a> and agreed to it being performed by an independent third party. The audit had gained strong support among accessibility contributors and others following the ticket.</p>\n<p>After soliciting detailed proposals from four companies, MacPherson has since rescinded the offer to coordinate the audit at this time and it seems he was unaware that he didn&#8217;t have the authority to authorize it in the first place.</p>\n<p>&#8220;For at least the time being, Automattic has decided to forgo conducting an Accessibility audit on Gutenberg,&#8221; MacPherson said. He cited the following reasons:</p>\n<ol>\n<li>&#8220;an audit will not be actionable given our release timeline, because…</li>\n<li>the audit will not affect release timing, so&#8230;</li>\n<li>it would be more prudent to explore an audit on a less rushed timeline in the future&#8221;</li>\n</ol>\n<p>MacPherson apologized for &#8220;getting hopes up and then failing the community&#8221; on this particular issue. He is supportive of getting an audit but it is not a priority to complete before Gutenberg&#8217;s merge proposal.</p>\n<p>&#8220;I&#8217;m hopeful we&#8217;ll explore an audit going forward, but unfortunately it will not happen before the merge proposal and thus I&#8217;m closing this issue as a won&#8217;t fix,&#8221; MacPherson said. &#8220;I would still like to blog about the state of Gutenberg accessibility, both the good and the bad. We&#8217;re making some improvements to keyboard navigation, color contrast, focus behavior, and date/color-pickers just this week.&#8221;</p>\n<p>Those following the ticket were disappointed in the decision and several heated replies have been hidden and/or moderated. The issue has since been locked and unlocked several times since the announcement that Automattic has decided to forgo the audit.</p>\n<p>&#8220;Literally every person with disabilities who has tested Gutenberg, both recently and at the outset, has flagged blocking issues as to why it&#8217;s not accessible,&#8221; Accessibility team member Amanda Rush said. &#8220;And user testing is just as important to accessibility as is WCAG 2.0 level AA compliance.&#8221;</p>\n<p>Because MacPherson said the decision came from Automattic, dissidents on the other side of the issue are saying that the company is acting in its own interests, as the decision was delivered without much explanation beyond an audit not fitting into Gutenberg&#8217;s timeline.</p>\n<blockquote class=\"twitter-tweet\">\n<p lang=\"en\" dir=\"ltr\">Gutenberg appears to be a commercially-driven add-on primarily intended for a8c’s benefit and should probably be treated as such by the community wherever that isn’t already true. <a href=\"https://t.co/c3yFImB5XL\">pic.twitter.com/c3yFImB5XL</a></p>\n<p>&mdash; Another Day, Another Doug (@zamoose) <a href=\"https://twitter.com/zamoose/status/1052033672952598528?ref_src=twsrc%5Etfw\">October 16, 2018</a></p></blockquote>\n<p></p>\n<blockquote class=\"twitter-tweet\">\n<p lang=\"en\" dir=\"ltr\">So disappointed in <a href=\"https://twitter.com/automattic?ref_src=twsrc%5Etfw\">@automattic</a>’s decision to forego an independent accessibility audit for Gutenberg. Shipping with known issues is the wrong way to go. Users with disabilities are more important than that! <a href=\"https://t.co/Z4diHmv4GX\">https://t.co/Z4diHmv4GX</a></p>\n<p>&mdash; Marcy Sutton (@marcysutton) <a href=\"https://twitter.com/marcysutton/status/1052307597192126464?ref_src=twsrc%5Etfw\">October 16, 2018</a></p></blockquote>\n<p></p>\n<p>&#8220;The idea of accessibility being punted to meet a release deadline is what people have been worried about for over a year, and those concerns have not been alleviated,&#8221; Morten Rand-Hendriksen said during a recent Accessibility team meeting on Slack before the audit was post-poned. &#8220;A clear message about what would happen should the audit come back with substantial issues and recommendations would greatly improve communication and take some of the tension out of the conversation in my opinion.&#8221;</p>\n<p>In response to one contributor asking how the audit might affect Gutenberg&#8217;s timeline, MacPherson <a href=\"https://github.com/WordPress/gutenberg/issues/10318#issuecomment-429154806\" rel=\"noopener noreferrer\" target=\"_blank\">said</a> he doesn&#8217;t have veto power over the release, nor does he have the data to make that assessment.</p>\n<p>&#8220;I&#8217;m still not convinced there are sufficient Accessibility issues that prevent a release,&#8221; MacPherson said. &#8220;If the second point changes, I&#8217;ll relay that info. I plan to be an advocate, but I don&#8217;t set the timelines and I also don&#8217;t have solid data around accessibility. That&#8217;s the point of the audit: so we can speak from a place of hard data.&#8221;</p>\n<p>An independent accessibility audit would have revealed whether the team&#8217;s current perceptions of Gutenberg&#8217;s lack of accessibility are accurate or inflated. It would also give the team&#8217;s new leadership the data he needs in order to make the most accurate recommendations regarding its readiness for the world. Kevin Hoffman advocated for pushing on with the audit regardless, in case WordPress 5.0 comes on a later timeline.</p>\n<p>&#8220;The January 22, 2019 date would allow more than three months between today and the release of 5.0 to complete an audit and take action,&#8221; Hoffman said. &#8220;The reasons above suggest that we cannot get an audit completed and significantly improve accessibility in three months time. If true, that is all the more reason to start the process now and respond to the audit by fixing as many issues as we can before 5.0 releases.</p>\n<p>&#8220;The idea that the timeline will become less rushed after 5.0 (when it&#8217;s in the hands of real-world users who need it most) makes no sense at all.&#8221;</p>\n<blockquote class=\"twitter-tweet\">\n<p lang=\"en\" dir=\"ltr\">As a blind <a href=\"https://twitter.com/hashtag/WordPress?src=hash&ref_src=twsrc%5Etfw\">#WordPress</a> user &amp; sometime dev I really appreciate your work &amp; it is a real tragedy that the leaders of WordPress &amp; this project didn\'t build in <a href=\"https://twitter.com/hashtag/a11y?src=hash&ref_src=twsrc%5Etfw\">#a11y</a> from the very beginning &#8211; Any good team knows it is much harder to fix in hindsight</p>\n<p>&mdash; Dale Reardon (@DaleReardon) <a href=\"https://twitter.com/DaleReardon/status/1049640723887185925?ref_src=twsrc%5Etfw\">October 9, 2018</a></p></blockquote>\n<p></p>\n<blockquote class=\"twitter-tweet\">\n<p lang=\"en\" dir=\"ltr\">Absolutely this. Like most prior <a href=\"https://twitter.com/hashtag/WordPress?src=hash&ref_src=twsrc%5Etfw\">#WordPress</a> admin functionality, <a href=\"https://twitter.com/hashtag/Gutenberg?src=hash&ref_src=twsrc%5Etfw\">#Gutenberg</a> has been designed and built with hardly any thought for <a href=\"https://twitter.com/hashtag/a11y?src=hash&ref_src=twsrc%5Etfw\">#a11y</a>. And the WP A11y Team have been left the job of trying to help retrofit it. This always ends badly &#8211; in burn out, and half-baked solutions. <a href=\"https://t.co/UKMR442gM5\">https://t.co/UKMR442gM5</a></p>\n<p>&mdash; CoolfieldsConsulting (@coolfields) <a href=\"https://twitter.com/coolfields/status/1049912989112000512?ref_src=twsrc%5Etfw\">October 10, 2018</a></p></blockquote>\n<p></p>\n<p>While Twitter&#8217;s court of public opinion cannot answer the question of whether or not Gutenberg is accessible, an independent audit would give contributors a good shot at resolving the most critical issues.</p>\n<p>&#8220;I really like the idea of a professional audit, though I don&#8217;t recall us ever doing one of these in WordPress, certainly not a condition for a release,&#8221; Gutenberg merge lead Gary Pendergast said. &#8220;I&#8217;d love to see something like it happen at some point. WordPress has always tried to get most of the way there on accessibility by sticking to common patterns and semantics, with the difference covered by key efforts of volunteers everyone on the Accessibility team doing testing and filing actionable bug reports. Gutenberg&#8217;s move to being an entirely JavaScript-based application has made it harder to apply those patterns, but we can work together to establish new patterns, a new baseline.&#8221;</p>\n<p>Although there is no precedent for it, in this instance where Automattic&#8217;s perception of the editor&#8217;s accessibility differs wildly from that of the community, an outside audit might mitigate some of the conflict surrounding the issue.</p>\n<p>Pendergast said that despite best intentions and prioritizing accessibility, there is a possibility the Gutenberg team may not be able to deliver an &#8220;acceptable UX for assistive technology users by the time 5.0 is released.&#8221;</p>\n<p>&#8220;I&#8217;m sorry,&#8221; Pendergast said. &#8220;Despite the best intentions of everyone on the Gutenberg team, we haven&#8217;t done enough. I can honestly say that accessibility has always been a priority, but it hasn&#8217;t been a high enough priority, and we&#8217;ve done a poor job of communicating where accessibility has been improved. I mentioned some of those improvements in my earlier comment, but those improvements are of no benefit if we haven&#8217;t hit the baseline accessible experience.&#8221;</p>\n<p>The challenge of building in accessibility at the design stage, instead of retrofitting it after the fact, is one that WordPress is still struggling to get right in the Gutenberg era. Accessibility experts with React skills are few and far between, so it&#8217;s not easy to get fixes for all the issues testers are finding.</p>\n<p>&#8220;In some meetings we’ve discussed how to make accessibility integrated in the design process (design in its broader sense) since the beginning,&#8221; Accessibility specialist Andrea Fercia said during the team&#8217;s most recent meeting on Slack. &#8220;This is certainly an area were our communication and knowledge sharing should improve.&#8221;</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 17 Oct 2018 22:16:30 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:41;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:57:\"WPTavern: First Look at The Twenty Nineteen Default Theme\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=84808\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:68:\"https://wptavern.com/first-look-at-the-twenty-nineteen-default-theme\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2272:\"<p><a href=\"https://www.allancole.com/\">Allan Cole</a>, a WordPress Theme Imagineer at Automattic has published the <a href=\"https://make.wordpress.org/core/2018/10/16/introducing-twenty-nineteen/\">first glimpses</a> of the Twenty Nineteen default theme slated to ship with WordPress 5.0. Cole is leading the theme while <a href=\"https://kjellr.com/\">Kjell Regstad</a> who does Product and Editorial Design at Automattic will be a design coach.</p>\n<div class=\"wp-block-image\">\n<img />Twenty Nineteen Blog Post Layout\n</div>\n<p>The theme takes a minimalist approach that&#8217;s a good fit for writers and can be adapted for simple business sites as well. Twenty Nineteen doesn&#8217;t have a sidebar but will have an area in the footer to display widgets.</p>\n<p>The theme will have full compatibility with Gutenberg when it&#8217;s released. It will also contain Front-end and Back-end editor styles. This will allow the presentation of content in the back-end to closely resemble how the finished product will look like. </p>\n<p>Twenty Nineteen is based on the <a href=\"https://github.com/Automattic/_s/\">Underscores</a> and <a href=\"https://github.com/WordPress/gutenberg-starter-theme\">Gutenberg starter themes</a>. SASS is used to keep styles in-sync between Gutenberg and the front-end experience which Cole notes is, &#8220;not usual for a default theme and open to debate.&#8221; </p>\n<p>With WordPress 5.0 scheduled for a November release, Twenty Nineteen is on a fast track development cycle. A release candidate is expected to be available at the end of this month. </p>\n<p>To keep tabs on development, you can monitor the <a href=\"https://github.com/WordPress/twentynineteen\">project&#8217;s GitHub page</a>. GitHub will be used to develop Twenty Nineteen until it&#8217;s ready to be merged into core. At that time, the GitHub page will be deprecated as development moves to WordPress Core Trac. </p>\n<p>Dev meetings that last a half-hour will take place every Tuesday at 12PM EDT in the <a href=\"https://make.wordpress.org/core/tag/core-themes/\">#core-themes</a> Slack channel. It&#8217;s worth noting that if Twenty Nineteen is not ready in time for the planned November 19th, release of WordPress 5.0, it will be removed and released at a later date.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 17 Oct 2018 02:45:30 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:42;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:79:\"WPTavern: ACF 5.8 Beta 1 Introduces Blocks Feature, Release Slated for November\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=84754\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:89:\"https://wptavern.com/acf-5-8-beta-1-introduces-blocks-feature-release-slated-for-november\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2092:\"<a href=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2018/10/blocks.jpg?ssl=1\"><img /></a>photo credit: Adabo! <a href=\"http://www.flickr.com/photos/34731278@N05/36299849102\">3d printed tetris blocks</a> &#8211; <a href=\"https://creativecommons.org/licenses/by-nc-sa/2.0/\">(license)</a>\n<p>Advanced Custom Fields is now actively testing its new block creation feature in <a href=\"https://www.advancedcustomfields.com/blog/acf-5-8-introducing-acf-blocks-for-gutenberg/\" rel=\"noopener noreferrer\" target=\"_blank\">ACF 5.8 beta 1</a>, released this week. ACF Blocks is a feature aimed at PHP developers who have not taken the deep dive into JavaScript yet. It essentially offers a shortcut to creating custom blocks using PHP and HTML instead of JavaScript.</p>\n<p>&#8220;We believe that ACF Blocks is one of the more important features ever added to our plugin,&#8221; ACF representative Eric Karkovack said. &#8220;It levels the playing field and allows more developers to take advantage of Gutenberg’s key feature.&#8221; The feature was designed to allow WordPress developers who use ACF to maintain their current workflow for extending the editor.</p>\n<p>ACF Blocks allows developers to register a custom block type from a functions.php file. From there they can create a field group and use any ACF fields in the block. Rendering the block is the same process that&#8217;s used for displaying custom fields, with the notable addition of wrapping the HTML + PHP in a function.</p>\n<p>The ACF team plans to include the new blocks feature in version 5.8, which is anticipated to arrive in November.</p>\n<p>Creating custom blocks in this way seems like a stopgap measure for developers who haven&#8217;t had the time to learn how to extend Gutenberg before WordPress 5.0 arrives. This feature may be a useful abstraction for those who need to maintain their current workflow with ACF but it postpones the inevitable for developers who want to be truly proficient at extending the new editor. JavaScript skills will be required to properly understand what is going on under the hood.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 16 Oct 2018 18:05:09 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:43;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"Matt: The Importance of Meeting In-Person\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"https://ma.tt/?p=48528\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"https://ma.tt/2018/10/the-importance-of-meeting-in-person/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4259:\"<p>I recently returned from Orlando where Automattic hosted its annual Grand Meetup where nearly all of our 800 employees from around the world, spend a week together in the same place. (And yes, <a href=\"https://automattic.com/work-with-us/\">we&#8217;re hiring</a>.)<br /></p>\n\n\n\n<p>Despite being a fully distributed company, I believe it&#8217;s still important to meet face-to-face — just not every day, in the same office. The Grand Meetup is our chance to get to know the people behind the Slack avatars and <a href=\"https://intenseminimalism.com/2015/distributed-companies-the-importance-of-meeting-face-to-face/\">build relationships</a> that can carry us through other 51 weeks of the year, when we’re working from more than 65 countries. It&#8217;s so much easier to hear the nuance in someone&#8217;s chat messages or <a href=\"https://p2theme.com/\">p2 posts</a> if you&#8217;ve <a href=\"https://www.instagram.com/p/BojFXGelvzn/\">hung out with them at Harry Potter World</a>, or learned about their family, pets, and hobbies during a flash talk. <br /></p>\n\n\n\n<img src=\"https://lh4.googleusercontent.com/KjkOXxAo8T4JitC7jv38GmvxSEAIx4KSQRLty5yfgDmvBVEU-cVLBNxAeStjDjFjIZM6wn0kEYmtUkKheddr3BggN2WAQ9b4IJTb2Kyu6J80zFbpW1oOpDrG8j-JCsshDPHch8VV\" alt=\"\" />Photo by&nbsp;<a href=\"https://pauljacobson.me/\">Paul Jacobson</a>\n\n\n\n<p>The week can be mentally exhausting, given that you&#8217;re often meeting many people for the first time. But we urge people to take it at their own pace, and the results are well worth the effort. Our <a href=\"https://data.blog/2017/04/12/welcoming-new-colleagues-a-data-based-story/\">data team actually studied the impact of the Grand Meetup</a> on our work relationships &#8212; the connections established between coworkers using our “Meetamattician” tool <a href=\"https://qz.com/work/1289444/automattics-secret-to-successful-remote-work-is-having-everyone-meet-in-person/\">were demonstrably closer</a> after the meetup: <br /></p>\n\n\n\n<img src=\"https://lh6.googleusercontent.com/x2WKDviUT-kk-M2WzbvBEmbJvSFs5oVQXcK2tze3t3ABJd291cUDxcBX31RlahdCYd4982ZUBQoEhUr5hrcxfpyBB-lbmBk2Vk7M_3eTh5vLbeo_kLD7ayLY0e1WJdgQXHucP2MF\" alt=\"\" />Before the Grand Meetup.\n\n\n\n<img src=\"https://lh6.googleusercontent.com/t7crZ1H36rX0wveq29-q6ue7zVDDcAcV76UZPXQCNJygxix45Lc3GoPyJrGKatP8Zd_J_En3NfIEC8fWnEKLM-QF8CzT-KCBE_vK_ta4Q1omQ-4ClI8xI5LjEMLVKBvS0H0dRfeM\" alt=\"\" />After the Grand Meetup.\n\n\n\n<p>This year we were proud to welcome some incredible keynote speakers: <em><a href=\"https://www.indiebound.org/book/9780307476074\">Wild</a></em> author <a href=\"http://www.cherylstrayed.com/\">Cheryl Strayed</a> talking about creativity and writing; <a href=\"https://ma.tt/2018/06/automattics-first-new-board-member-general-ann-dunwoody/\">Automattic board member Gen. Ann Dunwoody</a>, the first woman in U.S. Army history to achieve the four-star officer rank; <a href=\"https://lessdoing.com/\">Ari Meisel</a> on delegating and automating your life; and Dan Harris, author of <a href=\"https://www.10percenthappier.com/\"><em>10% Happier</em></a>, on the panic attack that led him to embrace meditation and mindfulness.<br /></p>\n\n\n\n<div class=\"wp-block-embed__wrapper\">\n<a href=\"https://www.instagram.com/p/BoZatKgFmW7/\" title=\"View on Instagram\" target=\"_blank\"><img src=\"http://instagr.am/p/BoZatKgFmW7/media/?size=l\" alt=\"Instagram Photo\" /></a>\n</div>Photo by&nbsp;<a href=\"https://leif.me/\">Leif Singer</a>\n\n\n\n<img src=\"https://lh5.googleusercontent.com/mazbsxl25hryG27trCrw-zpjBTcfHfI2tOsZYMxOzEynrNuDlJTQosWqw24dTTCDEHDXoFoh2yDWt-vc77RlTZxF3rB_dCNec1nWs2b49oAehR4hPPwIagU4Cj8Wli9nOu-zE3R_\" alt=\"\" />Ann Dunwoody. Photo by&nbsp;<a href=\"https://luca.blog/\">Luca Sartoni</a>\n\n\n\n<img src=\"https://lh3.googleusercontent.com/zq0pB7AUQDxdfSt_HWwz1aJfeFCF4sf2gB9Dwq_KMocsKThcedHSujsFv-P69VdnJAP-_XjyrarzLhT-AYzUryJkrE7t2jFiACT5mEmizslJ8I29laplSzIKqB4jUefXxqdAHyRv\" alt=\"\" />Ari Meisel. Photo by&nbsp;<a href=\"https://luca.blog/\">Luca Sartoni</a>\n\n\n\n<div class=\"wp-block-embed__wrapper\">\n<a href=\"https://www.instagram.com/p/BojgfYzA7px/\" title=\"View on Instagram\" target=\"_blank\"><img src=\"http://instagr.am/p/BojgfYzA7px/media/?size=l\" alt=\"Instagram Photo\" /></a>\n</div>Photo by&nbsp;<a href=\"https://www.instagram.com/jsscga/\">jessicacg</a>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 16 Oct 2018 16:40:50 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:44;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:100:\"WPTavern: WordPress Privacy Contributors Begin Work on V2 Roadmap, Form Cross-Platform Working Group\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=84759\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:110:\"https://wptavern.com/wordpress-privacy-contributors-begin-work-on-v2-roadmap-form-cross-platform-working-group\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:6584:\"<a href=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2018/10/privacy.jpg?ssl=1\"><img /></a>photo credit: Infosec Images <a href=\"http://www.flickr.com/photos/136770128@N07/41737510115\">Privacy blue</a> &#8211; <a href=\"https://creativecommons.org/licenses/by/2.0/\">(license)</a>\n<p>Contributors to WordPress&#8217; core <a href=\"https://make.wordpress.org/core/components/privacy/\" rel=\"noopener noreferrer\" target=\"_blank\">Privacy component</a> are <a href=\"https://make.wordpress.org/core/2018/10/11/whats-new-in-core-privacy/\" rel=\"noopener noreferrer\" target=\"_blank\">collaborating on a V2 roadmap</a> to address broader privacy and data protection issues that fall outside of legal requirements. The group organized at the beginning of the year to work on GDPR-specific objectives but has since expanded its scope to tackle concerns that are not attached to any specific piece of legislation.</p>\n<p>The Privacy team meets weekly and has approximately a dozen contributors who show up regularly to work on tickets and issues. The working <a href=\"https://docs.google.com/document/d/1EaEHY7dDovDZDdp05VZKH-obGZdH6bdUxGZsQ03OMRc/edit\" rel=\"noopener noreferrer\" target=\"_blank\">V2 roadmap</a> identifies a list of common international privacy concerns, such as data minimization, data integrity, transparency and notice, and contributors will explore their impact on a few core focus areas:</p>\n<ul>\n<li>Core privacy features\n<ul>\n<li>Gravatar privacy controls</li>\n<li>Embed privacy controls</li>\n</ul>\n</li>\n<li>Plugin privacy\n<ul>\n<li>For administrators</li>\n<li>For developers</li>\n</ul>\n</li>\n<li>Consent and logging</li>\n<li>WP-CLI support</li>\n<li>Multisite support</li>\n</ul>\n<p>The team has agreed to use a <a href=\"https://github.com/webdevlaw/open-source-privacy-standards/blob/master/privacy-by-design.md\" rel=\"noopener noreferrer\" target=\"_blank\">Privacy by Design (PbD)</a> approach, which uses a proactive framework to anticipate privacy issues before they are a problem for the user.</p>\n<p>Privacy team contributors are also monitoring two specific pieces of legislation that may impact WordPress site owners in 2019 &#8211; the <a href=\"https://iapp.org/resources/topics/california-consumer-privacy-act/\" rel=\"noopener noreferrer\" target=\"_blank\">US California Consumer Privacy Act</a> (CCPA), and the <a href=\"https://ec.europa.eu/digital-single-market/en/proposal-eprivacy-regulation\" rel=\"noopener noreferrer\" target=\"_blank\">EU ePrivacy Directive overhaul</a>. They plan to examine specific requirements once that information is available and will assist site owners in reaching compliance.</p>\n<h3>New Privacy Working Group to Facilitate Collaboration across Open Source Communities</h3>\n<p>At Drupal Europe 2018 a group of WordPress and Drupal contributors met to discuss the possibility of welcoming teams from major open source projects to work together on shared concerns. WordPress Privacy team contributor Heather Burns attended the first test run of the working group in the Open Source Lounge at the conference.</p>\n<p>&#8220;For the working group we have the big three &#8211; Drupal, WordPress, and Joomla &#8211; and we also spoke with representatives from the smaller projects like Neos and Typo3,&#8221; Burns said. &#8220;We&#8217;re all dealing with similar issues but from different approaches.&#8221;</p>\n<p>Burns said one of the goals of the working group is to push the idea forward that privacy is a common, positive, proactive value which can be taught and shared across projects. Members will discussion questions like whether privacy fixes belong in core or modules, how privacy notices pull information from different plugins and modules, and what laws are coming up that would require open source CMSs to build in some functionality in advance.</p>\n<p>&#8220;It&#8217;s a way of pooling resources, code libraries, and briefings, as well as giving us a forum to share experiences,&#8221; Burns said. &#8220;For example, we&#8217;re going to arrange for Drupal&#8217;s privacy lead to give a live video demo of their GDPR tools to our core group, and we&#8217;re going to do the same for them.&#8221;</p>\n<p>The privacy working group is being set up through the Drupal community structure and members are in the process of coordinating some funding. More information on funding will be available in the next few weeks.</p>\n<h3>Privacy Contributors Seek to Change the Perception of Privacy to a Positive, Proactive Value</h3>\n<p>In addition to collaborating across the broader open source community, the privacy working group endeavors to educate their communities on the inherent value of privacy instead of simply focusing on the consequences of companies being forced to pay a fee if they don&#8217;t meet legal obligations.</p>\n<p>&#8220;We&#8217;re very keen to also shift the perception of what privacy is, and that it&#8217;s not just seen as being about negative legal obligations for GDPR, CCPA, etc.,&#8221; Burns said. &#8220;We want people to think of privacy like accessibility: just the right thing to do for user protection.&#8221;</p>\n<p>Burns speaks about privacy at WordPress and Drupal conferences and how projects can have differing cultural, historical, and legal approaches to privacy. Cultural barriers to the recognition of privacy as a core value is one of the privacy team&#8217;s biggest challenges in advocating contributions that respect and protect users&#8217; rights.</p>\n<p>&#8220;What I&#8217;m proudest of this year is helping people to understand each other better,&#8221; Burns said. &#8220;We all come to the table assuming we share the same cultural, historical, and legal views of what privacy means and what role it should play, when the truth is there are wildly different views held even within project teams.</p>\n<p>&#8220;To paraphrase that awful quote, we don&#8217;t know what we don&#8217;t know. What I do is help people to understand where we&#8217;re all coming from and what we don&#8217;t actually know. From there, I define what a healthy approach to privacy should involve outside reactive legal obligations, using a methodology derived from a number of international frameworks and treaties on privacy. It&#8217;s a matter of inspiring people to realize that as open source project contributors, we are people of enormous power and influence over privacy on the web. The actions we take within our projects, however small, can help to protect people from those who would use their data to hurt them. That&#8217;s the most important thing any developer can ever do.&#8221;</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 16 Oct 2018 00:30:58 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:45;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:69:\"WPTavern: Contributing to Gutenberg: A New Contributor’s Experience\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=84718\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:76:\"https://wptavern.com/contributing-to-gutenberg-a-new-contributors-experience\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:7967:\"<div class=\"wp-block-image\">\n<img />\n</div>\n<p>The following is a guest post by <a href=\"https://twitter.com/ChrisVanPatten\">Chris Van Patten</a> who shares his experience learning and contributing to Gutenberg. There&#8217;s been a lot of talk of Gutenberg&#8217;s higher barrier to entry for new contributors.  Van Patten is the founder of <a href=\"https://tomodomo.co\">Tomodomo</a>, a digital agency for magazine publishers. </p>\n<hr class=\"wp-block-separator\" />\n<p>Over the past few months, but especially over the last few weeks, there has been extensive conversation about the barriers to entry present in contributing to the upcoming Gutenberg editor for WordPress.</p>\n<p>Of course, everyone&#8217;s experiences are subjective and unique. I can&#8217;t pretend to understand what everyone has felt. But my experience has been different than what some folks have been articulating, and I wanted to share my own take.</p>\n<h1>The Early Days</h1>\n<p>I&#8217;ve used WordPress for close to half my life; almost 15 years now. I remember some of the earliest versions of WordPress: the classic theme, the advent of Kubrick, MP6, up through today.</p>\n<div class=\"wp-block-image\">\n<img />Early Days of the WordPress Backend\n</div>\n<p>Like many in the community, I&#8217;m entirely self-taught. I have no background in computer science, and have no formal instruction under my belt. I picked up code through trial-and-error, tweaking files and breaking my site as I wanted to make changes.</p>\n<p>Since those early days, WordPress was always my CMS of choice both for personal projects and for clients with my agency Tomodomo. But even though I had committed to the WordPress platform, my contributions back were limited.</p>\n<p>The rules, rituals, and etiquette around posting on Trac seemed arcane and illegible. To this day, I could not make an SVN patch if my life depended on it. And much of the core code, imbued with years of history and backwards compatibility, was hard for me to pick apart.</p>\n<p>So instead, I contributed in other ways: open sourcing simple custom plugins I was building, organizing WordCamps and meetups, and speaking at WordCamps around the globe. But it always bothered me that I couldn&#8217;t find a way to get those elusive &#8216;props&#8217;.</p>\n<p>(Okay, so I did actually get props on one release, but I am convinced it was a mistake; I had neither opened the ticket or provided a patch.)</p>\n<h1>Going… Going… Gutenberg</h1>\n<p>When I first learned about Gutenberg and started exploring, I was apprehensive. At first it seemed scary. My JavaScript abilities didn&#8217;t extend beyond jQuery. React was inscrutable and it seemed like I&#8217;d need a doctorate to understand some of the ideas behind it. I still don&#8217;t understand how Webpack works its magic. Does anyone, really?</p>\n<p>But the possibilities of the new block interface were too enticing to ignore, so I started diving in and figuring out how it worked. In those halcyon days (aka earlier this year), Gutenberg was still pretty rough around the edges, and there were a lot of opportunities for improvement. I started lurking on the GitHub repo, reading issues, examining the code, and generally trying to wrap my head around what the heck was going on.</p>\n<p>As I was playing around with Gutenberg for a client project, I started reporting issues: simple things, like user interface bugs. I started commenting on tickets, usually offering suggestions for a particular feature, trying to advocate from the perspective of independent developers.</p>\n<p>I even <a href=\"https://github.com/WordPress/gutenberg/pull/6855\">filed my first pull request</a>! It was simple. I updated the README to include the day and time of the weekly #core-editor meeting (Wednesdays at 1pm UTC, if you&#8217;re wondering). It was an inauspicious beginning, but I was excited to get it merged.</p>\n<p>Over time, my knowledge grew. It was like my early days in web development, learning a CSS property here, and an HTML element there. I learned what a component was and how you could reuse them in different situations. I learned about JSX, and ES6, and some of the other crazy acronyms you encounter in Gutenland.</p>\n<p>As I was building more with Gutenberg, I was also finding new ways to <em>build Gutenberg itself</em>. I was able to understand more of the discussions, and offer my thoughts and suggestions. I started opening pull requests, largely dealing with design issues but also solving small bugs and quirks. I made a point of attending the weekly meeting I had previously added to the README, chiming in when I felt I had more perspective to share.</p>\n<p>Today I have 25 new issues and 27 pull requests under my belt, in addition to dozens of comments on existing tickets. I&#8217;m a &#8216;member&#8217; of the Gutenberg team on GitHub, and try to find time every day to triage new bugs or review pull requests. It took me most of the year to get to that point and it certainly wasn&#8217;t always easy. I still have so much to learn.</p>\n<p>When I hear about how difficult it is to contribute to Gutenberg, I can&#8217;t reconcile that with my own experience. That&#8217;s not to say it&#8217;s a breeze: Gutenberg does things very differently than WordPress core, and there is undoubtedly a learning curve.</p>\n<h1>Advice for Contributing to Gutenberg</h1>\n<p>If you aren&#8217;t comfortable coding from day one, there are so many other ways to contribute. Read through issues and add your own ideas and suggestions. Try testing and replicating bug reports. Hunt through inline documentation for typos and grammar corrections. All of these are valuable, and always appreciated.</p>\n<p>As you absorb the Guten-way through osmosis, you&#8217;ll find that the code isn&#8217;t as hard as you think — it&#8217;s just different. The intelligent people who build Gutenberg have done a great job at hiding away the &#8216;computer-science&#8217; bits so the rest of us don&#8217;t have to worry about data binding and other complex ideas. I still cannot explain state management, data stores, or context APIs but I have managed to find small areas of the code to improve.</p>\n<p>This isn&#8217;t to deny anyone&#8217;s frustration or confusion with Gutenberg and its development. Documentation is still lacking in many places. Some of the APIs are unintuitive. The tooling isn&#8217;t the simplest to set up. These are real problems, and I don&#8217;t want to pretend they don&#8217;t exist; we can undoubtedly do more to make Gutenberg development easier.</p>\n<p>And of course I have privilege to check: I&#8217;m lucky to have the time to spend in the GitHub repo, experimenting with code, and participating in weekly meetings. I recognize that&#8217;s not a reality for many people.</p>\n<p>If you can&#8217;t find the time, the Classic Editor will continue to be an option, and there&#8217;s no shame in prolonging the upgrade. It may take time for the Gutenberg experience to be as intuitive as we would all like it to be, and waiting for that is totally reasonable.</p>\n<p>But if you open yourself to some new ideas about what WordPress can be, and can make the time, you may end up surprised at how easy it is to contribute. If you get stumped, pop into <a href=\"https://wordpress.slack.com/messages/core-editor/\">#core-editor</a> or the <a href=\"https://wordpress.org/support/\">forums</a>. Don&#8217;t be afraid to post a bug report or suggestion; we might consolidate it with another issue if it was previously reported, but the additional information is still valuable. Every experience matters.</p>\n<p>I&#8217;m incredibly excited about the future of WordPress with Gutenberg and to finally be a real WordPress contributor. We have a long way to go, but that means there are still many exciting ways to make a difference. The project will only get stronger with more independent community voices chiming in.</p>\n<p>I hope you&#8217;ll join us!</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sat, 13 Oct 2018 02:32:48 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:46;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"WPTavern: WordCamp for Publishers Seeks Host City for 2019\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=84683\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:69:\"https://wptavern.com/wordcamp-for-publishers-seeks-host-city-for-2019\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1634:\"<p>WordCamp For Publishers&#8217; distributed organizing team is looking for a new host city in 2019. The industry-focused camp gathers together professionals who use WordPress to manage publications. This year&#8217;s successful event hosted speakers who highlighted important topics, such as ethics in journalism, the open web, AMP, Gutenberg, and communication between tech and editorial teams.</p>\n<p>The inaugural edition of this camp was held in Denver (2017), followed by Chicago this year. A few people on social media have lobbied for cities like Los Angeles and Detroit, but the decision rests on the availability of local organizers to handle the logistics of the event. These duties include facilitating venue coordination, swag delivery, and other things that need to happen on the ground.</p>\n<p>Based on the <a href=\"https://2018-chicago.publishers.wordcamp.org/2018/09/26/help-us-host-wordcamp-for-publishers-2019/\" rel=\"noopener noreferrer\" target=\"_blank\">call for host city applications</a>, it seems that applicants do not need a large team behind them, since there&#8217;s already an existing organizing team. Applicants need only the availability to coordinate local preparations.</p>\n<p>Individuals or teams who are interested to host the event in 2019 can <a href=\"https://docs.google.com/forms/d/15HseaVsp1Dn_bZ48Y6mVN8qPcw2Kf_IigunOl6QZSPU/viewform?edit_requested=true\" rel=\"noopener noreferrer\" target=\"_blank\">submit an application</a>. Organizers said they have a preference for cities that are &#8220;underrepresented media markets&#8221; where attendees may not see as many of these types of events.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 12 Oct 2018 23:32:29 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:47;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:106:\"WPTavern: Learn How to Build JavaScript Plugins for WordPress with Riad Benguella’s Starter Kit/Tutorial\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=84528\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:114:\"https://wptavern.com/learn-how-to-build-javascript-plugins-for-wordpress-with-riad-benguellas-starter-kit-tutorial\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2542:\"<a href=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2018/10/tools.jpg?ssl=1\"><img /></a>photo credit: <a href=\"https://stocksnap.io/photo/F91K0WLE2D\">Krzysztof Puszczyński</a>\n<p>Riad Benguella, the technical lead for phase 2 of the Gutenberg project, has <a href=\"https://riad.blog/2018/10/07/lets-start-building-javascript-plugins-for-wordpress/\" rel=\"noopener noreferrer\" target=\"_blank\">published</a> an educational resource to help WordPress developers get started building JavaScript plugins. The <a href=\"https://github.com/youknowriad/wp-js-plugin-starter\" rel=\"noopener noreferrer\" target=\"_blank\">WordPress JavaScript Plugin Starter</a> is unique in that it is built as a tutorial, not just a boilerplate. The GitHub repo contains eight commits that have been structured to explain each step along the way. Benguella designed the repository to answer the following questions:</p>\n<ul>\n<li>How do I quickly setup a WordPress environment and how do I bake it into my plugin?</li>\n<li>How do I define a WordPress Plugin?</li>\n<li>How do I load a simple JavaScript script in WordPress?</li>\n<li>How do I bundle my JavaScript files?</li>\n<li>How do I use advanced JavaScript features like JSX?</li>\n<li>How do I build a production-ready version of my plugin?</li>\n<li>How does all this fit together?</li>\n</ul>\n<p>Benguella predicts a shift in the WordPress development community, as JavaScript skills become essential for extending core&#8217;s rapidly evolving JS-based UI. Plugin architecture is changing to accommodate that.</p>\n<p>&#8220;Plugin developers are required to use JavaScript more in order to extend the editor,&#8221; Benguella said. &#8220;Most blocks need to be developed using this technology. The modules Gutenberg provides (Components, data module, i18n, apiFetch…) will also encourage developers to extend other parts of WP-Admin in JavaScript. Instead of writing HTML/CSS screens from scratch and rendering them from the server, developers are able to bootstrap and prototype fully accessible new screens in WP-Admin by composing these components in a small number lines of code.&#8221;</p>\n<p>Benguella&#8217;s <a href=\"https://github.com/youknowriad/wp-js-plugin-starter\" rel=\"noopener noreferrer\" target=\"_blank\">WordPress JavaScript Plugin Starter</a> resource demystifies the plugin creation process with detailed explanations of each step throughout the readme file. It&#8217;s a valuable resource for PHP developers who are just getting started transitioning into building JavaScript plugins.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 12 Oct 2018 20:21:39 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:48;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:64:\"WPTavern: WordCamp Nordic 2019 to be Held in Helsinki, March 7-8\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=84526\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:74:\"https://wptavern.com/wordcamp-nordic-2019-to-be-held-in-helsinki-march-7-8\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:6872:\"<p><a href=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2018/10/wordcamp-nordic.png?ssl=1\"><img /></a></p>\n<p>After many years of planning, WordPress&#8217; Nordic communities are finally getting a regional WordCamp. The first <a href=\"https://2019.nordic.wordcamp.org/\" rel=\"noopener noreferrer\" target=\"_blank\">WordCamp Nordic 2019</a> is set to be held in Helsinki, Finland the weekend of March 7-8 at the <a href=\"https://www.paasitorni.fi/en/\" rel=\"noopener noreferrer\" target=\"_blank\">Paasitorni Congress Center</a>.</p>\n<p>&#8220;Some folks from the Norwegian community came up with idea in 2016,&#8221; lead organizer Marco Martins said. &#8220;Then in a WordCamp Stockholm we got people together and we discussed the idea. But it was earlier this year in WordCamp Jyväskylä (Finland) that we decided to commit to it and organize it. After that I went to Oslo to discuss personally with people from the Nordic countries and we came to an agreement. We gathered a team from the different countries and here we are.&#8221;</p>\n<p>The international organizing team is planning for approximately 600 attendees but the venue has the capacity for 800 people, if ticket demand is higher than expected. Paasitorni is an 111-year old complex brimming with historic significance. The Art Nouveau style building is also known as the Helsinki Workers&#8217; House, previously serving as leisure premises for the working class. It also provided the headquarters for the Red army during the 1918 Finnish Civil War. In the 1990&#8217;s it was remodeled to be a conference center and now includes a hotel and restaurants on premises.</p>\n<p>Finland has a stable and active WordPress community, which Martins said was one of the factors in the decision to host the first WordCamp Nordic in Helsinki. Regular meetups are held across the country in Turku, Tampere, Jyväskylä, Oulu, and Seinäjoki. The local <a href=\"https://www.meetup.com/WPHelsinki/\" rel=\"noopener noreferrer\" target=\"_blank\">WordPress Helsinki Meetup</a> group has more than 900 members with average attendance of 20-60 attendees each month.</p>\n<p>Helsinki has hosted two previous WordCamps, both averaging more than 220 attendees. Three other WordCamps were held in Turku, Tampere, and Jyväskylä, along with an unofficial <a href=\"https://wp-metsa.fi/\" rel=\"noopener noreferrer\" target=\"_blank\">WP Metsä</a> (&#8220;WP Forest&#8221;) in 2017, featuring cabins, lakes, outdoor tubs, sauna, and lightning talks by the fire. According to local organizers, Finnish camps have always sold out sponsor packages and tickets relatively fast.</p>\n<p>WordCamp Nordic will host a Contributor Day on March 7, followed by the main event on March 8. Organizers expect attendees from Sweden, Norway, Iceland, Denmark, and other countries, with likely the most attendees from Finland. All the sessions will be conducted in English.</p>\n<p>&#8220;While Nordic countries have very close ties both culturally and historically, one of the challenges we often face when thinking of attending a local WordCamp in the region is language,&#8221; co-organizer Niko Pettersen said. &#8220;Even though most Finns learn Swedish in school, the language often stays at a basic level and doesn’t extend to technical things such as WordPress. By having all of our talks in English, we’re hoping to level the playing field and hopefully attract more people from all around the world to come and listen to what these communities have to share.&#8221;</p>\n<p>Organizers are still in the process of discussing what topics they would like to see, but Pettersen said many Nordic countries tend to focus heavily on education, the environment, and healthcare. &#8220;Also with the EU Accessibility Directive coming to full effect in the coming years, I have a feeling a11y will be one of the major topics we will want to cover,&#8221; Pettersen said.</p>\n<p>WordCamp Nordic will also be hosting an informal Activity Day on March 9th where attendees will be welcome to join various activities, such as karaoke, cycling tours, trips to islands, and other other events coordinated by the community and sponsors.</p>\n<p>&#8220;It is something that Oslo has been doing informally the day after the camp and the feedback has been great so we thought it would be a good idea to have the activity day for people to do something together and experience something Finnish in more informal way,&#8221; Martins said. &#8220;We are planning the activities, but sauna for sure, because Finland.&#8221;</p>\n<p>One unique aspect of Finnish culture is the national obsession with saunas, and WordCamp Nordic organizers are ready to introduce attendees to Finland&#8217;s favorite pastime.</p>\n<p>&#8220;Traditionally saunas have been a place to cleanse the body and mind, but more recently travelers have discovered it is also a great place to meet locals, share experiences and get tips on where to go next,&#8221; Pettersen said. &#8220;If you’ve never been to one, I warmly suggest you extend your stay over the weekend as we’re planning on taking groups to some of the new public saunas in Helsinki during the Activity Day the day after the event.&#8221;</p>\n<h3>WordCamp Nordic Organizers Aim to Revitalize Local Communities by Fostering New Meetup Groups</h3>\n<p>Finland is the birth place of many open source projects, including SSH, MySQL, Linux, and IRC. WordCamp Nordic organizers hope to inspire that same spirit of collaboration among neighboring WordPress communities by hosting the regional camp.</p>\n<p>&#8220;One of the goals we listed in our initial proposal was to focus on revitalizing the local communities in the region and help to form new meetup groups by getting the organizers and interested parties together during Contributor Day,&#8221; Pettersen said. &#8220;We saw our meetup scene grow in Finland from one to six in the space of a few years largely thanks events like these and good mentoring from the community at large.&#8221;</p>\n<p>Organizers plan to keep the camp running in future years but have not yet settled on the selection process for future host cities.</p>\n<p>&#8220;As long as WordCamp Europe is organized during the summer, I have a feeling future events will be leaning towards spring/autumn or winter,&#8221; Pettersen said. &#8220;The selection process is still up for debate, but I imagine whoever feels like this is their calling will have the full support of the Nordic community to carry on where we left off.&#8221;</p>\n<p>WordCamp Nordic joins a small list of regional WordCamps that have become can&#8217;t-miss, enriching events for many in the WordPress community. Tickets will go on sale at the end of October. Follow <a href=\"https://twitter.com/WordCampNordic\" rel=\"noopener noreferrer\" target=\"_blank\">@WordCampNordic</a> on Twitter or subscribe to the newsletter to get notified.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 12 Oct 2018 04:43:49 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:49;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:70:\"WPTavern: Tiny Raises $4M in Series A Funding, Publishes Gutenberg FAQ\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=84692\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:79:\"https://wptavern.com/tiny-raises-4m-in-series-a-funding-publishes-gutenberg-faq\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4061:\"<p><!-- wp:paragraph --></p>\n<p>Tiny, the company <a href=\"https://wptavern.com/ephox-creators-of-tinymce-rebrand-to-tiny-technologies-inc\">formerly known</a> as Ephox <a href=\"https://go.tiny.cloud/blog/big-milestones-for-tiny-today/\">has raised</a> $4M in Series A funding from <a href=\"https://www.brv.com/\">BlueRun Ventures</a>. Tiny is the company behind TinyMCE, a popular text editor used in many opensource projects, including WordPress. </p>\n<p><!-- /wp:paragraph --></p>\n<p><!-- wp:paragraph --></p>\n<p>In addition to the funding, Jeff Tannenbaum, partner at BlueRun Ventures <a href=\"https://medium.com/brv-signals/how-to-find-and-invest-in-sleeping-giants-a2a3f2e7b3d3\">is joining</a> Tiny&#8217;s board of directors. The company has also launched <a href=\"https://www.tiny.cloud/developer-preview/\">Tiny Drive</a>, a preview of <a href=\"https://www.tiny.cloud/developer-preview/\">TinyMCE 5</a>, and the <a href=\"https://go.tiny.cloud/partners/\">Tiny App Directory</a>. </p>\n<p><!-- /wp:paragraph --></p>\n<p><!-- wp:heading --></p>\n<h2>TinyMCE&#8217;s Relationship With Gutenberg</h2>\n<p><!-- /wp:heading --></p>\n<p><!-- wp:paragraph --></p>\n<p>Gutenberg is built on top of TinyMCE and this has led to few misconceptions about the project. To alleviate these misconceptions, Tiny published a <a href=\"https://go.tiny.cloud/blog/gutenberg-tinymce-faq/\">Gutenberg and TinyMCE FAQ</a> earlier this year.</p>\n<p><!-- /wp:paragraph --></p>\n<p><!-- wp:paragraph --></p>\n<p>TinyMCE is used by the Classic Editor but as the FAQ explains, they are not one in the same and never have been. </p>\n<p><!-- /wp:paragraph --></p>\n<p><!-- wp:quote --></p>\n<blockquote class=\"wp-block-quote\">\n<p>The Classic Editor is <em>less</em> than TinyMCE in that it exposes just 6 of the 54 of the <a href=\"https://www.tiny.cloud/docs/plugins/\">official plugins</a> and a fraction of the UI. A popular WordPress plugin called <a href=\"https://wordpress.org/plugins/tinymce-advanced/\">TinyMCE Advanced</a> created by Andrew Ozz exposes more of TinyMCE’s UI, core features, and plugins.</p>\n<p>The Classic Editor is also <em>more</em> than TinyMCE in that there is significant custom code in WordPress. This includes WordPress-specific UI components and backend code for embedding, links, media, and more. Some of the filtering code is specific to WordPress.</p>\n<p><cite>Andrew Roberts</cite></p></blockquote>\n<p><!-- /wp:quote --></p>\n<p><!-- wp:paragraph --></p>\n<p>Gutenberg uses TinyMCE to provide rich text editing and provides a Classic editor block that contains some UI elements from TinyMCE, but that&#8217;s about it. </p>\n<p><!-- /wp:paragraph --></p>\n<p><!-- wp:paragraph --></p>\n<p>Both projects have a close relationship but as Roberts <a href=\"https://techcrunch.com/2018/10/02/rich-text-editing-platform-tiny-raises-4m-launches-file-management-service/\">noted on TechCrunch</a>, the two are not mutually dependent on each other.</p>\n<p><!-- /wp:paragraph --></p>\n<p><!-- wp:paragraph --></p>\n<p>&#8220;Tiny’s core business comes from a mix of software vendors, large enterprises, and agencies building custom solutions for clients that has little to do with the WordPress ecosystem,” Roberts told TechCrunch. “It is a popular and commercially viable project in its own right.</p>\n<p><!-- /wp:paragraph --></p>\n<p><!-- wp:paragraph --></p>\n<p>While TinyMCE 5 features a brand new UI, earlier versions such as 4.7 were inspired by beta versions of Gutenberg. Tiny is not yet committed to making block based editing the default but is keeping a close eye on how Gutenberg rolls out. </p>\n<p><!-- /wp:paragraph --></p>\n<p><!-- wp:paragraph --></p>\n<p>TinyMCE and WordPress are open source projects that will continue to benefit each other as it makes sense. </p>\n<p><!-- /wp:paragraph --></p>\n<p><!-- wp:paragraph --></p>\n<p>&#8220;The TinyMCE and WordPress projects have had a symbiotic relationship over the years. We hope that this goodwill and sense of community continues for many years to come,&#8221; Roberts said.</p>\n<p><!-- /wp:paragraph --></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 12 Oct 2018 03:57:14 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}}}}}}}}}}s:4:\"type\";i:128;s:7:\"headers\";O:42:\"Requests_Utility_CaseInsensitiveDictionary\":1:{s:7:\"\0*\0data\";a:8:{s:6:\"server\";s:5:\"nginx\";s:4:\"date\";s:29:\"Mon, 12 Nov 2018 01:32:38 GMT\";s:12:\"content-type\";s:8:\"text/xml\";s:4:\"vary\";s:15:\"Accept-Encoding\";s:13:\"last-modified\";s:29:\"Mon, 12 Nov 2018 01:15:28 GMT\";s:15:\"x-frame-options\";s:10:\"SAMEORIGIN\";s:4:\"x-nc\";s:9:\"HIT ord 1\";s:16:\"content-encoding\";s:4:\"gzip\";}}s:5:\"build\";s:14:\"20180611005429\";}','no'),(102363,'_transient_timeout_feed_mod_d117b5738fbd35bd8c0391cda1f2b5d9','1542029558','no'),(102364,'_transient_feed_mod_d117b5738fbd35bd8c0391cda1f2b5d9','1541986358','no'),(102365,'_transient_timeout_feed_fd8071797867bca1fc1ed5947d3462ec','1542029558','no'),(102366,'_transient_feed_fd8071797867bca1fc1ed5947d3462ec','a:4:{s:5:\"child\";a:1:{s:0:\"\";a:1:{s:3:\"rss\";a:1:{i:0;a:6:{s:4:\"data\";s:3:\"\n\n\n\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:7:\"version\";s:3:\"2.0\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:1:{s:0:\"\";a:1:{s:7:\"channel\";a:1:{i:0;a:6:{s:4:\"data\";s:52:\"\n	\n	\n	\n	\n	\n	\n	\n	\n	\n\n \n	\n		\n		\n		\n		\n		\n		\n		\n		\n		\n	\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:3:{s:0:\"\";a:8:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"MonsterInsights\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"https://www.monsterinsights.com\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:42:\"The Best WordPress Google Analytics Plugin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:13:\"lastBuildDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sun, 11 Nov 2018 20:38:06 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"language\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"en-US\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:9:\"generator\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wordpress.org/?v=4.9.8\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:5:\"image\";a:1:{i:0;a:6:{s:4:\"data\";s:11:\"\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:1:{s:0:\"\";a:5:{s:3:\"url\";a:1:{i:0;a:5:{s:4:\"data\";s:80:\"https://www.monsterinsights.com/wp-content/uploads/2017/02/mascot@2x-100x100.png\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"MonsterInsights\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"https://www.monsterinsights.com\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:5:\"width\";a:1:{i:0;a:5:{s:4:\"data\";s:2:\"32\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:6:\"height\";a:1:{i:0;a:5:{s:4:\"data\";s:2:\"32\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}s:4:\"item\";a:10:{i:0;a:6:{s:4:\"data\";s:48:\"\n		\n		\n		\n		\n		\n				\n		\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:64:\"How to Add PayPal to Referral Exclusion List in Google Analytics\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:205:\"https://www.monsterinsights.com/how-to-add-paypal-to-referral-exclusion-list-in-google-analytics/?utm_source=rss&utm_medium=rss&utm_campaign=how-to-add-paypal-to-referral-exclusion-list-in-google-analytics\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:105:\"https://www.monsterinsights.com/how-to-add-paypal-to-referral-exclusion-list-in-google-analytics/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 08 Nov 2018 16:03:33 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:3:{i:0;a:5:{s:4:\"data\";s:9:\"Tutorials\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:16:\"Google Analytics\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:23:\"referral exclusion list\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"https://www.monsterinsights.com/?p=169180\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:678:\"<p>Want to learn how to add PayPal to your referral exclusion list in Google Analytics? If you’re using PayPal to accept payments, Google Analytics will list PayPal as the referrer source instead of original referrer sites. This prevents you from seeing the original referrer websites contributing to your conversions. To prevent tracking PayPal as referrer [&#8230;]</p>\n<p>The post <a rel=\"nofollow\" href=\"https://www.monsterinsights.com/how-to-add-paypal-to-referral-exclusion-list-in-google-analytics/\">How to Add PayPal to Referral Exclusion List in Google Analytics</a> appeared first on <a rel=\"nofollow\" href=\"https://www.monsterinsights.com\">MonsterInsights</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"Sunita Rai\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:7224:\"<p>Want to learn how to add PayPal to your referral exclusion list in Google Analytics? If you’re using PayPal to accept payments, Google Analytics will list PayPal as the referrer source instead of original referrer sites. This prevents you from seeing the original referrer websites contributing to your conversions.</p>\n<p>To prevent tracking PayPal as referrer and to track the real referrers, you need to add PayPal to the referral exclusion list in Google Analytics. And, here’s how to do that in just a few steps.</p>\n<h3>Why Google Analytics Lists PayPal as the Referrer – Explained</h3>\n<p>When using PayPal as your payment gateway, your customers leave your site and log into PayPal&#8217;s website to make a payment. After they pay successfully, they return to your site, often to a Thank You page, and the conversion is made.</p>\n<p>Essentially, Google Analytics tracks the last website visited before conversion as the referral source for that conversion. Hence, it attributes PayPal as the referral source for the transaction. But, in reality, the referral source is where the customer found your website or product link, not PayPal.</p>\n<p>For example, a customer comes to your site from an affiliate website and decides to buy a product. After adding the product to their cart, your site redirects the user to PayPal&#8217;s website to make the payment. Now, they log into PayPal, pay for the product, and return to your site. And that’s a conversion for your site.</p>\n<p>Now Google Analytics adds PayPal to referral traffic data because PayPal is the last site user visited before conversion. But the actual referral source is the affiliate website, not PayPal.</p>\n<p>In this way, PayPal takes the place of multiple referral source sites and prevents you from seeing the actual referrers. That’s why you should exclude PayPal or any other third-party payment gateway from your referral list. Here&#8217;s how to do that:</p>\n<h3>1. Finding Your eCommerce Referrals in Google Analytics</h3>\n<p>Before adding PayPal to the Referral Exclusion List, it’s best to check how many users are listed as referred by PayPal.</p>\n<p>To view your eCommerce referral list, you’ll need to visit <strong>Acquisition » All Traffic » Referrals</strong> from your Google Analytics panel.</p>\n<p><img class=\"alignnone size-full wp-image-169255\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/11/view-referrals-ga-traffic.jpg\" alt=\"view-referrals-ga-traffic\" width=\"266\" height=\"584\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/11/view-referrals-ga-traffic.jpg 266w, https://www.monsterinsights.com/wp-content/uploads/2018/11/view-referrals-ga-traffic-137x300.jpg 137w\" sizes=\"(max-width: 266px) 100vw, 266px\" /></p>\n<p>Then click on <strong>eCommerce</strong> under the Explorer tab.</p>\n<p><img class=\"alignnone size-full wp-image-169256\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/11/referral-list-ga.jpg\" alt=\"referral-list-ga\" width=\"620\" height=\"503\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/11/referral-list-ga.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/11/referral-list-ga-300x243.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></p>\n<p>As shown in the screenshot above, <strong>paypal.com</strong> made it to the top of the list. That’s because all the referral traffic coming from multiple sources uses PayPal to make payments.</p>\n<h3>2. Adding PayPal to Referral Exclusion List in Google Analytics</h3>\n<p>To add PayPal to your referral exclusion list, you’ll need to click the <strong>Admin</strong> option at the bottom of the Analytics panel on the left.</p>\n<p><img class=\"alignnone size-full wp-image-169257\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/11/ga-admin.jpg\" alt=\"ga-admin\" width=\"250\" height=\"586\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/11/ga-admin.jpg 250w, https://www.monsterinsights.com/wp-content/uploads/2018/11/ga-admin-128x300.jpg 128w\" sizes=\"(max-width: 250px) 100vw, 250px\" /></p>\n<p>Navigate to <strong>Tracking Info</strong> option in the <strong>Property</strong> section. Then, select <strong>Referral Exclusion List</strong>.</p>\n<p><img class=\"alignnone size-full wp-image-169258\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/11/referral-exclusion-list-ga.jpg\" alt=\"referral-exclusion-list-ga\" width=\"620\" height=\"454\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/11/referral-exclusion-list-ga.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/11/referral-exclusion-list-ga-300x220.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></p>\n<p>Upon clicking <strong>Referral Exclusion List</strong>, you’ll see your list of excluded sites.</p>\n<p>Now all you need to do is to add paypal.com to the list. To do so, click the <strong>Add Referral Exclusion</strong> button.</p>\n<p><img class=\"alignnone size-full wp-image-169259\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/11/add-referral-exclusion.jpg\" alt=\"add-referral-exclusion\" width=\"620\" height=\"243\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/11/add-referral-exclusion.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/11/add-referral-exclusion-300x118.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></p>\n<p>Then, enter paypal.com to the domain box and click the <strong>Create</strong> button.</p>\n<p><img class=\"alignnone size-full wp-image-169260\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/11/create-referral-exclusion-ga.jpg\" alt=\"create-referral-exclusion-ga\" width=\"523\" height=\"221\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/11/create-referral-exclusion-ga.jpg 523w, https://www.monsterinsights.com/wp-content/uploads/2018/11/create-referral-exclusion-ga-300x127.jpg 300w\" sizes=\"(max-width: 523px) 100vw, 523px\" /></p>\n<p>That’s it! Now you can see paypal.com on the list.</p>\n<p>Now that you’ve added PayPal to the referral exclusion list, Google Analytics will track the original referral sites and provide you with accurate referral traffic data.</p>\n<p>Google Analytics normally takes 24-48 hours to apply an exclusion. You can check your referral source data again after that time to check if the exclusion list is working for you.</p>\n<p>We hope this article helped you learn how to exclude PayPal from referral traffic data in Google Analytics. You may also want to learn <a href=\"https://www.monsterinsights.com/how-does-google-analytics-work-beginners-guide/\">how Google Analytics works</a>.</p>\n<p>Don’t forget to follow us on <a href=\"https://twitter.com/monsterinsights\" target=\"_blank\" rel=\"nofollow noopener\">Twitter</a> and <a href=\"https://www.facebook.com/monsterinsights\" target=\"_blank\" rel=\"nofollow noopener\">Facebook</a> for more helpful Google Analytics tips.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://www.monsterinsights.com/how-to-add-paypal-to-referral-exclusion-list-in-google-analytics/\">How to Add PayPal to Referral Exclusion List in Google Analytics</a> appeared first on <a rel=\"nofollow\" href=\"https://www.monsterinsights.com\">MonsterInsights</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:102:\"https://www.monsterinsights.com/how-to-add-paypal-to-referral-exclusion-list-in-google-analytics/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:51:\"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:57:\"How to Find and Use Real-Time Reports in Google Analytics\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:175:\"https://www.monsterinsights.com/how-to-find-real-time-reports-in-google-analytics/?utm_source=rss&utm_medium=rss&utm_campaign=how-to-find-real-time-reports-in-google-analytics\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:90:\"https://www.monsterinsights.com/how-to-find-real-time-reports-in-google-analytics/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 05 Nov 2018 18:10:08 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:4:{i:0;a:5:{s:4:\"data\";s:9:\"Tutorials\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:17:\"analytics reports\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:37:\"Real-Time Reports in Google Analytics\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:3;a:5:{s:4:\"data\";s:33:\"MonsterInsights Real-Time reports\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"https://www.monsterinsights.com/?p=168689\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:639:\"<p>Wondering how to find Real-Time reports in Google Analytics? Real-Time reports allow you to monitor activity on your site right as its occurring. You can view the number of active users on your site at any given moment, their geographic locations, the pages they’re viewing, and more. Real-Time reports are really useful for marketers to [&#8230;]</p>\n<p>The post <a rel=\"nofollow\" href=\"https://www.monsterinsights.com/how-to-find-real-time-reports-in-google-analytics/\">How to Find and Use Real-Time Reports in Google Analytics</a> appeared first on <a rel=\"nofollow\" href=\"https://www.monsterinsights.com\">MonsterInsights</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"Sunita Rai\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:9395:\"<p>Wondering how to find Real-Time reports in Google Analytics? Real-Time reports allow you to monitor activity on your site right as its occurring. You can view the number of active users on your site at any given moment, their geographic locations, the pages they’re viewing, and more.</p>\n<p>Real-Time reports are really useful for marketers to track responses to marketing campaigns, product releases, and new articles. That&#8217;s why, in this article, we’ll show you how to find Real-Time reports in Google Analytics and also share some tips on how to properly analyze and use them.</p>\n<h3>1. Find Google Analytics Real-Time Reports in Your WordPress Dashboard</h3>\n<p>Let’s get started with the simplest way to find your Google Analytics Real-Time reports. If your site was built using WordPress, you can find your Google Analytics Real-Time reports right on your WordPress dashboard using <a href=\"https://www.monsterinsights.com/\"> MonsterInsights</a>.</p>\n<p><a href=\"https://www.monsterinsights.com/\"><img class=\"alignnone size-full wp-image-157422\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/08/monsterinsights-best-ga-plugin-for-wordpress.jpg\" alt=\"monsterinsights-best-ga-plugin-for-wordpress\" width=\"620\" height=\"250\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/08/monsterinsights-best-ga-plugin-for-wordpress.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/08/monsterinsights-best-ga-plugin-for-wordpress-300x121.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></a></p>\n<p><a href=\"https://www.monsterinsights.com/\"> MonsterInsights</a> is the best Google Analytics plugin for WordPress. It allows you to install Google Analytics into WordPress sites easily with just a few clicks of your mouse, and provides you with comprehensive reports directly on your WordPress dashboard.</p>\n<p>But, first, you&#8217;ll need to <a href=\"https://www.monsterinsights.com/pricing/\">download the MonsterInsights plugin</a>, install it in your WordPress site, and set up Google Analytics with it. If you need detailed instructions, here’s our step-by-step guide on <a href=\"https://www.monsterinsights.com/how-to-properly-setup-google-analytics-in-wordpress/\">how to set up Google Analytics in WordPress with MonsterInsights</a>.</p>\n<p>After you’ve connected your WordPress site with Google Analytics, you can view your Google Analytics Real-time reports on your WordPress dashboard. Go to <strong>Insights » Reports</strong> from your WordPress dashboard and then click the <strong>Real-Time</strong> tab.</p>\n<p><img class=\"alignnone size-full wp-image-168691\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/11/how-to-find-real-time-reports-in-monsterinsights.jpg\" alt=\"how-to-find-real-time-reports-in-monsterinsights\" width=\"620\" height=\"432\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/11/how-to-find-real-time-reports-in-monsterinsights.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/11/how-to-find-real-time-reports-in-monsterinsights-300x209.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></p>\n<p>Now you can find your site’s Real-Time reports, as shown in the example screenshot below:</p>\n<p><img class=\"alignnone size-full wp-image-168692\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/11/real-time-report-in-monsterinsights.jpg\" alt=\"real-time-report-in-monsterinsights\" width=\"620\" height=\"415\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/11/real-time-report-in-monsterinsights.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/11/real-time-report-in-monsterinsights-300x201.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></p>\n<p>The MonsterInsights Real-Time report includes the following information:</p>\n<ol>\n<li>The number of active users on your site right now</li>\n<li>Pageviews per minute for the past 30 minutes</li>\n<li>Top pages users are currently viewing on your site</li>\n<li>Top referral traffic sources for your site currently</li>\n<li>Top countries and cities visitors on your site right now are browsing from</li>\n</ol>\n<p>In some reports, like <strong>Top Pages </strong>and <strong>Top Referral Traffic Sources</strong>, you&#8217;ll see a button to view all pageviews and referral traffic sources at the bottom. You can click on the button to view the full report on the Google Analytics platform.</p>\n<p><strong>Note:</strong> Real-Time reports feature was added in <a href=\"https://www.monsterinsights.com/announcing-monsterinsights-7-3-page-insights-addon-real-time-reports-and-more/\">MonsterInsights version 7.3.0</a>, so you need to have at least this version or later version installed on your WordPress site.</p>\n<h3>2. View Real-Time Reports in Your Google Analytics Account</h3>\n<p>If you’ve installed <a href=\"https://www.monsterinsights.com/how-to-add-google-analytics-to-wordpress-without-a-plugin/\">Google Analytics in WordPress without a plugin</a>, you won’t find your Google Analytics data (including the Real-Time reports) in your WordPress dashboard. Instead, you&#8217;ll need to visit the official Google Analytics website and log into your Google Analytics account.</p>\n<p>Then, you can see the <strong>Real-Time</strong> section on the left-hand side of the <strong>Reports</strong> column. Simply click on it and then on the <strong>Overview</strong> submenu.</p>\n<p><img class=\"alignnone size-full wp-image-168693\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/11/find-real-time-report-in-ga.jpg\" alt=\"find-real-time-report-in-ga\" width=\"620\" height=\"415\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/11/find-real-time-report-in-ga.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/11/find-real-time-report-in-ga-300x201.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></p>\n<p>Now you can see the <strong>Overview</strong> report for your Real-Time data.</p>\n<p><img class=\"alignnone size-full wp-image-168694\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/11/ga-real-time-stats.jpg\" alt=\"ga-real-time-stats\" width=\"540\" height=\"323\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/11/ga-real-time-stats.jpg 540w, https://www.monsterinsights.com/wp-content/uploads/2018/11/ga-real-time-stats-300x179.jpg 300w\" sizes=\"(max-width: 540px) 100vw, 540px\" /></p>\n<p>In the Real-Time Overview report, you can see the following data:</p>\n<ul>\n<li>Active users on site right now</li>\n<li>Pageviews per minute for the last 30 minutes</li>\n<li>Division of current traffic based on different devices they’re using</li>\n<li>Top referrals for the current active users on site</li>\n<li>Top social traffic</li>\n<li>Top keywords</li>\n<li>Top active pages users on your site right now are viewing</li>\n<li>Top locations on the Google map</li>\n</ul>\n<p>To view more data in the Real-Time reports, you can click the submenus below the <strong>Overview</strong> submenu in the <strong>Real-Time</strong> section.</p>\n<h3>How to Properly Analyze and Use the Real-Time Reports</h3>\n<p>The Real-Time reports in Google Analytics are very important for website owners. These reports can give you really insightful information and data to analyze your marketing campaigns and grow your business.</p>\n<p>Let’s discuss 3 of the major benefits of using Real-Time reports.</p>\n<p>1. You can track active users on your site right now. Keeping eyes on the Real-Time reports at different times throughout a day lets you find out what time your site is most visited. Then, you can publish major announcements, product releases, and blog articles during that time of the day for more visibility.</p>\n<p>2. You can track the results of your marketing efforts as they happen. It’s useful for tracking how your email marketing, social media marketing, and other paid marketing campaigns are performing.</p>\n<p>With the Real-Time reports, you don’t need to wait until a later date to see how users are reacting to your marketing campaigns and new product.</p>\n<p>3. Next, referral traffic sources and top places data in the Real-Time reports will help you to decide where to concentrate your marketing efforts and at what time. When you know the actual locations where most visitors on your site are coming, you can improve your marketing campaigns by making them specific to those locations and time zones.</p>\n<p>Hence, Google Analytics Real-Time reports help you improve your website marketing and grow your business.</p>\n<p>We hope this article helped you learn how to find Real-Time reports in Google Analytics and how to use them. You may also want to learn <a href=\"https://www.monsterinsights.com/how-to-add-a-stats-dashboard-on-your-wordpress-site/\">how to add a stats dashboard on your WordPress site</a>.</p>\n<p>Don’t forget to follow us on <a href=\"https://twitter.com/monsterinsights\" target=\"_blank\" rel=\"nofollow noopener\">Twitter</a> and <a href=\"https://www.facebook.com/monsterinsights\" target=\"_blank\" rel=\"nofollow noopener\">Facebook</a> for more helpful Google Analytics tips.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://www.monsterinsights.com/how-to-find-real-time-reports-in-google-analytics/\">How to Find and Use Real-Time Reports in Google Analytics</a> appeared first on <a rel=\"nofollow\" href=\"https://www.monsterinsights.com\">MonsterInsights</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:87:\"https://www.monsterinsights.com/how-to-find-real-time-reports-in-google-analytics/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:2;a:6:{s:4:\"data\";s:51:\"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:59:\"How to Check Stats for Individual WordPress Posts and Pages\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:195:\"https://www.monsterinsights.com/how-to-check-stats-for-individual-wordpress-posts-and-pages/?utm_source=rss&utm_medium=rss&utm_campaign=how-to-check-stats-for-individual-wordpress-posts-and-pages\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:100:\"https://www.monsterinsights.com/how-to-check-stats-for-individual-wordpress-posts-and-pages/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 01 Nov 2018 20:37:49 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:4:{i:0;a:5:{s:4:\"data\";s:9:\"Tutorials\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:24:\"Google Analytics metrics\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:13:\"page insights\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:3;a:5:{s:4:\"data\";s:43:\"view stats for each individual page or post\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"https://www.monsterinsights.com/?p=168225\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:637:\"<p>Want to check stats for individual WordPress posts and pages? Great idea! When you know how your individual posts and pages are performing, you can optimize each of them to boost your site&#8217;s conversions. Google Analytics is a powerful tool you can use to track the performance of your posts and pages precisely. In this [&#8230;]</p>\n<p>The post <a rel=\"nofollow\" href=\"https://www.monsterinsights.com/how-to-check-stats-for-individual-wordpress-posts-and-pages/\">How to Check Stats for Individual WordPress Posts and Pages</a> appeared first on <a rel=\"nofollow\" href=\"https://www.monsterinsights.com\">MonsterInsights</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"Sunita Rai\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:12082:\"<p>Want to check stats for individual WordPress posts and pages? Great idea! When you know how your individual posts and pages are performing, you can optimize each of them to boost your site&#8217;s conversions. Google Analytics is a powerful tool you can use to track the performance of your posts and pages precisely.</p>\n<p>In this article, we’ll show you how to see stats for each individual post or page in WordPress (step-by-step).</p>\n<h3>Step 1. Set up Google Analytics on Your WordPress Site</h3>\n<p>First of all, you&#8217;ll have to install and set up Google Analytics on your WordPress site. Google Analytics is the most popular digital analytics tool to track your website visitors and their behavior on your site, and provides you with detailed data.</p>\n<p>For WordPress sites, it’s easy to set up and use Google Analytics with the help of the <a href=\"https://www.monsterinsights.com/\">MonsterInsights plugin</a>.</p>\n<p><a href=\"https://www.monsterinsights.com/\"><img class=\"alignnone size-full wp-image-157422\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/08/monsterinsights-best-ga-plugin-for-wordpress.jpg\" alt=\"monsterinsights-best-ga-plugin-for-wordpress\" width=\"620\" height=\"250\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/08/monsterinsights-best-ga-plugin-for-wordpress.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/08/monsterinsights-best-ga-plugin-for-wordpress-300x121.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></a></p>\n<p>MonsterInsights simplifies the entire process of installing the Analytics code in WordPress as well as viewing your important website data because you can <a href=\"https://www.monsterinsights.com/feature/google-analytics-dashboard/\">see the highly comprehensive reports right inside your WordPress dashboard</a>. Besides, it allows you to easily set up tracking advanced metrics like <a href=\"https://www.monsterinsights.com/addon/ecommerce/\">eCommerce tracking</a>, <a href=\"https://www.monsterinsights.com/addon/forms/\">forms conversions</a>, <a href=\"https://www.monsterinsights.com/addon/ads/\">Google ads tracking</a>, <a href=\"https://www.monsterinsights.com/feature/file-download-tracking/\">file downloads</a>, etc.</p>\n<p>To get started, <a href=\"https://www.monsterinsights.com/pricing/\">download MonsterInsights&#8217; plugin file</a> on your computer and install it in WordPress. Then, you’ll need to connect your Google Analytics account with your WordPress site. It takes just a few clicks!</p>\n<p>If you need detailed instructions, here’s our step-by-step guide on <a href=\"https://www.monsterinsights.com/how-to-properly-setup-google-analytics-in-wordpress/\">how to set up Google Analytics in WordPress with MonsterInsights</a>.</p>\n<h3>Step 2. Install and Activate the Page Insights Addon</h3>\n<p>To allow you track your individual WordPress posts and pages, MonsterInsights comes with a great addon: <a href=\"https://www.monsterinsights.com/addon/page-insights/\">Page Insights</a>. The addon lets you view the stats for each of your WordPress blog posts and pages directly in your dashboard.</p>\n<p>You can install the addon by visiting the <strong>Insights » Addons</strong> page from your WordPress dashboard.</p>\n<p><img class=\"alignnone size-full wp-image-168226\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/11/install-monsterinsights-page-insights-addon.jpg\" alt=\"install-monsterinsights-page-insights-addon\" width=\"405\" height=\"480\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/11/install-monsterinsights-page-insights-addon.jpg 405w, https://www.monsterinsights.com/wp-content/uploads/2018/11/install-monsterinsights-page-insights-addon-253x300.jpg 253w\" sizes=\"(max-width: 405px) 100vw, 405px\" /></p>\n<p>After it’s installed, you’ll see the addon’s status as <strong>Inactive</strong>. Next, click the <strong>Activate</strong> button to enable the addon.</p>\n<p><img class=\"alignnone size-full wp-image-168234\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/11/activate-monsterinsights-page-insights-addon.jpg\" alt=\"activate-monsterinsights-page-insights-addon\" width=\"405\" height=\"567\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/11/activate-monsterinsights-page-insights-addon.jpg 405w, https://www.monsterinsights.com/wp-content/uploads/2018/11/activate-monsterinsights-page-insights-addon-214x300.jpg 214w\" sizes=\"(max-width: 405px) 100vw, 405px\" /></p>\n<p>Now, the addon’s status is <strong>Active</strong>.</p>\n<p>That’s it! Now, you can see the stats for your individual WordPress posts and pages right out of the box.</p>\n<h3>Step 3. Viewing Stats for Individual Posts and Pages in WordPress</h3>\n<p>Once you’ve installed and activated MonsterInsights&#8217; Page Insights addon properly in WordPress, you can check stats for each blog post and page in WordPress easily.</p>\n<p>To view the stats for your individual posts, you’ll need to visit <strong>Posts » All Posts</strong> from your dashboard. Similarly, you’ll need to go to <strong>Pages » All Pages</strong> to view the stats for your individual pages.</p>\n<p>Now, you can see an <strong>Insights</strong> column added on your WordPress Posts/ Pages screen.</p>\n<p><img class=\"alignnone size-full wp-image-168238\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/11/pages-screen-with-insights-icon.jpg\" alt=\"pages-screen-with-insights-icon\" width=\"620\" height=\"222\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/11/pages-screen-with-insights-icon.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/11/pages-screen-with-insights-icon-300x107.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></p>\n<p>Next, click on the Insights icon next to a blog post or page to view the stats for the specific blog post or page.</p>\n<p><img class=\"alignnone size-full wp-image-168227\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/11/page-insights-icon-click.jpg\" alt=\"page-insights-icon-click\" width=\"620\" height=\"288\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/11/page-insights-icon-click.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/11/page-insights-icon-click-300x139.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></p>\n<p>You&#8217;ll see a popup window with stats for the individual blog post or page.</p>\n<p><img class=\"alignnone size-full wp-image-168228\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/11/monsterinsights-page-insights-reports.jpg\" alt=\"monsterinsights-page-insights-reports\" width=\"620\" height=\"370\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/11/monsterinsights-page-insights-reports.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/11/monsterinsights-page-insights-reports-300x179.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></p>\n<p>The Page Insights report allows you to quickly view the following important metrics:</p>\n<ol>\n<li><strong>Bounce Rate</strong>: The percentage of single-page sessions in which users view only a single page and exit your site without triggering any other request to the Analytics server.</li>\n<li><strong>Entrances</strong>: The number of times users enter your website through the specific blog post or page.</li>\n<li><strong>Page Views</strong>: The total number of views for the specific blog post or page.</li>\n<li><strong>Time on Page</strong>: The average time users spend on the specific blog post or page.</li>\n<li><strong>Page Load Time</strong>: The average time it takes to load the specific blog post or page.</li>\n<li><strong>Exits</strong>: The number of times users exit your website through the specific post or page.</li>\n</ol>\n<p>Now that you can view the key metrics for each individual blog post or page from your WordPress dashboard, you can easily identify which posts and pages are doing well and which need optimization. Then, you can optimize the low-performing pages or posts to boost user engagement and conversions.</p>\n<h3>Viewing Stats for Individual Posts or Pages from Your Google Analytics Account</h3>\n<p>Alternatively, you can view stats for individual posts or pages from your Google Analytics account. This method may be best for users who’re already intimately familiar with the Google Analytics platform.</p>\n<p>First, you’ll need to log into your Google Analytics account. Then, go to <strong>Behavior » Site Content » All Pages</strong>.</p>\n<p><img class=\"alignnone size-full wp-image-168246\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/11/ga-all-pages-report.jpg\" alt=\"ga-all-pages-report\" width=\"620\" height=\"426\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/11/ga-all-pages-report.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/11/ga-all-pages-report-300x206.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></p>\n<p>There, you&#8217;ll see the stats for your individual pages and posts. As with <strong>Page Insights</strong> reports, you can see the important metrics like pageviews, unique pageviews, average time on page, entrances, bounce rate, exit rate, and page value.</p>\n<p>On the first page, you’ll see the top 10 pages and posts. To view more pages and posts, you can click the pagination arrows at the bottom.</p>\n<p>This way, you can easily view your top performing posts and pages but you&#8217;ll need to view almost all the pages to find the least performing pages and posts by clicking on one page after another.</p>\n<p>However, there’s a search option to directly find stats for a specific page or post.</p>\n<p>First, you’ll need to copy the slug for the page or post. A slug is the part of a URL that identifies a specific post or page. It’s often the last part of a URL, which is editable.</p>\n<p>For example, let’s take this URL (<strong>https://www.monsterinsights.com/google-analytics-plugin/</strong>).</p>\n<p>Here, <strong>/google-analytics-plugin/</strong> is the slug.</p>\n<p>So, copy the slug of the specific page or post and paste it in the search box of your Google Analytics reports page.</p>\n<p><img class=\"alignnone size-full wp-image-168244\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/11/search-stats-for-one-page-ga.jpg\" alt=\"search-stats-for-one-page-ga\" width=\"620\" height=\"136\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/11/search-stats-for-one-page-ga.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/11/search-stats-for-one-page-ga-300x66.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></p>\n<p>Now, you can see the stats for the specific page or post.</p>\n<p><img class=\"alignnone size-full wp-image-168245\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/11/view-individual-post-stats-ga.jpg\" alt=\"view-individual-post-stats-ga\" width=\"620\" height=\"200\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/11/view-individual-post-stats-ga.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/11/view-individual-post-stats-ga-300x97.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></p>\n<p>That’s it!</p>\n<p>We hope this article helped you to learn how to check stats for individual WordPress posts and pages with Google Analytics. You may also want to learn <a href=\"https://www.monsterinsights.com/how-to-add-a-stats-dashboard-on-your-wordpress-site/\">how to add a stats dashboard on your WordPress site</a>.</p>\n<p>Don’t forget to follow us on <a href=\"https://twitter.com/monsterinsights\" target=\"_blank\" rel=\"nofollow noopener\">Twitter</a> and <a href=\"https://www.facebook.com/monsterinsights\" target=\"_blank\" rel=\"nofollow noopener\">Facebook</a> for more helpful Google Analytics tips.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://www.monsterinsights.com/how-to-check-stats-for-individual-wordpress-posts-and-pages/\">How to Check Stats for Individual WordPress Posts and Pages</a> appeared first on <a rel=\"nofollow\" href=\"https://www.monsterinsights.com\">MonsterInsights</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:97:\"https://www.monsterinsights.com/how-to-check-stats-for-individual-wordpress-posts-and-pages/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:3;a:6:{s:4:\"data\";s:42:\"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:83:\"Announcing MonsterInsights 7.3 – Page Insights Addon, Real Time Reports, and More\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:231:\"https://www.monsterinsights.com/announcing-monsterinsights-7-3-page-insights-addon-real-time-reports-and-more/?utm_source=rss&utm_medium=rss&utm_campaign=announcing-monsterinsights-7-3-page-insights-addon-real-time-reports-and-more\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:118:\"https://www.monsterinsights.com/announcing-monsterinsights-7-3-page-insights-addon-real-time-reports-and-more/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 30 Oct 2018 09:37:10 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Announcements\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"https://www.monsterinsights.com/?p=167791\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:711:\"<p>Today, I&#8217;m super excited to announce the release of MonsterInsights 7.3 because it comes with a lot of exciting features that you have been asking for including real-time reports, page insights addon, and more. Let&#8217;s take a look at what&#8217;s new in MonsterInsights 7.3&#8230; Page Insights Addon Want to see stats for each individual blog [&#8230;]</p>\n<p>The post <a rel=\"nofollow\" href=\"https://www.monsterinsights.com/announcing-monsterinsights-7-3-page-insights-addon-real-time-reports-and-more/\">Announcing MonsterInsights 7.3 &#8211; Page Insights Addon, Real Time Reports, and More</a> appeared first on <a rel=\"nofollow\" href=\"https://www.monsterinsights.com\">MonsterInsights</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:11:\"Syed Balkhi\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:5730:\"<p>Today, I&#8217;m super excited to announce the release of MonsterInsights 7.3 because it comes with a lot of exciting features that you have been asking for including real-time reports, page insights addon, and more.</p>\n<p>Let&#8217;s take a look at what&#8217;s new in MonsterInsights 7.3&#8230;</p>\n<h3>Page Insights Addon</h3>\n<p>Want to see stats for each individual blog post or page in WordPress?</p>\n<p>Our new Page Insights addon allows you to quickly view individual post / page metrics right from your WordPress dashboard.</p>\n<p>Once activated, the page insights addon will add an Insights column on the WordPress Posts / Pages screen.</p>\n<p><img class=\"alignnone size-full wp-image-167361\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/how-to-find-page-insights.png\" alt=\"How to Find Page Insights\" width=\"1200\" height=\"557\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/how-to-find-page-insights.png 1200w, https://www.monsterinsights.com/wp-content/uploads/2018/10/how-to-find-page-insights-300x139.png 300w, https://www.monsterinsights.com/wp-content/uploads/2018/10/how-to-find-page-insights-768x356.png 768w, https://www.monsterinsights.com/wp-content/uploads/2018/10/how-to-find-page-insights-1024x475.png 1024w\" sizes=\"(max-width: 1200px) 100vw, 1200px\" /></p>\n<p>When you click on the Insights icon, it will open a popup window with stats for the individual blog post or page.</p>\n<p><img class=\"alignnone size-full wp-image-167364\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/page-insights.png\" alt=\"MonsterInsights Page Insights\" width=\"1200\" height=\"744\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/page-insights.png 1200w, https://www.monsterinsights.com/wp-content/uploads/2018/10/page-insights-300x186.png 300w, https://www.monsterinsights.com/wp-content/uploads/2018/10/page-insights-768x476.png 768w, https://www.monsterinsights.com/wp-content/uploads/2018/10/page-insights-1024x635.png 1024w\" sizes=\"(max-width: 1200px) 100vw, 1200px\" /></p>\n<p>The Page Insights addon allows you to quickly view important metrics like: new visitors, page views, bounce rate, time on page, page load time, and exits.</p>\n<h3>Real Time Reports</h3>\n<p>We have also added the much requested Real-Time report in MonsterInsights.</p>\n<p><img class=\"alignnone size-full wp-image-167923\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/real-time-report.png\" alt=\"MonsterInsights Real Time Report Screenshot\" width=\"1200\" height=\"801\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/real-time-report.png 1200w, https://www.monsterinsights.com/wp-content/uploads/2018/10/real-time-report-300x200.png 300w, https://www.monsterinsights.com/wp-content/uploads/2018/10/real-time-report-768x513.png 768w, https://www.monsterinsights.com/wp-content/uploads/2018/10/real-time-report-1024x684.png 1024w\" sizes=\"(max-width: 1200px) 100vw, 1200px\" /></p>\n<p>This report allows you to see the results of your marketing campaign or product launch as it&#8217;s happening.</p>\n<p>You can track the number of active visitors, top referral sources, top countries, and top pages right from the Real-time report.</p>\n<p>Because real-time reports can really impact Google Analytics API quota, we have it set to refresh every 60 seconds.</p>\n<h3>Custom Link Attribution</h3>\n<p>Want to measure results of the most important links on your website?</p>\n<p>With MonsterInsights&#8217; new custom link attribution feature, you can easily add custom event tracking to your important links and call-to-action buttons.</p>\n<p>To add custom event tracking to your WordPress links, simply add the following data-variable tags to the HTML of your link:</p>\n<p><strong>&lt;a href=&quot;https://www.monsterinsights.com&quot; data-vars-ga-category=&quot;Custom Category&quot; data-vars-ga-action=&quot;Custom Action&quot; data-vars-ga-label=&quot;Custom Label&quot;&gt;Example&lt;/a&gt;</strong></p>\n<p>This will add event tracking to the specific link, so you can track how valuable this link is when it comes Ecommerce or other conversion metrics.</p>\n<p>We also updated our Google AMP addon to add support for custom event tracking, so you can easily measure results while still utilizing the performance improvements of Google AMP.</p>\n<h3>Gravity Forms and Formidable Forms Conversion Tracking</h3>\n<p>We have also updated our <a href=\"https://www.monsterinsights.com/addon/forms/\">Forms Tracking addon</a> to add improved conversion tracking support for both Gravity Forms and Formidable Forms.</p>\n<p>While our Forms Tracking addon works with all <a href=\"https://www.monsterinsights.com/best-wordpress-contact-form-plugins/\">popular WordPress form plugins</a>, improved support helps you better identify and track your form conversions, so you can grow your business.</p>\n<p>We hope you enjoy these features. We have a lot more in the works that I can&#8217;t wait to share with you in the upcoming weeks.</p>\n<p>As always, thank you for continued support of MonsterInsights. We look forward to continue making analytics easy for you!</p>\n<p><em>Syed and the MonsterInsights team</em></p>\n<p>Don&#8217;t have a MonsterInsights Pro license? <a href=\"https://www.monsterinsights.com/pricing/\">Click here to get started today</a>, and experience the power, and ease, of MonsterInsights.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://www.monsterinsights.com/announcing-monsterinsights-7-3-page-insights-addon-real-time-reports-and-more/\">Announcing MonsterInsights 7.3 &#8211; Page Insights Addon, Real Time Reports, and More</a> appeared first on <a rel=\"nofollow\" href=\"https://www.monsterinsights.com\">MonsterInsights</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:115:\"https://www.monsterinsights.com/announcing-monsterinsights-7-3-page-insights-addon-real-time-reports-and-more/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:4;a:6:{s:4:\"data\";s:51:\"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:54:\"How to Share Your Google Analytics Reports with Others\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:185:\"https://www.monsterinsights.com/how-to-share-your-google-analytics-reports-with-others/?utm_source=rss&utm_medium=rss&utm_campaign=how-to-share-your-google-analytics-reports-with-others\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:95:\"https://www.monsterinsights.com/how-to-share-your-google-analytics-reports-with-others/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 29 Oct 2018 15:00:43 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:4:{i:0;a:5:{s:4:\"data\";s:9:\"Tutorials\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:17:\"analytics reports\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:14:\"traffic report\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:3;a:5:{s:4:\"data\";s:22:\"sharing Analytics data\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"https://www.monsterinsights.com/?p=167675\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:610:\"<p>Do you want to learn how to share your Google Analytics reports with others? Sharing solid data is a great way to gain the trust of customers and potential business partners! But, since they aren’t your team yet, you may not want to grant them access to your Analytics account. However, you can still share [&#8230;]</p>\n<p>The post <a rel=\"nofollow\" href=\"https://www.monsterinsights.com/how-to-share-your-google-analytics-reports-with-others/\">How to Share Your Google Analytics Reports with Others</a> appeared first on <a rel=\"nofollow\" href=\"https://www.monsterinsights.com\">MonsterInsights</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"Sunita Rai\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:9963:\"<p>Do you want to learn how to share your Google Analytics reports with others? Sharing solid data is a great way to gain the trust of customers and potential business partners! But, since they aren’t your team yet, you may not want to grant them access to your Analytics account. However, you can still share your desired Analytics reports with them if you&#8217;re in the know.</p>\n<p>In this article, we’ll show you how to share your Google Analytics reports with others without allowing them access to your Analytics account. Trust us: it&#8217;s super easy!</p>\n<h3>Why Would You Want to Share Your Google Analytics Data?</h3>\n<p>Showing solid statistics and data is one of the most effective ways to convince people over to your side. When trying to sell a product, you can more quickly convert a potential customer into a buyer if you show them how many people are already using your product (and for how long). Put simply: sharing your detail-rich Analytics data can help you sell more.</p>\n<p>Similarly, if you’re planning any kind of partnership with another company, they&#8217;ll most likely ask you to share your Analytics reports with them. By sharing Analytics data, they can properly evaluate your businesses and make a more-informed partnership deal. Plus, if your Analytics are awesome, showing them off to potential partners will ensure that they don&#8217;t undervalue your business when money gets put on the table.</p>\n<p>However, when you’re sharing Analytics data with other people outside of your team members, it’s best not to <a href=\"https://www.monsterinsights.com/how-to-grant-access-to-your-account-and-share-google-analytics-reports/\">grant access to your Analytics account</a>. This is because you don’t want to share every report. Instead, you should only relevant reports from a specified time period to get your business ahead.</p>\n<p>Now, let’s go ahead and see how to share Google Analytics reports with others hassle-free.</p>\n<h3>1. Export Analytics Data in PDF, Google Sheets, Excel, or CSV</h3>\n<p>The first option to share your Google Analytics data is to export a report in a PDF, Google Sheets, Excel, or CSV format. Then, you can share the file by uploading it to a Google Drive folder or directly via email.</p>\n<p>To get started, you’ll need to log into your Google Analytics account. Then, navigate to a report you want to share. In the top right corner, you&#8217;ll find an <strong>Export</strong> option for almost every report in Google Analytics.</p>\n<p><img class=\"alignnone size-full wp-image-167740\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/export-option-ga-reports.jpg\" alt=\"export-option-ga-reports\" width=\"620\" height=\"292\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/export-option-ga-reports.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/10/export-option-ga-reports-300x141.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></p>\n<p>Click on the <strong>Export</strong> option and select the file type you’d like to export.</p>\n<p><img class=\"alignnone size-full wp-image-167741\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/choose-file-type-export-ga-reports.jpg\" alt=\"choose-file-type-export-ga-reports\" width=\"620\" height=\"201\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/choose-file-type-export-ga-reports.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/10/choose-file-type-export-ga-reports-300x97.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></p>\n<p>Then, it’ll automatically download the report onto your computer. Now you can share the report with your customers or partners easily by emailing it to them or by sharing a Google Drive folder.</p>\n<p>If you’re <a href=\"https://www.monsterinsights.com/how-to-properly-setup-google-analytics-in-wordpress/\">using Google Analytics in your WordPress site with MonsterInsights</a>, you can see your Analytics reports inside your WordPress dashboard. If you&#8217;d like to share any report from the dashboard reports, you can click the <strong>View All Report</strong> below the reports which will automatically take you to your Google Analytics account.</p>\n<p><img class=\"alignnone size-full wp-image-167742\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/view-full-report-monsterinsights-reports.jpg\" alt=\"view-full-report-monsterinsights-reports\" width=\"620\" height=\"374\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/view-full-report-monsterinsights-reports.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/10/view-full-report-monsterinsights-reports-300x181.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></p>\n<p>Then, simply follow the same process discussed above.</p>\n<h3>2. How to Share Your Google Analytics Reports on a Regular Basis</h3>\n<p>The next option is to share your Analytics reports by setting up automatic emails in Google Analytics. With this option, you can schedule automatic emails containing the Analytics reports daily, weekly, or monthly.</p>\n<p>This is useful for sharing your Analytics data with your customers, partners, and team members for a certain period of time on a regular basis.</p>\n<p>You can find a <strong>Share</strong> option next to <strong>Export</strong> for almost every Analytics data report. Click the <strong>Share</strong> option to get started.</p>\n<p><img class=\"alignnone size-full wp-image-167743\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/share-option-ga-reports.jpg\" alt=\"share-option-ga-reports\" width=\"620\" height=\"165\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/share-option-ga-reports.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/10/share-option-ga-reports-300x80.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></p>\n<p>Then, enter the email addresses you want to share your Analytics report with. Next, you can review the subject line and rephrase it or leave it as it is. Next, confirm the attachment type. It’s PDF by default, but you can change it to an Excel or CSV file if you desire.</p>\n<p><img class=\"alignnone size-full wp-image-167744\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/sharing-ga-reports-via-emai.jpg\" alt=\"sharing-ga-reports-via-emai\" width=\"620\" height=\"541\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/sharing-ga-reports-via-emai.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/10/sharing-ga-reports-via-emai-300x262.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></p>\n<p>After that, you can choose the frequency of the emails. Also, you can choose which day you want to send out emails for the weekly and monthly options.</p>\n<p>Then, in the <strong>Advanced Options</strong>, you can choose how long a duration you want to send the emails.</p>\n<p><img class=\"alignnone size-full wp-image-167745\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/advanced-options-sharing-ga-reports-via-email.jpg\" alt=\"advanced-options-sharing-ga-reports-via-email\" width=\"620\" height=\"378\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/advanced-options-sharing-ga-reports-via-email.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/10/advanced-options-sharing-ga-reports-via-email-300x183.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></p>\n<p>Then, insert the email body with some lines about why the receiver is getting the email. Finally, check the <strong>I’m not a robot</strong> box and click the <strong>Send</strong> button. You’ll see a quick notification stating that your email has been scheduled.</p>\n<p>If you want to add more reports to the same email, you can easily do so. First, you’ll need to find the report you want to add and click the <strong>Share</strong> option, same as before. Then, click <strong>Add to an existing email</strong>.</p>\n<p><img class=\"alignnone size-full wp-image-167746\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/add-to-an-existing-email-sharing-ga-reports.jpg\" alt=\"add-to-an-existing-email-sharing-ga-reports\" width=\"620\" height=\"378\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/add-to-an-existing-email-sharing-ga-reports.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/10/add-to-an-existing-email-sharing-ga-reports-300x183.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></p>\n<p>Now you can select which existing email you want to add the report to.</p>\n<p><img class=\"alignnone size-full wp-image-167748\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/add-to-an-existing-email.jpg\" alt=\"add-to-an-existing-email\" width=\"620\" height=\"241\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/add-to-an-existing-email.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/10/add-to-an-existing-email-300x117.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></p>\n<p>Finally, don’t forget to click the <strong>Save</strong> button.</p>\n<p>We hope this article helped you to learn how to share your Google Analytic reports with others. You may also want to learn <a href=\"https://www.monsterinsights.com/how-to-create-custom-reports-in-google-analytics-step-by-step/\">how to create custom reports in Google Analytics</a>.</p>\n<p>Don’t forget to follow us on <a href=\"https://twitter.com/monsterinsights\" target=\"_blank\" rel=\"nofollow noopener\">Twitter</a> and <a href=\"https://www.facebook.com/monsterinsights\" target=\"_blank\" rel=\"nofollow noopener\">Facebook</a> for more helpful Google Analytics tips.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://www.monsterinsights.com/how-to-share-your-google-analytics-reports-with-others/\">How to Share Your Google Analytics Reports with Others</a> appeared first on <a rel=\"nofollow\" href=\"https://www.monsterinsights.com\">MonsterInsights</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:92:\"https://www.monsterinsights.com/how-to-share-your-google-analytics-reports-with-others/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:5;a:6:{s:4:\"data\";s:51:\"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:47:\"5 Best WordPress Ad Management Plugins for 2018\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:149:\"https://www.monsterinsights.com/best-wordpress-ad-management-plugins/?utm_source=rss&utm_medium=rss&utm_campaign=best-wordpress-ad-management-plugins\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:77:\"https://www.monsterinsights.com/best-wordpress-ad-management-plugins/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 25 Oct 2018 14:16:17 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:4:{i:0;a:5:{s:4:\"data\";s:9:\"Marketing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:12:\"ads tracking\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:28:\"google adsense for WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:3;a:5:{s:4:\"data\";s:31:\"add advertisements to WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"https://www.monsterinsights.com/?p=167146\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:603:\"<p>Are you looking for the best WordPress ad management plugins? Adding advertisements is one of the most common ways to monetize a website. With the right ad management plugin, you can properly manage your WordPress ads and boost your revenue. In this article, we’ll share the 5 best ad management plugins for WordPress so you [&#8230;]</p>\n<p>The post <a rel=\"nofollow\" href=\"https://www.monsterinsights.com/best-wordpress-ad-management-plugins/\">5 Best WordPress Ad Management Plugins for 2018</a> appeared first on <a rel=\"nofollow\" href=\"https://www.monsterinsights.com\">MonsterInsights</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"Sunita Rai\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:13028:\"<p>Are you looking for the best WordPress ad management plugins? Adding advertisements is one of the most common ways to monetize a website. With the right ad management plugin, you can properly manage your WordPress ads and boost your revenue.</p>\n<p>In this article, we’ll share the 5 best ad management plugins for WordPress so you can optimize your earnings from advertisements.</p>\n<h3>Why Use a WordPress Ad Management Plugin?</h3>\n<p>If you’re looking for an easy way to earn money through your site, adding adverts is a cool option. Many WordPress themes nowadays are advertisement-ready; however, they lack proper ad management features. That’s where an ad management plugin comes handy.</p>\n<p>For an instance, if you want to <a href=\"https://www.monsterinsights.com/how-to-add-google-adsense-to-your-wordpress-site/\">add Google AdSense ads in WordPress</a>, you can use a <strong>Custom HTML</strong> widget in WordPress. This method is simple, but you cannot place ads on areas other than your theme’s widget-ready areas. An ad management plugin helps you insert ads anywhere on your site.</p>\n<p>Plus, ad management plugins allow you to add both direct ads and AdSense ads on your site. You can start rotating and scheduling your ads to automate their displays. This helps you save plenty of time for more important tasks.</p>\n<p>In a nutshell, ad management plugins help you create better ads, manage the ads properly, and increase your earnings.</p>\n<p>Now, let’s go ahead and check out the best ad management plugins for WordPress.</p>\n<h3><a href=\"https://www.wpbeginner.com/refer/adsanity/\" target=\"_blank\" rel=\"nofollow noopener\">1. AdSanity</a></h3>\n<p><a href=\"https://www.wpbeginner.com/refer/adsanity/\" target=\"_blank\" rel=\"nofollow noopener\"><img class=\"alignnone size-full wp-image-162110\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/09/adsanity-wordpress-ad-manag.jpg\" alt=\"adsanity-wordpress-ad-manag\" width=\"620\" height=\"315\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/09/adsanity-wordpress-ad-manag.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/09/adsanity-wordpress-ad-manag-300x152.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></a></p>\n<p>AdSanity is the best WordPress ad management plugin available on the market. It’s a simple and easy-to-use plugin with powerful options to fully control and manage your WordPress ads.</p>\n<p>Using AdSanity, you can insert self-hosted direct ads as well as network ads like Google AdSense on your WordPress site easily. Not to mention, you can place your ads anywhere on your site using widgets, shortcodes, or template tags.</p>\n<p>The plugin also allows you to group ads based on categories, run a single ad or ad group, and schedule ads on your WordPress site. The plugin is extensible with a set of cool addons ready for use. If you need an extra feature, you can always look up to the available addons.</p>\n<p><a href=\"https://www.wpbeginner.com/refer/adsanity/\" target=\"_blank\" rel=\"nofollow noopener\">Get started with AdSanity today!</a></p>\n<h3><a href=\"https://wordpress.org/plugins/adrotate/\" target=\"_blank\" rel=\"nofollow noopener\">2. AdRotate</a></h3>\n<p><a href=\"https://wordpress.org/plugins/adrotate/\" target=\"_blank\" rel=\"nofollow noopener\"><img class=\"alignnone size-full wp-image-167160\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/adrotate-wordpress-plugin.jpg\" alt=\"adrotate-wordpress-plugin\" width=\"620\" height=\"202\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/adrotate-wordpress-plugin.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/10/adrotate-wordpress-plugin-300x98.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></a></p>\n<p>AdRotate allows you to easily create ads and ad groups and add them to your WordPress site. You can insert ads into your WordPress posts using shortcodes and into the sidebars using widgets.</p>\n<p>The plugin offers a simple interface to create and manage ads. It’s designed to match the WordPress dashboard interface, so you can easily get familiar with it. It supports both custom-made ads and ads from servers like Media.net and Google AdSense.</p>\n<p>The AdRotate plugin is available in both free and premium versions. If you want advanced features like geo-targeting, Adblock disguise, mobile adverts, and media/ asset management, you’ll need to install the pro version of the plugin.</p>\n<p><a href=\"https://wordpress.org/plugins/adrotate/\" target=\"_blank\" rel=\"nofollow noopener\">Get started with AdRotate today!</a></p>\n<h3><a href=\"https://wordpress.org/plugins/insert-post-ads/\" target=\"_blank\" rel=\"nofollow noopener\">3. Insert Post Ads</a></h3>\n<p><a href=\"https://wordpress.org/plugins/insert-post-ads/\" target=\"_blank\" rel=\"nofollow noopener\"><img class=\"alignnone size-full wp-image-167161\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/insert-post-ads-wordpress-plugin.jpg\" alt=\"insert-post-ads-wordpress-plugin\" width=\"620\" height=\"229\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/insert-post-ads-wordpress-plugin.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/10/insert-post-ads-wordpress-plugin-300x111.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></a></p>\n<p>Insert Post Ads allows you to automatically insert Google AdSense or any network ads into your blog posts. Displaying ads in your blog articles helps to increase click-through rates (CTRs) and boost your earnings.</p>\n<p>With Insert Post Ads plugin, you can automatically display ads before content, after post content, or after a specified number of paragraphs. Therefore, you don’t need to manually insert ads into every piece of content. You can add the ads to your WordPress posts, pages, and custom post types.</p>\n<p>The plugin is simple and easy-to-use. Anyone can quickly set up the plugin and start adding advertisements. It supports Google AdSense or any advertising codes.</p>\n<p><a href=\"https://wordpress.org/plugins/insert-post-ads/\" target=\"_blank\" rel=\"nofollow noopener\">Get started with Insert Post Ads today!</a></p>\n<h3><a href=\"https://www.wpbeginner.com/refer/oiopublisher/\" target=\"_blank\" rel=\"nofollow noopener\">4. OIO Publisher</a></h3>\n<p><a href=\"https://www.wpbeginner.com/refer/oiopublisher/\" target=\"_blank\" rel=\"nofollow noopener\"><img class=\"alignnone size-full wp-image-167162\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/oio-publisher-advertising-tool-wordpress.jpg\" alt=\"oio-publisher-advertising-tool-wordpress\" width=\"620\" height=\"295\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/oio-publisher-advertising-tool-wordpress.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/10/oio-publisher-advertising-tool-wordpress-300x143.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></a></p>\n<p>OIO Publisher is great for small businesses who want to sell ad spots directly to advertisers. It allows you to create ad spots on different locations on your site with <strong>Advertise here</strong> default text where advertisers can click to buy the spot.</p>\n<p>After the advertisers click on the banner, they’ll be taken to the sales page. From there, they can create an ad, pay for the ad spot, and display their ad. The advertisers can choose how long a period they want to show the ad. This’ll eliminate a middleman’s involvement in displaying ads on your site.</p>\n<p>The plugin handles payments for you and advertisers. It also sends daily advertisement reports to the advertisers that include the number of clicks, impressions, CTR, etc.</p>\n<p><a href=\"https://www.wpbeginner.com/refer/oiopublisher/\" target=\"_blank\" rel=\"nofollow noopener\">Get started with OIO Publisher today!</a></p>\n<h3><a href=\"https://wordpress.org/plugins/ad-inserter/\" target=\"_blank\" rel=\"nofollow noopener\">5. Ad Inserter</a></h3>\n<p><a href=\"https://wordpress.org/plugins/ad-inserter/\" target=\"_blank\" rel=\"nofollow noopener\"><img class=\"alignnone size-full wp-image-167163\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/ad-inserter-wordpress-plugin.jpg\" alt=\"ad-inserter-wordpress-plugin\" width=\"620\" height=\"196\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/ad-inserter-wordpress-plugin.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/10/ad-inserter-wordpress-plugin-300x95.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></a></p>\n<p>Ad Inserter is a feature-rich plugin with plenty of options to create ads and insert into your WordPress site. It supports all types of ads including Google AdSense, Amazon Native Shopping Ads, Media.net ads, and rotating banner ads.</p>\n<p>The plugin allows you to display ads in multiple locations on your site like before or after a post, before or after a paragraph, before or after comments, before or after a post excerpt, etc. Once configured, the plugin automatically inserts ads into posts and pages; however, you can disable automatic insertion anytime.</p>\n<p>You can find this plugin both in free and premium licenses. The free version is decent with a set of useful features, but you’ll probably want to upgrade your license for more advanced options.</p>\n<p><a href=\"https://wordpress.org/plugins/ad-inserter/\" target=\"_blank\" rel=\"nofollow noopener\">Get started with Ad Inserter today!</a></p>\n<h3>Tracking the Performance of Your Ads with Google Analytics</h3>\n<p>WordPress ad management plugins provide you with cool options to manage your ads; however, most of them fail to provide proper tracking features. So, we recommend you use the <a href=\"https://www.monsterinsights.com/\">MonsterInsights</a> plugin for ads tracking.</p>\n<p><a href=\"https://www.monsterinsights.com/\"><img class=\"alignnone size-full wp-image-157422\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/08/monsterinsights-best-ga-plugin-for-wordpress.jpg\" alt=\"monsterinsights-best-ga-plugin-for-wordpress\" width=\"620\" height=\"250\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/08/monsterinsights-best-ga-plugin-for-wordpress.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/08/monsterinsights-best-ga-plugin-for-wordpress-300x121.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></a></p>\n<p>By tracking the performance of your ads, you can learn exactly how your site&#8217;s visitors interact with your ads and then optimize your ads for more revenue.</p>\n<p><a href=\"https://www.monsterinsights.com/\">MonsterInsights</a> is the most powerful Google Analytics plugin for WordPress. It helps you to track your website&#8217;s audience and their behaviors on your site using Google Analytics. The plugin comes with a powerful <a href=\"https://www.monsterinsights.com/addon/ads/\">Ads Tracking addon</a> to let you track the performance of your AdSense ads properly.</p>\n<p>With MonsterInsights&#8217; ads tracking, you can track click-through rates to see how many clicks each banner ad is receiving. Then, you can identify the most popular ads on your site as well as the worst performing ones. You can delete the less popular ads or replace them with more relevant ads. This helps to improve CTR and boost your revenue.</p>\n<p>To get started, you’ll need to <a href=\"https://www.monsterinsights.com/how-to-properly-setup-google-analytics-in-wordpress/\">install MonsterInsights and set it up in your WordPress site</a>. Then, you’ll need to install the Ads Tracking addon and enable Google AdSense tracking.</p>\n<p><img class=\"alignnone size-full wp-image-89954\" src=\"https://www.monsterinsights.com/wp-content/uploads/2017/02/activate-ads-addon.jpg\" alt=\"activate ads addon\" width=\"379\" height=\"474\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2017/02/activate-ads-addon.jpg 379w, https://www.monsterinsights.com/wp-content/uploads/2017/02/activate-ads-addon-240x300.jpg 240w\" sizes=\"(max-width: 379px) 100vw, 379px\" /></p>\n<p>For detailed instructions, check out our step-by-step guide on <a href=\"https://www.monsterinsights.com/how-to-track-adsense-in-google-analytics-to-optimize-your-revenue/\">how to track AdSense in Google Analytics</a>.</p>\n<p>We hope this article helped you to find the best ad management plugins for WordPress. You may also like to read our post on the <a href=\"https://www.monsterinsights.com/the-highest-earning-google-adsense-ad-placements/\">highest earning Google AdSense ad placements</a>.</p>\n<p>Also, don’t forget to follow us on <a href=\"https://twitter.com/monsterinsights\" target=\"_blank\" rel=\"nofollow noopener\">Twitter</a> and <a href=\"https://www.facebook.com/monsterinsights\" target=\"_blank\" rel=\"nofollow noopener\">Facebook</a> for more Google Analytics tutorials.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://www.monsterinsights.com/best-wordpress-ad-management-plugins/\">5 Best WordPress Ad Management Plugins for 2018</a> appeared first on <a rel=\"nofollow\" href=\"https://www.monsterinsights.com\">MonsterInsights</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:74:\"https://www.monsterinsights.com/best-wordpress-ad-management-plugins/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:6;a:6:{s:4:\"data\";s:51:\"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"How to Block WordPress Referrer Spam in Google Analytics\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:175:\"https://www.monsterinsights.com/block-wordpress-referrer-spam-in-google-analytics/?utm_source=rss&utm_medium=rss&utm_campaign=block-wordpress-referrer-spam-in-google-analytics\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:90:\"https://www.monsterinsights.com/block-wordpress-referrer-spam-in-google-analytics/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 22 Oct 2018 13:15:14 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:4:{i:0;a:5:{s:4:\"data\";s:9:\"Tutorials\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:24:\"google analytics filters\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:35:\"blocking referrer spam in wordpress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:3;a:5:{s:4:\"data\";s:21:\"google analytics spam\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"https://www.monsterinsights.com/?p=165570\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:629:\"<p>Are you receiving a lot of referral traffic from sites with unusual domains? If the bounce rate for those hits is 100% and session duration is 00.00.00, it&#8217;s most likely referrer spam. Referrer spam can distort your analytics reports and harm your site. In this article, we’ll show you how to block WordPress referrer spam [&#8230;]</p>\n<p>The post <a rel=\"nofollow\" href=\"https://www.monsterinsights.com/block-wordpress-referrer-spam-in-google-analytics/\">How to Block WordPress Referrer Spam in Google Analytics</a> appeared first on <a rel=\"nofollow\" href=\"https://www.monsterinsights.com\">MonsterInsights</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"Sunita Rai\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:15743:\"<p>Are you receiving a lot of referral traffic from sites with unusual domains? If the bounce rate for those hits is 100% and session duration is 00.00.00, it&#8217;s most likely referrer spam. Referrer spam can distort your analytics reports and harm your site.</p>\n<p>In this article, we’ll show you how to block WordPress referrer spam in Google Analytics.</p>\n<h3>Not Using Google Analytics Yet?</h3>\n<p>If you’re wondering what this article is about, or what Google Analytics is, we recommend you take a moment to check out why Google Analytics is <a href=\"https://www.monsterinsights.com/why-your-business-needs-google-analytics-starting-right-now/\">important for your business growth</a>.</p>\n<p>To put it in brief here: Google Analytics is the most popular website analytics tool available on the market. It allows you to track your website&#8217;s traffic and provides you with detailed reports on how users interact with your site. You can view where your site visitors are coming from, what pages they open on your site, what they click, and everything else you could ever want to know right from the Analytics reports.</p>\n<p>And, once you know all that information, you can make informed marketing decisions to grow your site.</p>\n<p>In WordPress, it’s easy to set up and use Google Analytics with the <a href=\"https://www.monsterinsights.com/\">MonsterInsights</a> plugin.</p>\n<p><a href=\"https://www.monsterinsights.com/\"><img class=\"alignnone size-full wp-image-157422\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/08/monsterinsights-best-ga-plugin-for-wordpress.jpg\" alt=\"monsterinsights-best-ga-plugin-for-wordpress\" width=\"620\" height=\"250\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/08/monsterinsights-best-ga-plugin-for-wordpress.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/08/monsterinsights-best-ga-plugin-for-wordpress-300x121.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></a></p>\n<p><a href=\"https://www.monsterinsights.com/\">MonsterInsights</a> is the best and most user-friendly Google Analytics plugin for WordPress. It&#8217;s easy to use and comes packed with powerful features to allow you to track all your important analytics data. Using the plugin, you can easily track advanced metrics like eCommerce data, ads, forms, etc. And, you can see all the <a href=\"https://www.monsterinsights.com/feature/google-analytics-dashboard/\">reports right in your WordPress dashboard</a>.</p>\n<p>It takes zero effort to set up Google Analytics in WordPress when using this plugin. For detailed instructions, here’s our complete guide on <a href=\"https://www.monsterinsights.com/how-to-properly-setup-google-analytics-in-wordpress/\">how to set up Google Analytics in WordPress</a>. If you want to learn more, you can explore other useful articles on our blog.</p>\n<p>Now, let’s see what referrer spam actually is, and how to block WordPress referrer spam in Google Analytics.</p>\n<h3>What&#8217;s Referrer Spam?</h3>\n<p>Referrer spam is a way to pass fake website hits to your Google Analytics. You’ll receive referrer spam in your analytics reports when a spammer website sends out multiple requests to your site with fake URLs. Then, Google Analytics tracks the fake hits as valid referral traffic and prepares reports.</p>\n<p>Due to the referrer spam attack, there can be a massive increase in your regular website traffic. But those visits aren’t from humans; they&#8217;re from bots sent out by a spammer. Sometimes, the bots bypass your site and hit the Google Analytics servers directly. Such hits also appear as referral traffic in your analytics reports. That kind of spam is called ghost referral spam.</p>\n<p>Identifying referral spam in your Google Analytics reports is quite simple though. First, you&#8217;ll need to find out your referral traffic in Google Analytics. Open your Google Analytics account and navigate to <strong>Acquisition » All Traffic » Referrals</strong> to see your referrers.</p>\n<p><img class=\"alignnone size-full wp-image-165576\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/referral-spam-ganalytics-ov.jpg\" alt=\"referral-spam-ganalytics-ov\" width=\"620\" height=\"262\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/referral-spam-ganalytics-ov.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/10/referral-spam-ganalytics-ov-300x127.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></p>\n<p>You can suspect the strange and unusual domain names. Then, you can check the bounce rate. If the bounce rate is 100% and average session duration 00.00.00, these links can be spammy links.</p>\n<p>Now, let’s see how referrer spam can harm your website.</p>\n<h3>Why You Need to Worry About Referrer Spam?</h3>\n<p>One common purpose of referral spam is search engine optimization. The spammer website sends out the fake referrer URL to thousands of websites, and when they appear in the analytics reports, some are likely to click the links. Then, it increases the clicks on those links and can impact the spammer website’s SEO positively.</p>\n<p>But it can have a negative effect on your site. Sometimes those links contain malicious scripts which can make your site vulnerable to hacking.</p>\n<p>Some SEO experts argue that it doesn’t harm your site directly unless you click the links, but it can harm your business growth for sure. Lots of referrer spam can massively distort your analytics report and curb your ability to analyze your site’s performance.</p>\n<p>Similarly, if you need to show your site statistics to investors or business partners, these spam links can create a bad impression and spoil the deal.</p>\n<p>So, let’s check out how to block WordPress referrer spam in Google Analytics using 3 methods / steps.</p>\n<h3>1. Using a Strong Security Tool/ Software</h3>\n<p>Referrer spam is just one kind of spam that can affect your site; your site can be hit by a wide variety of spam and security attacks. So, you should be always prepared and plug up those security holes.</p>\n<p>To avoid the various different types of security threats to your WordPress site, you can use a powerful security tool like <a href=\"https://www.wpbeginner.com/refer/sucuri/\" target=\"_blank\" rel=\"nofollow noopener\">Sucuri</a>.</p>\n<p><a href=\"https://www.wpbeginner.com/refer/sucuri/\" target=\"_blank\" rel=\"nofollow noopener\"><img class=\"alignnone size-full wp-image-165733\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/sucuri-security-tool.jpg\" alt=\"sucuri-security-tool\" width=\"620\" height=\"311\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/sucuri-security-tool.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/10/sucuri-security-tool-300x150.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></a></p>\n<p><a href=\"https://www.wpbeginner.com/refer/sucuri/\" target=\"_blank\" rel=\"nofollow noopener\">Sucuri</a> is a powerful security and firewall software for WordPress sites. It protects your site against malware and Trojans as well as referrer spam.</p>\n<p>Sucuri Website Firewall blocks the most well-known spammy referrals by default. And, whenever it detects new referral spammers, it adds them to your block list so they cannot attack your site.</p>\n<h3>2. Blocking Referrer Spam in WordPress Using a Plugin</h3>\n<p>The second method is to install a WordPress plugin that blocks referral spam. If you look into the WordPress plugin repository, you can find plenty of security plugins. However, we’ve chosen the <a href=\"https://wordpress.org/plugins/block-referer-spam/\" target=\"_blank\" rel=\"nofollow noopener\">Block Referer Spam</a> plugin for this tutorial.</p>\n<p><a href=\"https://wordpress.org/plugins/block-referer-spam/\" target=\"_blank\" rel=\"nofollow noopener\"><img class=\"alignnone size-full wp-image-165735\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/block-referrer-spam-plugin.jpg\" alt=\"block-referrer-spam-plugin\" width=\"620\" height=\"201\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/block-referrer-spam-plugin.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/10/block-referrer-spam-plugin-300x97.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></a></p>\n<p>First, you’ll need to install and activate the plugin on your WordPress site. After it’s activated, you’ll see a <strong>Referer Spam</strong> menu added in your dashboard menu.</p>\n<p>When you hover your mouse pointer on it, you’ll see 2 submenus: <strong>Referer Spam</strong> and <strong>All Blocked Sites</strong>. If you click on <strong>All Blocked Sites</strong>, you’ll see the list of sites that are already blocked by the plugin.</p>\n<p><img class=\"alignnone size-full wp-image-165736\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/block-referrer-spam-plugin-optionsjpg.jpg\" alt=\"block-referrer-spam-plugin-options.jpg\" width=\"620\" height=\"416\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/block-referrer-spam-plugin-optionsjpg.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/10/block-referrer-spam-plugin-optionsjpg-300x201.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></p>\n<p>Now, to configure the plugin&#8217;s settings and add custom sites to block, you&#8217;ll need to click on the <strong>Referer Spam</strong> submenu.</p>\n<p>There, you can select <strong>Auto Update</strong> or <strong>Block Mode</strong>. Also, you can force a manual update of the referrer spam list.</p>\n<p><img class=\"alignnone size-full wp-image-165737\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/blockreferrerspam-auto-autoupdate.jpg\" alt=\"blockreferrerspam-auto-autoupdate\" width=\"620\" height=\"416\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/blockreferrerspam-auto-autoupdate.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/10/blockreferrerspam-auto-autoupdate-300x201.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></p>\n<p>If you see referrer spam links in your Google Analytics report that aren’t listed in the updated list, then you’ll need to add them to the custom block list. All you need to do to add custom block links is copy the links and paste them in the text area next to <strong>Custom Blocks</strong>. Don’t forget to click <strong>Save Changes</strong>.</p>\n<p><img class=\"alignnone size-full wp-image-165738\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/block-referrer-spam-custom-blocks.jpg\" alt=\"block-referrer-spam-custom-blocks\" width=\"620\" height=\"362\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/block-referrer-spam-custom-blocks.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/10/block-referrer-spam-custom-blocks-300x175.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></p>\n<p>Now, the plugin will block those referrer spam links.</p>\n<h3>3. Set Up Google Analytics Filtering to Block Ghost Referrals</h3>\n<p>Even after applying the 2 methods we suggested above, you may still see referrer spam in your Analytics reports sometimes. It’s because these websites aren’t visiting your site at all. Hence, <a href=\"https://www.wpbeginner.com/refer/sucuri/\" target=\"_blank\" rel=\"nofollow noopener\">Sucuri</a> or other plugins cannot block them.</p>\n<p>This referral spam is called ghost spam. They send out requests directly to Google Analytics using your UA Tracking code. This code is used to connect your WordPress site with your Google Analytics account, so it’s often added to the site’s header section. Because of this, anyone can find out the code and generate referrer spam using it.</p>\n<p>In order to block those websites, you&#8217;ll need to set up filters in Google Analytics.</p>\n<p>First, log into your Google Analytics account and then go to <strong>Audience » Technology » Network</strong>.</p>\n<p>Then, select <strong>Hostname</strong> as the primary dimension and expand the result to <strong>Monthly</strong>.</p>\n<p><img class=\"alignnone size-full wp-image-165744\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/ga-spammyreferrals.jpg\" alt=\"ga-spammyreferrals\" width=\"520\" height=\"356\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/ga-spammyreferrals.jpg 520w, https://www.monsterinsights.com/wp-content/uploads/2018/10/ga-spammyreferrals-300x205.jpg 300w\" sizes=\"(max-width: 520px) 100vw, 520px\" /></p>\n<p>There, you’ll see a list of hostnames with many spam hostnames. Now, note down the valid hostnames for your website to create a filter. For example, www.monsterinsights.com and monsterinsights.com, are the valid hostnames for our website.</p>\n<p>Next, you&#8217;ll need to create a filter that includes only the valid hostnames for your site. To do so, click on <strong>Admin</strong> at the end of the left-hand side&#8217;s Analytics panel. Then go to <strong>Filters</strong>.</p>\n<p><img class=\"alignnone size-full wp-image-165752\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/ganalytics-filter-option.jpg\" alt=\"ganalytics-filter-option\" width=\"620\" height=\"555\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/ganalytics-filter-option.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/10/ganalytics-filter-option-300x269.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></p>\n<p>You’ll see the filter screen with an <strong>Add Filter</strong> button. Click the button to get started. Now, you&#8217;ll have to enter your filter information here.</p>\n<p>First, add your filter name (for example, Valid Hostname Filter). Then, select Custom as your filter type and click <strong>Include</strong>. Below that, make sure that <strong>Filter Field</strong> is <strong>Hostname</strong>.</p>\n<p><img class=\"alignnone size-full wp-image-165753\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/add-filter-ganalytics-settings.jpg\" alt=\"add-filter-ganalytics-settings\" width=\"620\" height=\"555\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/add-filter-ganalytics-settings.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/10/add-filter-ganalytics-settings-300x269.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></p>\n<p>Now, you&#8217;ll see <strong>Filter Pattern</strong> box where you have to enter your valid hostnames using Regex string.</p>\n<p>The format is simple, you will need to add a ^ sign before each hostname and a $ sign after it. Use | sign to separate hostnames.</p>\n<p>So, your list of valid hostnames in the Filter Patter will look like below:</p>\n<p>^monsterinsights.com$|^example.monsterinsights.com$</p>\n<p>After that, click the <strong>Save</strong> button. Then, you can check your Google Analytics reports after 24 hours to see the changes.</p>\n<p>We hope this article helped to learn how to block WordPress referrer spam in Google Analytics. You may also want to check out our complete guide on <a href=\"https://www.monsterinsights.com/how-to-create-google-analytics-advanced-segments/\">creating advanced segments in Google Analytics</a>.</p>\n<p>And don’t forget to follow us on <a href=\"https://twitter.com/monsterinsights\" target=\"_blank\" rel=\"nofollow noopener\">Twitter</a> and <a href=\"https://www.facebook.com/monsterinsights\" target=\"_blank\" rel=\"nofollow noopener\">Facebook</a> for more helpful Google Analytics tips.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://www.monsterinsights.com/block-wordpress-referrer-spam-in-google-analytics/\">How to Block WordPress Referrer Spam in Google Analytics</a> appeared first on <a rel=\"nofollow\" href=\"https://www.monsterinsights.com\">MonsterInsights</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:87:\"https://www.monsterinsights.com/block-wordpress-referrer-spam-in-google-analytics/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:7;a:6:{s:4:\"data\";s:51:\"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:62:\"11 Best WordPress Plugins and Tools to Boost Your Site’s SEO\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:189:\"https://www.monsterinsights.com/best-wordpress-plugins-and-tools-to-boost-your-sites-seo/?utm_source=rss&utm_medium=rss&utm_campaign=best-wordpress-plugins-and-tools-to-boost-your-sites-seo\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:97:\"https://www.monsterinsights.com/best-wordpress-plugins-and-tools-to-boost-your-sites-seo/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 18 Oct 2018 13:15:45 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:4:{i:0;a:5:{s:4:\"data\";s:9:\"Marketing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:11:\"SEO plugins\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:13:\"WordPress SEO\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:3;a:5:{s:4:\"data\";s:19:\"improve website SEO\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"https://www.monsterinsights.com/?p=165756\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:650:\"<p>Looking for the best WordPress plugins and tools to boost your site’s SEO? Search Engine Optimization (SEO) is the process of optimizing your site’s presence on organic search engine results to increase traffic to your site. With the right set of SEO plugins and tools, you can skyrocket your site&#8217;s overall success by making it [&#8230;]</p>\n<p>The post <a rel=\"nofollow\" href=\"https://www.monsterinsights.com/best-wordpress-plugins-and-tools-to-boost-your-sites-seo/\">11 Best WordPress Plugins and Tools to Boost Your Site’s SEO</a> appeared first on <a rel=\"nofollow\" href=\"https://www.monsterinsights.com\">MonsterInsights</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"Sunita Rai\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:19760:\"<p>Looking for the best WordPress plugins and tools to boost your site’s SEO? Search Engine Optimization (SEO) is the process of optimizing your site’s presence on organic search engine results to increase traffic to your site. With the right set of SEO plugins and tools, you can skyrocket your site&#8217;s overall success by making it easier to find.</p>\n<p>In this article, we’ll share the 11 best WordPress SEO plugins and tools to improve your site’s SEO.</p>\n<h3><a href=\"https://www.monsterinsights.com/\">1. MonsterInsights</a></h3>\n<p><a href=\"https://www.monsterinsights.com/\"><img class=\"alignnone size-full wp-image-157422\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/08/monsterinsights-best-ga-plugin-for-wordpress.jpg\" alt=\"monsterinsights-best-ga-plugin-for-wordpress\" width=\"620\" height=\"250\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/08/monsterinsights-best-ga-plugin-for-wordpress.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/08/monsterinsights-best-ga-plugin-for-wordpress-300x121.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></a></p>\n<p>Website analytics are important for making better business decisions, creating marketing strategies, and improving your site’s SEO. Using Google Analytics, you can track important data on how search engines and your site&#8217;s visitors view your website.</p>\n<p><a href=\"https://www.monsterinsights.com/\">MonsterInsights</a> is the best way to use Google Analytics in WordPress. It’s the most user-friendly, most powerful Google Analytics plugin for WordPress.</p>\n<p>Using MonsterInsights, you can see your site’s top keywords; the keywords people are searching when they find your site. It also allows you to <a href=\"https://www.monsterinsights.com/docs/how-to-connect-google-search-console-to-google-analytics/\">connect your Analytics account with Search Console</a> and provides you with search console reports right in your WordPress dashboards.</p>\n<p>Plus, you can view your site’s mobile traffic, top referrals, top outbound links, most popular content, etc. You can use these reports to improve your SEO content as well as earn more backlinks.</p>\n<p>To learn more about the SEO benefits of MonsterInsights, check out our guide on <a href=\"https://www.monsterinsights.com/important-google-analytics-reports-to-improve-your-sites-seo/\">6 important Google Analytics reports to improve your WordPress SEO</a>.</p>\n<p><a href=\"https://www.monsterinsights.com/\">Get started with MonsterInsights today!</a></p>\n<h3><a href=\"https://wordpress.org/plugins/wordpress-seo/\" target=\"_blank\" rel=\"nofollow noopener\">2. Yoast SEO</a></h3>\n<p><a href=\"https://wordpress.org/plugins/wordpress-seo/\" target=\"_blank\" rel=\"nofollow noopener\"><img class=\"alignnone size-full wp-image-154146\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/08/yoast-seo-best-free-wordpress-seo-plugin.jpg\" alt=\"yoast-seo-best-free-wordpress-seo-plugin\" width=\"560\" height=\"182\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/08/yoast-seo-best-free-wordpress-seo-plugin.jpg 560w, https://www.monsterinsights.com/wp-content/uploads/2018/08/yoast-seo-best-free-wordpress-seo-plugin-300x98.jpg 300w\" sizes=\"(max-width: 560px) 100vw, 560px\" /></a></p>\n<p>Yoast SEO is the most popular WordPress SEO plugin available in the market, and for good reason. The plugin provides you with a massive range of SEO features and options to optimize your site for search engines as well as for your site&#8217;s visitors.</p>\n<p>With Yoast SEO, you can find the most advanced XML sitemaps to help search engines to better index your site. It also allows you to add breadcrumbs, set canonical URLs to avoid duplicate content, and add title and Meta tags for your site and every post you publish.</p>\n<p>Plus, it helps you to create better content overall with its Content and SEO analysis feature. It checks every piece of content you write and shows you how it looks from SEO and readability point of view. Meaning, it not only keeps the search engine bots happy, but your human readers as well!</p>\n<p>Additionally, it has several other interesting features like cornerstone content and internal linking, Google Search Console integration, snippet previews for search results and social media, multiple focus keywords, and much more.</p>\n<p><a href=\"https://wordpress.org/plugins/wordpress-seo/\" target=\"_blank\" rel=\"nofollow noopener\">Get started with Yoast SEO today!</a></p>\n<h3><a href=\"https://www.wpbeginner.com/refer/semrush/\" target=\"_blank\" rel=\"nofollow noopener\">3. SEMrush</a></h3>\n<p><a href=\"https://www.wpbeginner.com/refer/semrush/\" target=\"_blank\" rel=\"nofollow noopener\"><img class=\"alignnone size-full wp-image-155283\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/08/semrush-marketing-tool.jpg\" alt=\"semrush-marketing-tool\" width=\"560\" height=\"280\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/08/semrush-marketing-tool.jpg 560w, https://www.monsterinsights.com/wp-content/uploads/2018/08/semrush-marketing-tool-300x150.jpg 300w\" sizes=\"(max-width: 560px) 100vw, 560px\" /></a></p>\n<p>SEMrush is a powerful SEO and marketing tool available on the market, and a favorite among SEO professionals. It comes with a full set of features to enable you to supercharge your site’s SEO, content marketing, social media, and paid traffic.</p>\n<p>Using this tool, you can analyze your website along with your competitor&#8217;s sites and gather important insights. You can see what organic keywords your site is ranking for, where your backlinks come from, the performance of your advertising, analytics, etc. What’s most interesting about this tool is you can also view all of this information for your competitor&#8217;s sites as well.</p>\n<p>Since you can peep into the SEO and paid advertising strategies of your competitors, you can build better strategies for your own business to make your site stand out. Sometimes, you can even borrow the best strategies they’re using.</p>\n<p><a href=\"https://www.wpbeginner.com/refer/semrush/\" target=\"_blank\" rel=\"nofollow noopener\">Get started with SEMrush today!</a></p>\n<h3><a href=\"https://www.wpbeginner.com/refer/ahrefs/\" target=\"_blank\" rel=\"nofollow noopener\">4. Ahrefs</a></h3>\n<p><a href=\"https://www.wpbeginner.com/refer/ahrefs/\" target=\"_blank\" rel=\"nofollow noopener\"><img class=\"alignnone size-full wp-image-164613\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/ahrefs-seo-tool.jpg\" alt=\"ahrefs-seo-tool\" width=\"620\" height=\"300\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/ahrefs-seo-tool.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/10/ahrefs-seo-tool-300x145.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></a></p>\n<p>Ahrefs is one of the most popular SEO tools used by SEO experts and business owners. It allows you to view your site’s SEO performance as well as your competitor sites’ SEO performance and strategies. With these insights, you can learn what you need to do to outrank your competitors.</p>\n<p>Ahrefs comes with every SEO functionality you’ll ever need. You can see detailed organic search reports, including your top organic keywords, their position in the search results, rank movement over time, competing pages, etc. Besides, you can see top pages by links, social shares, and content analysis that&#8217;ll help you learn about the types of content that gain popularity.</p>\n<p>Similarly, it has advanced backlink research options that allow you to see the full backlink profile for any site. You can see updated backlinks every 15 minutes, anchor text for the backlinks, referring pages, etc.</p>\n<p>There’re more options for keyword research, content research, rank tracking, web monitoring, etc. in Ahrefs. It’s a great tool to boost your site’s SEO.</p>\n<p><a href=\"https://www.wpbeginner.com/refer/ahrefs/\" target=\"_blank\" rel=\"nofollow noopener\">Get started with Ahrefs today!</a></p>\n<h3><a href=\"https://adwords.google.com/KeywordPlanner\" target=\"_blank\" rel=\"nofollow noopener\">5. Google Keyword Planner</a></h3>\n<p><a href=\"https://adwords.google.com/KeywordPlanner\" target=\"_blank\" rel=\"nofollow noopener\"><img class=\"alignnone size-full wp-image-165762\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/google-keyword-planner-wordpress-seo-tools.jpg\" alt=\"google-keyword-planner-wordpress-seo-tools\" width=\"620\" height=\"346\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/google-keyword-planner-wordpress-seo-tools.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/10/google-keyword-planner-wordpress-seo-tools-300x167.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></a></p>\n<p>Google Keyword Planner is a powerful tool designed for Adwords advertisers to find the keywords with the best value for their sites. However, it has a lot of SEO value to offer. You can use this tool to find new keywords for your business.</p>\n<p>You can enter words, phrases, or a URL related to your business and start the search. Then, you’ll see the top keywords with average monthly searches on Google. Plus, you can see bidding amounts and competition levels. Although bidding value is designed for advertisers, you can learn a lot about keywords from it.</p>\n<p>It’s a free tool offered by Google. Thus, you can be precise about the keywords’ search volume, advertiser interest, competition, etc.</p>\n<p><a href=\"https://adwords.google.com/KeywordPlanner\" target=\"_blank\" rel=\"nofollow noopener\">Get started with Google Keyword Planner today!</a></p>\n<h3><a href=\"https://moz.com/link-explorer/\" target=\"_blank\" rel=\"nofollow noopener\">6. Link Explorer</a></h3>\n<p><a href=\"https://moz.com/link-explorer/\" target=\"_blank\" rel=\"nofollow noopener\"><img class=\"alignnone size-full wp-image-165763\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/moz-link-explorer-seo-plugins.jpg\" alt=\"moz-link-explorer-seo-plugins\" width=\"620\" height=\"284\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/moz-link-explorer-seo-plugins.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/10/moz-link-explorer-seo-plugins-300x137.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></a></p>\n<p>Link Explorer is a powerful SEO tool created by Moz. It’s a great link building tool that comes with feature-rich tools for link analysis and SEO research.</p>\n<p>With this tool, you can see discovered and lost links, domain authority over time, competitor’s analysis, spam score for penalized sites, link tracking, and more for any domain. You can compare the results and plan better SEO strategies. Besides, it has an easy-to-use Compare Link Profiles option to allow you to compare and analyze better.</p>\n<p>You can search up to 10 queries every month with a free Moz account. To unlock full access and features, you’ll need to subscribe to Moz Pro.</p>\n<p><a href=\"https://moz.com/link-explorer/\" target=\"_blank\" rel=\"nofollow noopener\">Get started with Link Explorer today!</a></p>\n<h3><a href=\"https://keywordtool.io/\" target=\"_blank\" rel=\"nofollow noopener\">7. KeywordTool.io</a></h3>\n<p><a href=\"https://keywordtool.io/\" target=\"_blank\" rel=\"nofollow noopener\"><img class=\"alignnone size-full wp-image-165764\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/keywordtool-io-seo-tools-wordpress.jpg\" alt=\"keywordtool-io-seo-tools-wordpress\" width=\"620\" height=\"277\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/keywordtool-io-seo-tools-wordpress.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/10/keywordtool-io-seo-tools-wordpress-300x134.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></a></p>\n<p>Just as its name implies, KeywordTool.io is a popular keyword research tool for SEO professionals. It’s a free tool you can use without creating an account. Yet, you can subscribe to its premium version for more advanced features, if needed.</p>\n<p>The tool uses Google’s auto-suggest feature to gather keywords. The search terms suggested by Google are selected based on how often users were searching for that particular term on Google.</p>\n<p>With its free version, you can see up to 750 keyword suggestions for every search. You can search keywords for different search channels like Google, YouTube, Bing, Amazon, etc. separately and also narrow the search for specific locations and languages.</p>\n<p><a href=\"https://keywordtool.io/\" target=\"_blank\" rel=\"nofollow noopener\">Get started with KeywordTool.io today!</a></p>\n<h3><a href=\"https://www.outreachplus.com/\" target=\"_blank\" rel=\"nofollow noopener\">8. OutreachPlus</a></h3>\n<p><a href=\"https://www.outreachplus.com/\" target=\"_blank\" rel=\"nofollow noopener\"><img class=\"alignnone size-full wp-image-165765\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/outreachplus-reachout-tool.jpg\" alt=\"outreachplus-reachout-tool\" width=\"620\" height=\"364\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/outreachplus-reachout-tool.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/10/outreachplus-reachout-tool-300x176.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></a></p>\n<p>OutreachPlus is a great email outreach software useful for marketers and SEO experts. It helps you send personalized emails to your prospective partners and customers to earn more traffic and backlinks. You can reach out to influencers to help grow your business.</p>\n<p>In addition to personalization, it has smart automation features which save a lot of time and also maintain follow-ups automatically. It detects user behavior like email open, reply, links clicked, and triggers personalized emails instantly based on their behavior.</p>\n<p>To ensure that your emails are delivered safely, it has an inbuilt email client. Also, it has a simple Inbox to help you manage your emails, track interactions, process responses quickly, and get multiple members involved in it.</p>\n<p><a href=\"https://www.outreachplus.com/\" target=\"_blank\" rel=\"nofollow noopener\">Get started with OutreachPlus today!</a></p>\n<h3><a href=\"https://wordpress.org/plugins/broken-link-checker/\" target=\"_blank\" rel=\"nofollow noopener\">9. Broken Link Checker</a></h3>\n<p><a href=\"https://wordpress.org/plugins/broken-link-checker/\" target=\"_blank\" rel=\"nofollow noopener\"><img class=\"alignnone size-full wp-image-162130\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/09/broken-link-checker-wordpress-plugin.jpg\" alt=\"broken-link-checker-wordpress-plugin\" width=\"620\" height=\"198\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/09/broken-link-checker-wordpress-plugin.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/09/broken-link-checker-wordpress-plugin-300x96.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></a></p>\n<p>Broken Link Checker is a free WordPress SEO plugin that checks your site content for broken links and helps you fix them. As you create more and more content every day, you rarely have time to check your old posts. That’s where the plugin comes handy. It checks your entire archive of published content and notifies you about broken links and lost images.</p>\n<p>Broken links create a really bad impression among your site visitors and also harms your site&#8217;s SEO. Hence, the plugin is very useful to keep your site content updated and fresh.</p>\n<p>However, the plugin can sometimes slow down your site as it’s resource intensive.</p>\n<p><a href=\"https://wordpress.org/plugins/broken-link-checker/\" target=\"_blank\" rel=\"nofollow noopener\">Get started with Broken Link Checker today!</a></p>\n<h3><a href=\"https://www.seoquake.com/index.html\" target=\"_blank\" rel=\"nofollow noopener\">10. SEOquake</a></h3>\n<p><a href=\"https://www.seoquake.com/index.html\" target=\"_blank\" rel=\"nofollow noopener\"><img class=\"alignnone size-full wp-image-165766\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/seoquake-seo-tools-wordpress.jpg\" alt=\"seoquake-seo-tools-wordpress\" width=\"620\" height=\"365\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/seoquake-seo-tools-wordpress.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/10/seoquake-seo-tools-wordpress-300x177.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></a></p>\n<p>SEOquake is a browser addon designed to help you get SEO insights with a simple mouse click. You can install the addon to Google Chrome, Mozilla Firefox, and Safari browsers to see a huge selection of SEO parameters for any webpage.</p>\n<p>With this tool, you can quickly conduct an on-page SEO audit, which allows you to identify and fix various optimization issues. It has a link examiner tool which shows you details for both internal and external links on any webpage. Plus, it allows you to see page rank, age, last updated date, Alexa rank, and much more.</p>\n<p>It’s a tiny-yet-handy tool for quick SEO performance overview and optimization.</p>\n<p><a href=\"https://www.seoquake.com/index.html\" target=\"_blank\" rel=\"nofollow noopener\">Get started with SEOquake today!</a></p>\n<h3><a href=\"https://wordpress.org/plugins/rel-nofollow-checkbox/\" target=\"_blank\" rel=\"nofollow noopener\">11. Rel NoFollow Checkbox</a></h3>\n<p><a href=\"https://wordpress.org/plugins/rel-nofollow-checkbox/\" target=\"_blank\" rel=\"nofollow noopener\"><img class=\"alignnone size-full wp-image-165767\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/rel-nofollow-checkbox-seo-plugin-wordpress.jpg\" alt=\"rel-nofollow-checkbox-seo-plugin-wordpress\" width=\"560\" height=\"280\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/rel-nofollow-checkbox-seo-plugin-wordpress.jpg 560w, https://www.monsterinsights.com/wp-content/uploads/2018/10/rel-nofollow-checkbox-seo-plugin-wordpress-300x150.jpg 300w\" sizes=\"(max-width: 560px) 100vw, 560px\" /></a></p>\n<p>Most SEO experts advise adding a nofollow attribute to external links on your site. Adding a nofollow attribute helps you to avoid passing your site’s authority to other sites.</p>\n<p>Rel NoFollow Checkbox is a free WordPress plugin which you can use to add a nofollow checkbox in your links. It adds a nofollow checkbox to the insert link popup in WordPress post editor. The post editor, by default, only has a checkbox to open links in new tab.</p>\n<p>This plugin helps you to add the nofollow attribute to the sites you don’t want to pass authority to. Sometimes you may want to add a dofollow link to your partners&#8217; websites or helpful resource websites. In such cases, you can leave the nofollow checkbox unchecked.</p>\n<p><a href=\"https://wordpress.org/plugins/rel-nofollow-checkbox/\" target=\"_blank\" rel=\"nofollow noopener\">Get started with Rel NoFollow Checkbox today!</a></p>\n<p>We hope this article helped you find the best WordPress SEO plugins and tools to improve your website’s SEO. You may also like to see our post on the <a href=\"https://www.monsterinsights.com/woocommerce-seo-tips-to-boost-traffic-and-sales/\">best WooCommerce SEO tips to boost your traffic and sales</a>.</p>\n<p>Also, don’t forget to follow us on <a href=\"https://twitter.com/monsterinsights\" target=\"_blank\" rel=\"nofollow noopener\">Twitter</a> and <a href=\"https://www.facebook.com/monsterinsights\" target=\"_blank\" rel=\"nofollow noopener\">Facebook</a> for more Google Analytics tutorials.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://www.monsterinsights.com/best-wordpress-plugins-and-tools-to-boost-your-sites-seo/\">11 Best WordPress Plugins and Tools to Boost Your Site’s SEO</a> appeared first on <a rel=\"nofollow\" href=\"https://www.monsterinsights.com\">MonsterInsights</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:94:\"https://www.monsterinsights.com/best-wordpress-plugins-and-tools-to-boost-your-sites-seo/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:8;a:6:{s:4:\"data\";s:48:\"\n		\n		\n		\n		\n		\n				\n		\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:48:\"How to Add Google AdSense to Your WordPress Site\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:173:\"https://www.monsterinsights.com/how-to-add-google-adsense-to-your-wordpress-site/?utm_source=rss&utm_medium=rss&utm_campaign=how-to-add-google-adsense-to-your-wordpress-site\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:89:\"https://www.monsterinsights.com/how-to-add-google-adsense-to-your-wordpress-site/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 15 Oct 2018 13:10:45 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:3:{i:0;a:5:{s:4:\"data\";s:9:\"Tutorials\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:12:\"ads tracking\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:28:\"google adsense for WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"https://www.monsterinsights.com/?p=165549\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:588:\"<p>Do you want to add Google AdSense to your WordPress site? Google AdSense is a free, simple way to earn money from your website by displaying targeted Google Ads on your site. In this article, we’ll show you how to properly add Google AdSense to your WordPress site along with a quick guide on how [&#8230;]</p>\n<p>The post <a rel=\"nofollow\" href=\"https://www.monsterinsights.com/how-to-add-google-adsense-to-your-wordpress-site/\">How to Add Google AdSense to Your WordPress Site</a> appeared first on <a rel=\"nofollow\" href=\"https://www.monsterinsights.com\">MonsterInsights</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"Sunita Rai\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:15351:\"<p>Do you want to add Google AdSense to your WordPress site? Google AdSense is a free, simple way to earn money from your website by displaying targeted Google Ads on your site.</p>\n<p>In this article, we’ll show you how to properly add Google AdSense to your WordPress site along with a quick guide on how to track the performance of your ads with Google Analytics.</p>\n<h3>What is Google AdSense?</h3>\n<p><a href=\"https://www.wpbeginner.com/refer/google-adsense/\" target=\"_blank\" rel=\"nofollow noopener\">Google AdSense</a> is a popular advertising network run by Google that allows you to easily add Google advertisements to make money from your website. It’s a cost-per-click (CPC) program in which you’ll get paid for every click users make on your site&#8217;s ads.</p>\n<p>Google AdSense provides the easiest way to monetize your site; you just need to insert a small code snippet on your site, and Google will do the rest.</p>\n<p>First, AdSense spiders will crawl your site to detect what your site content is about and then they&#8217;ll put related ads onto the ad blocks on your site. When people start to click on the ads, you’ll start making money.</p>\n<p>The process of getting payments is hassle-free because you don’t need to deal with advertisers. Google deals with the advertisers, collects payment from them, and sends you a percentage of the collected money. Google takes a small percentage of the money as their management fee.</p>\n<p>Now, let’s see how to add Google AdSense to your WordPress site in 3 easy steps.</p>\n<h3>Step 1: Create a Google AdSense Account and Connect It with WordPress</h3>\n<p>First, you&#8217;ll need to sign up for a Google AdSense account by going to the <a href=\"https://www.wpbeginner.com/refer/google-adsense/\" target=\"_blank\" rel=\"nofollow noopener\">Google AdSense website</a>. Click the <strong>Sign Up Now</strong> button to start signup process.</p>\n<p><a href=\"https://www.wpbeginner.com/refer/google-adsense/\" target=\"_blank\" rel=\"nofollow noopener\"><img class=\"alignnone size-full wp-image-165553\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/signup-googleas.jpg\" alt=\"signup-googleadsense\" width=\"620\" height=\"347\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/signup-googleas.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/10/signup-googleas-300x168.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></a></p>\n<p>On the next page, you’ll need to enter your website URL and email address. Then, choose whether you want to get helpful AdSense info to your email address by selecting your preferred option and click the <strong>Save and Continue</strong> button.</p>\n<p><img class=\"alignnone size-full wp-image-165554\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/create-asaccount.jpg\" alt=\"create-adsenseaccount\" width=\"620\" height=\"520\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/create-asaccount.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/10/create-asaccount-300x252.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></p>\n<p>Next, you’ll need to choose your home country and check the <strong>Terms and Conditions</strong> box to proceed. Finally, click the <strong>Create Account</strong> button.</p>\n<p>If you can see your Google AdSense homepage that means you’ve created your AdSense account. After this, the next step is to activate your account.</p>\n<p>On your AdSense homepage, you’ll find 2 tasks to complete to activate your AdSense account:</p>\n<ul>\n<li>First, you&#8217;ll need to provide your payment address.</li>\n<li>Second, you&#8217;ll need connect your WordPress site to AdSense.</li>\n</ul>\n<p>To connect your site to AdSense, you’ll need to add a piece of HTML code to your WordPress site’s header. You’ll find this code on your AdSense homepage. Copy the code.</p>\n<p><img class=\"alignnone size-full wp-image-165555\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/connect-wordpress-to-adsens.jpg\" alt=\"connect-wordpress-to-adsense\" width=\"620\" height=\"490\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/connect-wordpress-to-adsens.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/10/connect-wordpress-to-adsens-300x237.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></p>\n<p>To add the code, you’ll need log into your WordPress dashboard and install the <a href=\"https://wordpress.org/plugins/insert-headers-and-footers/\" target=\"_blank\" rel=\"nofollow noopener\">Insert Headers and Footers plugin</a>. The plugin lets you insert code into your theme&#8217;s header and footers safely, without having to edit your theme&#8217;s file.</p>\n<p>After you install the plugin, you can go to <strong>Settings » Insert Headers and Footers</strong> and paste the HTML code into the header field.</p>\n<p><img class=\"alignnone size-full wp-image-165556\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/insert-header-withplugin.jpg\" alt=\"insert-header-withplugin\" width=\"620\" height=\"296\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/insert-header-withplugin.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/10/insert-header-withplugin-300x143.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></p>\n<p>Now that you’ve added the code to your site’s header, return to your Google AdSense account homepage and click the <strong>I’ve pasted the code into my site</strong> box. Then, click the <strong>Done</strong> button.</p>\n<p><img class=\"alignnone size-full wp-image-165557\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/asactivation-process-complete.jpg\" alt=\"adsenseactivation-process-complete\" width=\"620\" height=\"465\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/asactivation-process-complete.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/10/asactivation-process-complete-300x225.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></p>\n<p>Next, you’ll see a short notice from Google AdSense that they’re reviewing your site. This is perfectly normal, but it does mean you&#8217;ll have to wait. Usually it takes a day to complete the activation process; however, it can take up to a couple of weeks for some sites.</p>\n<p><img class=\"alignnone size-full wp-image-165558\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/as-activation-review.jpg\" alt=\"adsense-activation-review\" width=\"620\" height=\"142\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/as-activation-review.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/10/as-activation-review-300x69.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></p>\n<p><strong>Note:</strong> Sometimes, Google can’t activate your account if your site fails to comply with the <a href=\"https://support.google.com/adsense/answer/48182\" target=\"_blank\" rel=\"nofollow noopener\">AdSense program policies</a>.</p>\n<h3>Step 2: Creating Google AdSense Units</h3>\n<p>Once your Google AdSense account is activated, you’ll get access to all the AdSense options which were grey before. Now you can start creating ad units.</p>\n<p>To get started, you’ll need to the click <strong>My Ads</strong> tab and select <strong>Content</strong>. Next, click on <strong>Ad Units</strong> and the <strong>New ad unit</strong> button.</p>\n<p><img class=\"alignnone size-full wp-image-165560\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/add-new-ad-unit.jpg\" alt=\"add-new-ad-unit\" width=\"560\" height=\"305\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/add-new-ad-unit.jpg 560w, https://www.monsterinsights.com/wp-content/uploads/2018/10/add-new-ad-unit-300x163.jpg 300w\" sizes=\"(max-width: 560px) 100vw, 560px\" /></p>\n<p>Next, you&#8217;ll need to give a name to your ad unit and select the ad size, type, style, and colors you prefer.</p>\n<p><img class=\"alignnone size-full wp-image-165561\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/create-ad-unit.jpg\" alt=\"create-ad-unit\" width=\"620\" height=\"560\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/create-ad-unit.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/10/create-ad-unit-300x271.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></p>\n<p>From <strong>Ad size</strong>, you can choose your ad dimensions. When choosing, make sure to choose one listed under <strong>Recommended </strong>for the best results.</p>\n<p>Next, you can select an ad type from <strong>Ad Type</strong> option. You’ll see <strong>Text &amp; display ads</strong> by default. You can simply stick with that.</p>\n<p>Another option within <strong>Ad style</strong> lets you customize the look of your text-based ad units. Mainly, you can change their design and color.</p>\n<p>The next option, <strong>Custom channels</strong>, allows you to better track the ad performance based on sites. This feature is optional, so you can skip this if you don’t want to use it.</p>\n<p>The last option, <strong>If no ads available</strong>, allows you to set what you’d like to show if Google can’t find any relevant ads.</p>\n<p>Once you’re done with this setup, simply click on <strong>Save and get code</strong> button.</p>\n<p>It’ll provide you with an ad code:</p>\n<p><img class=\"alignnone size-full wp-image-165563\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/ad-code.jpg\" alt=\"ad-code\" width=\"620\" height=\"475\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/ad-code.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/10/ad-code-300x230.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></p>\n<p>Copy the ad code and save it somewhere safe because you’ll need it in the next step.</p>\n<h3>Step 3: Adding Google AdSense Ads to WordPress</h3>\n<p>Now that you’ve successfully created your ad unit, you’re ready to add Google AdSense ads to your WordPress site.</p>\n<p>Advertisements are commonly displayed in the sidebars and other widget areas like your site&#8217;s footer. You can easily add the Google ad code to your site’s sidebars and other widget areas using the <strong>Custom HTML</strong> widget.</p>\n<p>First log into your WordPress site. Then, navigate to your <strong>Appearance » Widgets</strong> page from the dashboard. Next, drag and drop the <strong>Custom HTML</strong> widget to your selected widget area, like your Right Sidebar. Paste the Google AdSense code that you copied in the earlier step into the box. Don’t forget to click the <strong>Save</strong> button.</p>\n<p><img class=\"alignnone size-full wp-image-165564\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/add-code-to-customhtml-widg.jpg\" alt=\"add-code-to-customhtml-widg\" width=\"620\" height=\"379\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/add-code-to-customhtml-widg.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/10/add-code-to-customhtml-widg-300x183.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></p>\n<p>That’s it! Now you can visit your website&#8217;s front-end and check out how the ad looks.</p>\n<p>If you want advanced options for placement and tracking, you can check out the best ad management plugin on the market: <a href=\"https://www.wpbeginner.com/refer/adsanity/\" target=\"_blank\" rel=\"nofollow noopener\">AdSanity</a>.</p>\n<h3>Tracking Your AdSense Banner Ads in Google Analytics</h3>\n<p>Using Google AdSense, you can make decent earnings without putting in much effort. So, a little extra effort in improving the way you display ads can really boost your earning potential.</p>\n<p>Tracking the performance of your AdSense ads gives you comprehensive data on how your site&#8217;s visitors interact with your ads. Using this data, you can <a href=\"https://www.monsterinsights.com/adsense-tips-to-increase-earnings/\">improve your ad strategies and increase your earnings</a>.</p>\n<p>To properly track your Google AdSense ads, we recommend you use the <a href=\"https://www.monsterinsights.com/\">MonsterInsights</a> plugin.</p>\n<p><a href=\"https://www.monsterinsights.com/\"><img class=\"alignnone size-full wp-image-157422\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/08/monsterinsights-best-ga-plugin-for-wordpress.jpg\" alt=\"monsterinsights-best-ga-plugin-for-wordpress\" width=\"620\" height=\"250\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/08/monsterinsights-best-ga-plugin-for-wordpress.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/08/monsterinsights-best-ga-plugin-for-wordpress-300x121.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></a></p>\n<p><a href=\"https://www.monsterinsights.com/\">MonsterInsights</a> is the best and most beginner-friendly powerful Google Analytics plugin available on the market. It comes with a powerful <a href=\"https://www.monsterinsights.com/addon/ads/\">Ads Tracking addon</a> to help you track the performance of your AdSense ads properly.</p>\n<p>With MonsterInsights ads tracking, you can track click-through rates to see how many clicks each banner ad is receiving. Then, you can identify the most effective placements on your website.</p>\n<p>To be able to track your AdSense ads, you’ll need to <a href=\"https://www.monsterinsights.com/how-to-properly-setup-google-analytics-in-wordpress/\">set up Google Analytics in WordPress using MonsterInsights</a>. Then, you’ll need to install the Ads Tracking addon and enable Google AdSense tracking.</p>\n<p><img class=\"alignnone size-full wp-image-89954\" src=\"https://www.monsterinsights.com/wp-content/uploads/2017/02/activate-ads-addon.jpg\" alt=\"activate ads addon\" width=\"379\" height=\"474\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2017/02/activate-ads-addon.jpg 379w, https://www.monsterinsights.com/wp-content/uploads/2017/02/activate-ads-addon-240x300.jpg 240w\" sizes=\"(max-width: 379px) 100vw, 379px\" /></p>\n<p>For detailed instructions, check out our step-by-step guide on <a href=\"https://www.monsterinsights.com/how-to-track-adsense-in-google-analytics-to-optimize-your-revenue/\">how to track AdSense in Google Analytics</a>.</p>\n<p>After you&#8217;ve set up ads tracking in WordPress, you can <a href=\"https://www.monsterinsights.com/how-to-view-your-adsense-reports-in-google-analytics/\">view your AdSense performance reports</a> in Google Analytics.</p>\n<p>We hope this article helped you to learn how to add Google AdSense ads to your WordPress site. You may also like to read our post on <a href=\"https://www.monsterinsights.com/types-of-websites-that-earn-the-most-money-with-google-adsense/\">3 website types that earn most money with Google AdSense</a>.</p>\n<p>Also, don’t forget to follow us on <a href=\"https://twitter.com/monsterinsights\" target=\"_blank\" rel=\"nofollow noopener\">Twitter</a> and <a href=\"https://www.facebook.com/monsterinsights\" target=\"_blank\" rel=\"nofollow noopener\">Facebook</a> for more Google Analytics tutorials.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://www.monsterinsights.com/how-to-add-google-adsense-to-your-wordpress-site/\">How to Add Google AdSense to Your WordPress Site</a> appeared first on <a rel=\"nofollow\" href=\"https://www.monsterinsights.com\">MonsterInsights</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:86:\"https://www.monsterinsights.com/how-to-add-google-adsense-to-your-wordpress-site/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:9;a:6:{s:4:\"data\";s:51:\"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:60:\"8 Google Analytics Metrics Bloggers Should Track for Success\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:193:\"https://www.monsterinsights.com/google-analytics-metrics-bloggers-should-track-for-success/?utm_source=rss&utm_medium=rss&utm_campaign=google-analytics-metrics-bloggers-should-track-for-success\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:99:\"https://www.monsterinsights.com/google-analytics-metrics-bloggers-should-track-for-success/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 11 Oct 2018 14:45:51 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:4:{i:0;a:5:{s:4:\"data\";s:9:\"Marketing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:17:\"content marketing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:30:\"analytics reports for bloggers\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:3;a:5:{s:4:\"data\";s:23:\"optimize WordPress blog\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"https://www.monsterinsights.com/?p=165045\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:658:\"<p>Want to know which Google Analytics metrics bloggers should track and why? Google Analytics is a powerful website analytics tool that allows you to track your current blog audience and helps you to better understand your blog readers overall. By tracking Google Analytics metrics, you can measure your blog’s position at the present, its growth [&#8230;]</p>\n<p>The post <a rel=\"nofollow\" href=\"https://www.monsterinsights.com/google-analytics-metrics-bloggers-should-track-for-success/\">8 Google Analytics Metrics Bloggers Should Track for Success</a> appeared first on <a rel=\"nofollow\" href=\"https://www.monsterinsights.com\">MonsterInsights</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"Sunita Rai\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:21423:\"<p>Want to know which Google Analytics metrics bloggers should track and why? Google Analytics is a powerful website analytics tool that allows you to track your current blog audience and helps you to better understand your blog readers overall.</p>\n<p>By tracking Google Analytics metrics, you can measure your blog’s position at the present, its growth over time, and build strategies for bigger success in the future. In this article, we’ll share the 8 most important Google Analytics metrics bloggers should track to increase their success.</p>\n<h3>Using Google Analytics in WordPress</h3>\n<p>If you’re running a blog in WordPress, using Google Analytics is very easy with <a href=\"https://www.monsterinsights.com/\">MonsterInsights</a>.</p>\n<p><a href=\"https://www.monsterinsights.com/\"><img class=\"alignnone size-full wp-image-157422\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/08/monsterinsights-best-ga-plugin-for-wordpress.jpg\" alt=\"monsterinsights-best-ga-plugin-for-wordpress\" width=\"620\" height=\"250\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/08/monsterinsights-best-ga-plugin-for-wordpress.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/08/monsterinsights-best-ga-plugin-for-wordpress-300x121.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></a></p>\n<p>MonsterInsights is the most user-friendly and most powerful Google Analytics plugin for WordPress. It allows you to connect Google Analytics with your WordPress blog effortlessly and provides you with all the important metrics about your blog in the most comprehensive way.</p>\n<p>The plugin makes tracking advanced metrics like <a href=\"https://www.monsterinsights.com/addon/forms/\">forms conversions</a>, <a href=\"https://www.monsterinsights.com/addon/ecommerce/\">eCommerce</a>, downloads, and custom dimensions easy via simple addons. Without the plugin, you’d need to manually set up your Analytics account to track them. The manual setup process is quite complex and a beginner would need to hire an expert to get it working properly.</p>\n<p>In addition, MonsterInsights creates an <a href=\"https://www.monsterinsights.com/feature/google-analytics-dashboard/\">Analytics dashboard</a> directly in your WordPress dashboard to allow you to see all the metrics you need right on your dashboard. Therefore, you don’t need to log into another website (Google Analytics) each time you want to see your site&#8217;s metrics.</p>\n<p>By making Google Analytics simple for WordPress, MonsterInsights helps you to concentrate on creating better content and grow your blog with confidence.</p>\n<p>Now, let’s go ahead and see which Google Analytics metrics you should track for your blog’s success.</p>\n<p>Please note that you should have <a href=\"https://www.monsterinsights.com/\">MonsterInsights</a> installed on your WordPress site to view these reports. If you haven’t done so yet, install it now following our step-by-step instructions on <a href=\"https://www.monsterinsights.com/how-to-properly-setup-google-analytics-in-wordpress/\">how to set up Google Analytics in WordPress</a>.</p>\n<h3>1. Start with the Overview Report</h3>\n<p><strong>MonsterInsights&#8217; Overview report</strong> offers you a quick glimpse of your blog’s audience in general. With this report, you can view your blog’s sessions and pageviews for a certain period of time visually in graphs as well as quick reports on sessions, pageviews, average session duration, and bounce rate.</p>\n<p>This report is available in the <a href=\"https://www.monsterinsights.com/introducing-google-analytics-dashboard-widget-for-monsterinsights/\">MonsterInsights Dashboard widget</a> as well as in the Custom reports page. The Dashboard Widget lets you see your Google Analytics metrics right on your dashboard (no extra clicks required).</p>\n<p><img class=\"alignnone size-full wp-image-154759\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/02/monsterinsightsdashboardwidget.png\" alt=\"Google Analytics Dashboard Widget for WordPress by MonsterInsights\" width=\"620\" height=\"420\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/02/monsterinsightsdashboardwidget.png 620w, https://www.monsterinsights.com/wp-content/uploads/2018/02/monsterinsightsdashboardwidget-300x203.png 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></p>\n<p>To view it in the custom reports, you’ll need to visit <strong>Insights » Reports</strong> from your WordPress dashboard.</p>\n<p><img class=\"alignnone size-full wp-image-157435\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/08/monsterinsights-overview-report.jpg\" alt=\"monsterinsights-overview-report\" width=\"620\" height=\"575\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/08/monsterinsights-overview-report.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/08/monsterinsights-overview-report-300x278.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></p>\n<p>By default, the plugin shows you reports for the last 30 days; however, you can change to 7 days with 1 click or manually set a custom time range.</p>\n<p>From this report, you can see exactly how many sessions and pageviews your blog received in the last 30 days. Along with the number of sessions and pageviews, it also shows the percent change in comparison to the previous 30 days.</p>\n<p>Thus, it helps you see exactly how many users are reading your blog and whether the number of readers is increasing or decreasing. You can utilize this report to discover if your blog is growing or not.</p>\n<p>Besides, you can see average session duration and bounce rate for your blog in it. These reports help you understand user engagement on your blog. Having more time per session means your readers are really engaged and reading your content, while a higher bounce rate means users are immediately leaving your site.</p>\n<p>To learn more, here’s our complete guide on <a href=\"https://www.monsterinsights.com/how-to-track-user-engagement-in-wordpress-using-google-analytics/\">how to track and measure user engagement in WordPress</a>.</p>\n<h3>2. New vs. Returning Visitors</h3>\n<p>Both new and returning visitors are important for running a successful blog. New visitors are unique visitors who discovered your blog for the first time; while returning visitors are those who’ve already visited your blog at least once and come back again.</p>\n<p>With MonsterInsights, you can see <strong>New vs. Returning Visitors</strong> right in the <strong>Overview report</strong>. It’s available in the Dashboard widget as well as in the custom reports, which you can see by going to <strong>Insights » Reports</strong> from your WordPress dashboard.</p>\n<p><img class=\"alignnone size-full wp-image-165054\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/mi-new-vs-returning-visitors.jpg\" alt=\"mi-new-vs-returning-visitors\" width=\"620\" height=\"293\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/10/mi-new-vs-returning-visitors.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/10/mi-new-vs-returning-visitors-300x142.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></p>\n<p>In this report, you can see the percentage of your blog’s new and returning visitors. Getting more new visitors means you’re able to attract new eyeballs onto your content and your blog promotions going great. Whereas more returning visitors means your readers are liking your content and coming back to your blog again for more.</p>\n<p>You don’t need to worry about your new or returning percentage being imbalanced because both are important. Your focus should instead be on increasing the number of both new and returning users.</p>\n<h3>3. Referrals</h3>\n<p>Another important metric bloggers should track is referral traffic and its sources. You can find the referrals report right in the <strong>Overview report</strong> with MonsterInsights. All you need to do to see this report is to visit <strong>Insights » Reports</strong> from your WordPress dashboard.</p>\n<p><img class=\"alignnone size-full wp-image-158531\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/08/top-referrals-mi-overview-report.jpg\" alt=\"top-referrals-mi-overview-report\" width=\"620\" height=\"565\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/08/top-referrals-mi-overview-report.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/08/top-referrals-mi-overview-report-300x273.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></p>\n<p>In this report, you can view the top 10 websites sending you referral traffic. This means that these sites are linking to your blog from within their own content. In short, they’re your blog’s backlinks.</p>\n<p>You can earn backlinks either naturally or by guest posting.</p>\n<p>If other bloggers find your content useful to their readers, they can link your blog as a resource site. This is the natural process of earning backlinks. If you have plenty of natural backlinks from top websites, it means your content is great. And those types of backlinks also help your blog to get better rankings in search results.</p>\n<p>On the other hand, if you’ve earned backlinks by guest posting, you can find out which guest posts are getting you more referral traffic. It helps you to decide which type of content you should create more of for guest posting in the future.</p>\n<p>If you want to see more than 10 referral traffic sources, you can click the <strong>View All Referral Sources</strong> button at the bottom of the report. This&#8217;ll take you to your Google Analytics account where you can see a more detailed report.</p>\n<h3>4. Most Popular Posts</h3>\n<p>Tracking most popular posts helps you to find out what content works best for you. When you’re striving to grow your blog, this report can provide you with several insights for creating more popular posts.</p>\n<p>Using MonsterInsights, you can view your most popular posts in the <strong>Publishers</strong> report. You can find that by visiting <strong>Insights » Reports » Publishers</strong> from your WordPress dashboard.</p>\n<p><img class=\"alignnone size-full wp-image-158449\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/08/top-landing-pages-monsterinsights-report.jpg\" alt=\"top-landing-pages-monsterinsights-report\" width=\"560\" height=\"660\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/08/top-landing-pages-monsterinsights-report.jpg 560w, https://www.monsterinsights.com/wp-content/uploads/2018/08/top-landing-pages-monsterinsights-report-255x300.jpg 255w\" sizes=\"(max-width: 560px) 100vw, 560px\" /></p>\n<p>In this report, you can see your blog’s top landing pages with the exact number of visits each has received. Plus, you can see the average duration on the pages and bounce rate.</p>\n<p>Now you can optimize these top landing pages to improve engagement and reduce bounce rate. For example, if the bounce rate is high because the page isn’t mobile-ready, you can make it mobile-ready. Better user engagement increases your blog conversions as well as SEO ranking.</p>\n<p>Moreover, with in-depth content analysis of your most popular content, you can identify what type of content you should create for better engagement and conversion.</p>\n<h3>5. Top Outbound Links and Affiliate Links</h3>\n<p>Top Outbound Links are the top links clicked on your site that go to other websites. They’re the links you’re referring your blog readers to visit for related content not available on your site.</p>\n<p>By tracking the top outbound links, you can find out which websites are getting referral traffic from your blog. This is useful if you’re looking for ways to earn backlinks. Since you’re sending them good traffic, you can contact these sites and ask them to link back to your blog as well.</p>\n<p>With MonsterInsights, you can view this report in the <strong>Publishers report</strong> by visiting <strong>Insights » Reports » Publishers</strong> from your WordPress dashboard.</p>\n<p><img class=\"alignnone size-full wp-image-155904\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/08/outbound-links-report-monsterinsights.jpg\" alt=\"outbound-links-report-monsterinsights\" width=\"560\" height=\"555\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/08/outbound-links-report-monsterinsights.jpg 560w, https://www.monsterinsights.com/wp-content/uploads/2018/08/outbound-links-report-monsterinsights-150x150.jpg 150w, https://www.monsterinsights.com/wp-content/uploads/2018/08/outbound-links-report-monsterinsights-300x297.jpg 300w, https://www.monsterinsights.com/wp-content/uploads/2018/08/outbound-links-report-monsterinsights-100x100.jpg 100w\" sizes=\"(max-width: 560px) 100vw, 560px\" /></p>\n<p>In this report, you can see the top 10 outbound links along with clicks each has triggered.</p>\n<p>Next to the Outbound Links report, you can see <strong>Top Affiliate Links</strong> report in the <strong>Publishers report</strong>.</p>\n<p>If you’ve added affiliate links on your blog for referral commissions, you’ll want to know which affiliate links are being clicked the most. That’s what the Top Affiliate Links report shows you.</p>\n<p><img class=\"alignnone size-full wp-image-157438\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/08/affiliate-links-tracking-monsterinsights.jpg\" alt=\"Affiliate-Links-Tracking-MonsterInsights\" width=\"620\" height=\"700\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/08/affiliate-links-tracking-monsterinsights.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/08/affiliate-links-tracking-monsterinsights-266x300.jpg 266w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></p>\n<p>Affiliate marketing is a very popular form of marketing technique nowadays. It can benefit both the product website selling a product and the blog promoting the product. If you’ve a blog with a decent number of daily traffic, you can start affiliate marketing for extra revenue from your blog.</p>\n<p>If you need detailed instructions, here’s our step-by-step guide on <a href=\"https://www.monsterinsights.com/how-to-add-affiliate-links-in-wordpress-and-properly-track-them/\">how to add affiliate links in WordPress</a>.</p>\n<h3>6. Top Google Search Terms</h3>\n<p>One of the key indicators of a successful blog is more organic traffic coming to your site from Google or other search engines. Getting organic traffic means your blog ranks for certain keywords people are typing into the search engines.</p>\n<p>To identify which keywords they&#8217;re using, you should track the search terms for your site. MonsterInsights helps you to connect your Google Analytics account with Google Search Console and allows you to see the Google search terms right in your dashboard reports.</p>\n<p>To view the top Google Search terms, you need to go to <strong>Insights » Reports</strong> and click the <strong>Search Console</strong> tab on the top.</p>\n<p><img class=\"alignnone size-full wp-image-157448\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/08/monsterinsights-search-console-report.jpg\" alt=\"monsterinsights-search-console-report\" width=\"620\" height=\"636\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/08/monsterinsights-search-console-report.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/08/monsterinsights-search-console-report-292x300.jpg 292w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></p>\n<p>There, you can find the top 50 Google search terms for your blog. This is very useful to <a href=\"https://www.monsterinsights.com/important-google-analytics-reports-to-improve-your-sites-seo/\">analyze your Search Engine Optimization (SEO) strategies and improve them</a>.</p>\n<p>With this report, you can make sure whether your SEO efforts are working for your blog or not. If you see the same keywords you’ve focused on your blog as the top search terms, you can determine that your SEO and content strategies are doing great.</p>\n<p>If they don’t match, or you see many new keywords that you haven’t used on your blog, you can use those words as the new keywords for your future posts.</p>\n<h3>7. Custom Dimensions</h3>\n<p>Google Analytics, by default, tracks certain dimensions which are called primary dimensions. However, if you want to track other dimensions, you&#8217;ll have to manually set them up in your Analytics account.</p>\n<p>MonsterInsights plugin makes it easy to track custom dimensions like top authors, top focus keywords, top post types, top categories, etc. with its <a href=\"https://www.monsterinsights.com/addon/dimensions/\">Custom Dimensions addon</a>. All you need to do for tracking these custom dimensions is install the addon and set up with just a few clicks.</p>\n<p>Using MonsterInsights Custom Dimensions addon, you can track the following:</p>\n<ul>\n<li><strong>Most Popular Authors</strong>: Which author’s posts generate the most traffic</li>\n<li><strong>Top Focus Keyword</strong>: Which focus keywords you’ve used on your site are driving most organic traffic</li>\n<li><strong>Top Categories</strong>: Which category on your blog is getting most clicks</li>\n<li><strong>Most Popular Post Types</strong>: Which post type performs best</li>\n</ul>\n<p>To view the Custom Dimensions reports, you’ll need to visit <strong>Insights » Reports » Dimensions</strong> from your WordPress dashboard.</p>\n<p><img class=\"alignnone size-full wp-image-157455\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/08/most-popular-authors-custom-dimensions-report-monsterinsights.jpg\" alt=\"Most-Popular-Authors-Custom-Dimensions-Report-Monsterinsights\" width=\"620\" height=\"579\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/08/most-popular-authors-custom-dimensions-report-monsterinsights.jpg 620w, https://www.monsterinsights.com/wp-content/uploads/2018/08/most-popular-authors-custom-dimensions-report-monsterinsights-300x280.jpg 300w\" sizes=\"(max-width: 620px) 100vw, 620px\" /></p>\n<p>If you’re running a multi-author blog, the <strong>Most Popular Authors</strong> report helps you identify which author&#8217;s articles are the most popular.</p>\n<p>Now, you can reward the top author and encourage them to work harder. You can also train the rest of your authors to follow the same techniques. This enhances the overall readability of your blog and improves user engagement (reduces bounce rate) which play a great role in improving your SEO rankings.</p>\n<h3>8. Forms Conversions</h3>\n<p>Forms are one of the most important things you’ll need to add to your blog. By adding forms, you can provide an easy option to your blog readers to contact you, provide feedback, and stay in touch.</p>\n<p>Just adding forms in WordPress cannot ensure the goals being met. Thus, you&#8217;ll need to track your forms to see how they’re performing.</p>\n<p>MonsterInsights comes with a powerful <a href=\"https://www.monsterinsights.com/addon/forms/\">forms addon</a> that helps you to automatically track your WordPress forms. All you need to do to track your forms conversions is to install the addon and activate it.</p>\n<p>Then, you can find your <strong>Forms report</strong> in your dashboard reports by visiting <strong>Insights » Reports » Dimensions</strong> from your WordPress dashboard.</p>\n<p><img class=\"alignnone size-full wp-image-152780\" src=\"https://www.monsterinsights.com/wp-content/uploads/2018/07/wpforms-forms-reports.jpg\" alt=\"wpforms-forms-reports\" width=\"560\" height=\"543\" srcset=\"https://www.monsterinsights.com/wp-content/uploads/2018/07/wpforms-forms-reports.jpg 560w, https://www.monsterinsights.com/wp-content/uploads/2018/07/wpforms-forms-reports-300x291.jpg 300w\" sizes=\"(max-width: 560px) 100vw, 560px\" /></p>\n<p>As you can see in the screenshot above, you’ll see the total impressions, conversions, and conversion rate for all of your forms.</p>\n<p>This report helps you to identify which forms are triggering more views and submissions. Then, you can analyze the forms by their type, design, placing on the blog, etc. and optimize for more conversions.</p>\n<p>By optimizing your forms, you can make your blog more user-friendly, more interactive, and boost engagement.</p>\n<p>And there you have it! You now know which Google Analytics metrics you should track to optimize your blog for more readership and conversions.</p>\n<p>With <a href=\"https://www.monsterinsights.com/\">MonsterInsights</a>, you can track all of the important Google Analytics metrics for bloggers with ease. It makes tracking advanced metrics super easy and helps you grow your blog.</p>\n<p>So, what&#8217;re you waiting for? Install <a href=\"https://www.monsterinsights.com/\">MonsterInsights</a> on your blog and start the optimization.</p>\n<p>Also, don’t forget to follow us on <a href=\"https://twitter.com/monsterinsights\" target=\"_blank\" rel=\"nofollow noopener\">Twitter</a> and <a href=\"https://www.facebook.com/monsterinsights\" target=\"_blank\" rel=\"nofollow noopener\">Facebook</a> for more Google Analytics tutorials.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://www.monsterinsights.com/google-analytics-metrics-bloggers-should-track-for-success/\">8 Google Analytics Metrics Bloggers Should Track for Success</a> appeared first on <a rel=\"nofollow\" href=\"https://www.monsterinsights.com\">MonsterInsights</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:96:\"https://www.monsterinsights.com/google-analytics-metrics-bloggers-should-track-for-success/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}s:27:\"http://www.w3.org/2005/Atom\";a:1:{s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:3:{s:4:\"href\";s:37:\"https://www.monsterinsights.com/feed/\";s:3:\"rel\";s:4:\"self\";s:4:\"type\";s:19:\"application/rss+xml\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:44:\"http://purl.org/rss/1.0/modules/syndication/\";a:2:{s:12:\"updatePeriod\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"hourly\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:15:\"updateFrequency\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"1\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}}}}}}s:4:\"type\";i:128;s:7:\"headers\";O:42:\"Requests_Utility_CaseInsensitiveDictionary\":1:{s:7:\"\0*\0data\";a:10:{s:6:\"server\";s:12:\"nginx/1.15.2\";s:4:\"date\";s:29:\"Mon, 12 Nov 2018 01:32:38 GMT\";s:12:\"content-type\";s:34:\"application/rss+xml; ch