/div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">\r\nYeah. That\'s a pretty sweet deal. Ok... so this makes me think of some other questions:\r\n<ul>\r\n <li>Do all companies pay dividends?</li>\r\n <li>How do I buy a stock?</li>\r\n <li>Wait... so what\'s a bond?</li>\r\n</ul>\r\n</div>\r\n<div class=\"clear\"></div>\r\n\r\n\r\n\r\n\r\n\r\n\r\n</section>','What is a stock?','','inherit','closed','closed','','10-revision-v1','','','2018-01-17 08:54:17','2018-01-17 08:54:17','',10,'http://www.grasshopperfinance.com/2018/01/17/10-revision-v1/',0,'revision','',0),(22,1,'2018-01-17 08:56:29','2018-01-17 08:56:29','<section>\r\n\r\n<div class=\"from-them\">\r\nHey!\r\n</div>\r\n<div class=\"clear\"></div>\r\n\r\n<div class=\"from-me\">\r\nYo!\r\n</div>\r\n<div class=\"clear\"></div>\r\n\r\n<div class=\"from-them\">\r\nI have a dumb question. What is a stock?\r\n</div>\r\n<div class=\"clear\"></div>\r\n\r\n\r\n<div class=\"from-me\">\r\nHuh?\r\n</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">\r\nLike... what is a stock? People seem to buy them and make money.\r\n</div>\r\n<div class=\"clear\"></div>\r\n\r\n<div class=\"from-me\">\r\nHa. Good question! Well... a stock is something that you can buy that gives you ownership in a specific company.\r\n</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">\r\nI don\'t get it.\r\n</div>\r\n<div class=\"clear\"></div>\r\n\r\n<div class=\"from-me\">\r\nWell, let\'s say you wanted to start a brewery. And you figure you need $10,000 to get started, but you only have $5,000.\r\n</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">\r\nOk, ok. I do like beer so this seems right up my alley.\r\n</div>\r\n<div class=\"clear\"></div>\r\n\r\n\r\n<div class=\"from-me\">\r\nRight. So to cover that other $5,000 you need, you could split your company up into 100 little pieces. Then get 100 pieces of paper and on each one write \"One Share of Grasshopper Brewery Inc.\" Each of those pieces of paper is now a \"share\" of stock in your company.\r\n</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">\r\nThis doesn\'t seem very official.\r\n</div>\r\n<div class=\"clear\"></div>\r\n\r\n<div class=\"from-me\">\r\nWell... stay with me. So then you go to your friends and say, \"Hey! I\'m starting a badass brewery. You want in or what? You can buy 1% of my company for just 100 bucks\"\r\n</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">\r\nYeah, my friend would definitely go for that because they\'re idiots.\r\n</div>\r\n<div class=\"clear\"></div>\r\n\r\n<div class=\"from-me\">\r\nSo if you sell 50 of those shares of stock, you just raised $5,000 to start your toy company, and you still own 50 shares and own 50%.\r\n</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">\r\nAh... ok. But why would my friends buy that?\r\n</div>\r\n<div class=\"clear\"></div>\r\n\r\n<div class=\"from-me\">\r\nWell, let\'s say next year your company does great and makes $1,000 in profit. As the CEO, you can choose to reward your owners and return those profits to the investors. $1,000 in profit divided by 100 shares equals $10 each.\r\n</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">\r\nAhh... so each year all the owners get a sweet piece of the action.\r\n</div>\r\n<div class=\"clear\"></div>\r\n\r\n<div class=\"from-me\">\r\nYep! And that money you pay back to them is called a <i>dividend</i>. That\'s one of the two reasons to own a stock. Stock owners (may) get paid dividends every month, quarter or year.\r\n</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">\r\nSo what\'s the other reason?\r\n</div>\r\n<div class=\"clear\"></div>\r\n\r\n<div class=\"from-me\">\r\nSo.. let\'s say your buddy Chumbo missed out when you sold those first 50 shares. He could go to your buddy Flippy and try to buy one.\r\n</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">\r\nHow did you know my friend\'s names?\r\n</div>\r\n<div class=\"clear\"></div>\r\n\r\n<div class=\"from-me\">\r\nAnd Flippy might say? \"Well... I\'m making a sweet $10/year from this share. I would only sell it for $200\" and Chumbo is like \"BOOM. Done. Do you take bags full of pennies?\"\r\n</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">\r\nYou\'re really nailing their personalities here.\r\n</div>\r\n<div class=\"clear\"></div>\r\n\r\n<div class=\"from-me\">\r\nAnd so Flippy made out on that deal. He put up $100 in cash originally, but then was collecting $10/year in dividends and ALSO sold it for $200. All while you did all the work selling the toys!\r\n</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">\r\nYeah. That\'s a pretty sweet deal. Ok... so this makes me think of some other questions:\r\n<ul>\r\n <li>Do all companies pay dividends?</li>\r\n <li>How do I buy a stock?</li>\r\n <li>Wait... so what\'s a bond?</li>\r\n</ul>\r\n</div>\r\n<div class=\"clear\"></div>\r\n\r\n\r\n\r\n\r\n\r\n\r\n</section>','What is a stock?','','inherit','closed','closed','','10-revision-v1','','','2018-01-17 08:56:29','2018-01-17 08:56:29','',10,'http://www.grasshopperfinance.com/2018/01/17/10-revision-v1/',0,'revision','',0),(23,1,'2018-01-17 08:57:11','2018-01-17 08:57:11','<section>\r\n\r\n<div class=\"from-them\">\r\nHey!\r\n</div>\r\n<div class=\"clear\"></div>\r\n\r\n<div class=\"from-me\">\r\nYo!\r\n</div>\r\n<div class=\"clear\"></div>\r\n\r\n<div class=\"from-them\">\r\nI have a dumb question. What is a stock?\r\n</div>\r\n<div class=\"clear\"></div>\r\n\r\n\r\n<div class=\"from-me\">\r\nHuh?\r\n</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">\r\nLike... what is a stock? People seem to buy them and make money.\r\n</div>\r\n<div class=\"clear\"></div>\r\n\r\n<div class=\"from-me\">\r\nHa. Good question! Well... a stock is something that you can buy that gives you ownership in a specific company.\r\n</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">\r\nI don\'t get it.\r\n</div>\r\n<div class=\"clear\"></div>\r\n\r\n<div class=\"from-me\">\r\nWell, let\'s say you wanted to start a brewery. And you figure you need $10,000 to get started, but you only have $5,000.\r\n</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">\r\nOk, ok. I do like beer so this seems right up my alley.\r\n</div>\r\n<div class=\"clear\"></div>\r\n\r\n\r\n<div class=\"from-me\">\r\nRight. So to cover that other $5,000 you need, you could split your company up into 100 little pieces. Then get 100 pieces of paper and on each one write \"One Share of Grasshopper Brewery Inc.\" Each of those pieces of paper is now a \"share\" of stock in your company.\r\n</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">\r\nThis doesn\'t seem very official.\r\n</div>\r\n<div class=\"clear\"></div>\r\n\r\n<div class=\"from-me\">\r\nWell... stay with me. So then you go to your friends and say, \"Hey! I\'m starting a badass brewery. You want in or what? You can buy 1% of my company for just 100 bucks\"\r\n</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">\r\nYeah, my friend would definitely go for that because they\'re idiots.\r\n</div>\r\n<div class=\"clear\"></div>\r\n\r\n<div class=\"from-me\">\r\nSo if you sell 50 of those shares of stock, you just raised $5,000 to start your toy company, and you still own 50 shares and own 50%.\r\n</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">\r\nAh... ok. But why would my friends buy that?\r\n</div>\r\n<div class=\"clear\"></div>\r\n\r\n<div class=\"from-me\">\r\nWell, let\'s say next year your company does great and makes $1,000 in profit. As the CEO, you can choose to reward your owners and return those profits to the investors. $1,000 in profit divided by 100 shares equals $10 each.\r\n</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">\r\nAhh... so each year all the owners get a sweet piece of the action.\r\n</div>\r\n<div class=\"clear\"></div>\r\n\r\n<div class=\"from-me\">\r\nYep! And that money you pay back to them is called a <i>dividend</i>. That\'s one of the two reasons to own a stock. Stock owners (may) get paid dividends every month, quarter or year.\r\n</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">\r\nSo what\'s the other reason?\r\n</div>\r\n<div class=\"clear\"></div>\r\n\r\n<div class=\"from-me\">\r\nSo.. let\'s say your buddy Chumbo missed out when you sold those first 50 shares. He could go to your buddy Flippy and try to buy one.\r\n</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">\r\nHow did you know my friend\'s names?\r\n</div>\r\n<div class=\"clear\"></div>\r\n\r\n<div class=\"from-me\">\r\nAnd Flippy might say? \"Well... I\'m making a sweet $10/year from this share. I would only sell it for $200\" and Chumbo is like \"BOOM. Done. Do you take bags full of pennies?\"\r\n</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">\r\nYou\'re really nailing their personalities here.\r\n</div>\r\n<div class=\"clear\"></div>\r\n\r\n<div class=\"from-me\">\r\nAnd so Flippy made out on that deal. He put up $100 in cash originally, but then was collecting $10/year in dividends and ALSO sold it for $200. All while you did all the work selling the beer!\r\n</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">\r\nYeah. That\'s a pretty sweet deal. Ok... so this makes me think of some other questions:\r\n<ul>\r\n <li>Do all companies pay dividends?</li>\r\n <li>How do I buy a stock?</li>\r\n <li>Wait... so what\'s a bond?</li>\r\n</ul>\r\n</div>\r\n<div class=\"clear\"></div>\r\n\r\n\r\n\r\n\r\n\r\n\r\n</section>','What is a stock?','','inherit','closed','closed','','10-revision-v1','','','2018-01-17 08:57:11','2018-01-17 08:57:11','',10,'http://www.grasshopperfinance.com/2018/01/17/10-revision-v1/',0,'revision','',0),(24,1,'2018-01-17 08:57:38','2018-01-17 08:57:38','<section>\r\n\r\n<div class=\"from-them\">\r\nHey!\r