e think of some other questions:\r\n<ul>\r\n 	<li><a href=\"/\">Do all companies pay dividends?</a></li>\r\n 	<li><a href=\"/\">How do I buy a stock?</a></li>\r\n 	<li><a href=\"/\">Wait... so what\'s a bond?</a></li>\r\n</ul>\r\n</div>\r\n<div class=\"clear\"></div>\r\n</section>','What is a stock?','','inherit','closed','closed','','10-revision-v1','','','2018-01-18 01:27:18','2018-01-18 01:27:18','',10,'http://www.grasshopperfinance.com/10-revision-v1/',0,'revision','',0),(36,1,'2018-01-18 06:48:20','2018-01-18 06:48:20','<section>\r\n<div class=\"from-them\">Hey</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-me\">What it do!</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">How do I buy stock?</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-me\">You like... want to buy shares in a company as an investment?</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">Yes! Exactly.</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-me\">Wait... why? What\'s your goal?</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">I want to get rich!</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-me\">Sweet! But, if that\'s your goal, I would highly recommend learning about mutual funds or better yet index funds. That\'s a better way to reliably build wealth.</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">Ugh. Can you just answer my question.</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-me\">Sure. So basically you just need to open a special type of bank account called a \"brokerage account\". It\'s like a checking or savings account, but instead of holding cash in it, it can also hold stocks, bonds and mutual funds.</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">How do I do that?</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-me\">There\'s a bunch of online investment banks. It\'s easy, just go to their website, click \"open an account\". This is how it looks on Fidelity.com:<a href=\"http://www.grasshopperfinance.com/wp-content/uploads/2018/01/Screen-Shot-2018-01-17-at-10.36.03-PM.png\"><img class=\"alignnone size-medium wp-image-38\" src=\"http://www.grasshopperfinance.com/wp-content/uploads/2018/01/Screen-Shot-2018-01-17-at-10.36.03-PM-300x300.png\" alt=\"How to buy stocks\" width=\"300\" height=\"300\" /></a></div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-me\">It\'s pretty easy from there. Just follow the steps. You\'ll need your social security number (for taxes), address and some other basic info.</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-me\">There are a bunch of other online investment banks/brokers as well. <a href=\"/\">Check out a breakdown of the different investment banks.</a></div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">Wait... I see brokerage account but what are these other types of accounts?\r\n<a href=\"http://www.grasshopperfinance.com/wp-content/uploads/2018/01/Screen-Shot-2018-01-17-at-10.36.56-PM.png\"><img class=\"alignnone size-medium wp-image-39\" src=\"http://www.grasshopperfinance.com/wp-content/uploads/2018/01/Screen-Shot-2018-01-17-at-10.36.56-PM-300x184.png\" alt=\"Types of investment accounts\" width=\"300\" height=\"184\" /></a></div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-me\">\r\n\r\nThose are other types of investment bank accounts where you can buy stocks, bonds and mutual funds! They may be an even better option if you are trying to build long term wealth for retirement. Which one are you interested in?\r\n<ul>\r\n<li><a href=\"/\">What\'s a Rollover IRA?</a></li>\r\n<li><a href=\"/\">What\'s a Roth IRA?</a></li>\r\n<li><a href=\"/\">What\'s a Traditional IRA?</a></li>\r\n<li><a href=\"/\">What\'s the difference between a Roth IRA and a traditional IRA?</a></li>\r\n</ul>\r\n</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">Awesome. you\'re the best.</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-me\">I know</div>\r\n<div class=\"clear\"></div>\r\n</section>','How do I buy stock?','','publish','open','open','','how-do-i-buy-stock','','','2018-06-11 06:54:36','2018-06-11 06:54:36','',0,'http://www.grasshopperfinance.com/?p=36',0,'post','',0),(37,1,'2018-01-18 01:47:00','2018-01-18 01:47:00','<section>\r\n<div class=\"from-them\">Hey</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-me\">What it do!</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">How do I buy stock?</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-me\">You like... want to buy shares in a company as an investment?</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">Yes! Exactly.</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-me\">Wait... why? What\'s your goal?</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">I want to get rich!</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-me\">Sweet! But, if that\'s your goal, I would highly recommend learning about mutual funds or better yet index funds. That\'s a better way to reliably build wealth.\r\n</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">Can you just answer my question.</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-me\">Sure. So basically you just need to open a special type of bank account called a \"brokerage account\". It\'s like a checking or savings account, but instead of holding cash in it, it can also hold stocks, bonds and mutual funds.</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">How do I do that?</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-me\">There\'s a bunch of online investment banks. It\'s easy, just go to their website, click \"open an account\". This is how it looks on Fidelity: </div>\r\n<div class=\"clear\"></div>\r\n\r\n\r\n\r\n\r\n\r\n</section>','How do I buy stock?','','inherit','closed','closed','','36-revision-v1','','','2018-01-18 01:47:00','2018-01-18 01:47:00