ment bank accounts where you can buy stocks, bonds and mutual funds! They may be an even better option if you are trying to build long term wealth for retirement. Which one are you interested in?\r\n<ul>\r\n<li><a href=\"/\">What\'s a Rollover IRA?</a></li>\r\n<li><a href=\"/\">What\'s a Roth IRA?</a></li>\r\n<li><a href=\"/\">What\'s a Traditional IRA?</a></li>\r\n<li><a href=\"/\">What\'s the difference between a Roth IRA and a traditional IRA?</a></li>\r\n</ul>\r\n</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">Awesome. you\'re the best.</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-me\">I know</div>\r\n<div class=\"clear\"></div>\r\n</section>','How do I buy stock?','','inherit','closed','closed','','36-revision-v1','','','2018-01-18 06:53:33','2018-01-18 06:53:33','',36,'http://www.grasshopperfinance.com/36-revision-v1/',0,'revision','',0),(55,1,'2018-01-18 07:20:36','0000-00-00 00:00:00','','widget_image','','draft','closed','closed','','','','','2018-01-18 07:20:36','0000-00-00 00:00:00','a:1:{s:12:\"_multiwidget\";i:1;}',0,'http://www.grasshopperfinance.com/?post_type=jetpack_migration&p=55',0,'jetpack_migration','',0),(56,1,'2018-01-18 07:20:36','0000-00-00 00:00:00','','sidebars_widgets','','draft','closed','closed','','','','','2018-01-18 07:20:36','0000-00-00 00:00:00','a:4:{s:19:\"wp_inactive_widgets\";a:0:{}s:9:\"sidebar-1\";a:6:{i:0;s:8:\"search-2\";i:1;s:14:\"recent-posts-2\";i:2;s:17:\"recent-comments-2\";i:3;s:10:\"archives-2\";i:4;s:12:\"categories-2\";i:5;s:6:\"meta-2\";}s:9:\"sidebar-2\";a:0:{}s:9:\"sidebar-3\";a:0:{}}',0,'http://www.grasshopperfinance.com/?post_type=jetpack_migration&p=56',0,'jetpack_migration','',0),(58,1,'2018-01-18 07:39:37','2018-01-18 07:39:37','\n.author, .separator, .posted-on\n{\n	display: none;\n}\n\n/**** Start iPhone Stuff ****/\n\nbody {\n  font-family: \"Helvetica Neue\";\n  font-size: 20px;\n  font-weight: normal;\n}\n/* Custom by Jeremy */\np {\n	margin-bottom: 0;\n}\nsection {\n  ma