06-10-at-10.07.11-PM.png',0,'attachment','image/png',0),(135,1,'2018-06-11 06:54:01','2018-06-11 06:54:01','How Do I Buy Stock?','How Do I Buy Stock?','How Do I Buy Stock?','inherit','open','closed','','screen-shot-2018-06-10-at-11-53-20-pm','','','2018-06-11 06:54:22','2018-06-11 06:54:22','',36,'http://www.grasshopperfinance.com/wp-content/uploads/2018/01/Screen-Shot-2018-06-10-at-11.53.20-PM.png',0,'attachment','image/png',0),(136,1,'2018-06-11 06:55:56','2018-06-11 06:55:56','<section>\r\n<div class=\"from-them\">Hey!</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-me\">Yo!</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">I have a dumb question. What is a stock?</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-me\">Huh?</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">Like... what is a stock? People seem to buy them and make money.</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-me\">Ha. Good question! Well... a stock is something that you can buy that gives you ownership in a specific company.</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">I don\'t get it.</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-me\">Well, let\'s say you wanted to start a brewery. And you figure you need $10,000 to get started, but you only have $5,000.</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">Ok, ok. This seems right up my alley.</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-me\">Right. So to cover that other $5,000 you need, you could split your company up into 100 little pieces. Then get 100 pieces of paper and on each one write \"One Share of Grasshopper Brewery Inc.\" Each of those pieces of paper is now a \"share\" of stock in your company.</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">This doesn\'t seem very official, but I gave it a shot:\r\n<a href=\"http://www.grasshopperfinance.com/wp-content/uploads/2018/01/GrasshopperBeer.jpg\"><img class=\"alignnone wp-image-27 size-medium\" src=\"http://www.grasshopperfinance.com/wp-content/uploads/2018/01/GrasshopperBeer-240x300.jpg\" alt=\"One Share Sample Stock Certificate\" width=\"240\" height=\"300\" /></a>\r\n\r\n</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-me\">Um... yeah, kinda. Anyway, then you go to your friends and say, \"Hey! I\'m starting a badass brewery. You want in or what? You can buy 1% of my company for just 100 bucks\"</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">Yeah, my friend would definitely go for that because they\'re idiots.</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-me\">So if you sell 50 of those shares of stock, you just raised $5,000 to start your brewery, and you still own 50 shares and own 50%.</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">Ah... ok. But why would my friends buy that?</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-me\">Well, let\'s say next year your company does great and makes $1,000 in profit. As the CEO, you can choose to reward your owners and return those profits to the investors. $1,000 in profit divided by 100 shares equals $10 each.</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">Ahh... so each year all the owners get a sweet piece of the action.</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-me\">Yep! And that money you pay back to them is called a <i>dividend</i>. That\'s one of the two reasons to own a stock. Stock owners (may) get paid dividends every month, quarter or year.</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">So what\'s the other reason?</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-me\">So.. let\'s say your buddy Chumbo missed out when you sold those first 50 shares. He could go to your buddy Flippy and try to buy one.</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">How did you know my friend\'s names?</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-me\">And Flippy might say? \"Well... I\'m making a sweet $10/year from this share. I would only sell it for $200\" and Chumbo is like \"BOOM. Done. Do you take bags full of pennies?\"</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">You\'re really nailing their personalities here.</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-me\">And so Flippy made out on that deal. He put up $100 in cash originally, but then was collecting $10/year in dividends and ALSO sold it for $200. All while you did all the work selling the beer!</div>\r\n<div class=\"clear\"></div>\r\n<div class=\"from-them\">Yeah. That\'s a pretty sweet deal. Ok... so this makes me think of some other questions:\r\n<ul>\r\n 	<li><a href=\"/\">Do all companies pay dividends?</a></li>\r\n 	<li><a href=\"/\">How do I buy a stock?</a></li>\r\n 	<li><a href=\"/\">Wait... so what\'s a bond?</a></li>\r\n</ul>\r\n</div>\r\n<div class=\"clear\"></div>\r\n</section>','What is a stock?','','inherit','closed','closed','','10-revision-v1','','','2018-06-11 06:55:56','2018-06-11 06:55:56','',10,'http://www.grasshopperfinance.com/10-revision-v1/',0,'revision','',0),(137,1,'2018-06-11 06:56:31','2018-06-11 06:56:31','What is Stock?','What is Stock?','What is Stock?','inherit','open','closed','','screen-shot-2018-06-10-at-11-56-10-pm','','','2018-06-11 06:56:40','2018-06-11 06:56:40','',10,'http://www.grasshopperfinance.com/wp-content/uploads/2018/01/Screen-Shot-2018-06-10-at-11.56.10-PM.png',0,'attachment','image/png',0),(143,1,'2018-07-07 22:30:05','2018-07-07 22:30:05','<script type=\"text/javascript\" src=\"https://www.gstatic.com/charts/loader.js\"></script>\r\n<script type=\'text/babel\' src=\'/wp-includes/grasshopper/js/vfinx.js\'></script>\r\n<script type=\'text/babel\' src=\'/wp-includes/grasshopper/js/timethemarket.js\'></script>\r\n\r\n\r\nUse this page to see the amazing power of compound growth and calculate your potential future net worth. Invest early and often!\r\n\r\n\r\n\r\n<div id=\"root\"></div>','Investment Growth Retirement Calculator','','inherit','closed','closed','','62-revision-v1','','','2018-07-07 22:30:05','2018-07-07 22:30:05','',62,'http://www.grasshopperfinance.com/62-revision-v1/',0,'revision','',0),(144,1,'2018-07-09 17:14:38','2018-07-09 17:14:38','Time the Market Game','Time the Market Game','Time the Market Game','inherit','open','closed','','screen-shot-2018-07-09-at-10-11-01-am','','','2018-07-09 17:14:56','2018-07-09 17:14:56','',0,'http://www.grasshopperfinance.com/wp-content/uploads/2018/05/Screen-Shot-2018-07-09-at-10.11.01-AM.png',0,'attachment','image/png',0),(145,1,'2018-07-12 01:25:09','2018-07-12 01:25:09','<script type=\"text/javascript\" src=\"https://www.gstatic.com/charts/loader.js\"></script>\r\n<script type=\'text/babel\' src=\'/wp-includes/grasshopper/js/sp500.js\'></script>\r\n<script type=\'text/babel\' src=\'/wp-includes/grasshopper/js/growthcalculator.js\'></script>\r\n\r\nUse this page to see how your investments will grow over time. You can use the actual past market as a model.\r\n\r\n<div id=\"root\"></div>','Investment Growth Retirement Calculator','','inherit','closed','closed','','62-revision-v1','','','2018-07-12 01:25:09','2018-07-12 01:25:09','',62,'http://www.grasshopperfinance.com/62-revision-v1/',0,'revision','',0),(147,1,'2018-07-12 01:28:15','2018-07-12 01:28:15','<script type=\"text/javascript\" src=\"https://www.gstatic.com/charts/loader.js\"></script><script type=\'text/babel\' src=\'/wp-includes/grasshopper/js/vfinx.js\'></script><script type=\'text/babel\' src=\'/wp-includes/grasshopper/js/timethemarket.js\'></script>Are stocks due for a crash? Is it a good time to buy low? Can you time and beat the market?!\r\n\r\n&nbsp;\r\n\r\nClick the \"Start\" button below to start the clock on a random 10 year period of the US stock market. Click the Buy/Sell button to buy and sell and take advantage of bull markets while avoiding crashes. You\'ll be measured against a \"buy and hold\" strategy.\r\n<div></div>\r\n<div></div>\r\n<div id=\"root\"></div>\r\n<div>Investment details:</div>\r\n<ul>\r\n 	<li>Data is based on historical data of Vanguard\'s VFINX \"Vanguard 500\" index fund, which closely matches the S&amp;P 500 index.</li>\r\n 	<li>Dividends are automatically reinvested over time as long as you\'re holding the fund</li>\r\n 	<li>When you sell, your cash is moved into a savings account earning 1% per year</li>\r\n</ul>','Time The Market Game','','publish','closed','closed','','time-the-market-game','','','2018-07-12 01:28:31','2018-07-12 01:28:31','',0,'http://www.grasshopperfinance.com/?page_id=147',0,'page','',0),(148,1,'2018-07-12 01:28:15','2018-07-12 01:28:15','','Time The Market Game','','inherit','closed','closed','','147-revision-v1','','','2018-07-12 01:28:15','2018-07-12 01:28:15','',147,'http://www.grasshopperfinance.com/147-revision-v1/',0,'revision','',0),(149,1,'2018-07-12 01:28:31','2018-07-12 01:28:31','<script type=\"text/javascript\" src=\"https://www.gstatic.com/charts/loader.js\"></script><script type=\'text/babel\' src=\'/wp-includes/grasshopper/js/vfinx.js\'></script><script type=\'text/babel\' src=\'/wp-includes/grasshopper/js/timethemarket.js\'></script>Are stocks due for a crash? Is it a good time to buy low? Can you time and beat the market?!\r\n\r\n&nbsp;\r\n\r\nClick the \"Start\" button below to start the clock on a random 10 year period of the US stock market. Click the Buy/Sell button to buy and sell and take advantage of bull markets while avoiding crashes. You\'ll be measured against a \"buy and hold\" strategy.\r\n<div></div>\r\n<div></div>\r\n<div id=\"root\"></div>\r\n<div>Investment details:</div>\r\n<ul>\r\n 	<li>Data is based on historical data of Vanguard\'s VFINX \"Vanguard 500\" index fund, which closely matches the S&amp;P 500 index.</li>\r\n 	<li>Dividends are automatically reinvested over time as long as you\'re holding the fund</li>\r\n 	<li>When you sell, your cash is moved into a savings account earning 1% per year</li>\r\n</ul>','Time The Market Game','','inherit','closed','closed','','147-revision-v1','','','2018-07-12 01:28:31','2018-07-12 01:28:31','',147,'http://www.grasshopperfinance.com/147-revision-v1/',0,'revision','',0),(151,1,'2018-07-12 18:05:15','2018-07-12 18:05:15','Investment Growth Retirement Calculator','Investment Growth Retirement Calculator','Investment Growth Retirement Calculator','inherit','open','closed','','screen-shot-2018-07-12-at-11-04-30-am','','','2018-07-12 18:05:35','2018-07-12 18:05:35','',62,'http://www.grasshopperfinance.com/wp-content/uploads/2018/07/Screen-Shot-2018-07-12-at-11.04.30-AM.png',0,'attachment','image/png',0),(152,1,'2018-07-12 18:05:52','2018-07-12 18:05:52','Use this calculator to see how your investments will grow over time. You can use the actual past market as a model.\r\n\r\n<script type=\"text/javascript\" src=\"https://www.gstatic.com/charts/loader.js\"></script>\r\n<script type=\'text/babel\' src=\'/wp-includes/grasshopper/js/sp500.js\'></script>\r\n<script type=\'text/babel\' src=\'/wp-includes/grasshopper/js/growthcalculator.js\'></script>\r\n\r\n<div id=\"root\"></div>','Investment Growth Retirement Calculator','','inherit','closed','closed','','62-revision-v1','','','2018-07-12 18:05:52','2018-07-12 18:05:52','',62,'http://www.grasshopperfinance.com/62-revision-v1/',0,'revision','',0),(153,1,'2018-07-12 18:06:13','2018-07-12 18:06:13','Use this calculator to see how your investments will grow over time. You can use the actual past market as a model.\r\n<script type=\"text/javascript\" src=\"https://www.gstatic.com/charts/loader.js\"></script><script type=\'text/babel\' src=\'/wp-includes/grasshopper/js/sp500.js\'></script><script type=\'text/babel\' src=\'/wp-includes/grasshopper/js/growthcalculator.js\'></script><div id=\"root\"></div>','Investment Growth Retirement Calculator','','inherit','closed','closed','','62-revision-v1','','','2018-07-12 18:06:13','2018-07-12 18:06:13','',62,'http://www.grasshopperfinance.com/62-revision-v1/',0,'revision','',0),(155,1,'2018-09-16 04:12:55','2018-09-16 04:12:55','<a href=\"http://www.grasshopperfinance.com/wp-content/uploads/2018/09/boatmeme.jpg\"><img class=\"alignnone size-full wp-image-168\" src=\"http://www.grasshopperfinance.com/wp-content/uploads/2018/09/boatmeme.jpg\" alt=\"Rollover your 401(k)\" width=\"722\" height=\"499\" /></a>\r\n\r\nRolling over your 401(k) is like sending your grandma flowers: we all think we should probably do it, but most never get around to it. It takes a couple of hours and might be the most valuable time you spend in your life (This is true for the grandma flowers too). Here are the reasons why. #4 saves you almost a million bucks, so don\'t skip out early!\r\n<h1>1. Simplicity</h1>\r\nIn 2016 the <a href=\"https://www.bls.gov/news.release/tenure.nr0.htm\">average employee tenure was <strong>4.2 years</strong></a>. In a 40 year career that would be more than nine different jobs. If each of those jobs offered a 401(k) you could have nine accounts floating out there. Do you know where each and every one is? Have all the login information? Know how much is in there? Are they invested in the right stuff? Losing track of one of them could cost you tens or hundreds of thousands of dollars. Rolling over to a central, personal IRA keeps everything where you know it is.\r\n<h1>2. Cut Ties With Former Employers</h1>\r\n401(k)s are employer sponsored retirement accounts. Once you leave a job, that employer generally doesn\'t give a shit about you. But when you want to go back and get your money out, you might need to work with them again. Lost your account info? Talk to your old boss or HR department. Can\'t remember what bank it\'s with? Hope your old company is still taking your calls. Your old company has since been acquired or gone out of business? Now what? Rolling over to your own personal IRA cuts your old company completely out of your life!\r\n<h1>3. Unlimited Investment Options</h1>\r\nWhen you sign up for a 401(k) you are given a list of investment options. Those options are decided by your employer. Often they suck. It\'s still very worth it to invest for the tax benefits, but once you leave do a rollover to your own personal IRA and invest in whatever you want! (Hint: Buy and hold index funds)\r\n<h1>4. It will cost you  $732,102 if you don\'t</h1>\r\nStay with me here because we\'re gonna do some math.\r\n<ul>\r\n 	<li>Fidelity recently reported that the <a href=\"https://www.cnbc.com/2018/09/14/heres-how-much-millennials-have-in-their-401k-accounts.html\">average millennial\'s (21-37 years old) 401(k) balance is <strong>$25,500</strong></a>.</li>\r\n 	<li>The <a href=\"https://www.americanprogress.org/issues/economy/reports/2014/04/11/87503/fixing-the-drain-on-retirement-savings/\">average 401(k) charges <strong>1%</strong> annually in fees</a>. (It\'s even worse if your 401(k) was with a small business which generally have higher fees)</li>\r\n 	<li>A personal Rollover IRA can have fees as low as <strong>0%</strong>. (If you invest in <a href=\"https://www.fidelity.com/mutual-funds/investing-ideas/index-funds\">Fidelity\'s 0% index funds</a>, or very close to 0% with most brokerages\' index funds)</li>\r\n 	<li>An <a href=\"https://www.cnbc.com/2017/06/18/the-sp-500-has-already-met-its-average-return-for-a-full-year.html\">S&amp;P 500 index fund has gained <strong>9.8%</strong> per year</a> on average over the last 90 years.</li>\r\n</ul>\r\nSo that $25.5K you have in your old IRA is likely getting dinged for 1% per year. That means instead of your money growing at <strong>9.8%</strong> it\'s growing at <strong>8.8%</strong>. That doesn\'t sound terrible, but remember the power of compound growth! If you left that job at 26 and withdraw that money at 65, that\'s 39 years of growth at the lower growth rate. At 9.8% that $25.5K would grow to $977K at 65 vs $684K earning 8.8%. That means not rolling over your FIRST old IRA cost you <strong>$293K</strong>. Ouch. But that\'s just one. Your other eight will have successively less time to grow since you\'ll be closer to retirement, but add them up and you\'re kissing <strong>$723,102</strong> away if you pay the 1% fees. Here\'s a <a href=\"https://docs.google.com/spreadsheets/d/1-P41QJ7ypJFvA0ZwmRB7ETOdJKNl55eZI_BZ0cKdC3w/edit?usp=sharing\">Google Sheet that I used to do the math</a>. That\'s a lot of numbers, so here\'s a chart of 8.8% growth vs 9.8% growth:\r\n\r\n<a href=\"http://www.grasshopperfinance.com/wp-content/uploads/2018/09/Screen-Shot-2018-09-26-at-9.18.07-AM.png\"><img class=\"grey-border alignnone\" src=\"http://www.grasshopperfinance.com/wp-content/uploads/2018/09/Screen-Shot-2018-09-26-at-9.18.07-AM.png\" alt=\"Impact of 1% fees on compound growth\" width=\"624\" height=\"412\" /></a>\r\n\r\n&nbsp;\r\n\r\nThat\'s still kind of a lot of numbers so here\'s a picture of what that $723K could have bought you:\r\n\r\n<a href=\"http://www.grasshopperfinance.com/wp-content/uploads/2018/09/Screen-Shot-2018-09-15-at-8.09.40-PM.png\"><img class=\" wp-image-157\" src=\"http://www.grasshopperfinance.com/wp-content/uploads/2018/09/Screen-Shot-2018-09-15-at-8.09.40-PM-1024x709.png\" alt=\"$691K Yacht\" width=\"692\" height=\"479\" /></a>\r\n\r\nIt\'s brand new, 43 feet long, cruising speed of 35 knots and <strong>you just pissed it away</strong> by not rolling over your 401(k). (It\'s actually <a href=\"https://www.yachtworld.com/boats/2017/Evo-43-3220900/Mallorca/Spain#.W53JNpNKhTY\">listed on yachtworld.com for $691,985</a> so you\'ll have $31,117 left over to throw a massive party for your friends who don\'t have yachts because they didn\'t roll over their 401(k)s).\r\n\r\nSo please, for the love of god, rollover your 401(k) and stop being a dick and send Grandma some flowers.','Four reasons to rollover your old 401(k)s','Not rolling over your old 401(k)s will cost you $732,102','publish','open','open','','four-reasons-to-rollover-your-old-401ks','','','2018-09-26 16:22:18','2018-09-26 16:22:18','',0,'http://www.grasshopperfinance.com/?p=155',0,'post','',0),(156,1,'2018-09-16 03:10:07','2018-09-16 03:10:07','Rolling over your 401(k) is something most people think they should probably do, but most don\'t get around to it. It takes a couple of hours and might be the most valuable time you spend in your life. Here\'s the reasons why (#4 is the best, so don\'t skip out early!):\r\n<h1>1. Simplicity</h1>\r\nThe Bureau of Labor Statistics said that in 2016 the <a href=\"https://www.bls.gov/news.release/tenure.nr0.htm\">average employee tenure was 4.2 years</a>. In an average 40 year career that would be over nine different jobs. If each of those jobs offered a 401(k) you would have nine accounts floating out there. Do you know where each and every one is? Have all the login information? Know how much is in there? Are they invested in the right stuff? Losing track of one of them could cost you tens or hundreds of thousands of dollars. Rolling over to a central, personal IRA solves this!\r\n<h1>2. Cut Ties With Former Employers</h1>\r\nBy their nature 401(k)s are employer sponsored retirement accounts. Once you leave a job, that employer generally doesn\'t have your best interest as a top priority. But when you want to go back and get your money out, you might need to interface with them again. Lost your account info? Talk to your old boss or HR department. Can\'t remember what bank it\'s with? Hope your old company is still taking your calls. Your old company has since been acquired or gone out of business? Now what? Rolling over to your own personal IRA cuts your old company completely out of your life!\r\n<h1>3. Unlimited Investment Options</h1>\r\nWhen you sign up for a 401(k) you are given a list of investment options. Those options are decided by your employer. Often they suck. It\'s still very worth it to invest for the tax benefits, but once you leave do a rollover to your own p