r your 401(k) today','','inherit','closed','closed','','155-revision-v1','','','2018-09-16 03:10:07','2018-09-16 03:10:07','',155,'http://www.grasshopperfinance.com/155-revision-v1/',0,'revision','',0),(157,1,'2018-09-16 03:35:35','2018-09-16 03:35:35','$691K Yacht','$691K Yacht','$691K Yacht','inherit','open','closed','','screen-shot-2018-09-15-at-8-09-40-pm','','','2018-09-16 03:46:27','2018-09-16 03:46:27','',155,'http://www.grasshopperfinance.com/wp-content/uploads/2018/09/Screen-Shot-2018-09-15-at-8.09.40-PM.png',0,'attachment','image/png',0),(158,1,'2018-09-16 03:35:38','2018-09-16 03:35:38','Investing $500 per month from 22 to 70','Investing $500 per month from 22 to 70','Investing $500 per month from 22 to 70','inherit','open','closed','','screen-shot-2018-09-15-at-8-34-49-pm','','','2018-09-16 03:36:19','2018-09-16 03:36:19','',155,'http://www.grasshopperfinance.com/wp-content/uploads/2018/09/Screen-Shot-2018-09-15-at-8.34.49-PM.png',0,'attachment','image/png',0),(159,1,'2018-09-16 03:54:58','2018-09-16 03:54:58','Rolling over your 401(k) is like sending your grandma flowers: we all think we should probably do it, but most never get around to it. It takes a couple of hours and might be the most valuable time you spend in your life (This is true for the grandma flowers too). Here are the reasons why. #4 saves you almost a million bucks, so don\'t skip out early!\r\n<h1>1. Simplicity</h1>\r\nIn 2016 the <a href=\"https://www.bls.gov/news.release/tenure.nr0.htm\">average employee tenure was 4.2 years</a>. In a 40 year career that would be over nine different jobs. If each of those jobs offered a 401(k) you could have nine accounts floating out there. Do you know where each and every one is? Have all the login information? Know how much is in there? Are they invested in the right stuff? Losing track of one of them could cost you tens or hundreds of thousands of dollars. Rolling over to a central, personal IRA keeps everything where you know it is.\r\n<h1>2. Cut