h rate. At 9.8% that $25.5K would grow to $977K at 65 vs $684K earning 8.8%. That means not rolling over your FIRST old IRA cost you <strong>$293K</strong>. Ouch. But that\'s just one. Your other eight will have successively less time to grow since you\'ll be closer to retirement, but add them up and you\'re kissing <strong>$723,102</strong> away if you pay the 1% fees. Here\'s a <a href=\"https://docs.google.com/spreadsheets/d/1-P41QJ7ypJFvA0ZwmRB7ETOdJKNl55eZI_BZ0cKdC3w/edit?usp=sharing\">Google Sheet that I used to do the math</a>. That\'s a lot of numbers, so here\'s a chart of 8.8% growth vs 9.8% growth:\r\n\r\n<a href=\"http://www.grasshopperfinance.com/wp-content/uploads/2018/09/Screen-Shot-2018-09-15-at-8.34.49-PM.png\"><img class=\"alignnone wp-image-158\" style=\"border: solid 1px #ddd;\" src=\"http://www.grasshopperfinance.com/wp-content/uploads/2018/09/Screen-Shot-2018-09-15-at-8.34.49-PM-1024x682.png\" alt=\"Chart of investing $500 per month from 22 to 70\" width=\"621\" height=\"414\" /></a>\r\n\r\nThat\'s still kind of a lot of numbers so here\'s a picture of what that $723K could have bought you:\r\n\r\n<a href=\"http://www.grasshopperfinance.com/wp-content/uploads/2018/09/Screen-Shot-2018-09-15-at-8.09.40-PM.png\"><img class=\" wp-image-157\" src=\"http://www.grasshopperfinance.com/wp-content/uploads/2018/09/Screen-Shot-2018-09-15-at-8.09.40-PM-1024x709.png\" alt=\"$691K Yacht\" width=\"692\" height=\"479\" /></a>\r\n\r\nIt\'s brand new, 43 feet long, cruising speed of 35 knots and <strong>you just pissed it away</strong> by not rolling over your 401(k). (It\'s actually <a href=\"https://www.yachtworld.com/boats/2017/Evo-43-3220900/Mallorca/Spain#.W53JNpNKhTY\">listed on yachtworld.com for $691,985</a> so you\'ll have $31,117 left over to throw a massive party for your friends who don\'t have yachts because they didn\'t roll over their 401(k)s).\r\n\r\nSo please, for the love of god, rollover your 401(k) and stop being a dick and send Grandma some f