ing your calls. Your old company has since been acquired or gone out of business? Now what? Rolling over to your own personal IRA cuts your old company completely out of your life!\r\n<h1>3. Unlimited Investment Options</h1>\r\nWhen you sign up for a 401(k) you are given a list of investment options. Those options are decided by your employer. Often they suck. It\'s still very worth it to invest for the tax benefits, but once you leave do a rollover to your own personal IRA and invest in whatever you want! (Hint: Buy and hold index funds)\r\n<h1>4. It will cost you  $732,102 if you don\'t</h1>\r\nStay with me here because we\'re gonna do some math.\r\n<ul>\r\n 	<li>Fidelity recently reported that the <a href=\"https://www.cnbc.com/2018/09/14/heres-how-much-millennials-have-in-their-401k-accounts.html\">average millennial\'s (21-37 years old) 401(k) balance is <strong>$25,500</strong></a>.</li>\r\n 	<li>The <a href=\"https://www.americanprogress.org/issues/economy/reports/2014/04/11/87503/fixing-the-drain-on-retirement-savings/\">average 401(k) charges <strong>1%</strong> annually in fees</a>. (It\'s even worse if your 401(k) was with a small business which generally have higher fees)</li>\r\n 	<li>A personal Rollover IRA can have fees as low as <strong>0%</strong>. (If you invest in <a href=\"https://www.fidelity.com/mutual-funds/investing-ideas/index-funds\">Fidelity\'s 0% index funds</a>, or very close to 0% with most brokerages\' index funds)</li>\r\n 	<li>An <a href=\"https://www.cnbc.com/2017/06/18/the-sp-500-has-already-met-its-average-return-for-a-full-year.html\">S&amp;P 500 index fund has gained <strong>9.8%</strong> per year</a> on average over the last 90 years.</li>\r\n</ul>\r\nSo that $25.5K you have in your old IRA is likely getting dinged for 1% per year. That means instead of your money growing at <strong>9.8%</strong> it\'s growing at <strong>8.8%</strong>. That doesn\'t sound terrible, but remember the power of compound growth! If you left that job at 26 and withdraw that money at 65, that\'s 39 years of growth at the lower growth rate. At 9.8% that $25.5K would grow to $977K at 65 vs $684K earning 8.8%. That means not rolling over your FIRST old IRA cost you <strong>$293K</strong>. Ouch. But that\'s just one. Your other eight will have successively less time to grow since you\'ll be closer to retirement, but add them up and you\'re kissing <strong>$723,102</strong> away if you pay the 1% fees. Here\'s a <a href=\"https://docs.google.com/spreadsheets/d/1-P41QJ7ypJFvA0ZwmRB7ETOdJKNl55eZI_BZ0cKdC3w/edit?usp=sharing\">Google Sheet that I used to do the math</a>. That\'s a lot of numbers, so here\'s a chart of 8.8% growth vs 9.8% growth:\r\n\r\n<a href=\"http://www.grasshopperfinance.com/wp-content/uploads/2018/09/Screen-Shot-2018-09-15-at-8.34.49-PM.png\"><img class=\"alignnone wp-image-158\" style=\"border: solid 1px #ddd;\" src=\"http://www.grasshopperfinance.com/wp-content/uploads/2018/09/Screen-Shot-2018-09-15-at-8.34.49-PM-1024x682.png\" alt=\"Chart of investing $500 per month from 22 to 70\" width=\"621\" height=\"414\" /></a>\r\n\r\nThat\'s still kind of a lot of numbers so here\'s a picture of what that $723K could have bought you:\r\n\r\n<a href=\"http://www.grasshopperfinance.com/wp-content/uploads/2018/09/Screen-Shot-2018-09-15-at-8.09.40-PM.png\"><img class=\" wp-image-157\" src=\"http://www.grasshopperfinance.com/wp-content/uploads/2018/09/Screen-Shot-2018-09-15-at-8.09.40-PM-1024x709.png\" alt=\"$691K Yacht\" width=\"692\" height=\"479\" /></a>\r\n\r\nIt\'s brand new, 43 feet long, cruising speed of 35 knots and <strong>you just pissed it away</strong> by not rolling over your 401(k). (It\'s actually <a href=\"https://www.yachtworld.com/boats/2017/Evo-43-3220900/Mallorca/Spain#.W53JNpNKhTY\">listed on yachtworld.com for $691,985</a> so you\'ll have $31,117 left over to throw a massive party for your friends who don\'t have yachts because they didn\'t roll over their 401(k)s).\r\n\r\nSo please, for the love of god, rollover your 401(k) and stop being a dick and send Grandma some flowers.','Four reasons to rollover your old 401(k)s','Not rolling over your old 401(k)s will cost you $732,102','inherit','closed','closed','','155-revision-v1','','','2018-09-16 04:29:29','2018-09-16 04:29:29','',155,'http://www.grasshopperfinance.com/155-revision-v1/',0,'revision','',0),(172,1,'2018-09-16 05:06:43','2018-09-16 05:06:43','<a href=\"http://www.grasshopperfinance.com/wp-content/uploads/2018/09/30434468933_2a12ef5118_o.jpg\"><img class=\"alignright size-medium wp-image-174\" src=\"http://www.grasshopperfinance.com/wp-content/uploads/2018/09/30434468933_2a12ef5118_o-300x256.jpg\" alt=\"Jeremy Profile Pic\" width=\"300\" height=\"256\" /></a>Hey, I\'m Jeremy. I\'m 37 years old, live in San Diego and retired in 2017 at the age of 36.\r\n<h1>How did I do that?</h1>\r\nI spent my entire working career from the age of 22 to 34 starting and growing a small internet startup called RentLinx. During that time I was always the lowest paid employee and never took home more than $36,000 per year. On that salary, at the age of 34 I had grown my net worth (not counting the value of the business) to over $100,000. Not retirement territory of course, but not bad on $36K/year living in San Diego and well on my way to millionaire status by (traditional) retirement age.\r\n<h1>OK, then what?</h1>\r\nWell, then I sold my company for enough to retire on if I continued to live fairly frugally. I spent two years working for the company that bought my company, then parted on very good terms. I\'ll probably start another company soon, but in the year after I quit my job I spent two months in Italy coaching beach volleyball, two months in Australia just backpacking around and spent a lot of my time learning what to do with all this money.\r\n<h1>So what\'s the deal with this site?</h1>\r\nWell, I\'ve loved numbers, finance and investing since I was a kid. And since I had my windfall I\'ve been voraciously reading investing books, articles, studies, podcasts and anything else I could find. I\'ve come to the conclusion that doing it right is pretty easy, but not simple because there\'s a multi-billion dollar industry existing on people making bad investment decisions. So this site is there to give an unbiased, hopefully simple information on how to win with money and become a millionaire!\r\n\r\n&nbsp;','About This Site','','publish','closed','closed','','about','','','2018-09-16 16:40:43','2018-09-16 16:40:43','',0,'http://www.grasshopperfinance.com/?page_id=172',0,'page','',0),(173,1,'2018-09-16 05:04:18','2018-09-16 05:04:18','Hey, I\'m Jeremy. I\'m 37 years old, live in San Diego and retired in 2017 at the age of 36.\r\n<h1>How did I do that?</h1>\r\nI spent my entire working career from the age of 22 to 34 growing a small internet startup called RentLinx. During that time I was always the lowest paid employee and never took home more than $36,000 per year. On that salary, tt the age of 34 I had grown my net worth (not counting the value of the business) to over $100,000. Not retirement territory of course, but not bad on $36K/year living in San Diego and well on my way to millionaire status by (traditional) retirement age.\r\n<h1>OK, then what?</h1>\r\nWell, then I sold my company for enough to retire on if I continued to live fairly frugally. I spent two years working for the company that bought my company, then parted on very good terms. I\'ll probably start another company soon, but in the year after I quit my job I spent two months in Italy coaching beach volleyball, two months in Australia just backpacking around and spent a lot of my time reading every personal finance and investing book I can get my hands on.\r\n<h1>So what\'s the deal with this site?</h1>\r\nWell, I\'ve loved numbers, finance and investing since I was a kid. And since I had my windfall I\'ve been voraciously reading investing books, articles, studies, podcasts and anything else I