$36,000 per year. On that salary, at the age of 34 I had grown my net worth (not counting the value of the business) to over $100,000. Not retirement territory of course, but not bad on $36K/year living in San Diego and well on my way to millionaire status by (traditional) retirement age.\r\n<h1>OK, then what?</h1>\r\nWell, then I sold my company for enough to retire on if I continued to live fairly frugally. I spent two years working for the company that bought my company, then parted on very good terms. I\'ll probably start another company soon, but in the year after I quit my job I spent two months in Italy coaching beach volleyball, two months in Australia just backpacking around and spent a lot of my time learning what to do with all this money.\r\n<h1>So what\'s the deal with this site?</h1>\r\nWell, I\'ve loved numbers, finance and investing since I was a kid. And since I had my windfall I\'ve been voraciously reading investing books, articles, studies, podcasts and anything else I could find. I\'ve come to the conclusion that doing it right is pretty easy, but not simple because there\'s a multi-billion dollar industry existing on people making bad investment decisions. So this site is there to give an unbiased, hopefully simple information on how to win with money and become a millionaire!\r\n\r\n&nbsp;','About This Site','','inherit','closed','closed','','172-revision-v1','','','2018-09-16 05:08:09','2018-09-16 05:08:09','',172,'http://www.grasshopperfinance.com/172-revision-v1/',0,'revision','',0),(179,1,'2018-09-16 05:13:34','2018-09-16 05:13:34','body { font-size: 1rem; }\np { margin: 30px; }\nh1 { font-size: 2rem; }\n','wp-bootstrap-4-child','','inherit','closed','closed','','162-revision-v1','','','2018-09-16 05:13:34','2018-09-16 05:13:34','',162,'http://www.grasshopperfinance.com/162-revision-v1/',0,'revision','',0),(181,1,'2018-09-16 05:13:55','2018-09-16 05:13:55','body { font-size: 1rem; }\np { margin-bottom: 30px; }\nh1 { font-size: 2rem; }\n','wp-bootstrap-4-child','','inherit','closed','closed','','162-revision-v1','','','2018-09-16 05:13:55','2018-09-16 05:13:55','',162,'http://www.grasshopperfinance.com/162-revision-v1/',0,'revision','',0),(183,1,'2018-09-26 16:19:19','2018-09-26 16:19:19','','Impact of 1% fees on compound growth','','inherit','open','closed','','screen-shot-2018-09-26-at-9-18-07-am','','','2018-09-26 16:19:44','2018-09-26 16:19:44','',155,'http://www.grasshopperfinance.com/wp-content/uploads/2018/09/Screen-Shot-2018-09-26-at-9.18.07-AM.png',0,'attachment','image/png',0),(184,1,'2018-09-26 16:22:18','2018-09-26 16:22:18','<a href=\"http://www.grasshopperfinance.com/wp-content/uploads/2018/09/boatmeme.jpg\"><img class=\"alignnone size-full wp-image-168\" src=\"http://www.grasshopperfinance.com/wp-content/uploads/2018/09/boatmeme.jpg\" alt=\"Rollover your 401(k)\" width=\"722\" height=\"499\" /></a>\r\n\r\nRolling over your 401(k) is like sending your grandma flowers: we all think we should probably do it, but most never get around to it. It takes a couple of hours and might be the most valuable time you spend in your life (This is true for the grandma flowers too). Here are the reasons why. #4 saves you almost a million bucks, so don\'t skip out early!\r\n<h1>1. Simplicity</h1>\r\nIn 2016 the <a href=\"https://www.bls.gov/news.release/tenure.nr0.htm\">average employee tenure was <strong>4.2 years</strong></a>. In a 40 year career that would be more than nine different jobs. If each of those jobs offered a 401(k) you could have nine accounts floating out there. Do you know where each and every one is? Have all the login information? Know how much is in there? Are they invested in the right stuff? Losing track of one of them could cost you tens or hundreds of thousands of dollars. Rolling over to a central, personal IRA keeps everything where you know it is.\r\n<h1>2. Cut Ties With Former Employers</h1>\r\n401(k)s are employer sponsored retirement accounts. Once you leave a job, that employer generally doesn\'t give a shit about you. But when you want to go back and get your money out, you might need to work with them again. Lost your account info? Talk to your old boss or HR department. Can\'t remember what bank it\'s with? Hope your old company is still taking your calls. Your old company has since been acquired or gone out of business? Now what? Rolling over to your own personal IRA cuts your old company completely out of your life!\r\n<h1>3. Unlimited Investment Options</h1>\r\nWhen you sign up for a 401(k) you are given a list of investment options. Those options are decided by your employer. Often they suck. It\'s still very worth it to invest for the tax benefits, but once you leave do a rollover to your own personal IRA and invest in whatever you want! (Hint: Buy and hold index funds)\r\n<h1>4. It will cost you  $732,102 if you don\'t</h1>\r\nStay with me here because we\'re gonna do some math.\r\n<ul>\r\n 	<li>Fidelity recently reported that the <a href=\"https://www.cnbc.com/2018/09/14/heres-how-much-millennials-have-in-their-401k-accounts.html\">average millennial\'s (21-37 years old) 401(k) balance is <strong>$25,500</strong></a>.</li>\r\n 	<li>The <a href=\"https://www.americanprogress.org/issues/economy/reports/2014/04/11/87503/fixing-the-drain-on-retirement-savings/\">average 401(k) charges <strong>1%</strong> annually in fees</a>. (It\'s even worse if your 401(k) was with a small business which generally have higher fees)</li>\r\n 	<li>A personal Rollover IRA can have fees as low as <strong>0%</strong>. (If you invest in <a href=\"https://www.fidelity.com/mutual-funds/investing-ideas/index-funds\">Fidelity\'s 0% index funds</a>, or very close to 0% with most brokerages\' index funds)</li>\r\n 	<li>An <a href=\"https://www.cnbc.com/2017/06/18/the-sp-500-has-already-met-its-average-return-for-a-full-year.html\">S&amp;P 500 index fund has gained <strong>9.8%</strong> per year</a> on average over the last 90 years.</li>\r\n</ul>\r\nSo that $25.5K you have in your old IRA is likely getting dinged for 1% per year. That means instead of your money growing at <strong>9.8%</strong> it\'s growing at <strong>8.8%</strong>. That doesn\'t sound terrible, but remember the power of compound growth! If you left that job at 26 and withdraw that money at 65, that\'s 39 years of growth at the lower growth rate. At 9.8% that $25.5K would grow to $977K at 65 vs $684K earning 8.8%. That means not rolling over your FIRST old IRA cost you <strong>$293K</strong>. Ouch. But that\'s just one. Your other eight will have successively less time to grow since you\'ll be closer to retirement, but add them up and you\'re kissing <strong>$723,102</strong> away if you pay the 1% fees. Here\'s a <a href=\"https://docs.google.com/spreadsheets/d/1-P41QJ7ypJFvA0ZwmRB7ETOdJKNl55eZI_BZ0cKdC3w/edit?usp=sharing\">Google Sheet that I used to do the math</a>. That\'s a lot of numbers, so here\'s a chart of 8.8% growth vs 9.8% growth:\r\n\r\n<a href=\"http://www.grasshopperfinance.com/wp-content/uploads/2018/09/Screen-Shot-2018-09-26-at-9.18.07-AM.png\"><img class=\"grey-border alignnone\" src=\"http://www.grasshopperfinance.com/wp-content/uploads/2018/09/Screen-Shot-2018-09-26-at-9.18.07-AM.png\" alt=\"Impact of 1% fees on compound growth\" width=\"624\" height=\"412\" /></a>\r\n\r\n&nbsp;\r\n\r\nThat\'s still kind of a lot of numbers so here\'s a picture of what that $723K could have bought you:\r\n\r\n<a href=\"http://www.grasshopperfinance.com/wp-content/uploads/2018/09/Screen-Shot-2018-09-15-at-8.09.40-PM.png\"><img class=\" wp-image-157\" src=\"http://www.grasshopperfinance.com/wp-content/uploads/2018/09/Screen-Shot-2018-09-15-at-8.09.40-PM-1024x709.png\" alt=\"$691K Yacht\" width=\"692\" height=\"479\" /></a>\r\n\r\nIt\'s brand new, 43 feet long, cruising speed of 35 knots and <strong>you just pissed it away</strong> by not rolling over your 401(k). (It\'s actually <a href=\"https://www.yachtworld.com/boats/2017/Evo-43-3220900/Mallorca/Spain#.W53JNpNKhTY\">listed on yachtworld.com for $691,985</a> so you\'ll have $31,117 left over to throw a massive party for your friends who don\'t have yachts because they didn\'t roll over their 401(k)s).\r\n\r\nSo please, for the love of god, rollover your 401(k) and stop being a dick and send Grandma some flowers.','Four reasons to rollover your old 401(k)s','Not rolling over your old 401(k)s will cost you $732,102','inherit','closed','closed','','155-revision-v1','','','2018-09-26 16:22:18','2018-09-26 16:22:18','',155,'http://www.grasshopperfinance.com/155-revision-v1/',0,'revision','',0),(186,1,'2018-09-26 16:22:42','2018-09-26 16:22:42','body { font-size: 1rem; }\np { margin-bottom: 30px; }\nh1 { font-size: 2rem; }\n.grey-border { border: solid 1px #ddd;}','wp-bootstrap-4-child','','inherit','closed','closed','','162-revision-v1','','','2018-09-26 16:22:42','2018-09-26 16:22:42','',162,'http://www.grasshopperfinance.com/162-revision-v1/',0,'revision','',0),(187,1,'2018-10-02 07:24:46','2018-10-02 07:24:46','Almost every day I talk to someone who mentions their credit score. After being in school our entire young lives, I think we must all yearn for someone to give us another grade. And when the ol\' FICO corporation is slapping a big number on all of us we jump for joy and excitedly burn our financial future to try to improve it. But here\'s the problem: Focusing on your credit score is a TERRIBLE way to win with money. You\'re putting your energy towards exactly the wrong thing.\r\n<h1>Why caring about your credit score sucks:</h1>\r\n<ol>\r\n 	<li><strong>It\'s designed to make banks rich. </strong>And banks are rich enough. I want you to be rich. Your credit score EXISTS because banks use it as a way to maximize their profit and minimize losses when loaning money (or in some cases providing insurance). When you walk around downtown Manhattan, Chicago, San Francisco, etc and you see all those billion dollar high rises with banks names on the outside? They didn\'t get there by playing games that make you rich.</li>\r\n 	<li><strong>It puts your focus on debt instead of building wealth. </strong>As they say, numbers that are watched improve. And when you\'re thinking and focusing on your credit score, you\'re totally misplacing the time and energy that should be devoted to growing your own wealth.</li>\r\n 	<li><strong>It encourages overspending. </strong>Thinking about your shiny fucking credit score? It\'s a reminder you can borrow money to go play games with credit cards, buy too much car, and buy and too much house instead of spending less and investing your hard-earned money to make yourself rich.</li>\r\n</ol>\r\n<h1>What is a \"Net Worth Score\"?</h1>\r\nWell... it\'s not really a score. It\'s just your net worth. That\'s how many dollars you are worth. It\'s defined as follows:\r\n<blockquote><strong>Net Worth = What You Own - What You Owe</strong></blockquote>\r\nBut you know what? It should be a score. Let\'s make it one.\r\n<h1>As of today, I officially rename \"Net Worth\" to \"Net Worth Score\".</h1>\r\nThis makes it sound more like a fun little game instead of a soul crushing reminder that you\'re losing at life. And now you don\'t have to rely on that shitty credit score to be the only grade you get now that you\'re out of school.\r\n\r\n<a href=\"http://www.grasshopperfinance.com/wp-content/uploads/2018/10/networthstar.jpg\"><img class=\"alignnone wp-image-192\" src=\"http://www.grasshopperfinance.com/wp-content/uploads/2018/10/networthstar.jpg\" alt=\"\" width=\"309\" height=\"464\" /></a>\r\n<h1>Do you know your Net Worth Score?!</h1>\r\nIf you don\'t know at least approximately what your Net Worth Score is as you read this you\'re doing something wrong. So please stop watching your cartoon tentacle porn and follow these steps:\r\n<ol>\r\n 	<li>Open up Google Docs</li>\r\n 	<li>Create a new Google Spreadsheet and name it \"All Accounts/Net Worth Score\"</li>\r\n 	<li>Create three columns: Account Name, Account Type, Balance</li>\r\n 	<li>At the top list every single financial account to your name with a positive value (savings, checking, 401k, Roth IRA, investments, stock, bitcoin, etc)</li>\r\n 	<li>Then list every big asset that you own (house, investment property, car, etc). Don\'t bother with stuff smaller than a car</li>\r\n 	<li>Then list every single DEBT that you have: credit card, student loans, car loan, mortgage, medical loans, personal loans, etc. Make sure to list the balances as NEGATIVE numbers... debts count against your net worth.</li>\r\n 	<li>Then at the end SUM UP the \"Balance\" column to learn your Net Worth Score!</li>\r\n</ol>\r\nIt should look something like this:\r\n\r\n<a href=\"http://www.grasshopperfinance.com/wp-content/uploads/2018/10/Screen-Shot-2018-10-01-at-11.01.10-PM.png\"><img class=\"alignnone wp-image-191\" src=\"http://www.grasshopperfinance.com/wp-content/uploads/2018/10/Screen-Shot-2018-10-01-at-11.01.10-PM.png\" alt=\"How to calculate net worth spreadsheet\" width=\"595\" height=\"452\" /></a>\r\n\r\n<a href=\"https://docs.google.com/spreadsheets/d/1jC9AenAkDMNK-LQ21Yc9TqcPMkMAQNrddgpmwuwMwyE/edit?usp=sharing\">Here\'s a link to the Google Sheet if you want to make a copy to get started</a>\r\n<h1>Why caring about your Net Worth Score is awesome:</h1>\r\n<ol>\r\n 	<li><strong>You know where you\'re at. </strong>If you don\'t know your net worth score, then you\'re basically like an ostrich with your head in the sand with your credit score taped to your ass. Who cares if you have $4K in the bank if you owe $22K on your car?!\r\n<a href=\"http://www.grasshopperfinance.com/wp-content/uploads/2018/10/headinsand.jpg\"><img class=\"alignnone wp-image-190\" src=\"http://www.grasshopperfinance.com/wp-content/uploads/2018/10/headinsand.jpg\" alt=\"Head in sand, credit score on butt\" width=\"382\" height=\"243\" /></a></li>\r\n 	<li><strong>You won\'t lose track of accounts. </strong>Do you know where that savings account is your parents helped you open as a kid? Those bonds grandma gave you? That 401(k) from three jobs ago? I mean, there might be $25,000 in there but who cares if you lose it because you have a GOLD SHINY FUCKING CREDIT SCORE. (<a href=\"http://www.grasshopperfinance.com/four-reasons-to-rollover-your-old-401ks/\">p.s. roll over that old 401k because it\'s costing you almost a million bucks if you don\'t</a>)</li>\r\n 	<li><strong>You better understand the cost of debt. </strong>When going to buy that next car, put that big TV on your credit card, take out student loans, etc. It\'s easy to think in terms of \"Can I afford the monthly payment?\". But you miss the point that you\'re fucking your future self into years of indentured servitude paying for something you used up years ago. When you see the debt immediately crush your Net Worth Score you realize how far back it\'s setting you.</li>\r\n 	<li><strong>It puts your focus on building wealth. </strong>They say numbers that are watched improve. By watching your Net Worth Score you\'re focusing your energy on building wealth and getting to a place where you don\'t NEED to work.</li>\r\n 	<li><strong>A good Net Worth Score means you don\'t need to worry about a credit score. </strong>Rich people don\'t worry about their credit scores. They buy cars in cash. They have plenty of money for big down payments on apartments or houses. They don\'t need to prove to banks that they\'re good borrowers because they don\'t borrow money. They have money.</li>\r\n</ol>\r\nSo next time one of your broke-ass friends asks you what your credit score is, tell them to get their head out of the sand and start tracking their Net Worth Score!\r\n\r\np.s. If you focus on your Net Worth Score your credit score will be fine. Make all your payments on time and stay out of debt and you\'re already doing the two biggest things to improve your stupid fucking credit score.','Who cares about your credit score? Know your NET WORTH SCORE!','','publish','open','open','','who-cares-about-your-credit-score-know-your-net-worth-score','','\nhttp://www.grasshopperfinance.com/four-reasons-to-rollover-your-old-401ks/','2018-10-02 19:49:41','2018-10-02 19:49:41','',0,'http://www.grasshopperfinance.com/?p=187',0,'post','',0),(188,1,'2018-10-02 05:40:11','2018-10-02 05:40:11','','How to Calculate Net Worth','','inherit','open','closed','','screen-shot-2018-10-01-at-10-39-14-pm','','','2018-10-02 05:40:33','2018-10-02 05:40:33','',187,'http://www.grasshopperfinance.com/wp-content/uploads/2018/10/Screen-Shot-2018-10-01-at-10.39.14-PM.png',0,'attachment','image/png',0),(189,1,'2018-10-02 05:46:00','2018-10-02 05:46:00','','How to calculate net worth','','inherit','open','closed','','screen-shot-2018-10-01-at-10-45-36-pm','','','2018-10-02 05:46:13','2018-10-02 05:46:13','',187,'http://www.grasshopperfinance.com/wp-content/uploads/2018/10/Screen-Shot-2018-10-01-at-10.45.36-PM.png',0,'attachment','image/png',0),(190,1,'2018-10-02 05:59:32','2018-10-02 05:59:32','','Head in sand, credit score on butt','','inherit','open','closed','','headinsand','','','2018-10-02 05:59:59','2018-10-02 05:59:59','',187,'http://www.grasshopperfinance.com/wp-content/uploads/2018/10/headinsand.jpg',0,'attachment','image/jpeg',0),(191,1,'2018-10-02 06:01:29','2018-10-02 06:01:29','','How to calculate net worth spreadsheet','','inherit','open','closed','','screen-shot-2018-10-01-at-11-01-10-pm','','','2018-10-02 06:01:50','2018-10-02 06:01:50','',187,'http://www.grasshopperfinance.com/wp-content/uploads/2018/10/Screen-Shot-2018-10-01-at-11.01.10-PM.png',0,'attachment','image/png',0),(192,1,'2018-10-02 06:15:02','2018-10-02 06:15:02','','networthstar','','inherit','open','closed','','networthstar','','','2018-10-02 06:15:02','2018-10-02 06:15:02','',187,'http://www.grasshopperfinance.com/wp-content/uploads/2018/10/networthstar.jpg',0,'attachment','image/jpeg',0),(193,1,'2018-10-02 07:16:32','2018-10-02 07:16:32','','Focus on your net worth score meme',