.com/wp-content/uploads/2018/10/headinsand.jpg\"><img class=\"alignnone wp-image-190\" src=\"http://www.grasshopperfinance.com/wp-content/uploads/2018/10/headinsand.jpg\" alt=\"Head in sand, credit score on butt\" width=\"382\" height=\"243\" /></a></li>\n 	<li><strong>You won\'t lose track of accounts. </strong>Do you know where that savings account is your parents helped you open as a kid? Those bonds grandma gave you? That 401(k) from three jobs ago? I mean, there might be $25,000 in there but who cares if you lose it because you have a GOLD SHINY FUCKING CREDIT SCORE. (<a href=\"http://www.grasshopperfinance.com/four-reasons-to-rollover-your-old-401ks/\">p.s. roll over that old 401k because it\'s costing you almost a million bucks if you don\'t</a>)</li>\n 	<li><strong>You better understand the cost of debt. </strong>When going to buy that next car, put that big TV on your credit card, take out student loans, etc. It\'s easy to think in terms of \"Can I afford the monthly payment?\". But you miss the point that you\'re fucking your future self into years of indentured servitude paying for something you used up years ago. When you see the debt immediately crush your Net Worth Score you realize how far back it\'s setting you.</li>\n 	<li><strong>It puts your focus on building wealth. </strong>They say numbers that are watched improve. By watching your Net Worth Score you\'re focusing your energy on building wealth and getting to a place where you don\'t NEED to work.</li>\n 	<li><strong>A good Net Worth Score means you don\'t need to worry about a credit score. </strong>Rich people don\'t worry about their credit scores. They buy cars in cash. They have plenty of money for big down payments on apartments or houses. They don\'t need to prove to banks that they\'re good borrowers because they don\'t borrow money. They have money.</li>\n</ol>\nSo next time one of your broke-ass friends asks you what your credit score is, tell them to get their head out of the sand and start tracking their Net Worth Score!\n\np.s. If you focus on your Net Worth Score your credit score will be fine. Make all your payments on time and stay out of debt and you\'re already doing the two biggest things to improve your stupid fucking credit score.','Why do you care about your credit score? Know your NET WORTH SCORE!','','inherit','closed','closed','','187-autosave-v1','','','2018-10-02 19:49:05','2018-10-02 19:49:05','',187,'http://www.grasshopperfinance.com/187-autosave-v1/',0,'revision','',0),(196,1,'2018-10-02 07:31:21','2018-10-02 07:31:21','Almost every day I talk to someone who mentions their stupid fucking credit score. After being in school our entire young lives, I think we must all yearn for someone to give us another grade. And when the ol\' FICO corporation is slapping a big number on all of us we jump for joy and excitedly burn our financial future to try to improve it. But here\'s the problem: Focusing on your credit score is a TERRIBLE way to win with money. You\'re putting your energy towards exactly the wrong thing.\r\n<h1>Why caring about your credit score sucks:</h1>\r\n<ol>\r\n 	<li><strong>It\'s designed to make banks rich. </strong>And banks are rich enough. I want you to be rich. Your credit score EXISTS because banks use it as a way to maximize their profit and minimize losses when loaning money (or in some cases providing insurance). When you walk around downtown Manhattan, Chicago, San Francisco, etc and you see all those billion dollar high rises with banks names on the outside? They didn\'t get there by playing games that make you rich.</li>\r\n 	<li><strong>It puts your focus on debt instead of building wealth. </strong>As they say, numbers that are watched improve. And when you\'re thinking and focusing on your credit score, you\'re totally misplacing the time and energy that should be devoted to growing your own wealth.</li>\r\n 	<li><strong>It encourages overspending. </strong>Thinking about your shiny fucking credit score? It\'s a reminder you can borrow money to go play games with credit cards, buy too much car, and buy and too much house instead of spending less and investing your hard-earned money to make yourself rich.</li>\r\n</ol>\r\n<h1>What is a \"Net Worth Score\"?</h1>\r\nWell... it\'s not really a score. It\'s just your net worth. That\'s how many dollars you are worth. It\'s defined as follows:\r\n<blockquote><strong>Net Worth = What You Own - What You Owe</strong></blockquote>\r\nBut you know what? It should be a score. Let\'s make it one.\r\n<h1>As of today, I officially rename \"Net Worth\" to \"Net Worth Score\".</h1>\r\nThis makes it sound more like a fun little game instead of a soul crushing reminder that you\'re losing at life. And now you don\'t have to rely on that shitty credit score to be the only grade you get now that you\'re out of school.\r\n\r\n<a href=\"http://www.grasshopperfinance.com/wp-content/uploads/2018/10/networthstar.jpg\"><img class=\"alignnone wp-image-192\" src=\"http://www.grasshopperfinance.com/wp-content/uploads/2018/10/networthstar.jpg\" alt=\"\" width=\"309\" height=\"464\" /></a>\r\n<h1>Do you know your Net Worth Score?!</h1>\r\nIf you don\'t know at least approximately what your Net Worth Score is as you read this you\'re doing something wrong. So please stop watching your cartoon tentacle porn and follow these steps:\r\n<ol>\r\n 	<li>Open up Google Docs</li>\r\n 	<li>Create a new Google Spreadsheet and name it \"All Accounts/Net Worth Score\"</li>\r\n 	<li>Create three columns: Account Name, Account Type, Balance</li>\r\n 	<li>At the top list every single financial account to your name with a positive value (savings, checking, 401k, Roth IRA, investments, stock, bitcoin, etc)</li>\r\n 	<li>Then list every big asset that you own (house, investment property, car, etc). Don\'t bother with stuff smaller than a car</li>\r\n 	<li>Then list every single DEBT that you have: credit card, student loans, car loan, mortgage, medical loans, personal loans, etc. Make sure to list the balances as NEGATIVE numbers... debts count against your net worth.</li>\r\n 	<li>Then at the end SUM UP the \"Balance\" column to learn your Net Worth Score!</li>\r\n</ol>\r\nIt should look something like this:\r\n\r\n<a href=\"http://www.grasshopperfinance.com/wp-content/uploads/2018/10/Screen-Shot-2018-10-01-at-11.01.10-PM.png\"><img class=\"alignnone wp-image-191\" src=\"http://www.grasshopperfinance.com/wp-content/uploads/2018/10/Screen-Shot-2018-10-01-at-11.01.10-PM.png\" alt=\"How to calculate net worth spreadsheet\" width=\"595\" height=\"452\" /></a>\r\n\r\n<a href=\"https://docs.google.com/spreadsheets/d/1jC9AenAkDMNK-LQ21Yc9TqcPMkMAQNrddgpmwuwMwyE/edit?usp=sharing\">Here\'s a link to the Google Sheet if you want to make a copy to get started</a>\r\n<h1>Why caring about your Net Worth Score is awesome:</h1>\r\n<ol>\r\n 	<li><strong>You know where you\'re at. </strong>If you don\'t know your net worth score, then you\'re basically like an ostrich with your head in the sand with your credit score taped to your ass. Who cares if you have $4K in the bank if you owe $22K on your car?!\r\n<a href=\"http://www.grasshopperfinance.com/wp-content/uploads/2018/10/headinsand.jpg\"><img class=\"alignnone wp-image-190\" src=\"http://www.grasshopperfinance.com/wp-content/uploads/2018/10/headinsand.jpg\" alt=\"Head in sand, credit score on butt\" width=\"382\" height=\"243\" /></a></li>\r\n 	<li><strong>You won\'t lose track of accounts. </strong>Do you know where that savings account is your parents helped you open as a kid? Those bonds grandma gave you? That 401(k) from three jobs ago? I mean, there might be $25,000 in there but who cares if you lose it because you have a GOLD SHINY FUCKING CREDIT SCORE. (<a href=\"http://www.grasshopperfinance.com/four-reasons-to-rollover-your-old-401ks/\">p.s. roll over that old 401k because it\'s costing you almost a million bucks if you don\'t</a>)</li>\r\n 	<li><strong>You better understand the cost of debt. </strong>When going to buy that next car, put that big TV on your credit card, take out student loans, etc. It\'s easy to think in terms of \"Can I afford the monthly payment?\". But you miss the point that you\'re fucking your future self into years of indentured servitude paying for something you used up years ago. When you see the debt immediately crush your Net Worth Score you realize how far back it\'s setting you.</li>\r\n 	<li><strong>It puts your focus on building wealth. </strong>They say numbers that are watched improve. By watching your Net Worth Score you\'re focusing your energy on building wealth and getting to a place where you don\'t NEED to work.</li>\r\n 	<li><strong>A good Net Worth Score means you don\'t need to worry about a credit score. </strong>Rich people don\'t worry about their credit scores. They buy cars in cash. They have plenty of money for big down payments on apartments or houses. They don\'t need to prove to banks that they\'re good borrowers because they don\'t borrow money. They have money.</li>\r\n</ol>\r\nSo next time one of your broke-ass friends asks you what your credit score is, tell them to get their head out of the sand and start tracking their Net Worth Score!\r\n\r\np.s. If you focus on your Net Worth Score your credit score will be fine. Make all your payments on time and stay out of debt and you\'re already doing the two biggest things to improve your stupid fucking credit score.','Who the fuck cares about your credit score? Know your NET WORTH SCORE!','','inherit','closed','closed','','187-revision-v1','','','2018-10-02 07:31:21','2018-10-02 07:31:21','',187,'http://www.grasshopperfinance.com/187-revision-v1/',0,'revision','',0),(197,1,'2018-10-02 07:57:32','2018-10-02 07:57:32','Almost every day I talk to someone who mentions their credit score. After being in school our entire young lives, I think we must all yearn for someone to give us another grade. And when the ol\' FICO corporation is slapping